	(6, '2019-02-25 15:35:51', '0000-00-00 00:00:00', 'Pressupost contenidors', 'Hola,\r\n\r\nVoldria tenir cotització de preus de lloguer / venda de contenidors de 20\' i de 40\'.\r\nSeria per deixar-los al parking de les nostres instal·lacions a Viladecavalls com a capacitat suplementària al magatzem. Si us plau, incloeu transport.\r\nCotització per 1 i per 5 unitats.\r\n\r\nEn quants dies podeu servir des de fer comanda normalment?\r\n\r\nSalutacions,\r\nJordi', 1, 'VCONT', 1, 'NOGEST', 'EMAIL'),
	(7, '2019-02-25 23:40:28', '0000-00-00 00:00:00', '656786716', 'buenas,,,estoy interesado en planificar compra de varios contenedores de 20 pies con azotea y vayas, toldo, muy similar al q he visto en uno de sus trabajos,...  plazos de entrega en Bizkaia, espero su llamada... gracias.', 1, 'VCONT', 1, 'NOGEST', 'EMAIL'),
	(8, '2019-02-26 02:46:08', '0000-00-00 00:00:00', 'your returned payment', 'Good day! We have wired your transfer today as advised by our client who is your customer and it was returned. Please review the attached payment copy to see what needs to be corrected and advise ASAP. Await your reply. SAM', 1, 'VCONT', 1, 'NOGEST', 'EMAIL'),
	(9, '2019-02-26 08:02:42', '0000-00-00 00:00:00', 'Solicitud información y oferta', 'Buenos días, me llamo Fernando Rosillo y les escribo desde Las Palmas de GC, la cuestión es que estoy redactando un proyecto pero para ejecución inmediata, será para un cliente que necesita oficinas de módulos prefabricados en el Aeropuerto de Fuerteventura (Adjunto distribución) y un módulo para aula de formación en el Aeropuerto de GC cuyo único requisito es que tenga mínimo 12m2, para lo cual por favor ruego me pasen oferta económica según distribución que se adjunta, necesitaría determinar, por un lado precio en concepto de alquiler y por otro en venta. Incluir también transporte y montaje. Cualquier aclaración por favor no duden en ponerse en contacto conmigo, ruego por favor me la envíen lo antes posible, disculpe que sea así pero la verdad es que no les conocía y el tiempo se me ha echado encima con otras alternativas y antes de tomar la decisión me gustaría contar con vosotros. Muchas gracias y un saludo -- Fernando Rosillo Casimiro Ingeniero Industrial Col. Nº 2120 del COIICO +34 615 221 191 frosillo@rosilloingenieros.com www.rosilloingenieros.com [1] Links: ------ [1] https://www.rosilloingenieros.com/', 1, 'VCONT', 1, 'NOGEST', 'EMAIL'),
