	(58, '2019-02-26 12:48:45', '0000-00-00 00:00:00', 'Att Gerente - control de gestión', 'Buenos días, Mi nombre es Almudena, controller para empresas PYMES en H3 controlling, si pudieras hacerle llegar este email a vuestro gerente tal vez sean de su interés estos servicios ya que he ayudado a empresas como la suya a crecer. En la última empresa donde he estado mejoré sus circuitos, creé un sistema de control de gestión pudiendo ver la rentabilidad de la empresa en un click y reduje el gasto operativo. Esta empresa tiene una facturación de 2MM € y estas mejoras han supuesto un 5% de incremento de la rentabilidad en 2018. Cada empresa es diferente y por ello hay muchas formas de llegar a mejorar la rentabilidad, *no solo con las ventas una empresa puede ganar más dinero**. * Las grandes empresas desde hace años tienen la figura del controller en su plantilla. Ahora empresas de cualquier tamaño pueden optar a tener un controller como yo que les ayudará a mejorar la eficiencia sin asumir los costes de tener a alguien en plantilla. Si usted ya tuviera un controller en su empresa puedo ofrecerle mis servicios para cubrir alguna baja que se pudiera producir o realizar algún proyecto en concreto que por cargar de trabajo no puedan llevar a cabo. Adjunto un PDF donde podrás ver una pequeña presentación y también tienes mi web *www.h3controlling.com * donde encontrarás más información. Espero que sea de su interés y si es así aquí tiene mi contacto para poder vernos y desarrollar más este tema en persona sin ningún compromiso. Estoy segura de que podemos hacer grandes cosas juntos. Reciba un cordial saludo. *Almudena Hernández * *Financial Controlling Services* *T. +34 651134857* *almudena@h3controlling.com * *www.h3controlling.com * [image: logo_white_background Nombre_opt_reducido 3_opt.png] *Te ayudamos a mejorar tu empresa* *C/ Mestre Feliu Monne, 52 bajos* *08292 Esparreguera (Barcelona) * *España - Spain* Este mensaje se dirige exclusivamente a su destinatario y puede contener información privilegiada o confidencial. Si no es vd. el destinatario indicado, queda notificado de que la utilización, divulgación y/o copia sin autorización está prohibida en virtud de la legislación vigente. Si ha recibido este mensaje por error, le rogamos que nos lo comunique inmediatamente por esta misma vía y proceda a su destrucción. This message is intended exclusively for its addressee and may contain information that is CONFIDENTIAL and protected by professional privilege. If you are not the intended recipient you are hereby notified that any dissemination, copy or disclosure of this communication is strictly prohibited by law.If this message has been received in error, please immediately notify us via e-mail and delete it. P Por favor, considere el Medioambiente antes de imprimir este documento. Please, consider the environment before printing this document.', 1, 'VCONT', 1, 'NOGEST', 'EMAIL'),
