	(71, '2019-02-27 08:26:17', '0000-00-00 00:00:00', 'Mensaje', 'Buenos días. Tengo el honor de presentarle un producto que se adapta plenamente a las necesidades de su empresa. Nuestro producto le permitirá llegar a nuevos clientes e incrementar de manera inmediata sus ventas. Le presentamos una base de datos de empresas con los datos de contacto de sus dueños y directivos. El catálogo incluye más de un millón de direcciones, y es uno de los mayores en el mercado español. Contiene datos tales como: nombre de la empresa, domicilio social, datos de contacto del dueño, e-mail, teléfono, fax, página web, etc. Puede empezar a usar el catálogo y promocionar sus productos inmediatamente. *** Base de datos de empresas españolas 2019 - 1.548.400 registros. - 190 € - Sólo hasta el 27.02.2019 El retorno de la inversión está garantizado. http://www.basededatosdbs.com/?p=1 Atentamente, Javier Martinez', 65, 'VCONT', 1, 'NOGEST', 'EMAIL'),
