	(73, '2019-02-27 10:01:44', '0000-00-00 00:00:00', 'solicitud de presupuesto Primark palmas altas Sevilla', 'Buenos días 1 conjunto modular formado por 4 módulos a dos alturas + escalera+ 4 aire acondicionado Planta baja: 2 módulos diáfanos Planta alta : 2 módulos diáfanos 1 conjunto modular formado por 6 módulos a dos alturas + 5 aires acondicionado Planta baja: 1 modulo aislado y 2 módulos diáfanos( comedor con fregadero) Planta alta : 3 módulos independientes 3 contenedores marítimos 1 modulo aislado de vigilancia 2 x 2 m + 1 aire acondicionado 1 modulo aislado 4 x 2,44 con dos puertas para vigilancia + 1 aire acondicionado 2 módulos 1,15 x 1,15 sanitario (aseo) 1 modulo formado por 4 wc + 2 duchas (con calentador y lavabo) Espero tu oferta lo antes posible ya que el comienzo de la obra es a final de marzo. Duración 5 meses Atentamente, Justo Pérez 649 048 703 justo.perez@ktl.com.es www.ktl.pt/es [image: http://www.ktl.pt/site/imagens/logo_1.png] *Building Design SL* *Avda. República Argentina nº 24, 2ª Planta* *41011 Sevilla – España* *t. +34 954 18 42 00 Ext.1801* Advertencia legal: Hemos actualizado las políticas de privacidad, son efectivas desde el 25 de mayo de 2018. Cualquier uso de nuestros servicios o envío de documentación para realizar gestiones después de esa fecha anteriormente indicada, constituirá la aceptación de la nueva política de privacidad. Tenga presente que siempre puede darte de baja de los correos que enviamos, solo responder a este email indicando Dar Baja y dejaremos de contactar con usted. Si tienes alguna pregunta, no dudes en contactarnos. Este mensaje y, en su caso, los ficheros anexos son confidenciales, especialmente en lo que respecta a los datos personales, y se dirigen exclusivamente al destinatario referenciado. Si usted no lo es y lo ha recibido por error o tiene conocimiento del mismo por cualquier motivo, le rogamos que nos lo comunique por este medio y proceda a destruirlo o borrarlo, y que en todo caso se abstenga de uti