	(74, '2019-02-27 10:14:55', '0000-00-00 00:00:00', 'Un vídeo vende más que mil palabras', '[https://www.proveedores.com/articulos/un-video-vende-mas-que-mil-palabras] UN VÍDEO VENDE MÁS QUE MIL PALABRAS ================================================================================ ¿Tienes vídeos corporativos que te gustaría compartir? ¡En Proveedores.com estamos de estreno! Si cuelgas tus vídeos de empresa, no solo se mostrarán en tu perfil, sino que aparecerán en la home. Refuerza tu imagen corporativa y consigue más visibilidad en el portal. Se trata de un servicio totalmente gratuito que te ayudará a conseguir más clientes. Los vídeos son la forma más dinámica y eficaz de dar a conocer a tu empresa y marcarán la diferencia con tus competidores. ¡Venderás más! <> [https://www.proveedores.com/articulos/un-video-vende-mas-que-mil-palabras] Proveedores.com - Alcalde Barnils, 64 - 68, D-1 08174 Sant Cugat del Vallés ES [[DELIVERY_INFO]]', 68, 'VCONT', 1, 'NOGEST', 'EMAIL'),
	(75, '2019-02-27 11:11:35', '0000-00-00 00:00:00', 'Reciclamos GRATUITAMENTE las tintas de su impresora', 'LAS TINTAS VACÍAS… ¡¡¡AL CONTENEDOR ADLANT!!! ¿Por qué motivo? Porque Adlant te facilita el número de contenedores que tu empresa necesita y sin que tengas que desplazarte. Los cartuchos van de la impresora al contenedor. ¿Qué precio tiene el servicio? El servicio es TOTALMENTE GRATUITO. No cobramos ni los contenedores que se facilitan ni los transportes de recogida. ¿Qué gana mi empresa con este servicio? Este servicio está LLENO DE VENTAJAS, como que… 1. El Medio Ambiente te lo agradecerá. Tenemos que concienciarnos de que el tóner y la tinta son productos ALTAMENTE CONTAMINANTES. 2. Te sale GRATIS, no como si llevases los cartuchos a cualquier vertedero. 3. Adlant te entrega el CERTIFICADO que indica que hemos recogido estos productos de tu empresa. Responde a este correo para comenzar a reciclar con nosotros. Mario Lapaz Chaparro Gestor de Cuentas Tfno : +34 696 68 17 41 E-mail : barcelona@adlant.es Central: C/ 7, Nave 38 - Polígono Ind. San Cibrao 32.900 - San Ciprián de Viñas - Ourense Tfnos : +34 988 61 89 57 Fax : +34 988 36 62 83 E-mail : supervision@adlant.es Web : www.adlant.es Aviso Legal Informática y consumibles de Ourense , S.L., como Responsable del fichero, le informa que su dirección de correo electrónico, así como el resto de los datos de carácter personal que nos facilite, serán objeto de tratamiento automatizado en nuestros ficheros, con la finalidad de gestionar la agenda de contactos de nuestra empresa. Vd. podrá en cualquier momento ejercer el derecho de acceso, rectificación, cancelación y oposición en los términos establecidos en la Ley Orgánica de Protección de Datos de Carácter Personal (LOPD. 15/1999). También le notificamos que este mensaje -incluyendo cualquier archivo adjunto- es Privado y Confidencial, y va dirigido sólo al destinatario indicado, por tanto si ha recibido este mensaje por error, le solicitamos nos lo notifique inmediatamente por esta misma vía y proceda a su eliminación. This message -including any attached file- is PRIVATE AND CONFIDENTIAL and it is only intended for the addressee named above. If you have received this message and it is not addressed to you, please advise us immediately and kindly remove it from your system. The use or disclosure of the contents of this message may be regarded as an offence. Do not copy, reproduce or disclose them, either partially or fully.', 69, 'VCONT', 1, 'NOGEST', 'EMAIL'),
