	(96, '2019-02-28 13:29:20', '0000-00-00 00:00:00', 'alquiler', 'BUENAS , soy Alex Uranga de ZUMAIA (GUIPUZCOA) y estoy interesado en vuestras casetas prefabricadas. \r\n\r\nTengo un proyecto entre manos para este verano .\r\n\r\nConsiste un una escuela de surf .  Necesito algo para guardar el material , que la gente pueda dejar sus cosas y pueda cambiarse .\r\n\r\nEL ayuntamiento y Kostas a aceptado el proyecto , pero con  tal de que la caseta sea disimulada y no tenga mucho impacto visual desacorde con  el medio ambiente . \r\n\r\nque me podeis aconsejar ? \r\n\r\nAlguna caseta forrrada con madera , contenedor de hierro pintado ...\r\n\r\npor favor mandarme presupuesto .\r\n\r\nseria alquiler para 3 , 4 meses.\r\n\r\nGRACIAS\r\n\r\n', 88, 'VCONT', 3, 'NOGEST', 'EMAIL'),
