	(106, '2019-03-01 14:27:57', '0000-00-00 00:00:00', '=?iso-8859-1?Q?Despertem_la_vocaci=F3_per_la_ind=FAstria,	_col=B7labora_am?= b nosaltres!', 'Benvolgut/da, L\'Ajuntament de Castellbisbal, en el marc del Pacte per la Reindustrialització del Vallès Occidental, impulsem diferents mesures per despertar les vocacions industrials entre la població jove i desocupada. Nombrosos estudis i veus del teixit productiu coincideixen en la manca de professionals formats/des en les ocupacions industrials del present i del futur. Una de les principals activitats que tenim en marxa per afrontar aquest repte col·lectiu són els tallers de sensibilització per a joves: Gaudeix de la indústria que no embruta! dirigits, bàsicament, a cicles superiors de primària i ESO. Una activitat pensada per presentar els valors de la indústria el més divulgativa, atractiva i real possible, i que consta de dues opcions d\'una durada aproximada de 2 hores cadascuna d\'elles: taller a l\'aula i visita de camp. L\'èxit d\'aquesta iniciativa rau en que les empreses, centres tecnològics, grups de recerca, professionals i entitats que esteu dia a dia vinculats amb la indústria hi participeu com a actors principals, comunicant i explicat de viva veu com és la indústria avui i com seran els i les professionals del futur. Per això hem pensat amb vosaltres i us animem a donar-vos d\'alta a la Xarxa d\'agents col·laboradors per ajudar-nos a afrontar aquest repte. Us oferim 3 opcions diferents de participació: 1. Participant en el tallers que es fa a les aules, 2. Oferint les vostres instal·lacions per a rebre visites de camp i presentar directament la vostra activitat 3. Col·laborant en altres activitats que posarem en marxa per despertar les vocacions En el següent enllaç trobareu el formulari a omplir donar-vos d\'alta de la xarxa: https://goo.gl/forms/JFi7BX0uI8EOA8uk2 En cas de tenir qualsevol dubte us podeu posar en contacte amb la Secretaria Tècnica del Pacte per la Reindustrialització, el Consell Comarcal del Vallès Occidental (Sra. Mònica Gil, telèfon 93 727 35 34 ext. 309), o bé a l correu de Promoció Econòmica de l\'Ajuntament de Castellbisbal. Esperem que sigui del vostre interès la iniciativa. Ben cordialment, M. Àngels Urbano Carmona Tècnica de Desenvolupament Local Departament de Promoció Econòmica [cid:image004.jpg@01D4CDE5.763E0D50] Av. de Pau Casals, 9 Tel. 93 772 38 78 08755 Castellbisbal www.castellbisbal.cat', 98, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(107, '2019-03-01 15:54:57', '0000-00-00 00:00:00', 'CONTENEDOR 20´ ESPLUGUES ', 'Buenas tardes Eduard, Necesitaríamos 1 contenedor de 20´ (duración 1 mes) para las obras que vamos a comenzar en Esplugues de LLobregat. ¿Trabajáis esta zona? Si es así, ¿me podrías pasar cotización? Muchas gracias, quedo a la espera de confirmación para coordinar Un saludo Natalia Casenave Departamento Técnico ------------------------ Pol.Ind.Espiñeira 6B 15930 Boiro (A Coruña) España -------------------------------------------- +34 620 015 254 + 34 981 848 411 ------------------------ desarrollo1@oziona.com www.oziona.com ------------------------------ Este e-mail va destinado exclusivamente a sus destinatarios y puede contener información confidencial y/o datos de carácter personal, regulados en el Reglamento 2016/679 del Parlamento Europeo y del Consejo, al margen de otras normativas de carácter nacional o local. Si lo ha recibido por error o no es el legítimo destinatario, por favor notifíquelo al remitente. Queda prohibido revelar, distribuir o realizar cualquier acción basada en el contenido de este e-mail o en la dirección del remitente. This email is destined exclusively to the addressees and may contain confidential information or personal data, regulated under Regulation (EU) 2016/679 of the European Parliament and of the Council, beside other national or local regulations. If you have received this by mistake or if you are not the intended recipient, please notify the sender. It is prohibited to reveal, distribute or undertake any action based on the content of this email or the address of the sender.', 99, 'VCONT', 2, 'NOGEST', 'EMAIL'),
