	(111, '2019-03-03 17:16:29', '0000-00-00 00:00:00', 'Camara para flores', 'Hola estaria interesado en una camara de refrigeracion para flores en un contenedor de 3m. Lo que no necesito temperaturas bajo cero me seria suficiente un aparato refrigerador entre 0 a 10 C. Me gustaria saber el precio de lo que me costaria no es necesario temperaturas bajo cero como he visto en vuestra web Muchas gracias', 102, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(112, '2019-03-04 09:56:08', '0000-00-00 00:00:00', 'Solicitud presupuesto para Oficina Prefabricada para interior de una	Nave .', 'Buenos días, Estamos interesados en presupuesto para Oficina Prefabricada para interior de una Nave localizada en Alcala de unos 20m. Quedando a la espera de sus noticias, Les envió un cordial saludo. logop Sonsoles López 91 888 18 75 · sonsoles@antariaservices.es Antaria Services S.L.U Calle Rumanía, 8 (Polígono Industrial Inbisa) · C.P 28802 Alcalá de Henares (Madrid). Tlf: 91 880 31 13 ? 91 888 18 75 www.antariaservices.es facebook twitter ecoNo me imprimas si no es necesario. Protejamos el medio ambiente AVISO LEGAL: Este mensaje y sus archivos adjuntos van dirigidos exclusivamente a su destinatario, pudiendo contener información confidencial sometida a secreto profesional. No está permitida su comunicación, reproducción o distribución sin la autorización expresa de ANTARIA SERVICES, S.L.. Si usted no es el destinatario final, por favor elimínelo e infórmenos por esta vía. PROTECCIÓN DE DATOS: De conformidad con lo dispuesto en el Reglamento (UE) 2016/679 de 27 de abril de 2016 (GDPR), le informamos que los datos personales y dirección de correo electrónico, recabados del propio interesado o de fuentes públicas, serán tratados bajo la responsabilidad de ANTARIA SERVICES, S.L. para el envío de comunicaciones ordinarias vinculadas a nuestros servicios y se conservarán mientras exista un interés mutuo para ello. Los datos no serán comunicados a terceros, salvo obligación legal. Le informamos que puede ejercer los derechos de acceso, rectificación, portabilidad y supresión de sus datos y los de limitación y oposición a su tratamiento dirigiéndose a C/ Rumania, 8 Nave 1 y 3 - 28802 Alcalá de Henares (Madrid). Email: administracion@antariaservices.es. Si considera que el tratamiento no se ajusta a la normativa vigente, podrá presentar una reclamación ante la autoridad de control en www.agpd.es.', 103, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(113, '2019-03-04 10:06:18', '0000-00-00 00:00:00', 'Oferta contenedores', 'Buenos días. Solicito presupuesto y plazo de entrega para los siguientes contenedores (todos que sean blancos y de primer uso): · 1 container 20? · 1 container 40? · 1 container 20? high cube · 1 container 10? Se pasaría pedido en los próximos días por estos dos contenedores: · 1 container 20? high cube · 1 container 10? Quedamos al espera de su mejor oferta. Gracias un saludo Rosa Sancho compras@avangreen.com TF: 910 325 545 Av/ de Madrid,47 nave L6 28750 San Agustin de Guadalix (Madrid) www.avangreen.com', 104, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(114, '2019-03-04 10:21:09', '0000-00-00 00:00:00', 'Vale de comida para ZARCA S.L.', 'Hola, Mi nombre es María y estoy con ValeDeComida, una compañía que ofrece a las empresas la posibilidad de Proporcionar a los empleados un almuerzo a buen precio. - Simplifica y elimina costes administrativos por la gestión de los gastos de comida. - Importe exento de IRPF hasta 9€ por persona y día y deducible. - Empleados con más motivación ya que disfrutan de un gran beneficio social. Necesitaremos la siguiente información para preparar un presupuesto o propuesta: •Nombre de la empresa •Nombre y Apellido •Número de teléfono •Código postal •Dirección •Cuántos empleados tiene tu empresa? Le recomiendo que consulte nuestros precios respondiendo a este correo electrónico. Atentamente, María Padro Maria@es-CompararOrcamento-Now.site ValeDeComida Su privacidad es importante para nosotros. No pasaremos sus datos a compañías de terceros sin su expreso permiso Responder "Baja", si no desea recibir más mensajes', 105, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(115, '2019-03-04 11:19:32', '0000-00-00 00:00:00', 'Acquisition de cabine de peinture                     EPE FERROVIAL	SPA', 'N/REF :ST/019040 Chers Messieurs, bonjour!! J’ai le plaisir de vous informer que l’un des responsables de l’EPE FERROVIAL Spa, direction générale – Secrétariat de la commission des marchés Allelik – route d’El-Hadjar, commune d’El Bouni BP 63 – ANNABA, vient de me transmettre, un avis d’appel d’offres international N°CME.05/2019, portant sur : - Acquisition de cabine de peinture. Les caractéristiques techniques sont définies dans le cahier des charges, dont le retrait est contre le paiement de la somme de :CINQUANTE MILLE DINARS ALGERIENS (50.000DA), soit, l’équivalent de :TROIS CENT SOIXANTE EUROS (360€), l’exemplaire, non remboursable, au profit du client, au compte bancaire RIB : 001 008100310010016/81, ouvert auprès de la Banque Nationale d’Algérie (BNA-agence 810 esplanade Mohamed Boudiaf, Annaba-Algérie. La date limite des remises des offres est fixée au 26 Avril 2016. Je vous invite à cet effet, au cas où vous seriez intéressés à prendre part à cette adjudication de bien vouloir, me faxer par retour ou par émail votre accord sur papier à entête de votre honorable Firme, muni d’une copie de votre registre de commerce et celle du SWIFT de règlement ; en vue de vous enregistrer sur la liste des fournisseurs agrées de l’EPE FERROVIAL Spa et de retirer le dossier correspondant pour votre compte. Je reste bien entendu à votre entière disposition pour tout complément d’information. CORDIALEMENT S. TOUNSI Ing. Technico-commercial Gérant Tél : 00 216 70 866 161 Fax : 00 216 70 866 160 Cell : 00 216 98 326 883 Mails : tounsi@tunet.tn ‘’ : tounsi.mohamedsalah@gmail.com Adresse : TOUNSI M. SALAH Av. des étoiles, impasse n°2, villa n°4, El-MENZAH VIII, 2037 Tunis - TUNISIE', 59, 'VCONT', 3, 'NOGEST', 'EMAIL'),
