	(117, '2019-03-04 11:53:16', '0000-00-00 00:00:00', 'Lloguer mòdul', 'Bon dia, necessitem pressupost per un mòdul-contenidor amb les següents característiques: * Mides: 6 m llarg x 3 m fondària, que es pugui obrir i tancar tota la llargada * Dates: del 18 de març al 16 de maig * Lloc: l?Hospitalet de Llobregat Anna Ramos. Administració i comptabilitat MANAGEMENT I DISSENY D\'ESPECTACLES, S.L Ronda del Guinardó 59 bis baixos - 08024 Barcelona +34 93 310 53 62 · +34 672 358 059 www.mide.cat Abans d´imprimir aquest correu electrònic, pensi si ès imprescindible fer-ho. Por favor, antes de imprimir piense en el Medio Ambiente! Please consider the environment before printing this e-mail! En compliment de la Llei de Protecció de Dades de Caràcter Personal, l?informem que la recepció d?aquest missatge mitjançant correu electrònic du implícita la seva autorització, per a seguir utilitzant la seva adreça de correu electrònic així com la resta de dades personals que ens faciliti per aquest o altre mitjà, incorporats en el fitxer del qual es Responsable Management i Disseny d?Espectacles, S.L, i la finalitat dels quals es facilitar la gestió administrativa, mantenir futures comunicacions referents a serveis que puguin ser del seu interès, així com complir amb els requisits que la legislació vigent exigeix a la nostra organització. Podrà exercitar els seus drets d?accés, rectificació, cancel·lació i oposició en l?adreça del Responsable del Fitxer, amb seu a Ronda Guinardó, 59 bis 08034 Barcelona S?adverteix que el present missatge conté informació confidencial, sent per a ús exclusiu del destinatari a dalt indicat. En cas de no ser vostè el destinatari del mateix l?informem que la seva recepció no li autoritza a la seva divulgació o reproducció per qualsevol mitjà, havent de destruir-lo immediatament, pregant-li notifiqui aquest extrem al remitent. Agraïm la seva col·laboració.', 59, 'VCONT', 2, 'NOGEST', 'EMAIL'),
