	(119, '2019-03-04 13:07:14', '0000-00-00 00:00:00', 'RE: CONTENEDOR CLIMATIZADO A MEDIDA', 'Buenos días Pere, Después de valorar las diferentes opciones para el proyecto al que hacemos referencia, le comunicamos que finalmente se ha decidido desestimar la opción de los contenedores climatizados, como sala para vehículos especiales. Sentimos no poder contar con su empresa y le queremos agradecer la dedicación que ha puesto en nuestro proyecto, dándonos todas las opciones que estaban en su mano para atender nuestras necesidades. Gracias de nuevo por toda su atención. Pili Sierra Reception psierra@drivingevents.com | drivingevents.com t +34 93 812 55 21 | carrer del feu, 33 08554 st. miquel de balenyà, barcelona - spain P Consider the environment before printing this e?mail. See Legal notes De: Comercial ZARCA Enviado el: viernes, 15 de febrero de 2019 17:19 Para: Pili Sierra - Driving Events CC: \'Pere Catasus\' Asunto: RE: CONTENEDOR CLIMATIZADO A MEDIDA Buenas tardes, Pongo en copia a mi compañero Pere Catasus para que les oferte un conjunto de cámaras para controlar la temperatura y la humedad. Saludos ________________________________ [Descripción: logo ZARCA] ZARCA S.L. C/ Electricitat, 2 (Cant. C/ Mecànica, 2) Polígon Ind. Santa Rita 08755 Castellbisbal (Barcelona) www.zarca.es Eduard Zarzoso e-mail: eduard@zarca.es Telf: 931 175 501 FAX: 933 795 033 Móvil: 671 657 446 ________________________________ [Descripción: Descripción: firma-productos] La información incluida en este e-mail es CONFIDENCIAL, siendo para uso exclusivo del destinatario arriba mencionado. Si Usted lee este mensaje y no es el destinatario indicado, le informamos que está totalmente prohibida cualquier utilización, divulgación, distribución y/o reproducción de esta comunicación sin autorización expresa en virtud de la legislación vigente. Si ha recibido este mensaje por error, le rogamos nos lo notifique inmediatamente por esta misma vía y proceda a su eliminación. De: Pili Sierra - Driving Events [mailto:psierra@drivingevents.com] Enviado el: viernes, 15 de febrero de 2019 12:23 Para: comercial@zarca.es Asunto: CONTENEDOR CLIMATIZADO A MEDIDA Buenos días Sres. De , Hemos intentado contactar con ustedes por teléfono pero no ha sido posible. El motivo de nuestra llamada es que estamos interesados en comprar o alquiler un tipo contenedor a medida para ubicar dentro de nuestro almacén. La características que necesitamos son las siguientes: * Contenedor de unos 9*8m para almacenaje de vehículos prototipos i/o maquetas. * El espacio de la sala debe dar cabida a 2 vehículos aparcados de lado y con el suficiente espacio para poder abrir las puertas de los coches sin que se toquen. * Control de temperatura 15/20ºC y humedad. Iluminación interior. * El acceso de los vehículos: puerta que permita entrar los dos vehículos a la vez + puerta de acceso peatonal. [cid:image003.png@01D4D28B.06E958B0][UBICACIÓN DEL CONTENEDOR][cid:image012.png@01D4D28B.06E958B0][cid:image013.jpg@01D4D28B.06E958B0] Les agradeceríamos nos haga llegar lo antes posible una propuesta de lo que pueden ofrecernos. Cualquier duda o aclaración que necesiten al respecto pueden contactar con nosotros por teléfono o correo electrónico a: psierra@drivingevents.com i dlladó@drivingevents.com Quedamos a la espera de su respuesta. Saludos, Pili Sierra Reception [cid:image014.jpg@01D4D28B.06E958B0] t +34 93 812 55 21 www.drivingevents.com carrer del feu, 33 08554 ? st. miquel de balenyà barcelona ? spain P Consider the environment before printing this e?mail. For privacy policy, this message is intended exclusively for its addressee and may contain information that is CONFIDENTIAL and protected by professional privilege. If you are not the intended recipient you are hereby notified that any dissemination, copy or disclosure of this communication is strictly prohibited by law. If this message has been received in error, please immediately notify us via e?mail and delete it. [Imagen quitada por el remitente.] Libre de virus. www.avast.com', 107, 'VCONT', 2, 'NOGEST', 'EMAIL'),
