	(121, '2019-03-04 13:30:43', '0000-00-00 00:00:00', 'Petició oferta MÒDULS PREFABRICATS "OBRES I INSTAL·LACIONS D\'ADEQUACIÓ DE SOLAR SITUAT AL PORT DE BARCELONA "', 'Obra: ?OBRES I INSTAL·LACIONS D\'ADEQUACIÓ DE SOLAR SITUAT AL PORT DE BARCELONA JUNT A LA COTXERA D\'AUTOBUSOS DE ZONA FRANCA PER UN FUTUR US D\'APARCAMENT D\'AUTOBUSOS DE TRANSPORTS DE BARCELONA?. CODI D?EXPEDIENT: 14803352? Por la presente agradecería me envíe oferta de las unidades que le relaciono a continuación referentes al ESTUDIO de la obra para TRANSPORTS METROPOLITANS DE BARCELONA (TRANSPORTS DE BARCELONA, SA), agradeciendo una respuesta PARA ANTES DEL PRÓXIMO 14 DE MARZO DE 2019. Desde TMB para poder justificar la parte del proyecto que pretendemos subcontratar, nos piden una declaración (ANEXO 3) (adjunto fichero en WORD), que agradecería rellene con sus datos, los espacios de ?sotasignat?, DNI, nombre de la empresa o denominación y por último actividad u objeto social de la empresa. Una vez cumplimentado rogaría la envíen en formato PDF, sellada y firmada, a la espera de sus noticias, atentamente Alberto Vázquez Rodríguez Departament d?Estudis Desmontes y Construcciones Romero, S.A. C/ Sant Josep, 118 - Nau 2 Polígon Industrial El Pla 08980 ? Sant Feliu de Llobregat (Barcelona) ( 93 429 86 99 Ext. 1050 www.construccionesromero.com cid:image003.png@01D3DD54.70B99C00 P Antes de imprimir este mensaje, asegúrese de que es realmente necesario. EL MEDIO AMBIENTE ES COSA DE TODOS ü Abans d\'imprimir aquest missatge, asseguri\'s que és realment necessari. EL MEDI AMBIENT ÉS COSA DE TOTS Este mensaje y sus archivos adjuntos van dirigidos exclusivamente a su destinatario, pudiendo contener información confidencial sometida a secreto profesional. No está permitida su reproducción o distribución sin la autorización expresa de DESMONTES Y CONSTRUCCIONES ROMERO, SA. Si usted no es el destinatario final por favor elimínelo e infórmenos por esta vía. De acuerdo con la LOPD, le informamos que sus datos personales y dirección de correo electrónico forman parte de un fichero, cuyo responsable es DESMONTES Y CONSTRUCCIONES ROMERO, SA, siendo la finalidad del fichero, la gestión de carácter comercial y el envío de comunicaciones comerciales sobre nuestros productos y/o servicios . Si lo desea, podrá usted ejercitar los derechos de acceso, rectificación, cancelación y oposición de sus datos enviando un mensaje a la siguiente dirección de correo electrónico a romerosa@construccionesromero.com, indicando en la línea de ?Asunto? el derecho que desea ejercitar.', 109, 'VCONT', 2, 'NOGEST', 'EMAIL'),
