	(124, '2019-03-04 17:03:15', '0000-00-00 00:00:00', 'RV: caseta obra', 'Buenas, Se necesita precio y plazo para caseta de obra tanto nueva como usada. De 6mx2m diáfana o divida a la mitad. También oferta de caseta de aislada de oficina con las medidas anteriores tanto nuevas como usadas. Serian puestas en San Ciprian-Cervo-lugo Ignacio Teijeira de Gabriel Teléfono corporativo: 3111 Teléfono: 699443120 http://www.Reymogasa.com De conformidad con lo dispuesto en la Ley Orgánica 15/1999, de 13 de diciembre, de Protección de Datos de Carácter Personal, IMASA, con domicilio social en la Calle Palacio Valdés, 1, 1º, de Oviedo (Asturias-España), le informa que sus datos han sido obtenidos legítimamente y se han incorporado a un fichero automatizado titularidad de dicha entidad cuya finalidad es permitir las relaciones comerciales con su empresa. Sepa que tiene reconocida la posibilidad de ejercitar gratuitamente los derechos de acceso, rectificación, cancelación y oposición, en los términos previstos en la Ley Orgánica 15/1999, mediante escrito dirigido al Responsable de Seguridad que podrá ser presentado directamente en el domicilio social de la entidad o remitido por correo certificado a la dirección anteriormente señalada. Este correo electrónico contiene información privada y estrictamente confidencial. Si usted no es el destinatario, no está autorizado a leerlo, retenerlo o difundirlo. Si ha recibido este mensaje por error, le rogamos lo notifique a su emisor y borre los documentos adjuntos.', 112, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(125, '2019-03-04 17:19:47', '0000-00-00 00:00:00', 'Piscina', 'Buenas tardes\r\nTengo la intención de instalar una piscina en mi vivienda y he visto la posibilidad de transformar un contenedor en piscina y me ha parecido una buena idea.\r\nMe puede facilitar más información al respecto.\r\n\r\nGracias', 113, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(126, '2019-03-04 18:07:15', '0000-00-00 00:00:00', 'precio caseta', 'Hola , buenas tardes , Me interesa saber precios de venta de casetas de obra De medidas 2.5x2.40x2.60 metros o similar, para habilitar como oficina. No es necesario 3 ventanas , con menos estaría bien también. Gracias cid:image001.png@01D4D039.77D55550', 114, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(127, '2019-03-04 19:08:06', '0000-00-00 00:00:00', 'Consulta Contenedores 6\'', 'Estimad@, Un gusto saludarles. Les escribo para consultarle sobre los contenedores de 6 pies que muestran en su página web. Me interesa mucho este tipo de contenedor y mi pregunta es si ustedes lo envían a Chile, como venta o tal vez alguna empresa de acá que los compre regularmente para contactarme, ya que en el país es muy difícil encontrar contenedores menores de 20 pies. Quedo atento a su respuesta. Saludos cordiales, -- *Diego Petey P.* Ingeniero Civil Industrial +56 9 66880177 Skype: remote-waters www.remote-waters.com/', 115, 'VCONT', 3, 'NOGEST', 'EMAIL'),
