	(130, '2019-03-05 06:22:34', '0000-00-00 00:00:00', 'alquiler largo plazo de camara frigorifica ', 'Hola estoy interesada en alquilar una camara frigorifica en mi empresa. El material ha de conservarse a menos 18. Quisiera saber mas sobre las medidas. Me interesa creo la de 3 metros pero he de saber las dimensiones y la disponibilidad. \r\n\r\nmuchas gracias', 117, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(131, '2019-03-05 08:05:38', '0000-00-00 00:00:00', 'Servicios Transporte Internacional', 'A la atención del departamento de exportación o comercio internacional del ZARCA, Buenos días, Desde NIELS PAGH LOGISTICS SPAIN deseamos presentarles nuestro eficiente y completo servicio de transporte internacional de mercancías por carretera. Nuestro grupo lleva vigente y activo en el sector desde hace más de 25 años y nuestra sucursal más de 11, lo cual nos otorga la experiencia necesaria para saber qué es lo que nuestros clientes esperan al depositar su confianza en nuestra profesionalidad. Por ello, siempre efectuamos los servicios con exactitud y puntualidad, con lo que el cliente está informado en todo momento del estado de su carga y, de esta manera, aseguramos la calidad del servicio anticipándonos a los inconvenientes y resolviendo las tareas con la mayor eficacia y brevedad. Contamos con una flota de 106 cabezas tractoras y 160 semirremolques que nos permiten realizar servicios de cargas completas, grupajes, servicios urgentes, transporte de mercancías ADR., así como instalaciones ubicadas en puntos estratégicos de España y Dinamarca para realizar almacenaje si fuese preciso. Además, estamos muy comprometidos con el medio ambiente por lo que apostamos por las nuevas tecnologías para reducir todo lo posible el impacto que se produce en el mismo. Nuestra red de mercado se especializa en los países nórdicos y en los estados bálticos y, gracias a nuestros colaboradores, podemos ofrecer servicios de transporte internacional por el centro de Europa, con tal de abastecer lo máximo posible del continente Europeo. Esperamos que nuestra propuesta despierte su interés y deseamos nos confíen sus necesidades de transporte. Muchas gracias por contar con nosotros, Saludos / Salutacions / Best regards / MFG MARIANA JENSEN [sig] Niels Pagh Logistics Spain, S.L. C/Narcís Monturiol 9-11 P.I. Font de la Parera 08430 Santa Agnés de Malanyanes (La Roca del Vallés) Barcelona (Spain) Telf. +34.93.573.89.95 mj@npldk.com http://www.npldk.com En cumplimiento de lo establecido en la Ley Orgánica 15/1999 de 13 de Diciembre de Protección de Datos de Caracter Personal, le informamos que las direcciones de correo electrónico y datos personales quedan incorporados en el mencionado fichero y, además, que podrán ejercitar los derechos de acceso, rectificación y cancelación legalmente establecidos ante NIELS PAGH LOGISTICS SPAIN, S.L. C/Narcís Monturiol 9-11, 08430 La Roca del Vallés.', 118, 'VCONT', 2, 'NOGEST', 'EMAIL'),
