	(134, '2019-03-05 13:03:43', '0000-00-00 00:00:00', 'Consulta precio contenedores', 'Buenos dias;\r\n\r\nLe escribo porque he encontrado su contacto navegando en la Web buscando containers aplicados al sector de la construcción de casas, actualmente estoy realizando un curso sobre la arquitectura de containers con la idea de un futuro realizar mi propia casa container.\r\nLa razón de mi email es porque un ejercicio del curso es sobre el coste de contenedores con transporte.\r\nPodría ayudarme con una oferta para el suministro de contenedores con entrega por ejemplo en la zona de Terrassa (que es donde vivo) de los siguientes tipos de container:\r\n\r\n•	Un contenedor de 20 pies\r\n•	Un contenedor de 40 pies\r\n•	Un contenedor de 20 pies Open-side\r\n•	Un contenedor de 40 pies High-Cube\r\n•	Un contenedor de 53 pies\r\n\r\nEl transporte se realiza con un camión grúa?, para que ayude a su instalación en el sitio?. \r\nAgradecería mucho su ayuda.\r\nGracias por adelantado.\r\nAlexis\r\n', 61, 'VCONT', 3, 'NOGEST', 'EMAIL'),
