	(152, '2019-03-07 11:55:42', '0000-00-00 00:00:00', 'Reunión', 'Buenas tardes, Soy Sergi Durán, responsable de la empresa italiana *Edil Euganea *en España. *Edil Euganea* es un fabricante de módulos prefabricados de alta calidad con diseños personalizados y con una completa gama de productos como casetas de obra, Shelter, Box prefabricados, Contenedores, cabinas prefabricadas, etc. Me dirijo a usted para presentarle la empresa y saber su posible interés hacia nuestros productos o su posible conocimiento de alguien a quien pueda interesarle. Por ello le adjunto archivos con información y me pondré en contacto con usted nuevamente para saber si existe la posibilidad de reunirnos y ampliarle la información así como responder a las dudas que pueda tener. Le ánimo que le eche un vistazo a nuestra web: https://www.edileuganea.com/es Gracias por su tiempo. Reciba un cordial saludo, -- *Sergi Durán* *Spain Sales* E-mail: sergi.edileuganea@gmail.com Phone: + 34 652 022 471 Web site: www.edileuganea.com *linkedin* , *twitter* , *youtube *, *g**o**o**g**l**e**+*', 134, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(153, '2019-03-07 12:17:37', '0000-00-00 00:00:00', 'Comprar Módulo Prefabricado ', 'Buenos días, (comercial ZARCA, S.L.) Necesitamos comprar un módulo prefabricado (similar a una caseta de obra pero de mejor calidad) para una estación de servicio en Olot, Girona. Por ello, vista su página web en internet, le solicito presupuesto para COMPRA de un módulo prefabricado con 2 compartimentos, una oficina-almacén y un aseo. Medidas aproximadas de 6x2 m2 o 4x2 m2. Con portes incluidos a Olot, Carretera Polígono Industrial La Serra Km. 1, 17176 Bas, Girona. Desconozco qué modelos y qué calidades pueden existir. Estaría interesado en hablar con un comercial o me enviarais información al respecto. Esperando contestación suya reciba un cordial saludo. Gracias [cid:image002.jpg@01D4D4DF.C0A2FE90] Carlos Delgado | Maintenance Technical | Kuwait Petroleum Espana | | cadelgad@q8spain.es | www.Q8.com | | T +34 914364250 | M +34 682830891 | | C/ Francisco Silvela, 42 - 5º | 28028 Madrid | Spain | | A subsidiary of the Kuwait Petroleum International Group | Please consider the environment before printing Disclaimer: The information transmitted in this e-mail message is strictly confidential and is exclusively addressed to the recipient indicated above. If you are not the intended recipient (or someone responsible for delivery to the intended recipient) please be aware that any use, copying or disclosure of information contained in this e-mail message is strictly prohibited. If you have received this e-mail message by error, please notify us immediately by reply and then delete it from your system.', 135, 'VCONT', 2, 'NOGEST', 'EMAIL'),
