	(163, '2019-03-08 16:20:20', '0000-00-00 00:00:00', 'IMA-OT14118-PO-013 Contenedores - CHP Gondi -', 'Reference: IMA-OT14118-PO-20 Date: 08/03/2019 Project: CHP Gondi Subject: Contenedores Buenas tardes, Imagua Water Technologies ha sido adjudicatario de la construcción de la Planta de Tratamiento de Agua y Efluentes del Proyecto CHP Gondi que Sener está realizando en Guadalupe, México Por ello, a Imagua Water Technologies, le gustaría invitarle a que presentase su mejor oferta técnica y comercial para el alcance: Contenedores El alcance consiste en el Suministro de: 6 Contendores High Cube. En cinco de ellos se ubicarán los equipos de osmosis inversa, en el sexto contenedor irá dedicado a CCM y PLC. 1 Techada completa en chapa trapezoidal de acero prelacado de 0,5mm de espesor a dos aguas para cubierta. 1 Opcional aire acondicionado Fechas requerida de entrega de los equipos: semana 20, 2019 Entrega: * DDP España (a definir mas adelante) Se adjunta la siguiente documentación contractual: Comercial: * IMAGUA-WT-ESP-COM-001: Condiciones generales de compra Técnica: * IMA-OT14118-ET-013 Contenedores * EP-MCA-ST-01 0091 Rev. 3 Painting Technical Specification * Características de emplazamiento Para cualquier duda técnica, por favor póngase en contacto con: Sandra Tejerina: E-mail: sandra.tejerina@imagua.es y en copia: jesus.alonso@ Imagua.es irene.guisasola@imagua.es Cualquier duda comercial, por favor póngase en contacto: Jesús Alonso Ruiz, E-mail: jesus.alonso@ Imagua.es Irene Guisasola, E-mail: irene.guisasola@imagua.es La fecha límite para la entrega de la oferta es: 14 de Marzo de 2019 Por favor, confirmen la recepción de este email y su intención de ofertar Un saludo, Irene Guisasola IMAGUA Water Technologies C/ Playa Riazor 12, 3º, Oficina 3.1. 28042 Madrid C/ Saavedra 4, oficina 21. 33208 Gijon - Asturias Emai: irene.guisasola@imagua.es Webpage: www.imagua.es Movil/Cell: +34 657 63 21 81', 144, 'VCONT', 3, 'NOGEST', 'EMAIL'),
