	(165, '2019-03-08 20:15:34', '0000-00-00 00:00:00', 'Desearia informacion sobre vuestro servicio de camaras frigorificas portatiles de alquiler o compra.', 'Hola buenos Días.\r\nDesearía me visitara un comercial para estudiar que tipo de cámara portátil seria la mas adecuada para mis necesidades. Somos una empresa de distribución al por mayor de frutas y verduras ubicados en el Maresma. Hemos cambiado de nave y esta no tiene cámara y estamos valorando de alquilar o comprar un modulo de 3 o 6.\r\nSaludos y gracias.\r\nAtentamente.\r\nAmelia Giró.\r\nDept. Administración.', 145, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(166, '2019-03-09 12:52:47', '0000-00-00 00:00:00', 'Petición de oferta y plazo de entrega', 'Buenos días, solicitamos oferta y plazo de entrega de: 1º.- Contenedor de refrigeración de 20 pies para el almacenamiento de uva durante la época de vendimia y también, para la conservación de mosto (zumo de uva) durante los meses posteriores. Dicho contenedor se va a instalar en el exterior sobre suelo. 2º.- Almacenar cajillas de uva, sobre palét tipo “europeo” y durante un tiempo máximo de 4 días. Temperatura entrada - salida de la uva = +27ºC / +8ºC. 3º.- Conservación de mosto, en depósito de 1.000 litros y durante un tiempo de 6 meses. Temperatura durante la conservación de aprox. 0ºC. 4º.- Suelo y paredes, lisos, lavables y de juntas cónicas en los ángulos. 5º.- Paredes, suelo, techo y puertas con material de máximo aislante. 6º.- Cortina de láminas de plástico para evitar la pérdida de temperatura, a la entrada del contenedor. 7º.- Revestimiento exterior del contenedor con pintura resistente a la corrosión. A la espera de recibir el presupuesto por su parte, quedo a su entera disposición para atender cualquier aclaración al respecto. Atentamente. Juan Antonio Fdez. Dpto. técnico y comercial VICENTE NAVAS S.L. FRIO INDUSTRIAL Ctra. Antigua de Madrid, Parcela 59 13200 Manzanares (Ciudad Real) Tlf. 926 620 982 - Fax. 926 614 887 comercial@vicentenavassl.com mailto:comercial@vicentenavassl.comhttp://www.vicentenavassl.com', 146, 'VCONT', 3, 'NOGEST', 'EMAIL'),
