	(195, '2019-03-13 18:57:57', '0000-00-00 00:00:00', 'comprar 3 contenedores marítimos de 20 pies', '*¿Eres ya un ecociudadano?* Estimados amigos: Estamos interesados en comprar *3 contenedores marítimos de 20 pies* adaptados para construir una vivienda. Necesitamos que a cada contenedor se le *acoplen unas patas retráctiles de 110 cm* que faciliten su transporte en camión, sin necesidad de usar grúa para cargarlos, tal y como se muestra en el *minuto 20 y 21 de este vídeo*: https://www.youtube.com/watch?v=Dy-tCMVPkfg&t=1374s ¿Podrían ustedes hacer esto? Por otro lado, necesitamos garantizar una *anchura interior real de 225 cm*, lo que significa que parte del aislamiento de las paredes, etc. habría que ponérselo por fuera, no por dentro. No necesitamos que pueda transportarse en barco, pero sí que pueda transportarse en camión con la mayor facilidad posible y sin la menor pega legal (así que, no podríamos rebasar una anchura exterior de 255 cm.). Por último, la altura querríamos aprovecharla al máximo y, puesto que está permitido circular con una altura de hasta 4 metros, el contenedor podría tener una *altura de 2,9 metros* (a la que se le sumarían los 110 cm. de la altura del camión de transporte). En caso de que puedan suministrarnos este servicio, necesitaríamos saber precio, tiempo de entrega, forma de pago, etc. Muchas gracias por su tiempo. Ángel Massotti.', 169, 'VCONT', 2, 'NOGEST', 'EMAIL'),
