	(204, '2019-03-14 12:56:57', '0000-00-00 00:00:00', 'CASETA MODULAR PARA OFICINA', 'Buenas tardes, ruego nos faciliten presupuesto de caseta modular para oficina, bien de segunda mano o nueva, más traslado a Almería Área de Servicio Pita. Indicar suplemento con instalación de equipo de Aire Acondicionado. Adjunto envío boceto. Quedamos a la espera de sus noticias. Gracias. Francisco Javier Fernández Director de Zona. FITSA - Algeciras www.fitsa.net En cumplimiento de la Ley Orgánica 15/1999 de 13 de Diciembre, de Protección de Datos de Carácter Personal FITSA, pone en su conocimiento que esta información ha sido remitida por su personal y con la finalidad del cumplimiento de las funciones que son de su competencia. Los datos incluidos en este mensaje están dirigidos a su destinatarios designados y pueden contener información confidencial sometida a secreto profesional, cuya divulgación no está permitida por la ley por lo que sí lo ha recibido por error, le rogamos nos lo haga saber a la menor brevedad posible, y elimine el original, no estando permitido hacer ningún uso del mensaje. Ponemos en su conocimiento la posibilidad de ejercer sus derechos de acceso, rectificación, cancelación u oposición, en los términos establecidos en la legislación vigente, que podrá hacer efectivos dirigiéndose por escrito a FITSA, con domicilio en C/ Rio Mesa 16, 1º i-2 - 29620 - Torremolinos (Málaga), o a la dirección de e-mail: info@fitsa.net El correo electrónico vía internet no es seguro y no se puede garantizar que no haya errores, ya que puede ser interceptado, modificado, perdido o destruido e incluso contener virus. Cualquier persona que se ponga en contacto con FITSA por correo electrónico se considera que asume estos riesgos. Q Antes de imprimir este mensaje, asegúrate de que es necesario. Proteger el medio ambiente está también en tu mano.', 174, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(205, '2019-03-14 12:58:40', '0000-00-00 00:00:00', 'Presupuesto transformación de contenedor marítimo', 'Buenas tardes! Soy Carlos Castaño de la agencia Singular One, estamos buscando alquilar un contenedor que sea transparente de cristal o material similar por todas sus caras menos por una de las paredes. Vamos a realizar un evento en Madrid para unos productos de cocina de una famosa marca de electrodomésticos y la idea es montar una cocina dentro del contenedor y que esté a la vista de todos. Habrá cocinero estará dentro haciendo platos y la gente que pase podrá pararse a verlos in situ a través del cristal, pero sin entrar en el contenedor Espero sus comentarios. Muchas gracias!', 175, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(206, '2019-03-14 18:11:31', '0000-00-00 00:00:00', 'Seguir siendo más competitivos', '--- Este correo electrónico ha sido comprobado en busca de virus por AVG. http://www.avg.com', 176, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(207, '2019-03-14 20:09:32', '0000-00-00 00:00:00', 'Módulos en nave industrial', 'Hola, busco información para la instalación dentro de una nave industrial de unos vestuarios con ducha (hombres y mujeres separados), oficina pequeña, sala para comer... Inicialmente contamos con unos 10 trabajadores pero que podrían llegar a ser 25/30 por turno, por lo que sería interesante si disponen de un sistema modular ampliable.\r\nQuería saber si este tipo de instalaciones resultan más económicas que hacerlas en obra, si requieren de proyecto, qué coste podría tener por metro cuadrado, tiempo de fabricación e instalación, portes a Menorca...\r\nEn nuestra nave se pueden instalar 2 alturas ya que en la parte más baja hay 7 metros y ocupar así la menor superficie útil.', 177, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(208, '2019-03-15 09:05:50', '0000-00-00 00:00:00', 'Precio contenedor open side', 'Buenos días, he visto en su página web que tienen contenedores de tipo open side, que se abren las dos puertas de los extremos + 1 puerta lateral, tenéis o existe la posibilidad de adquirirlo con la posibilidad de abrir también la otra puerta lateral? Si es así qué precio tendría tanto en nuevo como en usado? El tamaño sería de 20 pies. Muchas gracias Obtener Outlook para Android', 178, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(209, '2019-03-15 09:19:08', '0000-00-00 00:00:00', 'Consulta sobre contenedor frigorífico', 'Buenos días, Quisiera haceros una consulta sobre alquiler o compra de un contenedor frigorífico pequeño. Me podéis llamar? Gracias Jordi Sentís Director Técnico BCNFarma S.L. C/ Eduard Maristany, 430-432. 08918 Badalona Barcelona - Spain Teléfono +34 932 688 996 Fax: +34 933 150 469 e-mail: j.sentis@bcnfarma.com', 179, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(210, '2019-03-15 09:33:31', '0000-00-00 00:00:00', 'Col·laboració Colla Gegantera 2019 - 25è aniversari i Ciutat Gegantera de Catalunya', 'Benvolguts/des, Enguany es presenta el que segurament sigui, l\'any més important de les nostres vides, geganterament parlant, d\'aquí que us fem arribar una proposta de col·laboració pel teixit industrial local, amb l\'objectiu de treballar conjuntament per fer realitat el projecte i que, ambdues parts en puguem sortir beneficiades. Com veureu, la proposta és concreta però no hi ha ni mínims ni màxims en les aportacions, perquè considerem que tota ajuda és positiva i entenem l\'esforç afegit que suposen les col·laboracions. Però pensem que el moment és històric, i formar part d\'aquesta celebració també ho és. Estem immersos en el 25è aniversari del Manel i la Vicenta, gegants de Castellbisbal, i per celebrar tal efemèride, el passat gener vam organitzar la primera trobada Internacional de Gegants Músics (que tocaven instruments musicals) i que mai s\'havia celebrat enlloc. Vam comptar amb gegants vinguts d\'Anglaterra (Newcastle), nord de França (Saint Sylvestre), Espinal (Navarra), Areatza (País Basc) i d\'arreu de Catalunya. També vam aprofitar per estrenar la imatge gràfica que ens acompanyarà tot aquest any i la pàgina web que teniu a la nostra firma. Però l\'acte gran el tindrem els propers 7-8-9 de juny quan esdevindrem la XXXII Ciutat Gegantera de Catalunya, aquest títol ens permetrà portar durant 1 any els gegants de Catalunya: Treball i Cultura. I organitzar una festa al poble amb més de 60 colles de gegants i acollir més de 5.000 persones. El contacte pot ser presencial i, en cas de mostrar interès per la causa, mitjançant aquest e-mail o per telefòn (686953214 Sergi), podem comentar qualsevol dubte/proposta. A continuació, trobeu el compte bancari de l\'entitat per tal que, aquelles persones que ja vulgueu fer l\'aportació pugueu, però al concepte cal especificar el nom de l\'empresa i comunicar-nos-ho. En cas que es requereixi de factura, ens ho podeu dir abans de fer l\'ingrés, sinó us farem arribar un rebut conforme el pagament del donatiu s\'ha efectuat i cobrat. Colla Gegantera de Castellbisbal: ES8901824252930201661704 (IMPORTANT: al concepte especificar el NOM DE L\'EMPRESA i la paraula DONATIU) Esperem comptar amb l\'ajuda de tothom per convetir Castellbisbal en un poble GEGANT! Moltes gràcies, ________________________________ Sergi (686953214) Colla Gegantera de Castellbisbal 32a Ciutat Gegantera de Catalunya 2019 http://www.ciutatgegantera2019.cat gegantscastellbisbal@hotmail.com Gràcies,', 98, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(211, '2019-03-15 09:40:30', '0000-00-00 00:00:00', 'Contaminar o casas prefabricadas ', '   Buenos días,\r\n\r\n   Queremos hacer una casa en planta de 120 m2, 9 m de ancho de fachada por 13,50m de fondo y nos gustaría hacerlo con containner. Qué precio tienen?. Gracias de antemano.\r\n\r\n   Saludos,', 180, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(212, '2019-03-15 09:46:19', '0000-00-00 00:00:00', 'Presentación facilities services', 'Buenos días , Mi nombre es Carlos Lalin y el motivo de este correo es para presentarme como ejecutivo comercial de Grupo LD Facilities Services. Somos una empresa familiar con más de 1300 empleados, con sedes en Barcelona y Madrid, y nos dedicamos al sector de Facilities Services desde 1943, gestionando absolutamente todo lo necesario para cubrir las necesidades globales de todo tipo de empresas, (principalmente servicios de limpieza y mantenimiento) desde Pymes, hasta multinacionales de cualquier sector. Nuestro objetivo es simple, gestionar todo lo necesario para que vuestra empresa ahorre tiempo, costes, aumente en beneficios y podáis emplear el 100% de vuestro tiempo a lo que realmente importa, vuestro negocio. Actualmente tenemos en nuestra cartera, clientes de GGCC como: FC Barcelona, Generalitat de Catalunya, Recinto modernista de Sant Pau, Mediaset, Cosmocaixa, Wework Madrid y Barcelona, etc. Por poner un breve ejemplo de la envergadura de las empresas que avalan nuestro trabajo y nuestra amplia experiencia, día a día. Nuestra filosofía flexible y nuestra estructura, nos permite adaptarnos a las necesidades reales de cada cliente e integrarnos completamente dentro de su ecosistema. Me gustaría tener una reunión con vosotros y, presentaros nuestro amplio catálogo de servicios, para que nos tengáis en cuenta de cara a futuras prospecciones de mercado o licitaciones. Adjunto PDF en el cual queda más detallado nuestro amplio catálogo de servicios y, quedo a vuestra disposición para resolver cualquier duda. Saludos,', 181, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(213, '2019-03-15 10:02:53', '0000-00-00 00:00:00', 'INVITACIÓN A LA LICITACIÓN DE EXPEDIENTE NET5778414_SVCIO ALQUILER CON OPCIÓN A COMPRA MÓD DESMONT A INSTALAR EN CEGMA LCCA_P', 'La AGENCIA DE MEDIO AMBIENTE Y AGUA DE ANDALUCÍA está tramitando el expediente para la adjudicación por contrato menor del SERVICIO DE ALQUILER CON OPCIÓN A COMPRA DE UN MÓDULO DESMONTABLE EN EL CENTRO DE GESTIÓN DE MEDIO MARINO PARA EL LABORATORIO DE CONTROL DE LA CALIDAD AMBIENTAL, EN SU UNIDAD TÉCNICA DE PALMONES. De acuerdo con la memoria justificativa del contrato anexa, las condiciones que debe tener en cuenta para formular su oferta son las siguientes: * _Objeto del contrato_: SERVICIO DE ALQUILER CON OPCIÓN A COMPRA DE UN MÓDULO DESMONTABLE EN EL CENTRO DE GESTIÓN DE MEDIO MARINO PARA EL LABORATORIO DE CONTROL DE LA CALIDAD AMBIENTAL, EN SU UNIDAD TÉCNICA DE PALMONES. * _Especificaciones técnicas de la prestación_: *TRANSPORTE **E INSTALACIÓN* *El transporte del módulo desde su lugar de origen al emplazamiento, incluirá el transporte especial necesario y las grúas que se precisen, así como la **tramitación y pago de cuantos permisos o licencias se requieran para ello. **Además, se entenderán incluido el montaje/desmontaje **en****e**l **CEGMA**.* *CARACTERÍSTICAS TÉCNICAS DEL MÓDULO* *El módulo debe ser prefabricado, **de dimensiones **aproximadas: **7**,**00**m x 2,5**0**m y de altura libre 2,50 m.* *Las características delos elementos y sistemas constructivos garantizarán la durabilidad con el m**í**nimo gasto de conservación.* *La puerta de entrada al módulo será abatible hacia el interior y como mínimo de 0,85 m de ancho, llevará cerradura de llave y tirador, **así como sistema de retención antiportazos y de sujeción cuando sea necesario dejarla abierta. La puerta estará revestida en el exterior por panel sandwich igual al resto del cerramiento del módulo. * *El módulo tendrá la iluminación y la ventilación naturales directas, mediante huecos exteriores.* *Deberá **disponer de instalación eléctrica **de**230 V, con puntos de iluminación fluorescente, con conmutador de encendido junto a la puerta de acceso y con enchufe**s**de electricidad. El cableado será de cobre de 2,5 mm² RZ1-K de 0,6/1 Kv, o similar. * *Las luminarias serán superficiales y deberán permitir que los trabajadores dispongan de condiciones de visibilidad adecuadas para poder utilizar los módulos sin riesgo para su seguridad y salud. La iluminación deberá cumplir las disposiciones del Anexo IV del RD 486 de lugares de trabajo.* *MANTENIMIENTO DEL MÓDULO * *El módulo será mantenido por la empresa adjudicataria, según la normativa en vigor, durante la vigencia del contrato.* *Será por cuenta del contratista la sustitución inmediata, en un plazo máximo de 24 horas, de cualquier tipo de avería del módulo, estando el coste de estas reparaciones incluido, en la cuota mensual por mantenimiento, salvo que la avería se deba a causas imputables a **la Agencia de Medio Ambiente y Agua****(en adelante **LA AGENCIA**)**. * * _Responsable del contrato_: Emilio García Adiego. Responsable del LCCA, Unidad de Palmones. * _Duración del contrato_: 12 meses. * _Importe máximo del contrato_: 7.300,00 €, IVA excluido. La_oferta_ se deberá remitir contestando a al presente correo electrónico. El plazo de presentación de ofertas finaliza el próximo *jueves 21 de marzo de 2019, a las 12:00h.* *Junto con su oferta, debe anexar firmado el documento denominado "Memoria Justificativa y Prescripciones Técnicas" así como, "Modelo de Declaración Responsable". * No obstante, si no están interesados en presentar una oferta, les solicitamos que nos lo comuniquen por escrito en el plazo señalado. Para cualquier cuestión pueden preguntarla a través de este correo electrónico. José Manuel Campos Lissén josem.campos.lissen@juntadeandalucia.es Agencia de Medio Ambiente y Agua http://www.agenciamedioambienteyagua.es Tel 34 955 260 000 C/ Johan G. Gutenberg, 1. Isla de la Cartuja. C.P. 41092. Sevilla (España).', 182, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(214, '2019-03-15 11:40:45', '0000-00-00 00:00:00', 'Invitació Market Place en Economia Circular 2019', 'Benvolguts, benvolgudes, Per si és del vostre interès, us envien invitació i us encoratgem a participar en la 3a edició del Market Place d\'Economia Circular que tindrà lloc el proper 7 de maig a Barberà del Vallès en el marc del projecte Vallès Circular, en el qual l\'Ajuntament de Castellbisbal hi està adherit. [cid:image002.jpg@01D4D512.97F41370] Departament de Promoció Econòmica [cid:image003.jpg@01D4DB19.8B603370] Av. de Pau Casals, 9 Tel. 93 772 38 78 08755 Castellbisbal www.castellbisbal.cat', 98, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(215, '2019-03-15 13:38:18', '0000-00-00 00:00:00', 'SIN TITULO', '', 183, 'VCONT', 2, 'NOGEST', 'EMAIL'),
