	(220, '2019-03-15 18:58:29', '0000-00-00 00:00:00', 'PRESUPUESTO CASETA DE VENTAS', 'Buenas tardes, me pongo en contacto con ustedes para pedirles presupuesto para una caseta de ventas acristalada, me gustaría recibir precio para alquilar o comprar, y si hubiera la opción de que fueran nuevas o de 2ª mano. La ubicación en la que se encuentra la zona de ventas sería en Badajoz. Gracias y un saludo, * Juan Manuel Castilla Burguillos Departamento de Arquitectura y Construcción* Avenida Sinforiano Madroñero, 11 06011, Badajoz (España) Tlf. (+34) 924 22 13 40- 924 24 20 25 www.grupomyd.com Este mensaje y sus archivos adjuntos van dirigidos exclusivamente a su destinatario, pudiendo contener información confidencial sometida a secreto profesional. No está permitida su reproducción o distribución sin la autorización expresa de URVEDIP MYD SL. Si usted no es el destinatario final por favor elimínelo e infórmenos por esta vía. De acuerdo con lo establecido por el Reglamento (UE) 2016/679, en materia de Protección de datos, le informamos que el Responsable del Tratamiento de sus datos es URVEDIP MYD SL. Utilizamos sus datos para prestarle los servicios que nos ha solicitado, así como enviarle comunicaciones comerciales que sean de su interés. Legitimados en la ejecución del contrato en su caso o en aplicación de las medidas precontractuales. No se cederán sus datos a terceros salvo obligación legal. Asimismo, le informamos que tiene derecho a acceder, rectificar y suprimir los datos, así como otros derechos, indicados en la información adicional, que puede ejercer dirigiéndose a URVEDIP MYD SL, en Avda. SINFORIANO MADROÑERO 11, o a través del correo electrónico privacidad@grupomyd.com Puede solicitar información adicional y detallada sobre Protección de Datos en nuestra página web: http://www.grupomyd.com/aviso-legal/ Antes de imprimir este mensaje, asegúrese de que es necesario. El medio ambiente está en nuestra mano', 188, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(221, '2019-03-15 21:46:04', '0000-00-00 00:00:00', 'Presupuesto módulos', 'Buenas tardes, Soy Albert Puyol productor en DQuality Group. Estamos preparando la tercera edición del Reggaeton Beach Festival que se celebra este 27 de Julio en Barcelona y estoy buscando un proveedor de módulos para el evento. La cantidad de módulos son: Módulos: - 3 módulos de 5 ventanas. - 1 módulos información (con una ventana) - 1 módulos normal (EATA) - 1 módulo normal (Producción) - 1 módulos normal (incidencias) - 1 módulos reclamaciones - 1 módulos normal (prensa) - 9 módulos de camerinos. - Disponéis sanitarios vip? Por ejemplo, un módulo santario vip con 4 aseos y limpiamanos. Necesito que todos tengan aire acondicionado y con seguros en las puertas. ¿Disponéis de estas unidades? ¿Podéis realizarme un presupuesto por favor? Muchas Gracias Albert Puyol Iniesta 685141710 Projects D-Quality Group C/Aurora 4 Parets del valles (Barcelona)', 189, 'VCONT', 3, 'NOGEST', 'EMAIL'),
