	(223, '2019-03-16 06:40:02', '0000-00-00 00:00:00', 'Info sobre contenedor / transformado ', 'Hola,\r\nMi interés por contactar con ustedes es, información por un container transformado en pescadería que e visto en su sección proyectos, me gustaría me mandasen una info más detallada si es posible, medidas, precio, más opciones si las hay, en base al proyecto ya realizado,\r\nEn espera de su respuesta, me despido cordialmente,\r\nFrancesc', 191, 'VCONT', 2, 'NOGEST', 'EMAIL'),
