	(239, '2019-03-18 18:02:28', '0000-00-00 00:00:00', 'Importante: 25 de Marzo Nueva Área de Cliente', 'Estimados clientes, Es un placer comunicarles que el próximo día 25 de marzo tendrán disponible la nueva área de clientes en la web de Construdata21. Podrán disfrutar de una herramienta profesional mejorada, moderna, intuitiva y con más utilidades. En definitiva, una aplicación más visual y tan fácil de manejar como cualquier móvil, con información más clara y gráfica además de muchos extras imprescindibles. En las próximas semanas nuestro Departamento de Atención al Cliente contactará con sus usuarios para programar una formación específica sobre el uso de la nueva web y que así puedan sacarle todo el partido a la plataforma. Como siempre, si tienen cualquier duda podrán contactar con nosotros además de que en la página tendrán disponible una nueva sección de Preguntas Frecuentes con instrucciones claras para hacer búsquedas, editar y crear alertas o carpetas, accesos para sus comerciales, etc. Se mantendrá toda la información que tengan guardada en la página actual (carpetas, alertas, comentarios, eventos...) y durante algún tiempo todavía podrán acceder a la versión anterior de la web (desde el menú vertical). Pero no será aconsejable alternar el uso entre las dos plataformas, ya que los cambios que se realicen en una no estarán visibles en la otra o podrían no funcionar correctamente. En el caso de que tengan usuarios comerciales activados (subcarteras o sublogins) para poder acceder a la nueva web tendrán que hacer un pequeño cambio en su login/nombre de usuario sustituyendo el símbolo (@) por un guión medio (-). Para su comodidad, en los próximos días enviaremos por email al usuario principal los nuevos datos de acceso de todos sus comerciales. Por motivos de seguridad y para poder trabajar con nuestra aplicación sin problemas de uso o visualización les recomendamos que actualicen su navegador a la última versión disponible, preferiblemente Google Chrome o Mozilla Firefox. Esperamos que les guste. Saludos cordiales. Dept. Atención al cliente Internet Construdata21, S.A. Tel: (+34) 902 218 821 / 986 441 054 Fax: (+34) 986 226 869 clientes@construdata21.com C/ López de Neira 3, of. 201/202 - 36202 Vigo www.construdata21.com Sociedad participada por Netaccede SCR-PYME, S.A. _____________________ Confidencialidad: Este mensaje y sus archivos adjuntos van dirigidos exclusivamente a su destinatario, pudiendo contener información confidencial sometida a secreto profesional. No está permitida su comunicación, reproducción o distribución sin la autorización expresa del emisor. Si usted no es el destinatario final, por favor elimínelo e infórmenos por esta vía. Las personas y entidades que violen sus deberes de confidencialidad podrán ser perseguidas ante los Tribunales de Justicia al amparo de la legislación civil, penal y administrativa, nacional e internacional. De conformidad con lo dispuesto en la normativa vigentes en protección de datos personales y el Reglamento (UE) 2016/679 de 27 de abril de 2016 (RGPD), así como la Ley 34/2002, de 11 de julio, de Servicios de la Sociedad de la Información y de Correo Electrónico (LSSICE) Internet Construdata 21, S.A., le informa que: Fin del tratamiento: envío de comunicaciones e interacciones relacionadas con los servicios ofertados por la empresa Criterios de conservación de los datos: Se conservarán mientras exista un interés mutuo Comunicación de los datos: No se comunicarán los datos a terceros, salvo obligación legal. Derechos que asisten al usuario: Derecho de acceso, rectificación, portabilidad y supresión de sus datos y a la limitación u oposición al su tratamiento. Derecho a presentar una reclamación ante la Autoridad de control (agpd.es) si considera que el tratamiento no se ajusta a la normativa vigente. Datos de contacto para ejercer sus derechos: Internet Construdata21, S.A., en C/ López de Neira 3, Oficina 201-202_36202 Vigo (Pontevedra) y/o a través del correo electróni