	(247, '2019-03-19 09:39:41', '0000-00-00 00:00:00', 'MODULOS CONTENEDORES MODIFICADOS', 'Buenos días Eduard, Somos una empresa de arquitectura en Barcelona y actualmente estamos desarrollando un proyecto que requiere una serie de contenedores modificados que necesitamos valorar, el Sr. Francisco de la empresa Silversea nos ha pasado vuestro contacto. Se trata de un área gastronómica y de ocio en las inmediaciones del Camp Nou; para ello necesitamos presupuestar una serie de módulos que adjunto en formato Excel y pdf. Nuestra propuesta es que estos módulos se desarrollen a partir de contenedores marítimos de 20\'. En esta fase inicial -a falta de terminar de definir al detalle cada módulo- necesitamos una valoración estimativa de vuestra parte, tanto la producción como el transporte a Barcelona centro (Camp Nou) y plazos de entrega estimados. Desde ya muchas gracias, dejo mis datos a pie de mail ante cualquier comentario y/o duda. Saludos Nicolás Galán, Arq. Proyectos [cid:image002.jpg@01D4DE37.302CFFD0] [cid:image003.png@01D4DE37.302CFFD0] G.A.C. 3000 S.L. C/Séneca 11, Baixos. 08006 BARCELONA T: +34 93 206 61 27 nicolas@gac3000.com', 208, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(248, '2019-03-19 09:51:30', '0000-00-00 00:00:00', 'Contenedor marítimo 20  \'', 'Buenos días,\r\nNecesito un presupuesto de un contenedor nuevo con doble puerta para usarlo como trastero en un Instituto de Vacarisses en Barcelona. Es para colocarlo en el patio y el espacio libre que tengo aprox. es de 8m x 2,5m. Creo que  el contenedor de estándar 20\' es de 6m  de largo y el de 40\' es de 12m? . Podrían enviarme presupuesto de varias opciones?.\r\nAtentemente,\r\nirma cases.\r\n', 209, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(249, '2019-03-19 10:56:19', '0000-00-00 00:00:00', 'presupuesto', 'Buenos días necesito presupuesto para la compra de una caseta de obra de 6 metros con baño compuesto por inodoro y lávalo y ducha con puerta separada. Adjunto plano de lo que queremos. [cid:image001.png@01D4DE42.92E00630] Un saludo', 210, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(250, '2019-03-19 12:18:24', '0000-00-00 00:00:00', 'presupuesto alquiler módulos plan romero 2019', 'buenas días, Solicitamos presupuesto para el alquiler de módulos, por una duración de un mes (del 14 de mayo al 14 de junio), para el Plan Romero 2019. Las necesidades que tenemos desde esta Delegación del Gobierno,Secretaria General Provincial de Justicia e Interior en Cádiz, con CIF S-4111001-F, son las siguientes: * Sanlucar de Barrameda en Bajo Guia (Cádiz) o 1 conjunto modular formado por 2 módulos M6 diáfano o 1 módulo aislado M6 (6x2,44), con la puerta en lado estrecho o 1 módulo aislado M7C (7x2,44),con dos despachos y un aseo o 1 módulo aislado M6 (6x2,44), con la puerta en lado estrecho, con aseo y ducha. o 1 módulo aislado M6 (6x2,44), con la puerta en lado ancho, con aseo y ducha. o 7 aparatos de aire acondicionado con bomba de calor * Palacio Doñana , Matalascañas-Huelva o 1 módulo aislado M7C (7x2,44),con dos despachos sin wc. o 2 aparatos de aire acondicionado con bomba de calor. Adjunto plano detallado de los módulos en Bajo Guia .Para cualquier aclaración podéis llamar al teléfono que aparece en pie de página. Un cordial saludo. -- --', 211, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(251, '2019-03-19 12:53:21', '0000-00-00 00:00:00', 'Presupuesto 10 containers 40\' tipo Open Side con puertas también en ambos laterales (cortos)', 'Buenas tardes, Estamos participando en la fase final de un tender de 10 plantas de Biogas para el mercado de Dinamarca y, por dimensiones y resistencia mecánica, estaríamos muy interesados en obtener su mejor precio para 10 contenedores de 40 pies tipo Open Side con puertas: · En cara frontal (lado largo) · En lateral derecho (lado corto) · En lateral izquierdo (lado corto) Ruego nos hagan llegar su mejor precio para contenedores nuevos. Muchas gracias!!! cid:image003.png@01D1C0D6.41B3C5D0 Inoxfer Enginyeria i Serveis, S.L. Daniel Cots Gallardo Project Manager Telf. 93 274 52 82 Fax 93 345 44 47 e-mail : oficinatecnica@teyco-comercial.com', 212, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(252, '2019-03-19 12:58:24', '0000-00-00 00:00:00', 'B&B chambre, salle de bain et salon', 'Buenos días\r\nSomos propretarios de un b&b en Alicante, quieremos tener informaciones sobre contenedores maritimo reformados en habitaciones doble con cuarto de baño, cama grande y 2 lados con cristal.\r\n\r\nPara contartarnos fincapao@gmail.com o 0034 629865809\r\nUn saludo\r\nJoris', 213, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(253, '2019-03-19 13:54:50', '0000-00-00 00:00:00', 'Transformación de un contenedor', 'Hola, Tenemos actualmente 2 food trucks de comida mexicana y estaríamos interesados en transoformar un contenedor para convertirlo en un food truck. Podríamos vernos algún día para comentar el proyecto? http://corazondeagave.com.es/galerias/foodtruck Un saludo, Peter Tarrida del Mármol Corazón de Agave Móvil: 628 31 34 62 admin@corazondeagave.es www.corazondeagave.es La posible información de carácter personal que pueda contener el presente correo electrónico, está protegida debidamente por la normativa del Reglamento General de Protección de Datos (RGPD) que compromete a no utilizarla para fines distintos por la que ha sido remitida a su destinatario, a la vez que la sujeta a una obligación de confidencialidad. En consecuencia, es de uso exclusivo para su destinatario, quedando prohibida a cualquier otra persona su revelación, copia, distribución o el ejercicio de cualquier acción relativa a su contenido. Si recibiera este e-mail erróneamente o de forma incompleta, ruego procedan a reenviárnoslo. Información Básica Política de Privacidad (RGPD) Responsable: CORAZON DE AGAVE S.L. ? BLANCA VELIA PÉREZ SÁNCHEZ Finalidad: Gestión de la ejecución de la relación comercial y facturación de la misma Legitimación: Ejecución de un contrato Periodo de Conservación: Los datos proporcionados se conservarán mientras se mantenga la relación comercial o durante los años necesarios para cumplir con las obligaciones legales Comunicaciones comerciales: Se solicita consentimiento expreso para poder enviar comunicaciones comerciales i promocionales sobre novedades de nuestros productos Podrà revocar en cualquier momento el consentimento prestado su solicitud a admin@corazondeagave.es Destinatarios: No se cederán datos a terceros, salvo obligación legal Derechos: Acceder, rectificar y suprimir los datos, así como otros derechos, como se explica en la información adicional Información adicional: Pued