	(257, '2019-03-20 08:31:36', '0000-00-00 00:00:00', 'Mensaje', 'Buenos días. Tras visitar su página de Internet, hemos observado que está dirigida principalmente a empresas; por eso, queremos proponerles un producto que les ayudará a aumentar significativamente su número de clientes. Le presentamos una base de datos de empresas con los datos de contacto de sus dueños y directivos. El catálogo incluye más de un millón de direcciones, y es uno de los mayores en el mercado español. Contiene datos tales como: nombre de la empresa, domicilio social, datos de contacto del dueño, e-mail, teléfono, fax, página web, etc. Puede empezar a usar el catálogo y promocionar sus productos inmediatamente. El retorno de la inversión está garantizado. ¡Lo compra una vez y lo puede usar toda la vida! Base de datos de empresas españolas - 1.548.400 registros. - 190.00 € - Sólo hasta el 20/03/2019 Más información en nuestra web: http://www.basededatosempresas-db.com/?page=catalog Atentamente, Pablo Martinez GC-Team', 165, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(258, '2019-03-20 09:06:41', '0000-00-00 00:00:00', 'ADVANCED FACTORIES 2019', '[https://www.diba.cat/targeto/images/logo_dibaoberta.png] INVITACIÓ ADVANCED FACTORIES Connectant amb la Fàbrica Digital [https://www.diba.cat/documents/36150622/234345014/Advanced-Factories-2019-banner-1080x270-cat.png/803241fd-b2fb-4a18-8986-3d4b836a50be?t=1552461300196] El Pacte Nacional per a la Industria va establir moltes iniciatives per millorar la competitivitat de les nostres empreses de l\'àmbit industrial. Entre algunes d\'elles està previst ajudar a les nostres pimes a abraçar la denominada Industria 4.0, amb l\'objectiu d\'escalar ràpidament posicions en la millora de la nostra productivitat i innovació. És per això que els propers 9-11 d\'abril s\'organitza novament a Barcelona l\'Advanced Factories i el Industry 4.0 Congress, del que la Diputació de Barcelona, a través de la Delegació de Promoció Econòmica i Ocupació, en som col·laboradors. Advanced Factories és la cita amb la innovació pel sector industrial, amb solucions que van des de l\'automatització industrial, la màquina-eina, la robòtica o la fabricació en 3D, fins les tecnologies associades a la indústria 4.0 com són la Intel·ligència Artificial, Internet de les Coses, la Ciberseguretat o el BigData. És un esdeveniment a l\'alçada dels reptes als que ens hem d\'enfrontar la industria catalana si volem millorar la nostra competitivitat. Una fira amb les solucions, robòtica i maquinària industrial més innovadores del mercat, i el major congrés europeu sobre indústria 4.0, l\'impressionant Industry 4.0 Congress, on descobrir les tendències, equips i tecnologia pel disseny de les fàbriques digitals i connectades, així com els nous models de negoci pel nostre sector. [https://www.diba.cat/documents/36150622/234345014/invitaci%C3%B3.jpg/65c4d2ba-1341-4810-9c39-0076bc43943f?t=1552461373221] Des de la Diputació de Barcelona és per nosaltres un plaer traslladar-te aquest codi d\'invitació, perquè el pugueu fer arribar a les empreses industrials del vostre municipi. Si segueixen l\'enllaç podran acreditar-se gratuïtament a ADVANCED FACTORIES 2019. És un Premium VIP Pass de 3 dies, que dona accés a: · la fira · a tot el programa de conferències del INDUSTRY 4.0 CONGRESS · a les àrees interactives i el Factory Innovation Theatre · a la sala VIP del Congrés · a la app de l\'esdeveniment disponible a Google Play i Apple Store Que no s\'ho perdin, estem convençuts que la seva visita els aportarà moltes idees, estratègies i solucions amb les què impulsar la gestió de la seva planta o àrea de negoci cap a una nova dimensió. Esperem poder-vos saludar personalment allà al llarg d\'aquells dies. Una cordial salutació, Sonia Recasens i Alsina Diputada delegada de Promoció Econòmica i Ocupació Diputació de Barcelona [https://www.diba.cat/documents/10165/31592443/facebook.png] [https://www.diba.cat/documents/10165/31592443/twitter.png] [https://www.diba.cat/documents/10165/31592443/youtube.png] [https://www.diba.cat/documents/10165/31592443/icona_instagram50x50.png] Bon dia, Per si és del vostre interès, us fem a mans la invitació de la Diputació de Barcelona per a l’Advanced Factories, que tindrà lloc a Barcelona els dies 9, 10 i 11 d’abril. Salutacions cordials. Departament de Promoció Econòmica [cid:image002.jpg@01D4DEF2.E12B4BF0] Av. de Pau Casals, 9 Tel. 93 772 38 78 08755 Castellbisbal www.castellbisbal.cat', 98, 'VCONT', 4, 'NOGEST', 'EMAIL'),
