	(267, '2019-03-20 12:40:55', '0000-00-00 00:00:00', 'AIP formación bonificada Gestión de proyectos', '*|MC:SUBJECT|**|MC_PREVIEW_TEXT|* * Gestionar proyectos es una tarea compleja que tiene que ser realizada con rigor y sobretodo mucho control sobre cada uno de los procesos. Gracias a nuestros cursos enfocados a la gestión de proyectos podrás dominar las distintas herramientas más utilizadas en las principales empresas. * Presto Presto es el programa de presupuestos y mediciones BIM que integra la gestión y el control de costes para edificación y obra civil que comprende las diferentes necesidades de todos los agentes que intervienen en todas las fases: MS Project Microsoft Project es un software de administración de proyectos diseñado, desarrollado y comercializado por Microsoft para ayudar a administradores de proyectos en el desarrollo de planes, asignación de recursos a tareas, dar seguimiento al progreso, administrar presupuestos y analizar cargas de trabajo. REVIT Revit es un programa de diseño creado exclusivamente para proyectos de construcción. A partir del diseño en 3D del edificio se obtienen los planos en 2D que se precisan para la presentación del proyecto: planos de planta, alzados, secciones, así como vistas modelizadas que permiten mostrar el proyecto con gran realismo. Revit permite abordar los proyectos de modelado BIM en dos partes: el conocimiento del proyecto y la gestión del proyecto. AIP somos un centro con más de 30 años de experiencia donde te ofrecemos formación personalizada adecuada a las necesidades de tu empresa sin que tengas que preocuparte del proceso de bonificación ya que nosotros nos encargamos de gestionarlo. Ofrecemos servicios de formación en empresas o en nuestras instalaciones y contamos con el certificado de centro oficial de formación Adobe. INFORMATE SOBRE NUESTROS CURSOS Copyright ©, todos los derechos reservados. Nuestra dirección de correo es: guillem@aipbarcelona.com (guillem@aipbarcelona.com%20%C2%A0) ¿Desea cambiar la forma en que recibe estos correos electrónicos? Si no desea seguir recibiendo esta información puede darse de baja de esta lista.', 221, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(268, '2019-03-20 13:28:32', '0000-00-00 00:00:00', 'Presupuesto para la Sala Montjuïc - Barcelona', 'Buenos días, Os queríamos pedir presupuesto para el alquiler de varias casetas modulares, para el festival de cine al aire libre "Sala Montjuïc". El festival tiene lugar en el foso del Castillo de Montjuïc, en Barcelona, este año del 28 de junio al 2 de agosto. La entrega e instalación de las casetas se haría el martes 25 de junio, y el desmontaje el martes 6 de agosto. Nuestras necesidades serían las siguientes: - 2 módulos de 15 m2 ensamblados - 1 módulo de 10m2 - 1 módulo de 15 m2 - 1 módulo de 18 m2 Con los servicios adicionales correspondientes: - 4 extintores polvo 6 kg - Servicio de asistencia - Transporte y entrega - Transporte de recogida - Obras de instalación Adjunto imagen con los módulos que necesitamos. Muchas gracias de antemano, y un cordial saludo, Antoine Leonetti *Antoine Leonetti* 93 302 3553 - info@modiband.com Descobreix tots els nostres projectes al web ? ?', 222, 'VCONT', 2, 'NOGEST', 'EMAIL'),
