	(270, '2019-03-20 13:51:07', '0000-00-00 00:00:00', 'Sua empresa tem um Software de Gestão Integrada?', 'Olá Zarca\r\n\r\nO Prime Gestão é um sistema online para Gestão do seu negócio. Gerencie seus processos de vendas, compras, faturamento, financeiro e produção da sua empresa e acesse todos os dados da sua empresa online e de qualquer lugar utilizando um computador,notebook, tablet ou smartphone. \r\n\r\nFaça-nos uma visita: http://www.primegestaoerp.com.br\r\n\r\nUm forte abraço\r\nErick\r\n\r\nNão tenho interesse nesta oferta: \r\nhttp://www.sairdalista.site?u=http://www.zarca.es&c=e81e21aa9c544A08E9D0', 223, 'VCONT', 3, 'NOGEST', 'EMAIL'),
