	(272, '2019-03-20 16:35:35', '0000-00-00 00:00:00', 'SOLICITUD DE PRESUPUESTO', 'Buenas tardes, Me pongo en contacto con ustedes porque he visto en su web que ofrecen el servicio de alquiler de contenedores refrigerados, el caso es que necesito que me presupuesten las siguientes opciones: * 1 contenedor de 10´ (Alquiler por 2 meses Agosto y septiembre) * 1 contenedor de 20´ (Alquiler por 2 meses Agosto y septiembre) Los contenedores son para meter la fruta en la misma finca donde se cosecha y es necesario que se pongan a 4º de temperatura. La finca es una plantación de arándanos en Cantabria. Además del alquiler, ¿tienen la opción de venta o alquiler con opción a compra?, este servicio lo necesito todos los años en los meses de verano. Quedo atento a su presupuesto. Un saludo, Santiago Ruiz Fernández 658965769', 225, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(273, '2019-03-20 16:43:24', '0000-00-00 00:00:00', 'Consulta de material - Zarca', 'Buenas tardes, Estoy interesada en recibir información acerca del alquiler de dos módulos que aparecen en vuestra página web y que adjunto en este email. Se trataría de un alquiler desde finales de esta semana hasta mediados del próximo mes de Mayo para una película. Me gustaría saber si están disponibles en la ciudad de Barcelona así como de qué precios estaríamos hablando. NOSTROMO PICTURES, S.L. Via Augusta, 81-85 pral 2a (08006) Barcelona B-65369522 Referencia del proyecto: WASP NETWORK Espero vuestra respuesta. Muchas gracias! Un saludo, *__* *Silvia Merino Borràs. arte.*666.10.26.53 silviamerinoborras@gmail.com https://vimeo.com/silviamerinoart', 226, 'VCONT', 3, 'NOGEST', 'EMAIL'),
