	(291, '2019-03-21 15:38:13', '0000-00-00 00:00:00', 'Oferta para 2 contenedores modificados', 'Buenos días, Los escribo pues estamos buscando una empresa que nos pueda adaptar dos containers y reconvertirlos para dos usos diferentes: Uno de ellos debería ser un almacén: estanterías simples e iluminación. El otro debe ser reconvertido en un taller: bancos de trabajo, algún estante, A/C, iluminación, puntos de corriente. Por si no nos conocen, TRITON Submarines es una empresa estadounidense que se especializa en el ensamblaje y mantenimiento de submarinos para uso lúdico y de investigación científica. En los últimos meses hemos abierto nuestro primer centro de producción en Europa y estamos desarrollando el primer proyecto que será 100% hecho en España. Actualmente estamos expandiendo nuestra red de proveedores para este proyecto y las demás líneas de producción que se establecerán en Barcelona. Si quieren saber más, los invito a visitar nuestra web: www.tritonsubs.com -- Thank you in advance for any attention you may bring to this matter, (Mr.) Joan Bigas Purchase & Engineering Department Triton Submarines EMEA, SL Gallery Building, Office 20 Carrer de l’Escar 26 08039 Barcelona (ES) Office: +34 937-034-470 Mobile: +34 626-054-212 Web: www.tritonsubs.com Email: joan@tritonsubs.com', 240, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(292, '2019-03-21 15:47:52', '0000-00-00 00:00:00', 'B. Braun _ Actualización contacto pedidos / B. Braun _ Update Procurement Data ', 'Buenos días/Buenas tardes, Contactamos con ustedes desde el dpto. de Compras Centrales del Grupo B. Braun en España. El motivo de este correo es la necesidad de actualización de los datos maestros de nuestros proveedores. Actualmente, B. Braun se encuentra inmerso en un proceso de digitalización de Compras cuya primera fase consistirá en la implementación del software SAP ARIBA. Pese a que esta implementación será gradual, debemos empezar a tomar medidas para garantizar que todos nuestros proveedores siguen recibiendo la información y comunicaciones necesarias, relativas a la gestión de Compras. Rogamos nos hagan llegar antes del 5 de Abril, los siguientes datos actualizados, teniendo en cuenta que, en la medida de lo posible, estos deben ser datos generales no personalizados. Pedidos Contacto Comercial Denominación Social Email Pedidos Persona de Contacto Pedidos Teléfono de Contacto Pedidos Email Comercial Persona de Contacto Comercial Teléfono de Contacto Comercial Actividad General Les mantendremos informados de la evolución de este proyecto en caso que sea necesaria su colaboración. Reciban un cordial saludo, ______________________________________________________________________________________________________________________________________________________________________ Dear Sir or Madam, We are contacting you from the Procurement Department of B. Braun Spain. The reason behind this e-mail is our need to update our provider database regarding contact information As of today, B. Braun is in a process of transformation towards a more digitalized management of procurement, which will be possible thanks to the implementation of SAP ARIBA. Keeping in mind that this transformation will be gradual, we have to make sure that we take the right actions in order to guarantee that all our providers keep on receiving all the necessary information. Please send us the following updated information before April 5th and to prioritize general contact information instead of personal ones. Orders Sales Company name Order email Order contact Order phone number Sales email Sales contact Sales phone number Core business We will inform you of any updates or news regarding this project in the event that we require further collaboration. Kind regards, Alejandro Sánchez Category Manager Services & Auxiliary Supplies Procurement Department T. + 34 93 546 69 27 [cid:image001.png@01D4DFFD.605721F0] _______________________________________________________________ The information contained in this communication is confidential, may be attorney-client privileged, may constitute inside information, and is intended only for the use of the addressee. It is the property of the company of the sender of this e-mail. Unauthorized use, disclosure, or copying of this communication or any part thereof is strictly prohibited and may be unlawful. If you have received this communication in error, please notify us immediately by return e-mail and destroy this communication and all copies thereof, including all attachments.', 241, 'VCONT', 3, 'NOGEST', 'EMAIL'),
