	(304, '2019-03-22 15:33:33', '0000-00-00 00:00:00', 'FEDERAL BUREAU OF INVESTIGATION FBI.WASHINGTON DC.', 'FROM THE DESK OF THE EXECUTIVE DIRECTOR: FEDERAL BUREAU OF INVESTIGATION FBI.WASHINGTON DC. Dear Beneficiary We hope this notification arrives meeting your good health and mind. (FBI) Washington, DC in conjunction with some other relevant investigation agencies here in the United STATES of America have recently been informed through our Global intelligence monitoring network that you have an over-due payment in tone of USD $10.3M. It might interest you to know that we have taken our time in screening through this project as stipulated on our protocol of operation and have finally confirmed that your payment/transaction with Citibank is 100% genuine and hitch free from all facets and of which you have the lawful right to claim your fund without any further delay. Having said all this, we will further advise that you go ahead in dealing with the Citibank, Alabama(AL) accordingly as we will be monitoring all their activities with you as well as your correspondence at all levels. NOTE: There are numerous scam emails on the internet, imposters impersonating names and images. We therefore warn our dear citizens to be very careful with any claim email you receive prior to these irregularities so that they do not fall victim to this ugly circumstance anymore and should in case you are already dealing with anybody or office claiming that you have a payment with them, you are to STOP further contact with them immediately in your best interest and contact the real bank (Citibank) only where your fund is laying, with the below information: Bank Name: Citibank Address: 815 D Pelham Rd, Jacksonville, Alabama(AL) 36265. Attn: Lambert huddles (Remittance Director) E-mail: lambert_huddles01yahoo.com website: www.citibank.com Contact the bank today and furnish them with this information below for processing of your payment/funds accordingly. FULL NAME:____________________ CURRE