	(315, '2019-03-25 08:15:49', '0000-00-00 00:00:00', 'RE: Presupuesto contenedores ZPMC ESPAÑA REMINDER', 'Buenos días Eduard, Qué tal? Soy Mónica de ZPMC España, trabajamos con vosotros para unos trabajos en el puerto de Barcelona en la terminal de BEST a finales 2018. En abril vamos a empezar un nuevo proyecto en el puerto de Barcelona, pero en otra terminal en APMT Barcelona, y vamos a necesitar: * 1 contenedor vacío para herramientas 20". * 1 contenedor oficina * 2 sanitarios Puedes enviarme presupuesto, por favor? Sería para unos 7 días aprox. Espero tu respuesta Gracias Saludos Mónica Zahonero Martínez Assistant Accountants ZPMC España S.L.U. Edificio Geminis. Avda. Cortes Valencianas nº 39 5ª Planta Ofic. A1 46.015 Valencia +34 667 733 089 Monicazahonero@zpmc.eu www.zpmc.com www.zpmc-spain.com', 256, 'VCONT', 2, 'NOGEST', 'EMAIL'),
