	(317, '2019-03-25 09:11:07', '0000-00-00 00:00:00', 'AVISO PAGOS GRUPO DULCESOL', 'Estimado proveedor: Por parte de la empresa DULCESA S.L.U. se ha generado una remesa de pagos confirmados (confirming), a trav?s de la entidad bancaria SANTANDER. Esta entidad contactar con Ud/s. y le ofrecer la posibilidad de anticipar todas o parte de las facturas incluidas en la remesa. Si desea/n conocer la relaci¢n de facturas incluidas en la remesa, puede/n hacerlo tambi?n con sus claves a trav?s de nuestra web (http://www.dulcesol.es/, EXTRANET, ACCESO PROVEEDORES); aqu¡ pueden consultar, asimismo, los datos de contacto que figuran en nuestra base de datos (direcci¢n postal, tel?fono, fax y correo electr¢nico). Si no dispone/n de sus claves, puede/n solicitarlas respondiendo a este mensaje e indic ndolo en su respuesta. El modo de pago asignado por nuestra empresa a sus facturas es el denominado CHEQUE. Por las facturas que Ud/s. no anticipe/n, la entidad bancaria SANTANDER emitir autom ticamente un cheque, cuando se produzca el vencimiento de cada una de las facturas pagadas, y lo enviar por correo postal a la direcci¢n que figura en nuestra base de datos. Si lo prefieren, esta forma de pago puede ser sustituida por una TRANSFERENCIA. Para que ello sea posible, debe/n Ud/s. facilitar un n£mero de cuenta bancaria a la entidad SANTANDER, a trav?s del n£mero de fax, 91 257 11 41, para lo cual pueden utilizar el mismo formulario que dicha entidad les har llegar. Si as¡ se lo indica/n, la entidad SANTANDER le/s abonar en el futuro en la cuenta facilitada todas las transferencias por nuestros pagos confirmados. Deber n acompa¤ar alg£n certificado o documento acreditativo, respecto de la titularidad de la cuenta en la que deseen recibir las transferencias. Estamos a su disposici¢n para resolver cualquier duda relacionada con la gesti¢n de sus facturas y del pago de las mismas. Puede/n contactar con nosotros respondiendo a este mismo mensaje y planteando las cuestiones que considere/n oportunas. Tambi?n puede/n ponerse en contacto con la entidad bancaria, a trav?s del tel?fono 902 02 27 15. Gracias por su atenci¢n. Reciba/n un cordial saludo. GRUPO DULCESOL (Administraci¢n y Finanzas) proveedores.dulcesa@dulcesol.es Dear supplier: We have generated a consignment of confirmed payments (confirming) through the banking entity Santander. It will contact you to offer you the possibility of anticipate the payment of all the invoices of the consignment or just some of them before the date of their expiration. If you want to know the invoices included in the consignment, you can do it in our web (http://www.dulcesol.es/, EXTRANET, ACCESO PROVEEDORES); here you can also check the contact data that we have of your company in our database (postal address, telephone number, fax, email address). If you can not logging, you can ask us for your passwords to log, answering this email. The payment method that we have assigned to your company is cheque. In case you do not anticipate your invoices before the date of their expiration the banking entity Santander will send a cheque of your invoices to the postal address of your company that appear in our database. If you prefer a bank transfer as a payment method you have to ask for change it just giving your account number with a certificated document that prove that your company is the account holder, to the banking entity Santander using the fax number 91 257 11 41 sending the formulary that the banking entity Santander will send to you. Please, contact us answering this email if you have any question, asking about whaterver you need to know else of this process. You can also contact with the banking entity Santander using the telephone number 902 02 27 15. Thank you very much for your attention. Best Regards, GRUPO DULCESOL (administration and finances department) proveedores.dulcesa@dulcesol.es', 258, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(318, '2019-03-25 09:54:22', '0000-00-00 00:00:00', 'Solicitud de oferta contenedor aire comprimido', 'Buenos días, Tal y como comentamos por teléfono, necesito una oferta de la instalación de un sistema de aire comprimido en un contenedor de 40 pies. El contenedor dispondrá de: · Debe ser apto para transporte marítimo. · Suelo metálico antideslizante. · Iluminación. · Instalación eléctrica y cuatro eléctrico con las protecciones necesarias para el 2x compresores, 2x secadores, 1x purga electrónica, iluminación y el ventilador. · 2x rejilla de entrada de aire situada frente a la aspiración de los compresores · 2x Conducto de la extracción de calor de la refrigeración del compresor con cuello de cisne, este contará con una preinstalación para que el montaje se finalice en campo (durante el trayecto en barco irá desmontado) · Debe disponer de un ventilador en el lateral del contenedor para extracción de calor, la temperatura máxima ambiente de la zona es en torno a 31ºC , en el interior del contenedor no se deben superar los 46 grados que marca el límite de funcionamiento del compresor. Con esto se considera que es suficiente por lo que no es necesario ningún tipo de aislamiento en el contenedor. · Respecto a la instalación de tuberia, el objetivo de este proyecto es hacer un contenedor estándar lo más barato posible, no hay especificación de materiales o métodos de unión por lo que lo dejo a tu criterio en función de con qué soléis trabajar, siempre teniendo en cuenta el coste y las pulgadas de los equipos. La tubería irá debidamente fijada por el techo o paredes del contenedor · La recogida de condensados será con bajantes en tubing transparente flexible desembocando en una tubería rígida común a todos los equipos del material que creáis conveniente. · Salida de la tubería de aire y de condensados por el lateral del contenedor con la correspondiente conexión por brida. · Es necesario hacer 2 aberturas de 1.70 m de alto y 2m de ancho en el lateral del contenedor para poder acceder a la parte trasera de los compresores al realizar ocasionalmente (2 veces por año aproximadamente) las labores de mantenimiento. El método de apertura o desmontaje del panel queda a vuestra elección, siempre teniendo en cuenta que sea económico y lo más sencillo posible de abrir. · En este proyecto vamos a precio por lo que debe ser lo más económico, no hay problema en que sea un contenedor usado. En caso de que sea necesario pintarlo se hará del RAL especifico de Ingersoll Rand · En los archivos adjuntos tienes los planos de los equipos y un esquema básico del montaje. La disposición de los equipos puede variar si se os ocurre alguna solución mejor. Los equipos que se instalarán en el interior son: 2x Compresor 37KW: · Salida de aire: pulgada y media BSPT · Salida condensados: ½ " BSPT · Diámetro del cable de alimentación 120 mm · Potencia nominal motor principal 37 KW · Potencia del paquete 43.4 KW · 480/3/60 Hz · 1095 KG · 1937x1056x153 mm 6x Filtros FA400I: · Entrada y salida de aire: pulgada y media BSPT · Salida condensados: ½ " BSPT · 470x113x129 mm · 2.36 kg · No tiene conexión electrica 2x Secador modular: · Entrada y salida de aire: 1" BSPT · 120/1/60 Hz · 34 W · 104 kg · 1847x566x277 mm 1x Depósito 1000L: · Entrada y salida de aire: 2" GAS · Salida condensados: ½ " GAS · Altura 2010 mm · Diámetro 850 mm · Peso 280 kg · No tiene conexión eléctrica 1x Purga electrónica para el depósito: · Entrada condensados: ½ " · Salida condensados: 1/4 " · 120/1/60 Hz · 2VA El destino final del contenedor es Sudamérica por lo que el voltaje será 480V 3 fases sin neutro o 120V a una fase, frecuencia 60Hz. Si necesitas cualquier aclaración no dudes en contactarme. Un saludo. Jorge Escolar González Sales Support Engineer Compression Technologies and Services EMEIA Ingersoll Rand Casas de Miravete Nº22B Edificio 1B-3ª Planta 28031 Madrid Spain Office (+34) 620 20 71 51 Email Jorge.escolar@irco.com Website www.ingersollrandproducts.com [cid:image006.png@01D4B238.07161F30]', 259, 'VCONT', 4, 'NOGEST', 'EMAIL'),
