	(329, '2019-03-25 16:53:49', '0000-00-00 00:00:00', 'información de alquiler', 'Buenas tardes, Somos una empresa de Sitges que estamos haciendo una obra nueva y necesitamos alquilar un contenedor para guardar parte de los muebles de la clienta. Será en la urbanización mas alba que pertenece a Sant pere de Ribes. Nos gustaría nos informaran de procedimiento y precios. Un cordial saludo! Aïda Corbalan Perez Departamento de administracion Carretera de les costes,42 08870 Sitges E-mail: sit@sitconfort.com web: www.sitconfort.es Tel: 93.894.60.59 whatsapp: 687.405.208 Este mensaje y los ficheros anexos son confidenciales. Los mismos contienen información reservada que no puede ser difundida. Si usted ha recibido este correo por error, tenga la amabilidad de eliminarlo de su sistema y avisar al remitente mediante reenvío a su dirección electrónica; no deberá copiar el mensaje ni divulgar su contenido a ninguna persona. A continuación dispone de la información básica sobre protección de datos. Puede consultar la información adicional sobre protección de datos en nuestra página web. * Responsable del Tratamiento: SIT CONFORT, S.L. * Finalidad: Atender y dar respuesta a su petición o consulta y mantener los contactos y relaciones que se produzcan como consecuencia de la misma. * Base jurídica: El consentimiento inequívoco al ponerse en contacto con nosotros y facilitarnos sus datos para tal fin, pudiendo también ser el interés legítimo o la necesidad para gestionar una relación contractual o medidas precontractuales. * Destinatarios: No cedemos sus datos a terceros. Derechos: Acceso, rectificación, supresión, oposición, limitación del tratamiento, portabilidad poniéndose en contacto con nosotros en: sit@sitconfort.como en la forma en que se indica en nuestra política de protección de datos. En caso de considerar vulnerado su derecho a la protección de datos personales, podrá interponer una reclamación ante la Agencia Española de Protección de Datos ( www.agpd.es).', 264, 'V