	(331, '2019-03-25 17:14:51', '0000-00-00 00:00:00', 'RV: Modulo', 'Buenas tardes, Estaría interesado en adquirir un módulo de obra, para instalar fijo dentro de nuestras instalaciones. Les agradeceré me pasen presupuestos de nuevos y usados, en medidas de 4 y 6 metros. Saludos [https://originiafoods.com/imagen_evento_OF_cabecera.jpg] [logo] Jesús Vergé Coordinador Industrial [Descripci?n: Tlf] 973 797 515 - [Descripci?n: M?vil] 679 967 366 - [Descripci?n: Email] jverge@infrusesa.com [logo] [https://samcanet.samca.com/samcanet/apps/gestionFirmas/img/logoGrupoSamca.png] infrusesa.com originiafoods.com gruposamca.com AVISO: Este correo electrónico se dirige de modo exclusivo a su destinatario y, por tanto, tiene carácter confidencial, especialmente en lo que respecta a los datos personales que contiene. Si recibe este mensaje por error, le rogamos nos lo comunique de inmediato y lo elimine sin conservar copia del mismo ni de sus documentos adjuntos. Originia Foods es una marca registrada de Grupo SAMCA. NOTICE: This e-mail is intended only for the recipient and it is confidential, especially regarding to personal data contained in it. If you receive this message by mistake, please notify us immediately and delete its original and any copies and attachments. Originia Foods is a registered trademark of SAMCA Group. AVISO: Este correo electronico se dirige de modo exclusivo a su destinatario y, por tanto, tiene caracter confidencial, especialmente en lo que respecta a los datos personales que contiene. Si recibe este mensaje por error, le rogamos nos lo comunique de inmediato y lo elimine sin conservar copia del mismo ni de sus documentos adjuntos.', 266, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(332, '2019-03-25 17:40:33', '0000-00-00 00:00:00', 'Descubra el valor de su empresa hoy mismo.', 'Buenos días Eduardo Zarzoso Aznar, Propuesta de valoración empresarial para Zarzoso I Catasus, S.L. Le proponemos valorar Zarzoso I Catasus, S.L. hoy mismo. Una valoración independiente es la mejor manera de averiguar el precio que uno pudiera desembolsar por su empresa. Tanto si desea iniciar el proceso ahora, como si está a unos años de tomar la decisión, hoy es un buen momento para revelar el valor de su empresa. Eduardo, revelamos el valor objetivo de mercado de su empresa. Uno de los problemas con el valor de su empresa es que tiene distintas soluciones. Nuestro documento revela las diferentes soluciones al problema del valor en una manera concisa y sencilla, para que usted tenga la información que necesita hoy mismo. Garantía de confidencialidad. En un servicio confidencial, le mostraremos los ratios más importantes de Zarzoso I Catasus, S.L. así como los distintos valores de la misma. Una distinción entre valor total y valor patrimonial, valor de su deuda y valor estimado entre otros. Todos los indicadores vienen completamente explicados y pueden ser la diferencia entre obtener un precio justo o perder capital simplemente por no saber la diferencia. Y es muy interesante saber la diferencia e historia más allá de los números. Nuestra valoración le permite, entre otras cosas: · Determinar un excelente punto de partida y evitar perder dinero en una negociación. · Establecer de manera clara y sencilla la situación monetaria de su empresa. · Valorar la posible venta de la misma con sus distintas variantes. · Conocimiento del valor para implementar una estrategia de mejora. · Cambiar completamente o alterar la directiva y resolver posibles disputas entre socios. · Posibilidad de ampliar una línea de negocio. · Valor futuro de su empresa. · Identificar una empresa que usted desee comprar como adquisición. Nuestra valoración monetaria considera los 3 últimos ejercicios presentados por su empresa Zarzoso I Catasus, S.L. , puesto que la valoración de una empresa en el presente viene respaldada por su trayectoria, descubra el valor de su empresa por 399€ IVA incluido. Somos de confianza e independientes, puesto que nosotros no nos vamos a beneficiar de lo que pueda venir consecuentemente, usted hace un pago único y sin compromiso alguno. Es algo que nuestros clientes hacen regularmente para confirmar la figura que ellos tienen en la mente con la que le podemos suministrar nosotros. Para pedir la valoración monetaria de su empresa Zarzoso I Catasus, S.L. por 399€ IVA incluido., únicamente responda al email con sus datos sociales (CIF, dirección, y dirección de email). Nosotros le mandamos la valoración por un lado y una factura para su posterior pago. Usted Recibirá: - Valoración monetaria de su empresa. o Explicación de los ratios más importantes y valor de la misma o Valor total, patrimonial, ajuste de activo/pasivo y valor futuro. - Situación general financiera de su empresa. o Áreas a mejorar y preguntas para ayudarle a mejorar. Sabemos lo importante que es su empresa para usted, sepa lo que vale hoy mismo. *Recepción en 48/72h por email en formato PDF *Pago por transferencia bancaria. Reciba un cordial saludo, Nicolás Garillete Director comercial Teléfono: 680 759 589 www.pongaleprecio.es simon@pongaleprecio.eu info@pongaleprecio.es Visite nuestra web o mándenos un email a info@pongaleprecio.es Calle San Rufo Sin número Madrid. Comunidad de Madrid 28011 España ¿Por qué he recibido esto? Como empresa conforme con la ley de protección de datos y GDPR, nos gustaría explicarle por qué ha recibido el correo. En el contexto de B2B, el marco legal que nos ampara es el del interés legítimo. Creemos que es de su interés el poder valorar su empresa con nosotros. Vea nuestra política de privacidad en www.pongaleprecio.es . Valgroup Valoraciones, todos los derechos reservados. Acceda a nuestra web www.pongaleprecio.es Eduardo B65767030 Catalonia SPTANKB65767030 233 233 42735 74th Si desea dejar de recibir nuestros emails responda con STOP EMAILS a info@pongaleprecio.es Este documento es privado y confidencial, y así trataremos su información y todo lo que nos indique. No interferimos en la compraventa de empresas, por lo que el documento en mano es completamente independiente y objetivo. Zarzoso I Catasus, S.L. Zarzoso I Catasus, S.L. Este mensaje y sus archivos van dirigidos exclusivamente a su destinatario, pudiendo contener información confidencial sometida a secreto profesional. No está permitida su reproducción o distribución sin la autorización expresa de Póngale Precio. si usted no es el destinatario final por favor elimínelo e infórmenos por esta vía. Este mensaje y cualquier documento adjunto que lleve consigo es confidencial. Igualmente, la información contenida es confidencial y está dirigida únicamente a las personas mencionadas. No debe divulgarse o utilizarse para fines distintos a los intencionados. Male Spain 5203 ES1335716 Eduardo Registrada en Inglaterra y Gales Número registral 11378798. Zarzoso I Catasus, S.L. Complejo Rockingham Court, Acklam, TS5 7BN. UK.', 267, 'VCONT', 2, 'NOGEST', 'EMAIL'),
