	(335, '2019-03-25 21:55:31', '0000-00-00 00:00:00', 'Zona de almacenaje y ocio', 'Buenas tardes.\r\n\r\nMi nombre es Julián y estaba interesado en asesoramiento para la compra de una vivienda prefabricada o caseta de obra.\r\n\r\nLa intención es ponerla en el jardín de nuestra casa unifamiliar con parcela, para ser utilizada como zona de almacenaje y si, el precio y las dimensiones lo permiten, disponer de una zona de ocio y estar (un lugar diáfano para colocar una mesa, sofá, etc).\r\n\r\nSolicito que se pongan en contacto conmigo para barajar posibles opciones.\r\n\r\nMuchas gracias.\r\n\r\nSaludos,\r\nJulián García\r\n625787647', 61, 'VCONT', 4, 'NOGEST', 'EMAIL'),
