	(337, '2019-03-26 10:30:57', '0000-00-00 00:00:00', 'GPS control de flota para ZARCA S.L.', 'Hola, Mi nombre es María Gómez y pertenezco a FlotaGPS , una empresa que ofrece a las compañías la capacidad de controlar cómo sus empleados actúan en la carretera a la vez que aumenta la productividad del quipo. Quiero ayudarle a entender mejor la industria del control de flotas GPS y ofrecerle las mejores tarifas de servicio. Los puntos clave a tener en cuenta: • Las estadísticas muestran que millones de euros se pierden cada año en España debido a la disminución de la productividad del personal. • La gestión de combustible de la flota reduce el consumo de combustible y también aumenta la capacidad de asignar de manera eficiente su flota utilizando puntos de referencia y posicionamiento en tiempo real. Incluso si usted ya tiene una fuente para la localización de flotas GPS, es bueno saber cuáles son sus opciones ya que constantemente aparecen alternativas nuevas y más avanzadas. Nuestro sitio web le mostrará las opciones más actuales con los mejores descuentos ofrecidos por los proveedores de software de GPS de gran reputación nacional. Necesitaremos la siguiente información para preparar un presupuesto o propuesta: * ¿Cuántos vehículos necesita rastrear? * Nombre de su organización * Nombre y Apellido * Número de teléfono * Ciudad * Dirección * Código postal Le recomiendo que consulte nuestros precios respondiendo a este correo electrónico. Atentamente, María Gómez Maria@es-Flota-GPS.online ES-Flota-GPS Su privacidad es importante para nosotros. No pasaremos sus datos a compañías de terceros sin su expreso permiso. Responder "BAJA", si no desea recibir más mensajes.', 271, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(338, '2019-03-26 10:59:09', '0000-00-00 00:00:00', 'Licitación - Alquiler oficina modular', 'Estimados proveedores, Estamos en proceso de licitación del alquiler de una oficina modular de 45m², Características mínimas: - Aislamiento térmico - Aislamiento acústico - Iluminación - Aire acondicionado - Extintor Por favor detallar costes y plazos de instalación. Contrato inicial por un año. Se tomarán en cuenta sólo presupuestos recibidos antes de finalizar el jueves 28 de marzo de 2019, cualquier duda que tengan no duden en ponerse en contacto conmigo. Muchas gracias, Luis Gonzalez Tucci Purchasing / Supply Chain Pol. Ind. SUPOI-8 C/ Dels Ibers, 54 12550 Almazora (Castellón) España (Spain) mobile +34 647 342 132 Luis.GonzalezTucci@efi.com www.efi.com [cid:image001.jpg@01D2C335.0FC3D120] Confidentiality notice: This message may contain confidential information. It is intended only for the person to whom it is addressed. If you are not that person, you should not use this message. We request that you notify us by replying to this message, and then delete all copies including any contained in your reply. Thank you.', 272, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(339, '2019-03-26 11:37:44', '0000-00-00 00:00:00', 'Contacto Pacoimsa (Servicios Gráficos)', 'Buenos días, Soy Joan Cabré de la empresa Pacoimsa (Servicios Gráficos) me pongo en contacto con ustedes para ofrecerles nuestros servicios, adjunto la carta de presentación de nuestra empresa, en la que explica detalladamente, todos los servicios que podemos ofrecer. Comentarles que llevamos más de 40 años en el sector, por lo que ofrecemos muy buen servicio y unos precios muy competitivos en el mercado. Una amplia oferta de impresión: tarjetas, sobres, cartas, facturas, albaranes, talonarios, recibos, etiquetas, flyers, catálogos, vinilos, rotulación, packaging, etc? Estaría encantado de mantener una reunión con ustedes, para así explicarles más detalladamente, nuestras opciones de colaboración. Quedo a su disposición para cualquier tipo de consulta que les pueda surgir. Muchas gracias por su atención. Atentamente Dpto. comercial Joan Cabré Díaz 627 422 508', 273, 'VCONT', 2, 'NOGEST', 'EMAIL'),
