	(341, '2019-03-26 12:48:02', '0000-00-00 00:00:00', 'Reunio', 'Bon dia Sóc Gemma Sala d\'Atenció al client de Phone Solution. Distribuïdor Oficial de Vodafone Empreses. Oferim solucions a les necessitats de la seva empresa. Perquè connectar amb els teus clients i tenir als teus treballadors connectats és sinònim de productivitat. En Phone Solution oferim serveis personalitzats i de màxima qualitat a empreses i pimes, treballem amb l\'objectiu de fer créixer el teu negoci. No volem que perdis ni una trucada dels teus clients i per a això, t\'ajudem a augmentar la productivitat del teu equip. Treballa on vulguis i quan vulguis, sense límits i sense barreres i més podràs controlar tot el que passa a la teva empresa. A través de CDR One pots conèixer si el teu equip respon a les trucades o quins són els empleats més proactius. T\'ajudem a organitzar el treball a través del teu smartphone perquè puguis tenir tota la gestió de la teva oficina al palmell de la mà. A través d\'Works es poden controlar fitxatges d\'entrades i sortides, control d\'activitats, vigilància, confirmació de visita. Des Phone Solution ens sumem a la innovació en tots els nostres serveis. Amb Vodafone Secure Device Manager tindràs visibilitat i control absolut dels dispositius mòbils per evitar pèrdua de dades. També prestem serveis de missatgeria, oferim als clients que així ho sol·licitin una plataforma on podràs gestionar llistes i campanyes de forma ràpida i senzilla. Un altre dels nostres productes és ofereix suport IT per a pimes. L\'objectiu és escoltar, analitzar i solucionar els problemes que es puguin derivar del dia a dia. Oferim serveis addicionals i suport tècnic cada vegada que el client ho necessiti. Si ho necessites vam crear l\'App del teu negoci. Si li anés bé poder veure\'ns un dia de la setmana que ve, el dia i hora que els vagin millor. Moltes gràcies per la confiança. Espero confirmació de la reunió Una salutació Gemma Sala Atención al cliente Phone Solution, S.L.U. Av. Francesc Macià, 46-50 7º 2ª, 08208 Sabadell, Barcelona telemarketing@phonesolution.es +34 672 133 483 / +34 93 707 20 20 [cid:image001.jpg@01D4B3C1.3EE96450][AW Denominacio?ün DISTRIBUIDOR OFICIAL V-BUSINESS_RGB_RED]', 275, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(342, '2019-03-26 12:56:49', '0000-00-00 00:00:00', 'Modulo prefabricado', 'Hola Eduard, Hablamos por teléfono antes y me diste una presupuesto de este modulo prefabricado (ver imagen adjunta) con transporte a Mallorca son 7.700€. Por favor puedes enviar el descripción técnica, tambien los medidas? Y hablas ingles? Mi espanyol es no es suficiente para hacer negocios. Saludos, Gabriella Gabriella Asztalos +34 649 612 991', 276, 'VCONT', 2, 'NOGEST', 'EMAIL'),
