	(353, '2019-03-27 11:58:50', '0000-00-00 00:00:00', 'oferta contenedor 40 ft', 'Hola, buenos días, Soy Estela, de la empresa Condorchem. Quisiera solicitaros una oferta de un contenedor marítimo de 40 ft. Si pudierais darme precio de contenedor nuevo y de segunda mano ( si tenéis esa opción). No sé si necesitáis algún dato más. Para cualquier cosa quedo a vuestra disposición. Gracias. Un saludo. Estela Ausín Process Engineer Manager estela.ausin@condorchem.com Phone: +34 937 547 705 Mobile: +34 664 855 071 Toll free USA & CANADA 1-844 464-0913 condorchem.com blog-en.condorchem.com Disclaimer: This email and any files transmitted with it are confidential and intended solely for the use of the individual or entity to whom they are addressed. If you have received this email in error please notify the system manager. Please note that any views or opinions presented in this email are solely those of the author and do not necessarily represent those of the company. Finally, the recipient should check this email and any attachments for the presence of viruses. The company accepts no liability for any damage caused by any virus transmitted by this email. Cláusula de Confidencialidad: Este mensaje, y en su caso, cualquier fichero anexo al mismo, puede contener información confidencial o legalmente protegida (LOPD 15/1999 de 13 de Diciembre), siendo para uso exclusivo del destinatario. No hay renuncia a la confidencialidad o secreto profesional por cualquier transmisión defectuosa o errónea, y queda expresamente prohibida su divulgación, copia o distribución a terceros sin la autorización expresa del remitente. Si ha recibido este mensaje por error, se ruega lo notifique al remitente enviando un mensaje al correo electrónico condorchem@condorchem.com y proceda inmediatamente al borrado del mensaje original y de todas sus copias. Gracias por su colaboración. Consider the environment before printing this mail. No imprimas si no es necesario. Protejamos el Medio Ambiente.', 281