	(354, '2019-03-27 12:03:10', '0000-00-00 00:00:00', 'Alquiler/compra de contenedores', 'Buenos días, Me pongo en contacto con vosotros porque necesito presupuesto de alquiler y/o compra de 5 contenedores de barco, de 6mt de ancho. Pintados en rojo. Además de 4 contenedores con un panel lateral personalizado a modo de 4 ventanillas de atención al Cliente. Os paso una imagen 3D para que podáis entender las necesidades y si tenéis alguna duda, por favor llamadme. Muchas Gracias! [NCT_AZUL] Yolanda Gómez Vélez I Producción I yolandagvelez@naturact.com I (+34) 655 318 997 I Alfarería, 2. Pol. Ind. Los Rosales. 28933 Móstoles, Madrid I (+34) 91 236 03 59 I info@naturact.com', 282, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(355, '2019-03-27 12:13:22', '0000-00-00 00:00:00', 'Solicitud casetas de obra', 'Buenos días:\r\nMe pongo en contacto con ustedes para solicitar presupuesto para la implantación de oficinas de obra, en Níjar (Almería), para la realización de una implantación de casetas prefabricadas.\r\n\r\nDebe de disponer de alojamiento para 30 personas, para los departamentos de :\r\n- Prevención: 2 Personas.\r\n- Calidad y M.A.: 2 Personas.\r\n- Topografía: 6 Personas.\r\n- Oficina Técnica: 3 Personas.\r\n- Administración: 3 Personas.\r\n- Sala de Juntas: para poder reunir a 30 personas.\r\n- Jefes de Producción: 6 Despachos individuales.\r\n- Director de Obra: 1.\r\n- Jefe de Obra: 1\r\n- Aseos, con vestuarios y duchas.\r\n\r\nAdministración y Seguridad estarán a la entrada de las casetas y dispondrán de una ventana para ver quien entra en las instalaciones.\r\nTopografía y Oficina Técnica estarán contiguas.\r\n\r\nSe quiere realizar una implantación progresiva. Es decir, primero se ubicarán todos los departamentos básico para el inicio de la obra y posteriormente se ampliarán los que puedan faltar.  En principio hacer un despacho de jefe de producción y en segunda implantación el resto hasta 30 personas. La idea es tener un núcleo principal que en caso de ampliación no sea afectado por las obras.\r\n\r\n\r\nTambién es necesario que aporten presupuesto de casetas aisladas para instalaciones de comedores, vestuarios, duchas y aseos para implantarlos en obra, así como de aseos químicos si disponen de ellos.\r\n\r\n Para cualquier consulta o aclaración estoy a su disposición.\r\n\r\n Atentamente: \r\n \r\n\r\nBernardo A. Maldonado Valverde.\r\nTel.: 650 13 81 06', 283, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(356, '2019-03-27 12:27:18', '0000-00-00 00:00:00', ' Petición oferta obra: "Hotel y frente comercial en Yaiza. Lanzarote"', 'Les agradeceríamos nos ofertaran el alquiler de la oficina, y el mobiliario de la misma, para la Dirección Técnica (según directrices en documento adjunto) de esta obra: "Hotel y frente comercial en Yaiza. Lanzarote", que estamos estudiando para licitación a YUDAYA. Aparte necesitaremos casetas normales de obra, vestuarios y comedor, para la gente de obra. Un saludo. Juan Carlos González Peinado Gestor de Ofertas Edificación España Departamento de Ofertas [cid:image015.png@01D3C5B0.F41D1920] T. +34 915 45 56 55 jcgonzalezp@sacyr.com SACYR INFRAESTRUCTURAS, S.A. Avda de Manoteras 26, 6ª Planta 28050- Madrid (España) Sacyr.com [cid:image016.png@01D3C5B0.F41D1920] [cid:image017.png@01D3C5B0.F41D1920] [cid:image018.png@01D3C5B0.F41D1920] [cid:image019.png@01D3C5B0.F41D1920] [cid:image020.png@01D3C5B0.F41D1920] [Sacyr_Lice_Icono]', 284, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(357, '2019-03-27 12:31:14', '0000-00-00 00:00:00', 'Solicitud presupuesto', 'Buenos días, Me pongo en contacto de la empresa Oserma 1992 Obres i Serveis, S.L. Necesitaría presupuesto para el alquiler de: 1. Contenedor almacén 2,40 x 3m aprox 1. Caseta diáfana 2,40 x 3,7m aprox Es para una obra en la ciudad de Barcelona, y el tiempo aproximado es de 4 a 6 meses. Nos urge bastante. Muchas gracias, [Logo Oserma 2018 (firma)] Patricia Calderon Oserma 1992 Obres i Serveis, S.L. T. 935 321 515', 285, 'VCONT', 4, 'NOGEST', 'EMAIL'),
