	(359, '2019-03-27 14:11:47', '0000-00-00 00:00:00', 'Solicitud Informacion', 'Buenas tardes, Estaria interesada en un contenedor marítimo transformado en piscina, de tamaño aproximado 6metros de largo, la bomba de la piscina podría estar fuera del contenedor, ya que tenemos espacio para su instalación. Es para una casa unifamiliar, no somos una empresa. Me gustaría que me informarais de precio aproximado y si es posible. 675449857 Muchas gracias, Paula Enviado desde mi iPhone', 286, 'VCONT', 3, 'NOGEST', 'EMAIL'),
