	(361, '2019-03-27 17:37:47', '0000-00-00 00:00:00', 'RE: Solicitud de oferta contenedor aire comprimido', 'Buenas tardes, Acabo de hablar con el cliente ya que me surgían dudas sobre la tensión de suministro que nos daban (480/3/60 y 120/1/60). Tras comentárselo me ha aclarado que ellos nos suministran solamente a 480/3/60 y de ahí deberemos sacar nosotros con un trafo lo que necesitemos en monofásica. Por tanto, todo lo que te puse en 120 queda descartado ya que no nos suministran a esa tensión. Tendríamos que sacar una fase nosotros a 230/1/60 de un trafo en el cuadro para nuestros equipos, es decir, la purga del calderin (2VA), los 2 secadores (34 KW cada uno), la iluminación y el ventilador en caso de que sea monofásica. 230/1/60 es un voltaje más estándar para nuestros equipos y si salimos ya con eso directamente del cuadro nos ahorraríamos en modificarlos. Disculpad este cambio de ultima hora, quedo a la espera de vuestro presupuesto. Si necesitais cualquier aclaración lo comentamos. Saludos. Jorge Escolar González Sales Support Engineer Office (+34) 620 20 71 51 Email Jorge.escolar@irco.com De: Escolar Gonzalez, Jorge Enviado el: lunes, 25 de marzo de 2019 9:54 Para: comercial@zarca.es Asunto: Solicitud de oferta contenedor aire comprimido Buenos días, Tal y como comentamos por teléfono, necesito una oferta de la instalación de un sistema de aire comprimido en un contenedor de 40 pies. El contenedor dispondrá de: · Debe ser apto para transporte marítimo. · Suelo metálico antideslizante. · Iluminación. · Instalación eléctrica y cuatro eléctrico con las protecciones necesarias para el 2x compresores, 2x secadores, 1x purga electrónica, iluminación y el ventilador. · 2x rejilla de entrada de aire situada frente a la aspiración de los compresores · 2x Conducto de la extracción de calor de la refrigeración del compresor con cuello de cisne, este contará con una preinstalación para que el montaje se finalice en campo (durante el trayecto en barco irá desmontado) · Debe disponer de un ventilador en el lateral del contenedor para extracción de calor, la temperatura máxima ambiente de la zona es en torno a 31ºC , en el interior del contenedor no se deben superar los 46 grados que marca el límite de funcionamiento del compresor. Con esto se considera que es suficiente por lo que no es necesario ningún tipo de aislamiento en el contenedor. · Respecto a la instalación de tuberia, el objetivo de este proyecto es hacer un contenedor estándar lo más barato posible, no hay especificación de materiales o métodos de unión por lo que lo dejo a tu criterio en función de con qué soléis trabajar, siempre teniendo en cuenta el coste y las pulgadas de los equipos. La tubería irá debidamente fijada por el techo o paredes del contenedor · La recogida de condensados será con bajantes en tubing transparente flexible desembocando en una tubería rígida común a todos los equipos del material que creáis conveniente. · Salida de la tubería de aire y de condensados por el lateral del contenedor con la correspondiente conexión por brida. · Es necesario hacer 2 aberturas de 1.70 m de alto y 2m de ancho en el lateral del contenedor para poder acceder a la parte trasera de los compresores al realizar ocasionalmente (2 veces por año aproximadamente) las labores de mantenimiento. El método de apertura o desmontaje del panel queda a vuestra elección, siempre teniendo en cuenta que sea económico y lo más sencillo posible de abrir. · En este proyecto vamos a precio por lo que debe ser lo más económico, no hay problema en que sea un contenedor usado. En caso de que sea necesario pintarlo se hará del RAL especifico de Ingersoll Rand · En los archivos adjuntos tienes los planos de los equipos y un esquema básico del montaje. La disposición de los equipos puede variar si se os ocurre alguna solución mejor. Los equipos que se instalarán en el interior son: 2x Compresor 37KW: · Salida de aire: pulgada y media BSPT · Salida condensados: ½ " BSPT · Diámetro del cable de alimentación 120 mm · Potencia nominal motor principal 37 KW · Potencia del paquete 43.4 KW · 480/3/60 Hz · 1095 KG · 1937x1056x153 mm 6x Filtros FA400I: · Entrada y salida de aire: pulgada y media BSPT · Salida condensados: ½ " BSPT · 470x113x129 mm · 2.36 kg · No tiene conexión electrica 2x Secador modular: · Entrada y salida de aire: 1" BSPT · 120/1/60 Hz · 34 W · 104 kg · 1847x566x277 mm 1x Depósito 1000L: · Entrada y salida de aire: 2" GAS · Salida condensados: ½ " GAS · Altura 2010 mm · Diámetro 850 mm · Peso 280 kg · No tiene conexión eléctrica 1x Purga electrónica para el depósito: · Entrada condensados: ½ " · Salida condensados: 1/4 " · 120/1/60 Hz · 2VA El destino final del contenedor es Sudamérica por lo que el voltaje será 480V 3 fases sin neutro o 120V a una fase, frecuencia 60Hz. Si necesitas cualquier aclaración no dudes en contactarme. Un saludo. Jorge Escolar González Sales Support Engineer Compression Technologies and Services EMEIA Ingersoll Rand Casas de Miravete Nº22B Edificio 1B-3ª Planta 28031 Madrid Spain Office (+34) 620 20 71 51 Email Jorge.escolar@irco.com Website www.ingersollrandproducts.com [cid:image006.png@01D4B238.07161F30]', 259, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(362, '2019-03-27 17:45:16', '0000-00-00 00:00:00', 'Proyecto 19356 -  Peticion de información y precio', 'Estimados Señores, Estamos desarrollando un proyecto de un sistema de tratamiento de combustible a instalar en el Círculo Polar Artico, para ello precisamos un contenedo de 20 pies semejante a una camara frigorifica, en cuyo interior se localizaran los diferentes componentes del sistema. La temperatura exterior puede llegar a ser de -60 ºC ( sesenta grados bajo cero) y la temperatura interior de entre -10 y 0 ºC. El suelo interior debera estar diseñado para soportar las cargas de los equipos. Se dotara de un sistema de calefacción interior. Debera disponer de pasamyros para la entrada y salida de producto y otras auxiliares, asimo para la entrada de la conduccion electrica, Rogamos nos indiquen si ustedes pueden proporcionarnos el contenedor-camara, siguiendo nuestras directrices. Gracias anticipadas. Un saludo Tomas Diez HECISA Sales Department Hispano Europea de Comercio e Industria S.L. Calidad, 24 - Pol. Los Olivos 28906 Getafe - Madrid - España Certificaciones: ISO 9001 ISO 14000 NCAGE http://hecisa.com', 288, 'VCONT', 2, 'NOGEST', 'EMAIL'),
