	(463, '2019-04-01 06:51:10', '0000-00-00 00:00:00', 'Camara frigorifica.', 'Hola, Estomas buscando a una solución para nuestra start up. Vamos hacer comida fresca para mascotas, y necesitamos un sitio donde podemos guardar el producto en su cadena de frío. El producto tiene que estar frio antes de procesar. Luego cuando el producto esta envasado tiene que estar congelado a -18. Ahora mismo para encontrar un nave que esta equipado con cámaras es difícil... Entonces estoy buscando a una solución. Yo he visto que tenéis cámaras portátiles. Y me parece un buen solución.O una instalada \'\'fija\'\' es más economico y gasta menós energia? También si me puedes decir los precios más o menos seriá muy agradable. Gracias Samuel', 364, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(464, '2019-04-01 09:43:32', '0000-00-00 00:00:00', 'piscina', 'Hola bon dia, fabriqueu vosaltres les piscines amb el container? estaria interessat en parlar amb vosaltres sobre el tema, salutacions, Descripció: cid:CF240658-5B7F-461B-A47E-E14A24A75873 Albert Batalla Gerència | Federació Catalana d\'Activitats Subaquàtiques Descripció: T 629453582 Descripció: M a.batalla@fecdas.cat Descripció: cid:EAFCFAF4-CE22-4371-9A8E-718EA1C8871C Moll de la Vela, 1 (Zona Fòrum) www.fecdas.cat Descripció: cid:C1105FD8-37B3-49DB-AF72-8815EB204AEB Descripció: cid:21FF9578-7C7B-4895-9508-1F1CF5429D4C Descripció: cid:C00B60C5-EB20-4CA8-A893-D7E6911BB376 Descripció: cid:D929FB8F-44A0-45A7-B7D8-3D90C082AF56 "La informació continguda en aquest missatge i / o arxiu (s) adjunt (s), enviada des de Federació Catalana d?Activitats Subaquàtiques, és confidencial / privilegiada i està destinada a ser llegida només per la (es) persona (es) a la (es ) que va dirigida. Li recordem que les seves dades han estat incorporades en el sistema de tractament de Federació Catalana d?Activitats Subaquàtiques i que sempre que es compleixin els requisits exigits per la normativa, vostè podrà exercir els seus drets d\'accés, rectificació, limitació de tractament, supressió, portabilitat i oposició / revocació, en els termes que estableix la normativa vigent en matèria de protecció de dades, dirigint la seva petició a C/ Moll De La Vela 1, 08930 - Sant Adrià De Besòs. Si vostè llegeix aquest missatge i no és el destinatari assenyalat, l\'empleat o l\'agent responsable de lliurar el missatge al destinatari, o ha rebut aquesta comunicació per error, l\'informem que està totalment prohibida, i pot ser il·legal, qualsevol divulgació, distribució o reproducció d\'aquesta comunicació, i li preguem que ens ho notifiqui immediatament i ens retorni el missatge original a l\'adreça esmentada. Gràcies."', 365, 'VCONT', 3, 'NOGEST', 'EMAIL'),
