	(467, '2019-04-01 11:43:53', '0000-00-00 00:00:00', 'INVITACIÓN A LA LICITACIÓN DE EXPEDIENTE NET5778414_SVCIO ALQUILER CON OPCIÓN A COMPRA MÓD DESMONT A INSTALAR EN CEGMA LCCA_P', 'Buenos días, Se ha modifcado el pliego del contrato de referencia. Se ha eliminado la conexión eléctrica al módulo. También se ha obviado que la puerta sea abatible hacia el interior. Además se ha elevado el importe del contrato. Se vuelve a solicitar oferta. La AGENCIA DE MEDIO AMBIENTE Y AGUA DE ANDALUCÍA está tramitando el expediente para la adjudicación por contrato menor del SERVICIO DE ALQUILER CON OPCIÓN A COMPRA DE UN MÓDULO DESMONTABLE EN EL CENTRO DE GESTIÓN DE MEDIO MARINO PARA EL LABORATORIO DE CONTROL DE LA CALIDAD AMBIENTAL, EN SU UNIDAD TÉCNICA DE PALMONES. De acuerdo con la memoria justificativa del contrato anexa, las condiciones que debe tener en cuenta para formular su oferta son las siguientes: * _Objeto del contrato_: SERVICIO DE ALQUILER CON OPCIÓN A COMPRA DE UN MÓDULO DESMONTABLE EN EL CENTRO DE GESTIÓN DE MEDIO MARINO PARA EL LABORATORIO DE CONTROL DE LA CALIDAD AMBIENTAL, EN SU UNIDAD TÉCNICA DE PALMONES. * _Especificaciones técnicas de la prestación_: *TRANSPORTE **E INSTALACIÓN* *El transporte del módulo desde su lugar de origen al emplazamiento, incluirá el transporte especial necesario y las grúas que se precisen, así como la **tramitación y pago de cuantos permisos o licencias se requieran para ello. **Además, se entenderán incluido el montaje/desmontaje **en****e**l **CEGMA**.* *CARACTERÍSTICAS TÉCNICAS DEL MÓDULO* *El módulo debe ser prefabricado, **de dimensiones **aproximadas: **7**,**00**m x 2,5**0**m y de altura libre 2,50 m.* *Las características delos elementos y sistemas constructivos garantizarán la durabilidad con el m**í**nimo gasto de conservación.* *La puerta será de al menos de 0,85 m de ancho, llevará cerradura de llave y tirador, **así como sistema de retención antiportazos y de sujeción cuando sea necesario dejarla abierta. La puerta estará revestida en el exterior por panel sandwich igual al resto del cerramiento del módulo. * *El módulo tendrá ventilación natural directa, mediante ventana.* *MANTENIMIENTO DEL MÓDULO * *El módulo será mantenido por la empresa adjudicataria, según la normativa en vigor, durante la vigencia del contrato.* *Será por cuenta del contratista la sustitución inmediata, en un plazo máximo de 24 horas, de cualquier tipo de avería del módulo, estando el coste de estas reparaciones incluido, en la cuota mensual por mantenimiento, salvo que la avería se deba a causas imputables a **la Agencia de Medio Ambiente y Agua****(en adelante **LA AGENCIA**)**. * * _Responsable del contrato_: Emilio García Adiego. Responsable del LCCA, Unidad de Palmones. * _Duración del contrato_: 12 meses. * _Importe máximo del contrato_: 7.500,00 €, IVA excluido. La_oferta_ se deberá remitir contestando a al presente correo electrónico. El plazo de presentación de ofertas finaliza el próximo *viernes 5 de abril de 2019, a las 14:00h.* *Junto con su oferta, debe anexar firmado el documento denominado "Memoria Justificativa y Prescripciones Técnicas" así como, "Modelo de Declaración Responsable". * No obstante, si no están interesados en presentar una oferta, les solicitamos que nos lo comuniquen por escrito en el plazo señalado. Para cualquier cuestión pueden preguntarla a través de este correo electrónico. José Manuel Campos Lissén josem.campos.lissen@juntadeandalucia.es Agencia de Medio Ambiente y Agua http://www.agenciamedioambienteyagua.es Tel 34 955 260 000 C/ Johan G. Gutenberg, 1. Isla de la Cartuja. C.P. 41092. Sevilla (España).', 182, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(468, '2019-04-01 12:32:41', '0000-00-00 00:00:00', 'Consulta contenedores', 'Buenos días, Nos ponemos en contacto con ustedes para ver si podrían darnos precio de la estructura de un contendor de 20?. Seria básicamente el contenedor con los montantes y el suelo, es decir, sin ninguna de las 4 paredes y sin el techo. Quedamos a la espera de sus noticias. Gracias de antemano. Saludos, Felipe Del Olmo EWK Equipos de Refrigeración Paseo de la Castellana, 163 - 10 D E-28046-Madrid Tel. +34915675726 Fax. +34915675786 http://www.ewk.eu EWK Información básica sobre Protección de Datos Responsable: Razón social: EWK EQUIPOS DE REFRIGERACION, S.A. CIF: A-83090431 Domicilio: Pª DE LA CASTELLANA 163 ? 10º (28046 Madrid) Base jurídica del tratamiento de datos: Consentimiento del interesado Finalidad: Mantenimiento de la relación mercantil Destinatarios de sus datos: No se cederán datos a terceros, salvo obligación legal Ejercicio de sus derechos: Puede acceder, rectificar y suprimir sus datos, portabilidad de los datos, limitación u oposición a su tratamiento, derecho a no ser objeto de decisiones automatizadas, así como a obtener información clara y transparente sobre el tratamiento de sus datos. (Más información sobre protección de datos en: https://www.ewk.eu/index.php/pagina/es/603) Procedencia: Del propio interesado titular de los datos. Confidencialidad: La información contenida en el presente correo electrónico es confidencial; en el supuesto de que usted no sea el destinatario autorizado, le rogamos borre el mensaje y nos lo comunique a la presente dirección: ewk@ewk.eu', 368, 'VCONT', 2, 'NOGEST', 'EMAIL'),
