	(477, '2019-04-01 16:28:07', '0000-00-00 00:00:00', 'SOLICITUD OFERTA CONTENEDOR/ALMACÉN RESIDUOS P.E. FARRAPA', 'Buenas tardes Por la presente solicito su mejor oferta económica según el siguiente alcance: o Suministro e instalación en el P.E. Farrapa (abajo detallo dirección y coordenadas) de un contenedor para almacenaje de residuos peligrosos o no y con una superficie útil aproximada a los 15 m2 y 2,5 m de altura. § El contenedor deberá llevar una cubeta de retención instalada para evitar que fugas de los recipientes salgan al exterior del contenedor. § El contenedor deberá incluir un sistema de cierre, considerándose sistema mínimo el cierre mediante candado de seguridad. § El contenedor deberá incluir una rampa de acceso con barandillas antipánico en sus laterales. § El contenedor deberá estar pintado en verde, con el logo de Enel Green Power serigrafiado en blanco (EGPE suministrará al adjudicatario la documentación gráfica que necesite a este respecto). CONDICIONANTES DE LA OFERTA Se ofertará de la siguiente manera: - 1 OFERTA SIN DESGLOSAR, QUE INCLUYA UN ÚNICO PRECIO Y QUE CONTEMPLE, POR ESCRITO, CON CARÁCTER DE MÍNIMOS: o Suministro y transporte hasta la planta. o Descarga, instalación y nivelación del container en el terreno. o Puesta a tierra de las partes metálicas del container. Ante cualquier duda o necesidad de aclaración, por favor, contáctenme en mi email o teléfono. El plazo máximo para presentación de la oferta expira el día 08-04-2019 a las 18:00 DIRECCIÓN P.E. FARRAPA: P.K. 2,9 LU-P-0105 (Desde ALTO DA XESTA hacia A PASTORIZA) C.P. 27738 - ABADÍN - LUGO COORDENADAS SET: HUSO UTM:29 X= 630.740 Y=4.803.083 ETRS 89 43º 22´ 9.23´´ N 7º 23´ 10.70´´ W Saludos Martín Fariña Palleiro Operation&Maintenance Supervisor [Clients:Enel:Design:Artworks:04 Email Signature:logos png:EGP_Logo_Primary_RGB.png] ENEL GREEN POWER ESPAÑA S.L. C/ Enrique Mariñas Romero Periodista, s/n - Edf.Proa, planta 11 15009 A Coruña, Spain +34 699200243 martin.farina@enel.com __________________________________________________________________________________________________________________________________________ Este mensaje está previsto únicamente para el siguiente uso: PÚBLICO - USO INTERNO - CONFIDENCIAL (ALTAMENTE CONFIDENCIAL) - RESTRINGIDO __________________________________________________________________________________________________________________________________________ Este correo electrónico es confidencial y puede contener información privilegiada. Si lo ha recibido por error, está avisado de su estatus. Avísenos de inmediato respondiendo al mensaje de correo electrónico y borre el mensaje de su sistema. No lo copie ni lo use para ningún propósito, ni revele su contenido a ninguna otra persona, a menos que reciba autorización. Cualquier uso malintencionado podría constituir una infracción de confidencialidad.', 375, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(478, '2019-04-01 17:08:48', '0000-00-00 00:00:00', 'Bluetainer France', 'Hola, Soy Hugo el director de la sociedad Bluetainer que se situa a Perpina, nescesito un presupuesto por el contenedor 8 pies dry azul de segunda mano que podemos ver en el sitio de ZARCA. Hugo Jauzac Bluetainer France (+33) 06 51 19 28 80 www.bluetainer.com', 318, 'VCONT', 2, 'NOGEST', 'EMAIL'),
