	(480, '2019-04-01 20:23:01', '0000-00-00 00:00:00', 'info modulos', 'Buenas tardes Les escribo de parte de la Cooperativa Valenciana Buena Onda, para solicitar presupuesto para un modulo de aseo para discapacitados. Necesitamos que incluya wc, lavabo y ducha y que los desagües del wc estén separados de los desagües de lavabo y ducha ya que utilizamos dos sistemas distintos de depuración de las aguas residuales, estamos construyendo un camping ecológico. Adjuntamos reglamento de la Generalitat Valenciana con los requisitos que debe cumplir el módulo resaltado en amarillo. . En el caso de necesitar más detalles pueden contactar con nosotros al 633891864. Un saludo, Domenico Piria', 59, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(481, '2019-04-02 11:22:11', '0000-00-00 00:00:00', 'Diseño Gráfico', '*|MC:SUBJECT|**|MC_PREVIEW_TEXT|* El Diseñador Gráfico En AIP te ofrecemos nuestros cursos en Diseño Gráfico y Maquetación con los que podrás alcanzar los conocimientos profesionales necesarios, tanto para uso particular, como para uso profesional. Ser un buen diseñador gráfico es todo un arte, hay que dominar muchas herramientas, programas, etc.. Hay que saber cómo debe ser la comunicación con los diferentes profesionales con los que se trabaja, con clientes, cómo realizar los proyectos, saber qué información te está dando el cliente y desarrollar esa información hasta transformarla en proyectos y un producto del agrado del cliente. Desde AIP queremos formar a futuros diseñadores que desde este 2017 puedan entrar en el mundo laboral con garantías de éxito. AIP somos un centro con más de 30 años de experiencia donde te ofrecemos formación personalizada adecuada a las necesidades de tu empresa sin que tengas que preocuparte del proceso de bonificación ya que nosotros nos encargamos de gestionarlo. Ofrecemos servicios de formación en empresas o en nuestras instalaciones y contamos con el certificado de centro oficial de formación Adobe. INFORMATE SOBRE NUESTROS CURSOS Copyright ©, todos los derechos reservados. Nuestra dirección de correo es: guillem@aipbarcelona.com (guillem@aipbarcelona.com%20%C2%A0) ¿Desea cambiar la forma en que recibe estos correos electrónicos? Si no desea seguir recibiendo esta información puede darse de baja de esta lista.', 221, 'VCONT', 2, 'NOGEST', 'EMAIL'),
