	(490, '2019-04-02 17:30:08', '0000-00-00 00:00:00', 'Cotización de transporte competitivo', 'Cotización de transporte competitivo versión web darme de baja MORARTE LOGISTICS ¡Hola! Estamos encantados de ofrecerte nuestros servicios. A continuación te proponemos nuestros sitios más habituales, pero si no aparece el país que buscas, no dudes en contactarnos y preguntarnos. Realizamos tanto servicios de exportación, importación e intrapaíses. Para cualquier cotización de trasporte que necesite, no dudes en contactar con nosotros, somos especialistas en: Cargas completas (Nacional - Internacional) Cargas parcial / grupaje (Nacional - Internacional) En internacional por carretera, hacemos tanto exportación como importación, tenemos servicios semanales. Así mismo, tenemos servicio marítimo, tanto de carga completa y grupaje, con cualquier destino fuera de Europa. >> Necesitaremos códigos postales de carga / descarga, medidas y peso para cotizar a la mayor brevedad << Departamento comercial Telf.: 0034 968 389 984 - 968 386 532 Fax: 34 968 615 572 Email: morarte@morarte.es Web: http://www.morarte.es Opciones de suscripción 1) Si deseas darte de baja haz click aquí En cumplimiento de lo dispuesto en la Protección de Datos, para el ejercicio de sus derechos de acceso, rectificación, cancelación y oposición al tratamiento de sus datos personales, contenidos en nuestras condiciones de protección de datos, solamente tiene que hacer clic aquí y pulsar enviar. Si no puede hacer clic, responda a este e-mail indicando su email en el asunto, o bien a través del envío de un correo ordinario a la dirección: Indicar dirección.', 381, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(491, '2019-04-02 17:39:48', '0000-00-00 00:00:00', 'revista logistica industrial 2000', 'Como en meses anteriores adjunto te envío nuestra revista LOGISTICA INDUSTRIAL 2000 correspondiente al mes de Marzo de 2019 de forma gratuita. Si en algún momento tienes alguna noticia interesante de actividades, productos, reportajes, etc. nos la puedes hacer llegar a través de este correo: edilog2000@wanadoo.es y la publicaremos en la revista, sin coste alguno, evidentemente. Si consideras necesario que enviemos la revista a otra persona de esa empresa, pásanos su correo al mencionado en el párrafo anterior, y se la haremos llegar por este mismo procedimiento. Saludos cordiales José A. Herreros Gerente', 382, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(492, '2019-04-02 18:00:55', '0000-00-00 00:00:00', 'OFERTA 4 CONTENEDORES 20´', 'Buenas tardes, Según conversación telefónica, necesitaba 2 contenedores muy urgentes, a ver si puede ser mañana, en la siguiente dirección La dirección de entrega es: Passeig del Callao, 220, 08302 Mataró Contacto Fran: 662.59.36.81 Y los otros 2 serían para la misma dirección de los anteriores el jueves La dirección sería la misma donde está el otro de 20: Parc Central en Camí de la Geganta, Mataró 08304 Contacto: Fran 662.59.36.81 Muchas gracias, espero que me podáis ayudar Un saludo Natalia Casenave Departamento Técnico ------------------------ Pol.Ind.Espiñeira 6B 15930 Boiro (A Coruña) España -------------------------------------------- +34 620 015 254 + 34 981 848 411 ------------------------ desarrollo1@oziona.com www.oziona.com ------------------------------ Este e-mail va destinado exclusivamente a sus destinatarios y puede contener información confidencial y/o datos de carácter personal, regulados en el Reglamento 2016/679 del Parlamento Europeo y del Consejo, al margen de otras normativas de carácter nacional o local. Si lo ha recibido por error o no es el legítimo destinatario, por favor notifíquelo al remitente. Queda prohibido revelar, distribuir o realizar cualquier acción basada en el contenido de este e-mail o en la dirección del remitente. This email is destined exclusively to the addressees and may contain confidential information or personal data, regulated under Regulation (EU) 2016/679 of the European Parliament and of the Council, beside other national or local regulations. If you have received this by mistake or if you are not the intended recipient, please notify the sender. It is prohibited to reveal, distribute or undertake any action based on the content of this email or the address of the sender.', 99, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(493, '2019-04-02 18:37:56', '0000-00-00 00:00:00', 'Tankeros. Contenedor 8\' segunda mano', 'Buenas tardes, Estamos interesados en comprar un contenedor tipo ?almacén de obra? para envío de herramienta a Canarias u otros destinos y que nos sirva para tenerla segura en obra también. Tiene que caber dentro de un contenedor ?normal? de 20? o 40?. He visto que tienen uno de 8? de segunda mano. Quería saber qué dimensiones interiores y exteriores tiene, y peso. Y si tienen algo más similar. Muchas gracias Un saludo Jorge Fernández Arnaiz Producción / Montajes Tf. 659 48 82 49 TANKEROS, S.L. C/ DE LAS NAVES, 1 - 4 28923 ALCORCÓN - MADRID -ESPAÑA POL. INDUSTRIAL SAN JOSÉ DE VALDERAS Telf.: +(34) 91 619 84 80 - Fax: +(34) 91 619 84 89 montajes@tankeros.com - www.tankeros.com Antes de imprimir este mensaje piense si es necesario. Proteger el medio ambiente es una labor de todos. Please consider your environmental responsibility before printing this e-mail. Se informa a quien recibiera este documento sin ser el destinatario o persona autorizada por éste, que la información contenida en el mismo es confidencial y su utilización y/o divulgación está prohibida. Si ha recibido este documento por error, le rogamos nos lo comunique y proceda a su destrucción. This message is intended exclusively for its addressee and may contain information that is confidential and protected by professional privilege. If you are not the intended recipient you are hereby notified that any dissemination, copy or disclosure of this communication is strictly prohibited by law. If this message has been received in error, please immediately notify us via e-mail and delete it. En cumplimiento de la normativa de protección de datos, le informamos de que sus datos personales forman parte de un fichero titularidad de TANKEROS, S.L., con domicilio social en C/ Las Naves, 1, 28923 de Alcorcón (Madrid) y son tratados con la única finalidad de mantenimiento de la relación adquirida con usted. Usted puede ejerc