	(494, '2019-04-03 05:49:54', '0000-00-00 00:00:00', 'Re: PVC Strip/CONET CO.,LTD', 'Dear Sir/Madam, CONET is one of the largest manufacturers of PVC Strip Curtain in China since 2006. Here we apply to be your supplier. Our products get REACH Certificate, below are our sell well goods and picture of the details: PVC strip curtain : Normal, Polar, Anti-Insect, Anti-Static PVC Strip Curtains... Popular sizes : 2mm*200mm, 2mm*300mm, 3mm*300mm… Hook on accessories: Stainless steel, Galvanized and so on. If you are interested in our products, email me or just call me directly. Look forward to your early reply. Best Regards, Laura Industry Co.,LTD ------------------------------------------------------------------------ Export Dept.:B-813 No 6. CuiLing Road, Laoshan District, Qingdao, China Code: 266061 Tel: (+86 - 532) 6806 5015 Fax: (+86 - 532) 6806 5025 Email: conet20@conetplastic.com Skype: conet20@conetplastic.com Http://www.conetplastic.com', 384, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(495, '2019-04-03 08:21:07', '0000-00-00 00:00:00', 'FWD: MENSAJE', 'Estimados Señores: Tengo el honor de presentarle un producto que se adapta plenamente a las necesidades de su empresa. Nuestro producto le permitirá llegar a nuevos clientes e incrementar de manera inmediata sus ventas. Con el objetivo del aumento inmediato de las ventas de sus productos y el incremento del número de visitas a su página web, hemos preparado un catálogo que contiene una lista de clientes potenciales.?? Todos los catálogos son específicos para sectores concretos. La selección de los sectores y clientes objetivo es extremadamente sencilla. La aplicación especial que incluimos gratuitamente permite elegir sectores y subsectores.?? Contiene datos tales como: nombre de la empresa, domicilio social, datos de contacto del dueño, e-mail, teléfono, fax, página web, etc. Puede empezar a usar el catálogo y promocionar sus productos inmediatamente. El retorno de la inversión está garantizado. ¡Lo compra una vez y lo puede usar toda la vida! Base de datos de empresas españolas - 1.548.400 registros. - 190.00 € - Sólo hasta el 03/04/2019 Más información en nuestra web: http://www.globempresas.com/?page=catalog Atentamente, GC-Team Juan Andrés Marion', 385, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(496, '2019-04-03 10:27:13', '0000-00-00 00:00:00', 'RE: Solicitud de oferta contenedor aire comprimido', 'Buenos días, Revisando el email he visto que en este último que os mande hay un error, son 34 W cada secador, no KW. En el primer email se indicaba correctamente. Por tanto seria los compresores a 480/3/60 y el ventilador, iluminación, secadores (34 W cada uno) y la purga (2VA) habría que sacar una fase con un pequeño trafo a 230/1/60. Todo ello debe ir con las debidas protecciones y considerando la puesta a tierra del contenedor. También deberíamos incluir una luz de salida de emergencia en la puerta. El conducto de la extracción de calor debe ser acorde a las siguientes dimensiones [cid:image002.jpg@01D4EA07.B14C3820] El compresor mide 1.534 m de alto, así que la altura de ahí hasta el techo y luego el cuello de cisne que debe ir desmontado durante el transporte. Las rejillas de aspiración en ambos de ambos extremos deberían tener aproximadamente medio metro de alto (o incluso un metro diría yo) y de ancho con un metro sería más que suficiente. Esto como ves es algo aproximado dependiendo de los límites de la puerta que me has comentado y de los tamaños habituales que tengáis disponibles, debe tratarse de una rejillas con lamas inclinadas que impidan que entre la lluvia. Adjunto un recorte de la aspiración en el lateral del compresor: [cid:image005.png@01D4EA07.B1392550] Si necesitas cualquier dato más para agilizar la oferta no dudes en contactarme, ya que como te he comentado nos surge algo de prisa. Te adjunto otra vez el esquema del contenedor donde he incluido un PID de la tubería del aire que puede facilitarle las cosas a tu subcontrata. Adjunto también los planos de la otra vez. Un saludo. De: Escolar Gonzalez, Jorge Enviado el: miércoles, 27 de marzo de 2019 17:38 Para: \'comercial@zarca.es\' Asunto: RE: Solicitud de oferta contenedor aire comprimido Buenas tardes, Acabo de hablar con el cliente ya que me surgían dudas sobre la tensión de suministro que nos daban (480/3/60 y 120/1/60). Tras comentárselo me ha aclarado que ellos nos suministran solamente a 480/3/60 y de ahí deberemos sacar nosotros con un trafo lo que necesitemos en monofásica. Por tanto, todo lo que te puse en 120 queda descartado ya que no nos suministran a esa tensión. Tendríamos que sacar una fase nosotros a 230/1/60 de un trafo en el cuadro para nuestros equipos, es decir, la purga del calderin (2VA), los 2 secadores (34 KW cada uno), la iluminación y el ventilador en caso de que sea monofásica. 230/1/60 es un voltaje más estándar para nuestros equipos y si salimos ya con eso directamente del cuadro nos ahorraríamos en modificarlos. Disculpad este cambio de ultima hora, quedo a la espera de vuestro presupuesto. Si necesitais cualquier aclaración lo comentamos. Saludos. Jorge Escolar González Sales Support Engineer Office (+34) 620 20 71 51 Email Jorge.escolar@irco.com De: Escolar Gonzalez, Jorge Enviado el: lunes, 25 de marzo de 2019 9:54 Para: comercial@zarca.es Asunto: Solicitud de oferta contenedor aire comprimido Buenos días, Tal y como comentamos por teléfono, necesito una oferta de la instalación de un sistema de aire comprimido en un contenedor de 40 pies. El contenedor dispondrá de: · Debe ser apto para transporte marítimo. · Suelo metálico antideslizante. · Iluminación. · Instalación eléctrica y cuatro eléctrico con las protecciones necesarias para el 2x compresores, 2x secadores, 1x purga electrónica, iluminación y el ventilador. · 2x rejilla de entrada de aire situada frente a la aspiración de los compresores · 2x Conducto de la extracción de calor de la refrigeración del compresor con cuello de cisne, este contará con una preinstalación para que el montaje se finalice en campo (durante el trayecto en barco irá desmontado) · Debe disponer de un ventilador en el lateral del contenedor para extracción de calor, la temperatura máxima ambiente de la zona es en torno a 31ºC , en el interior del contenedor no se deben superar los 46 grados que marca el límite de funcionamiento del compresor. Con esto se considera que es suficiente por lo que no es necesario ningún tipo de aislamiento en el contenedor. · Respecto a la instalación de tuberia, el objetivo de este proyecto es hacer un contenedor estándar lo más barato posible, no hay especificación de materiales o métodos de unión por lo que lo dejo a tu criterio en función de con qué soléis trabajar, siempre teniendo en cuenta el coste y las pulgadas de los equipos. La tubería irá debidamente fijada por el techo o paredes del contenedor · La recogida de condensados será con bajantes en tubing transparente flexible desembocando en una tubería rígida común a todos los equipos del material que creáis conveniente. · Salida de la tubería de aire y de condensados por el lateral del contenedor con la correspondiente conexión por brida. · Es necesario hacer 2 aberturas de 1.70 m de alto y 2m de ancho en el lateral del contenedor para poder acceder a la parte trasera de los compresores al realizar ocasionalmente (2 veces por año aproximadamente) las labores de mantenimiento. El método de apertura o desmontaje del panel queda a vuestra elección, siempre teniendo en cuenta que sea económico y lo más sencillo posible de abrir. · En este proyecto vamos a precio por lo que debe ser lo más económico, no hay problema en que sea un contenedor usado. En caso de que sea necesario pintarlo se hará del RAL especifico de Ingersoll Rand · En los archivos adjuntos tienes los planos de los equipos y un esquema básico del montaje. La disposición de los equipos puede variar si se os ocurre alguna solución mejor. Los equipos que se instalarán en el interior son: 2x Compresor 37KW: · Salida de aire: pulgada y media BSPT · Salida condensados: ½ " BSPT · Diámetro del cable de alimentación 120 mm · Potencia nominal motor principal 37 KW · Potencia del paquete 43.4 KW · 480/3/60 Hz · 1095 KG · 1937x1056x153 mm 6x Filtros FA400I: · Entrada y salida de aire: pulgada y media BSPT · Salida condensados: ½ " BSPT · 470x113x129 mm · 2.36 kg · No tiene conexión electrica 2x Secador modular: · Entrada y salida de aire: 1" BSPT · 120/1/60 Hz · 34 W · 104 kg · 1847x566x277 mm 1x Depósito 1000L: · Entrada y salida de aire: 2" GAS · Salida condensados: ½ " GAS · Altura 2010 mm · Diámetro 850 mm · Peso 280 kg · No tiene conexión eléctrica 1x Purga electrónica para el depósito: · Entrada condensados: ½ " · Salida condensados: 1/4 " · 120/1/60 Hz · 2VA El destino final del contenedor es Sudamérica por lo que el voltaje será 480V 3 fases sin neutro o 120V a una fase, frecuencia 60Hz. Si necesitas cualquier aclaración no dudes en contactarme. Un saludo. Jorge Escolar González Sales Support Engineer Compression Technologies and Services EMEIA Ingersoll Rand Casas de Miravete Nº22B Edificio 1B-3ª Planta 28031 Madrid Spain Office (+34) 620 20 71 51 Email Jorge.escolar@irco.com Website www.ingersollrandproducts.com [cid:image006.png@01D4B238.07161F30]', 259, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(497, '2019-04-03 10:30:57', '0000-00-00 00:00:00', 'Vale de comida para ZARCA S.L.', 'Hola, Mi nombre es María y estoy con ValeDeComida, una compañía que ofrece a las empresas la posibilidad de Proporcionar a los empleados un almuerzo a buen precio. - Simplifica y elimina costes administrativos por la gestión de los gastos de comida. - Importe exento de IRPF hasta 9€ por persona y día y deducible. - Empleados con más motivación ya que disfrutan de un gran beneficio social. Necesitaremos la siguiente información para preparar un presupuesto o propuesta: •Nombre de la empresa •Nombre y Apellido •Número de teléfono •Código postal •Dirección •Cuántos empleados tiene tu empresa? Le recomiendo que consulte nuestros precios respondiendo a este correo electrónico. Atentamente, María Padro Maria@es-CompararOrcamento-Now.site ValeDeComida Su privacidad es importante para nosotros. No pasaremos sus datos a compañías de terceros sin su expreso permiso Responder "Baja", si no desea recibir más mensajes', 105, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(498, '2019-04-03 10:57:30', '0000-00-00 00:00:00', 'Cajas y contenedores Isotérmicos.Precios ¡', 'JULIO SERRA JANER AGENTE COMERCIAL COLEGIADO', 386, 'VCONT', 2, 'NOGEST', 'EMAIL'),
