	(500, '2019-04-03 12:38:55', '0000-00-00 00:00:00', 'Solicitud información', 'Buenos días, estoy interesado en conocer los precios de contenedor almacén. Sería del tipo que tienen las puertas acondicionadas como aparecen en su web los modelos con puerta pivotante y almacén ligero. Indíquenme los precios y tamaños, y si tienen servicio de entrega para Madrid-Guadalajara. Saludos, Manuel.', 388, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(501, '2019-04-03 15:47:10', '0000-00-00 00:00:00', 'Marketplace 100% Gratis de Servicios Profesionales. Envía Presupuestos y Gana Clientes! Regístrate!', 'BCLEVR Te Ponemos En Contacto Directo Con Nuevas Oportunidades De Negocio y Nuevos Clientes Cada Día. Date Ya De Alta Gratis! FUNCIONA COMO EL AIRBNB, PERO PARA TODOS LOS SERVICIOS LOCALES DE CLASES, ENTRENADORES, PROFESORES PARTICULARES Y CLASES PARTICULARES. BCLEVR es una aplicación que conecta automáticamente a personas con profesionales. Es destinada a todos los prestadores de servicios, como negocios locales, profesionales liberales, freelancers, empresas y personas con negocios proprios. Consigue acceso a nuevos clientes y oportunidades de negocio cada día! En BCLEVR encontrarás miles de personas en busca de profesionales para realizar los servicios de que necesitan. Una vez que una persona haga una solicitud de presupuesto para un servicio que tu haces recibirás un mensaje de correo electrónico y puedes empezar a hacer negocio. Fácil, rápido y gratuito! Uso totalmente libre, sin mensualidades y sin comisiones. Nunca fue tan fácil crecer tu negocio. Categorías más populares de las solicitudes de presupuesto para Entrenadores, Profesores Particulares Y Clases Particulares: Últimas Solicitudes de Servicios Locales en BCLEVR: ¡Mira Nuestro Vídeo de Como Funciona! Que Dicen Nuestros Usuarios: Para Particulares: ¿Necesitas algun servicio o producto? Dinos lo que necesitas y en pocas horas recibes gratis 5 presupuestos. 1. Díganos lo que necesitas En primer lugar, responde unas cuantas preguntas rápidas para que podamos averiguar qué tipo de profesional estás buscando. 2. Consulta los presupuestos que recibes En pocas horas recibes hasta 5 presupuestos gratis para el servicio o producto que necesitas. 3. Contrata el profesional adecuado Compara presupuestos, consulta el perfil y evaluaciones de cada profesional. Cuando estés listo, contrata el profesional adecuado. Para Profesionales: ¿Eres un Profesional? Crece tu negocio con BCLEVR. BCLEVR es perfecto para freelancers, profesionales, proveedores de servicios, comerciantes y personas con negocios propios. 1. Te traemos nuevos clientes Recibe notificaciones en tiempo real cada vez que alguien necesite tus servicios o productos. 2. Tú decides. Tú tienes el control Consulta todas las solicitudes de presupuesto que te enviamos y responde únicamente a las que te interesan. 3. Consigue tu próximo cliente Envia presupuestos con mensaje personalizada y precio estimado. ENTRAR EN BCLEVR © 2018 BCLEVR Rua Prof Dr Carlos Lloyd 14, 2º Dto 4715-319 Braga, Portugal Quiero darme de baja | Abrir este correo en el navegador', 389, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(502, '2019-04-03 16:05:14', '0000-00-00 00:00:00', 'Peticion Precios', 'Buenas tardes, Rogaría me enviaran precio del siguiente material para presupuesto en el tramo Humanes ? Monfragüe: u Suministro y montaje de un módulo prefabricado de dimensiones exteriores aproximadas 2400 x 3000 mm ancho x alto hasta 7 m de largo, formado por: envolvente de hormigón armado vibrado, compuesto por una parte que comprende el fondo y las paredes incorporando puertas y rejillas de ventilación natural, y otra que constituye el techo, estando unidas las armaduras del hormigón entre sí y a la red de tierras, según la norma RU 1303. Incluso alumbrado normal y de emergencia. Incluye el propio suministro, el transporte, la carga y la descarga del material a pie de obra, el montaje, los desplazamientos, pequeño material, herramientas, maquinaria, medios auxiliares. (SMOD01bba) (S) 17,0000 Un saludo Descripción: Descripción: CAMYFON COLOR 2 ____________________________________________________________________________ __________________________________________ Marina González Freiría Dpto. de Compras E-mail: marina@camyfon.es Web. www.camyfon.es Av. Martínez Garrido, 43 36205| VIGO (PONTEVEDRA) Tel.: +34 986 262 828 | +34 986 262 899 | Fax: +34 986 260 102 P Antes de imprimir piensa en tu responsabilidad y compromiso con el MEDIO AMBIENTE CONFIDENCIALIDAD. Este correo electrónico y, en su caso, cualquier fichero anexo al mismo, es confidencial y va dirigido únicamente al destinatario del mismo. Queda prohibida su divulgación, copia o distribución a terceros sin la previa autorización de CAMYFÓN, S.L. Si ha recibido este mensaje por error, le rogamos nos lo comunique de forma inmediata por esta misma vía y proceda a su eliminación, así como a la de cualquier documento adjunto al mismo.', 390, 'VCONT', 3, 'NOGEST', 'EMAIL'),
