	(505, '2019-04-03 16:50:26', '0000-00-00 00:00:00', 'PETICION DE PRESUPUESTO ALQUILER CASETA SANT JUST', 'Rogamos nos oferten. 5 Meses de alquiler en Sant Just (Barcelona) de caseta prefabricada con un despacho para reuniones y un aseo con WC y ducha (superficie total aprox. 30m2) con A/C, calefacción y con el siguiente mobiliario: mesa de despacho, sillones, mesa de reuniones, estantería, frigorífico, cafetera. Saludos. Fdo: Marcos Castrillón Otero A.C.G. Ingeniería, S.A. INGENIERÍA ? MONTAJE Y MANTENIMIENTO DE INSTALACIONES ELÉCTRICAS Polígono de Falmuria. C/Carrió Nº 9 33438 PRENDES - CARREÑO - ASTURIAS Tfno: 985887661 Fax: 985887737 E-mail: mcastrillon@acgingenieria.com www.acgingenieria.com AVISO LEGAL: Este mensaje se dirige exclusivamente a su destinatario. Contiene información CONFIDENCIAL sometida a secreto profesional cuya divulgación está prohibida por la ley. Si ha recibido este mensaje por error, debe saber que su lectura, copia y uso están prohibidos. Le rogamos que nos lo comunique inmediatamente por esta misma vía o por teléfono (985 88 76 61) y proceda a su destrucción. Si el destinatario de este mensaje no consintiera la utilización del correo electrónico vía internet y la grabación de los mensajes, rogamos lo ponga en nuestro conocimiento de forma inmediata.', 393, 'VCONT', 2, 'NOGEST', 'EMAIL'),
