	(507, '2019-04-03 18:33:00', '0000-00-00 00:00:00', 'SIN TITULO', 'Buenas tardes, Pertenezco a la asociación de festejos de Saelices de la Sal desde donde estamos buscando una caseta de panel sándwich.Nos gustaría conocer el presupuesto para una caseta de 4*2,4m o medidas similares, en el que venga detallado el coste de electricidad, ventanas, aire acondicionado,...pues son cosas de las que podemos prescindir, tanto nuevas como de segunda mano. Por otra parte también valoramos la posibilidad de una caseta a medida (ya hemos hecho unos planos). Muchas gracias de antemano, espero su repuesta. Me gustaria saber si hariais los portes y de ser asi porque precio. Libre de virus. www.avast.com <#DAB4FAD8-2DD7-40BB-A1B8-4E2AA1F9FDF2>', 395, 'VCONT', 3, 'NOGEST', 'EMAIL'),
