	(512, '2019-04-04 09:24:53', '0000-00-00 00:00:00', 'Re: Camara frigorifica.', '? On Mon, 1 Apr 2019 at 06:51, Info Samuel / Sara wrote: > Hola, > > Estomas buscando a una solución para nuestra start up. Vamos hacer comida > fresca para mascotas, y necesitamos un sitio donde podemos guardar el > producto en su cadena de frío. El producto tiene que estar frio antes de > procesar. Luego cuando el producto esta envasado tiene que estar congelado > a -18. > > Ahora mismo para encontrar un nave que esta equipado con cámaras es > difícil... Entonces estoy buscando a una solución. > > Yo he visto que tenéis cámaras portátiles. Y me parece un buen solución.O > una instalada \'\'fija\'\' es más economico y gasta menós energia? > > También si me puedes decir los precios más o menos seriá muy agradable. > > Gracias > > Samuel >', 364, 'VCONT', 2, 'NOGEST', 'EMAIL'),
