	(515, '2019-04-04 12:11:07', '0000-00-00 00:00:00', 'Contenedor de obra', 'Muy Srs. nuestros, Estaríamos interesados en adquirir un par de contenedores para obra, del tipo marítimo, de segunda mano y unos 6 a 8m3, que a ser posible incluyesen el protector de candado antirrobo (sin candado). Agradeceríamos nos pudiesen dar presupuesto, incluyendo su transporte hasta nuestras instalaciones de Rivas Vaciamadrid (Madrid). Atentamente, Vicente Gil Este correo electrónico y la información contenida en el mismo, y en su caso cualquier fichero anexo al mismo, son de carácter confidencial y está sometida al secreto profesional, dirigiéndose exclusivamente al destinatario mencionado en el encabezamiento. Si Ud. no es el receptor de la comunicación, le informamos que cualquier divulgación, copia, distribución o utilización no autorizada de la información contenida en la misma está prohibida por la legislación vigente. Para ejercer los derechos de acceso, rectificación, cancelación y oposición podrá dirigirse a aticon@aticon.es. Todo lo cual se informa en cumplimiento del artículo 5 de la Ley Orgánica 15/1999, de 13 de diciembre de Protección de Datos de Carácter Personal. Muchas gracias por su colaboración. This message, and in the case of any file annexed to it, can have confidential information, and it is exclusively for the use of the address of the message. It is strictly forbidden to spread a copy or distribute to third parties, without the express order of the sender. If you have received this message mistakenly, we request you to notify to the sender, and please be sure to erase it. Thank you for your collaboration PD: Antes de imprimir este correo piense si es realmente necesario', 59, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(516, '2019-04-04 12:49:47', '0000-00-00 00:00:00', 'Re: Proyecto 19356 -  Peticion de	información y precio', 'Estimados Señores, Rogamos nos indiquen si pueden ofertarnos el contendor indicado o si, por el contrario, declinan ofertar. Gracias anticipadas. Un saludo Tomas Diez HECISA At 18:45 27/03/2019, you wrote: >Estimados Señores, > >Estamos desarrollando un proyecto de un sistema >de tratamiento de combustible a instalar en el >Círculo Polar Artico, para ello precisamos un >contenedo de 20 pies semejante a una camara >frigorifica, en cuyo interior se localizaran los >diferentes componentes del sistema. > >La temperatura exterior puede llegar a ser de >-60 ºC ( sesenta grados bajo cero) y la >temperatura interior de entre -10 y 0 ºC. > >El suelo interior debera estar diseñado para >soportar las cargas de los equipos. > >Se dotara de un sistema de calefacción interior. > >Debera disponer de pasamyros para la entrada y >salida de producto y otras auxiliares, asimo >para la entrada de la conduccion electrica, > >Rogamos nos indiquen si ustedes pueden >proporcionarnos el contenedor-camara, siguiendo nuestras directrices. > >Gracias anticipadas. > >Un saludo > >Tomas Diez > >HECISA >Sales Department >Hispano Europea de Comercio e Industria S.L. >Calidad, 24 - Pol. Los Olivos >28906 Getafe - Madrid - España >Certificaciones: >ISO 9001 >ISO 14000 >NCAGE >http://hecisa.com', 288, 'VCONT', 3, 'NOGEST', 'EMAIL'),
