	(532, '2019-04-05 16:38:35', '0000-00-00 00:00:00', 'Oficina Acristalada', 'Hola bona tarda. Estava interessat en un model que teniu a la pàgina web:\r\n\r\nOficina Acristalada Gris (3m Ancho)\r\nMódulo prefabricado oficina acristalada gris de 7,20 x 3 metros (anchura especial) con aire acondicionado.\r\n\r\nM\'agradaria saber el preu aproximat, per saber si està dins les meves possibilitats o no. Busco una solució econòmica per fer un espai de treball en un terreny que tinc, m\'interessaria que fós diàfan i el màxim de lluminós possible. El fomat seria aquest...una espècie de contenidor, que per una de les seves cares, fos tot vidre pq entri la llum.\r\n\r\npoden trucar-me o contactar-me per correu. Moltes gràcies per la seva atenció.', 411, 'VCONT', 3, 'NOGEST', 'EMAIL'),
