	(535, '2019-04-05 20:38:08', '0000-00-00 00:00:00', 'módulos madera para uso como aula en instituto', 'Buenas tardes,\r\n\r\nEstamos interesados en dos módulos de 60 m2 para ampliar nuestro instituto. Sería para uso como aulas, no como vivienda. Preferiblemente en madera. Nos pueden pasar presupuesto, por favor?\r\nGracias\r\nMireiaVernet', 413, 'VCONT', 2, 'NOGEST', 'EMAIL'),
	(536, '2019-04-06 00:04:21', '0000-00-00 00:00:00', 'Querida en Cristo,', '-- Querida en Cristo, Saludos a ustedes, soy la Sra. Rachael James de Reino Unido. Me casé con el Sr. Tom James, que trabajaba en una empresa de construcción en Asia durante veinte años antes de que muriera en los desastres, nos casamos pero sin hijos. Ahora estoy sufriendo desde hace mucho tiempo cáncer de mama y cáncer de pulmones, de todas las indicaciones, mi condición está realmente deteriorándose y Es bastante obvio que no viviré más de 2 meses según Mi doctor, esto es porque la etapa del cáncer ha llegado a un muy mal. Etapa. Desde la muerte de Tom, decidí no volver a casarme. Deposité un cierta cantidad en un banco y ahora estoy dispuesto a donar esta suma a Los menos privilegiados y para contribuir al desarrollo de la mezquita y la iglesia en África, América, Asia y Europa. Mi difunto esposo era muy rico y después de su muerte, heredé Todo su negocio y su riqueza, actualmente este dinero sigue con el El banco y la gerencia me escribieron como el beneficiario por venir. reenviar para recibir el dinero o más bien emitir una carta de autorización a alguien que lo reciba en mi nombre si no puedo venir. yo soy Actualmente en un hospital donde he estado bajo tratamiento para Cáncer de los pulmones, desde entonces he perdido mi capacidad para hablar y mi Los doctores me han dicho que solo tengo unos meses para vivir. Por favor Quiero que tenga en cuenta que este dinero está en el banco. Quiero una persona que sea confiable y que utilice el 90% de esto. dinero para financiar iglesias, orfanatos y viudas en todo el mundo pero en mi nombre "Mrs.Rachel James" Tan pronto como reciba su respuesta, Darte el contacto del banco. También te emitiré una carta de Autoridad que lo probará como el nuevo beneficiario de este fondo. Por favor, asegúrese de que actuará de acuerdo con lo establecido en este documento y Mantenga este contacto confidencial hasta que llegue el momento en que estos fondos lleguen a su Custodia, esto es para garantizar que nada ponga en peligro mi último deseo en Tierra. Espero tu urgente respuesta. Tuyo en cristo', 414, 'VCONT', 2, 'NOGEST', 'EMAIL'),
