	(539, '2019-04-07 12:47:00', '0000-00-00 00:00:00', 'Info', 'Estem interessats per col·locar dins un parquing de la nostra propietat amb un espai disponible aprox. de 2,5 x2,5 x 8 mts ample x fons x alçada, de un mòdul ( o dos en funció mides) a efectes de emmagatzemament de mobles, arxiu papers etc a nivell domèstic, i que tingui una certa seguretat (tampoc a un nivell extremadament alt). Nosaltres havem pensat amb containers usats que es poguessin reciclar i clar poder aprofitar tot inclòs amb alçada ( facilitat de accedir-hi relativament facil ,escala dins o fora). Vos demanem info al respecta al millor preu possible en funció estat ( nou, segona ma , reciclar, reformar..etc) Les mides facilitades podrien tenir petites modificacions , també necessitem el transport e l´instal·lació dels mateixos ( lloc: el Bages -zona Manresa). Les petites restauracions ( si sigues el cas) ens ho podrem plantejar fer nosaltres mateixos. Nostres dades de contacte. Joan Santasusana Codina C/ Vinya del Rei, 5 08328 ALELLA ( Bcn) Tel- 93 5551206 Mòbil: 610476694 Cordialment. Joan', 416, 'VCONT', 2, 'NOGEST', 'EMAIL'),
