	(553, '2019-04-08 17:16:33', '0000-00-00 00:00:00', 'María de Huerva -  ALQUILER DE CASETAS', 'Buenas tardes, Me gustaría solicitar un presupuesto para el alquiler de diferentes tipos de casetas en la localidad de María de Huerva (Zaragoza). Las especificaciones de dichas casetas se definen a continuación: · 1 contenedor almacén 2,35 x 6 m. · 2 contenedores sanitarios 2,35 x 6 m con 6 tazas (uno para hombres y otro para mujeres). · 3 módulos de oficinas 6 x 4,70 m compuesto por: 6mesas, 6 sillas, 2 cajoneras, 2 estanterías y aire acondicionado. · 1 caseta de control de accesos 2,35 x 4,10 m compuesto por:1 mesa, 2 sillas, 1 estantería y aire acondicionado. · 1 contenedor oficina 2,35 x 6 m compuesto por: 2 mesas, 2 sillas, 2 cajoneras, 1 estantería y aire acondicionado. · 1 sala de reuniones 7 x 4,70 m compuesto por: 1 mesa de reuniones para 14 personas, 14 sillas, mesa auxiliar, 2 estanterías y aire acondicionado. Duración: 6 meses. Un saludo. Aitor Crespo Rodríguez Aprovisionamientos / Procurement T: (+34) 944 712 131 [Logo] Global Energy Services Siemsa, S.A. Parque Tecnológico de Bizkaia Edif. 407 2ª Planta 48170 Zamudio – Vizcaya - Spain www.services-ges.com WITH YOU ALL THE WAY DISCLAIMER: The information in this e-mail is private and confidential, for that reason its distribution or resending to third parties outside GLOBAL ENERGY SERVICES SIEMSA, S.A. or to one of the companies in its Group is strictly forbidden. Likewise this communication has only an informative purpose and doesn’t represent an offer, acceptance or binding opinion for GLOBAL ENERGY SERVICES SIEMSA, S.A. or one of the companies of the Group. Neither GLOBAL ENERGY SERVICES SIEMSA S.A. nor one of the companies of the Group will assume any obligation or execute orders carry through e-mail. Please consider the enviroment before printing this email. ADVERTENCIA: Esta comunicación va dirigida en exclusiva a su destinatario y puede contener información privada y confidencial, por ello queda prohi