	(565, '2019-11-04 19:12:56', '2019-04-09 15:15:26', 'Posibilidad de Colaboración 2019 - Sistemas de Embalaje Anper', 'Si usted no es capaz de ver este email, haga clic http://321ug.r.a.d.sendibm1.com/mk/mr/BC2cqqo1z0QqwOi7dQxBToegM8wlhe2q-KW9sQ8noJAKpXIcayyGCHcoDCEj1FrmR8dV4ug0A1iW9JWX0W2H2K7OAUI3EMFcWH1S-0zEcryhiYox Buenos días, Soy Silvia, responsable de ventas internas de Sistemas de embalajes Anper. Somos una empresa que ofrece Servicio de Embalaje Global a nivel nacional. Nuestros principales productos son: -Film estirable manual y automático: Realizamos toda la transformación completa. -Cintas adhesivas neutras e impresas: Cortamos e imprimimos todas las calidades y medidas. -Plásticos (reciclados, retráctiles): En todos los micrajes, formatos y medidas. -Poliolefina retráctil: Disponemos en stock de todas las medidas y espesores. Asimismo, tenemos en stock más de 1800 referencias de otros artículos de embalaje para servicio inmediato (cantoneras, packing list, etiquetas etc....) Ofrecemos un servicio global, A PRECIOS MUY COMPETITIVOS y servicio en 24/48 horas. Agradecería me enviara información para poder realizarle una propuesta de reducción de costes para 2019 sin ningún tipo de compromiso, o si prefiere una visita personalizada, estaré encantada de visitarle. Le dejo link de nuestro vídeo corporativo para que nos conozca mejor: https://www.youtube.com/watch?v=wZGrAo1AiVk&t=4s Quedo pendiente de su respuesta. Muchas gracias!!! Un saludo, Silvia Horcas Sistemas de embalaje Anper Si desea darse de baja de nuestro boletín de noticias, haga clic http://321ug.r.a.d.sendibm1.com/mk/un/dJ2YmxGB3jNgzwlA53vfkOulbTMB5WzFnrn4FJF903Dy0aE8mYFSdKJxxtuVW-oES41zezl8FY0GPv4LqLrldOCFZ70Tp1dl4yQ0HAVJ24lNxvIaSQLe116ACbxph8F36lYJZ8HwZsGuhOI', 431, 'VCONT', 2, 'NOGEST', 'EMAIL'),
