	(576, '2019-11-04 20:30:55', '2019-04-10 08:45:21', 'Alquiler casetas de obra', 'Buenos días, Solicitamos nos envíe oferta para el alquiler de casetas de obra para una obra situada en la calle Roger 48-64 de Barcelona. - 1ud caseta oficina + baño (6,00 x 4,00 o medida similar) - 2ud caseta diáfana (6,00 x 4,00) - 1ud caseta baños y duchas (6,00 x 4,00) - 1ud contenedor (6,00 x 4,00) - 2ud escaleras El tiempo estimado de alquiler estaría entre 16-18 meses Rogaríamos nos informaran de vuestra disponibilidad Quedo a vuestra disposición para cualquier duda o aclaración. Gracias Un saludo Enric Bernadás Robles Jefe de Producción 666.40.32.27 Delegación Catalunya C/ Aragón, 383, 1er. - 08013 Barcelona 93.207.70.15 AVISO DE CONFIDENCIALIDAD La informacion incluida en el presente correo electronico es confidencial, siendo de uso exclusivo para el destinatario arriba mencionado. Si Ud. lee este mensaje y no es el destinatario al que va dirigido o el agente, empleado responsable de entrega del mensaje al destinatario, le informamos que esta prohibida cualquier divulgacion, distribucion o reproduccion de cualquier modo y le rogamos que se nos notifique y devuelva el mensaje a la direccion de origen, procediendo a su eliminacion. El remitente le informa que los datos que Vd. nos ha facilitado y/o los que han sido obtenidos de fuentes de acceso publico, forman parte de ficheros de titularidad de dicha empresa, con domicilio, a tales efectos, en Ronda de Poniente 11, 28760 Tres Cantos, Madrid, con la finalidad de gestionar la relacion contractual que le vincula con esta empresa (en el caso de que Vd. ya sea cliente y/o proveedor) y gestionar, asimismo, la labor comercial y la promocion de los productos y servicios que ofrece dicha empresa. Se le garantiza la posibilidad de ejercitar sus derechos de acceso, rectificacion, cancelacion y oposicion al tratamiento de sus datos, dirigiendo una comunicacion por escrito a la direccion indicada anteriormente, o en la direccion de correo 