	(577, '2019-11-04 20:30:55', '2019-04-10 10:57:15', 'ConFoot Ltd Finland looking for distributors in Spain', 'Dear all, I am trying to reach the correct person handling business co-operation for Zarca. ConFoot, the Company I represent, designs and manufactures patented, detachable shipping container legs that can be operated by one person. Getting a max 30 ton container free-standing on the legs is a matter of minutes. ConFoot legs are the only portable container handling solution in the world. We have distributors throughout Europe, and we are currently looking for distributors in Spain. ConFoot will be present at SIL Barcelona from 26 to 28 June 2019, and we welcome contacts from all interested parties. To discuss the matter further at SIL Barcelona, please book a meeting by calling +358 40 142 6796 or by emailing sami@confoot.fi More info on our company and products in Spanish here http://confoot.fi/es I am looking forward to your reply, any help in this matter will be greatly appreciated! With very best regards, Sami Seppänen ConFoot Ltd, Helsinki Mobile: +358 40 142 6796 sami.seppanen@confoot.fi PO Box 287, 00151 Helsinki, FI Click for more info on ConFoot products This email and any files transmitted with it are confidential and intended solely for the use of the individual or entity to whom they are addressed. If you have received this email in error please notify the system manager. This message contains confidential information and is intended only for the individual named. If you are not the named addressee you should not disseminate, distribute or copy this e-mail. Please notify the sender immediately by e-mail if you have received this e-mail by mistake and delete this e-mail from your system. If you are not the intended recipient you are notified that disclosing, copying, distributing or taking any action in reliance on the contents of this information is strictly prohibited.', 438, 'VCONT', 3, 'NOGEST', 'EMAIL'),
