	(579, '2019-12-06 01:25:20', '2019-04-10 12:02:02', 'Re: casetas de obra RIBARROJA DEL EBRO', 'Buenos días. ¿Podrían enviarme los precios solicitados sin aseos ni módulo sanitario? Nos urge la instalación y se ha pensado en baños químicos porque el lugar de ubicación de la obra es un paraje natural sin ningún tipo de servicio (sin electricidad, ni abastecimiento, ni saneamiento). - 1 caseta destinada a oficina y sala de reuniones para albergar una mesa de trabajo (para ordenador e impresora) para una silla/persona y una mesa de reuniones para ocho sillas/personas. - 2 casetas para dos puestos/mesas de trabajo y una estantería cada una. - 1 caseta destinada a sala de reuniones para alojar mesas y sillas para unas 20 personas. - 1 caseta para vestuarios de 20 a 25 trabajadores con taquillas y bancos. - 1 caseta para comedor con mesas y sillas o bancos para 20 a 25 personas. - 2 baños químicos. - El mobiliario. - Dispensadores de agua y generador para suministro eléctrico. Espero que puedan pasarme la oferta lo antes posible. Gracias, UXAMA Ingeniería y Arquitectura, S.L. P Por favor, antes de imprimir este correo electrónico, piense si es realmente necesario. P Please, consider the environment before printing. Aviso legal: La información incluida en esta comunicación electrónica es confidencial y va dirigida únicamente al destinatario del mismo. En el supuesto de que usted no fuera el destinatario, le solicitamos que nos lo indique y no comunique su contenido a terceros, procediendo a su destrucción. Le informamos que está totalmente prohibida cualquier utilización, divulgación, distribución y/o reproducción de esta comunicación sin autorización expresa en virtud de la Legislación vigente. Gracias por su colaboración. Disclaimers: The information contained in this electronical communication is confidential and is intended for the exclusive use of the above named address (es). If you are not the intended recipient, you are expressly prohibited from copying, distributi