er way using any of the information contained within this communication. If you have received this communication by error, please contact with sender. Thanks for your collaboration.', 423, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(580, '2019-12-06 01:25:20', '2019-04-10 12:41:00', 'PRESUPUESTO URGENTE COMPRA - ALQUILER CONTENEDORES MARITIMOS 40\'-20\'', 'Buenos Días, Soy Irene Martinez encargada de producción de la empresa de eventos Mondoliorndo s.l me pongo en contacto con ustedes para poder tener un presupuesto con urgencia de la propuesta de evento que queremos desarrollar en junio en Madrid capital ( fecha a concretar) La idea es crear 2 contenedores uno color brillante Oro y otro Plata de 40? y 1 contenedor negro donde localizaremos a una dj en su interior. Los contenedores de 40? tendrán una exposición de producto sobre una cajas que llevaremos nosotros por lo que el contenedor tendrá que tener iluminación ( rail con focos negros ) cuadro eléctrico y algunos enchufes. Necesitaríamos evaluar estas opciones : ALQUILER 1. Container de40? Alquiler 1dia 2. Pintado interior ( con suelo) y exterior ( sin techo) ( Oro u otro RAL) 3. Apertura de 4metros en uno de los contenedores de 40?. Transporte ,carga y descarga de 2 contenedores de 40? en punto de Madrid capital. COMPRA: 4. Container de 40? Compra 1dia 5. Pintado interior ( con suelo) y exterior ( sin techo) ( Oro u otro RAL) 6. Apertura de 4metros en uno de los contenedores de 40?. 7. Transporte ,carga y descarga de 2 contenedores de 40? en punto de Madrid capital. 6M CONTAINER ALQUILER 8. Container de 6m Alquiler 1dia 9. Pintado interior ( con suelo) y exterior ( sin techo) ( Oro u otro RAL) 10. Apertura de 2metros en un contenedor. 11. Con cuadro elctrico para iluminación interior ( a definir ) enchufes para enchufar mesas dj ? 12. Transporte ,carga y descarga en punto de Madrid capital. * Instalación de focos 10uds por contenedor de 40?. COMPRA 1. Container de 6m compra 1dia 2. Pintado interior ( con suelo) y exterior ( sin techo) ( Oro u otro RAL) 3. Apertura de 2metros en un contenedor. 4. Con cuadro eléctrico para iluminación interior ( a definir ) enchufes para enchufar mesas dj ? 5. Transporte ,carga y descarga en punto de Madrid capital. 6. Instalación de focos 10uds por contenedor de 40?. Adjunto imágenes que hemos encontrado de la idea del dorado . telf. +34 647376942 www.mondolirondo.com Plaza de Jesus 3 1º IZQ, 28014, Madrid La información contenida en este mensaje y/o archivo(s) adjunto(s), enviada desde MONDOLIRONDO SL, es confidencial/privilegiada y está destinada a ser leída sólo por la(s) persona(s) a la(s) que va dirigida. Le recordamos que sus datos han sido incorporados en un fichero y que siempre y cuando se cumplan los requisitos exigidos por la normativa, podrá ejercer los derechos de acceso, rectificación, cancelación y oposición, ante nuestra entidad. Si usted lee este mensaje y no es el destinatario señalado, el empleado o el agente responsable de entregar el mensaje al destinatario, o ha recibido esta comunicación por error, le informamos que está totalmente prohibida, y puede ser ilegal, cualquier divulgación, distribución o reproducción de esta comunicación, y le rogamos que nos lo notifique inmediatamente y nos devuelva el mensaje original a la dirección arriba mencionada. Gracias.', 439, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(581, '2019-12-06 01:25:20', '2019-04-10 16:41:01', 'PRECIOS', 'Hola, estaría interesada en saber los precios de las casetas pre fabricadas. Estaríamos interesados en las dos que tenéis en la portada de vuestra web pero realmente algo más pequeña. Nosotros estamos en Estepona (Málaga), esto sería un inconveniente? También saber si las alquiláis. Gracias y saludos, Ana Cuesta Tel. 666567892 www.anacuesta.com www.solrealestate.com www.esteponarealestate.com cid:image002.jpg@01D45B0D.ED3CE340', 440, 'VCONT', 4, 'NOGEST', 'EMAIL'),
