	(587, '2019-12-06 01:25:21', '2019-04-11 12:44:55', 'MODULOS CONTENEDORES', 'Buenos días Eduard, Hace unas semanas os pasamos para valorar unos contenedores; habéis podido revisarlo? ¿Podemos contar con vuestro presupuesto? Dejo mis datos a pie de mail ante cualquier comentario y/o duda. Saludos Nicolás Galán, Arq. Proyectos [cid:image001.jpg@01D4F064.5D60AE40] [cid:image002.png@01D4F064.5D60AE40] G.A.C. 3000 S.L. C/Séneca 11, Baixos. 08006 BARCELONA T: +34 93 206 61 27 nicolas@gac3000.com De: Nicolas Enviado el: martes, 19 de marzo de 2019 9:40 Para: \'comercial@zarca.es\' Asunto: MODULOS CONTENEDORES MODIFICADOS Buenos días Eduard, Somos una empresa de arquitectura en Barcelona y actualmente estamos desarrollando un proyecto que requiere una serie de contenedores modificados que necesitamos valorar, el Sr. Francisco de la empresa Silversea nos ha pasado vuestro contacto. Se trata de un área gastronómica y de ocio en las inmediaciones del Camp Nou; para ello necesitamos presupuestar una serie de módulos que adjunto en formato Excel y pdf. Nuestra propuesta es que estos módulos se desarrollen a partir de contenedores marítimos de 20\'. En esta fase inicial -a falta de terminar de definir al detalle cada módulo- necesitamos una valoración estimativa de vuestra parte, tanto la producción como el transporte a Barcelona centro (Camp Nou) y plazos de entrega estimados. Desde ya muchas gracias, dejo mis datos a pie de mail ante cualquier comentario y/o duda. Saludos Nicolás Galán, Arq. Proyectos [cid:image001.jpg@01D4F064.5D60AE40] [cid:image002.png@01D4F064.5D60AE40] G.A.C. 3000 S.L. C/Séneca 11, Baixos. 08006 BARCELONA T: +34 93 206 61 27 nicolas@gac3000.com', 208, 'VCONT', 3, 'NOGEST', 'EMAIL'),
