	(590, '2019-12-06 01:25:24', '2019-04-11 22:08:03', 'Platos de ducha', 'Buenas tardes disponemos en stock platos de ducha de acrilicos en blanco, reforzados con fibra de vidrio, en la medida 90 x90 cuadrado. Por si fuera de su interes el precio que tenemos en venta son de 20 euros la unidad. Cantidad minima 20 unidades Forma de Pago contado o transferencia. En espera de sus noticias, les saluda atentamente Jose Morales 635411713', 447, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(591, '2019-12-06 01:25:24', '2019-04-12 09:02:39', 'Solicitud Informacion', 'Buenos días , Quería recibir un presupuesto para el alquiler de un contenedor frigorífico para nuestra temporada de bodas. Seria de junio a octubre. Lo usaríamos un día, pero el contenedor por logística tendría que estar en la finca durante esos meses. La capacidad necesitada de unos 4-5 palets. Espero vuestro presupuesto. Gracias Saludos', 448, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(592, '2019-12-06 01:25:24', '2019-04-12 09:21:46', 'piscina contenedor', 'buenas . estaria interesado en saber el precio de una piscina en un contenedor, en el hueco que tengo entraria una de hasta 8 mts, por lo que he leido seri entoces de 6mts.\r\nqueria saber el precio ya puesta en el terreno, ', 61, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(593, '2019-12-06 01:25:24', '2019-04-12 12:44:19', 'Solicitud de reunión con Eduardo Zarzoso', 'Buenos días Eduardo, Un placer saludarte de nuevo. Te pido disculpas de antemano por la interrupción. Hace algún tiempo te mandé, a través de nuestro departamento de proyectos, una solicitud de visita, puesto que tenía verdadero interés en conocerte y poder presentarte nuestros servicios bonificados por FUNDAE. Me he tomado la libertad de volver a contactarte ya que vuestra actividad se desarrolla en un ámbito donde tenemos a muchos de nuestros principales clientes. Los exitosos resultados obtenidos con ellos, me han animado a mandarte este email para volver a solicitar esa visita. Se que hablar de éxito sin más, es muy genérico y dice poco. En realidad, lo que buscamos siempre es el crecimiento de la empresa utilizando los mismos recursos de los que dispone y el desarrollo de las personas implicadas para conseguir equipos más eficientes con personas más felices y comprometidas. Para no extenderme demasiado puedo enumerarte los principales beneficios obtenidos por nuestros clientes con nuestros 3 programas personalizados más solicitados: * Programa de Entrenamiento de Vendedores: Vendedores cualificados / Captación de nuevos clientes / Desarrollo de la cartera actual / Satisfacción del vendedor / Mejora de procesos comerciales. * Programa Up Convert: Incremento de las ventas a través del aumento del ratio de conversión / Evitar competir por precio / Avanzar a la competencia / Minimizar el esfuerzo / Potenciar tu valor como proveedor. * Programa de Habilidades Directivas y Equipos: Capacitación en liderazgo / Proyección eficaz de objetivos hacia el equipo / Capacidad para desarrollar equipos de alto rendimiento / Desarrollo de la creatividad para la resolución de problemas / Desarrollo de la capacidad de negociación estratégica / Empatía, autoliderazgo, relisiencia, asertividad / Disminución substancial del nivel de estrés Si he conseguido despertar tu interés y quieres que hablemos, facilítame un par de alternativas de cita y cuadramos agendas. Si lo prefieres, podemos hablar por teléfono o Skype. Si es así, te ruego que escojas día y hora pulsando aquí. Muchas gracias por tu atención y amabilidad. Espero podernos conocer pronto. Juan Carlos Fontcuberta www.juancarlosfontcuberta.com Impulso Coaching de Negocios S.L. Tel.: +34 622 497 690 Esteve Pila 28, 08173 Sant Cugat del Vallés www.impulsocoach.com ?Este correo electrónico contiene información privada y estrictamente confidencial. Si usted no es el destinatario del presente mensaje, no tiene autorización para leerlo, retenerlo o difundirlo. El correo electrónico no permite asegurar ni la confidencialidad ni la correcta recepción de los mensajes, si usted estuviera disconforme con su utilización, le rogamos que nos lo haga saber. Recibe este comunicado como integrante o contacto de la red profesional Impulso o de alguno de nuestros colaboradores y partners, por su inscripción a alguno de los eventos que habitualmente organizamos, de fuentes accesibles al público o facilitados por usted, autorizándonos en todos los casos al envío de este correo electrónico. Le informamos que Impulso Coaching de Negocios S.L., con C.I.F. B85968410 y domicilio en el número 93 3ºE de la calle Serrano de Madrid, C.P. 28006, es responsable del fichero de datos de carácter personal que permite este contacto y cuya finalidad es servir de soporte a la relación comercial con usted, envío de publicidad, prospección comercial o cumplimiento de las obligaciones legales asociadas. Dichos datos se conservarán mientras se mantenga la relación comercial o durante los años necesarios para cumplir con las obligaciones legales. Los datos no se cederán a terceros salvo en los casos en que exista una obligación legal. Usted tiene derecho a obtener confirmación sobre si en IMPULSO COACHING DE NEGOCIOS SL estamos tratando sus datos personales. Por tanto, tiene derecho a acceder a sus datos personales, rectificar los da