	(610, '2019-12-06 01:25:27', '2019-04-15 10:59:28', 'Diseño web', '*|MC:SUBJECT|**|MC_PREVIEW_TEXT|* ¡Necesitas estar donde tus clientes te buscan! Hoy en día casi todo se compra o se consulta por internet, por eso es imprescindible tener una web bien diseñada. Con nuestros cursos de Diseño web tendrás tu página en el top de tu sector. Domina herramientas como Photoshop, wordpress, Javascript o HTML 5 y CSS y domina tu mercado. Photoshop, Wordpress, Seo y sem, Html5 y CSS, Javascript. Consigue la página web que tú quieres tener. Con los distintos cursos de diseño web que te ofrece AIP podrás diseñar tú mismo tu propia web a tu gusto, a tu manera. AIP somos un centro con más de 30 años de experiencia donde te ofrecemos formación personalizada adecuada a las necesidades de tu empresa sin que tengas que preocuparte del proceso de bonificación ya que nosotros nos encargamos de gestionarlo. Ofrecemos servicios de formación en empresas o en nuestras instalaciones y contamos con el certificado de centro oficial de formación Adobe. INFORMATE SOBRE NUESTROS CURSOS Copyright ©, todos los derechos reservados. Nuestra dirección de correo es: guillem@aipbarcelona.com (guillem@aipbarcelona.com%20%C2%A0) ¿Desea cambiar la forma en que recibe estos correos electrónicos? Si no desea seguir recibiendo esta información puede darse de baja de esta lista.', 221, 'VCONT', 4, 'NOGEST', 'EMAIL'),
