	(614, '2019-12-06 01:25:27', '2019-04-15 23:16:33', 'INFORMACIÓN DE PISCINA CONTENEDOR Y VIVIENDA PREFABRICADA', 'Buenos días: Estoy interesado en algunos de sus productos y les solicito información sobre el coste de una piscina contenedor no superior a estas medias 2,50 mtrs cm ancho como máximo y de largo 4 ó 5 mtrs. Esta será instalada encima de una vivienda en proceso de construcción actualmente. Tambien estaría interesado en vivienda prefabricada que sería instalada en una de las terrazas . Todo esto sería enviado a la Ciudad de Melilla. Un cordial saludo Yusef Mohamed Mohand Tlf. 686761986', 465, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(615, '2019-12-06 01:25:27', '2019-04-16 08:25:29', 'Modulo prefabricado duchas', 'De Sebastián José Moles Moles. Necesito conocer su disponibilidad y presupuesto para un grupo de 14 duchas modulares en la Isla de Eivissa el día 1 de junio, Los módulos deberían estar una semana antes para realizar las conexiones y verificaciones oportunas. En las condiciones económicas consideren el transporte hasta la Isla y la garantía que proceda. El emplazamiento será en un recinto cerrado y vigilado con espacio suficiente. Se prevé un uso de una semana. Teléfono de contacto 676476535', 466, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(616, '2019-12-06 01:25:27', '2019-04-16 09:15:14', 'Compra contenedor frigorifico 20 "', 'Soy  el responsable de compras de la compañía SRG Global Liria.\r\n\r\nEstamos interesados en la compra de un contenedor de 20” frigorifico.\r\n\r\nContenedor nuevo.\r\nEntrega incluida\r\nPoblación de entrega  Liria ( Valencia) \r\nDireccion: Carreta Valencia Ademuz km 30.5 \r\n\r\nProducto o productos:\r\n\r\nOpcion 1: Contenedor 20 " frigorifico, con rampa de entrada al contenedor, y que alcance -40º.\r\nOpcion 2: mismo contenedor pero que alcance -30º\r\n\r\nComentarios o indicaciones:\r\n\r\nPor favor desglosar el coste en:\r\n\r\n1) Coste contenedor.\r\n2) Transporte.\r\n3) Indicar el Periodo de Garantía y en que consiste.\r\n', 467, 'VCONT', 4, 'NOGEST', 'EMAIL'),
