	(618, '2019-12-06 01:25:27', '2019-04-16 11:47:52', 'RV: OBRA EN GETAFE. LOS MOLINOS', 'OBRAS, CAMINOS Y ASFALTOS, S.A. COMO ADJUDICATARIA DE LA OBRA ?Los Molinos (Huertos urbanos y Estructuras de sombra)? SOLICITA OFERTA DE: u CASETA DE 2 OFICINAS+ASEO 19,40 m2 Caseta prefabricada de obra, para dos despachos de oficina y un aseo con inodoro y lavabo de 7,92x2,45x2,45 m de 19,40 m2. Estructura y cerramiento de chapa galvanizada pintada, aislamiento de poliestireno expandido autoextinguible, interior con tablero melaminado en color. Cubierta de chapa galvanizada reforzada con perfil de acero; fibra de vidrio de 60 mm, interior con tablex lacado. Divisiones en tablero de melamina. Suelo de aglomerado revestido con PVC continuo de 2 mm, y poliestireno de 50 mm con apoyo en base de chapa galvanizada de sección trapezoidal. Puerta de 0,80x2,00 m, de chapa galvanizada de 1 mm, reforzada y con poliestireno de 20 mm, picaporte y cerradura. Dos ventanas aluminio anodizado corredera, contraventana de acero galvanizado. Instalación eléctrica a 220 V, toma de tierra, automático, 2 fluorescentes de 40 W, enchufes para 1500 W y punto luz exterior de 60 W. Dos equipos de aire acondicionado/bomba de calor. Incluido transporte y descarga en obra. ?????????????????????????????????????????????.2ud DATOS: OBRAS, CAMINOS Y ASFALTOS, S.A. C/ MIGUEL FARADAY Nº 20 OFICINAS A101/102 EDIFICIO CHARMEX GREEN BULDING 28906 GETAFE (MADRID) C.I.F. A-32.212.375 TFNOS: 91.491.29.40/91.743.33.52 firma_angel_navarro', 469, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(623, '2019-12-09 23:54:27', '2019-04-16 12:24:45', 'Petición Oferta Venta Módulos/Conjunto Modular Prefabricado. Obra Lleida', 'Buenos días, Para nuestra obra en ejecución el Lleida, necesitaría que me pudieran enviar oferta para montaje y venta de las unidades que aparecen en el Excel adjunto. Se trata de un conjunto modular de 120m2 (Edificio de Servicios) y de un módulo de 6x3,3m como caseta para operador de báscula. Básicamente lo se busca es cumplir con la distribución y superficie que aparece en los planos. Los acabados, posición de los aires acondicionados,... será la que acostumbren a tener sus módulos. Adjunto planos de distribución del conjunto modular y del módulo de báscula. Debido al corto plazo del que disponemos para la entrega de la obra (17 de julio), necesitaría pudieran enviarme la oferta lo antes posible, para así poder cerrar la contratación a la empresa adjudicataria a la mayor brevedad posible. Para cualquier consulta, no duden en ponerse en contacto conmigo. Un saludo | Solera Ramiro, Daniel - Project Manager | | Dirección de Proyectos de Tratamiento y Energía. URBASER, S.A. | | Camino de las Hormigueras, 171 | 28031 Madrid | ESPAÑA | | * +34 689 35 01 98 | www.urbaser.es | Se informa a quien recibiera este documento sin ser el destinatario o persona autorizada por éste, que la información contenida en el mismo es confidencial y su utilización y/o divulgación está prohibida. Si ha recibido este documento por error, le rogamos nos lo comunique y proceda a su destrucción. En cumplimiento de la normativa de protección de datos, le informamos de que sus datos personales forman parte de un fichero propiedad de la empresa remitente y son tratados con la única finalidad de mantenimiento de la relación adquirida con usted. Usted puede ejercitar sus derechos de acceso, rectificación, cancelación y oposición dirigiéndose por escrito a Urbaser, S.A., Camino de Hormigueras 171, Edificio CD, Planta 0, (Polígono Empresarial Villa de Vallecas), 28031, (Ma