	(629, '2019-12-09 23:54:28', '2019-04-16 19:35:03', 'Al departamento de RRHH', 'Buenos días. Aunque he comprobado que en este momento no existe ningún proceso de selección abierto para el perfil de Delineante proyectista, me gustaría ofrecer mi candidatura, con el objetivo de que la tengan en cuenta para futuros procesos de selección. Me siento especialmente motivado por trabajar en una empresa de renombre y prestigio como la suya en el sector de la construcción modular y además, estoy capacitado para cubrir el puesto vacante de Delineante proyectista. Tengo más de diez años de experiencia, en los últimos años he trabajado en empresas del sector de la construcción modular como ALGECO y ALCO, también en obra civil, estructura y calderería, he realizado proyectos de todo tipo. Me gustaría que tengan en cuenta mi candidatura para futuros procesos de selección porque me encantaría ser parte de su equipo de trabajo. Estaré encantado de ampliarles mi perfil profesional si así lo requieren, de modo que estaré localizable al teléfono 647 93 73 98 o por correo electrónico a michelpab2014@gmail.com Queda a su disposición y le saluda atentamente, Miguel Angel Pablos', 478, 'VCONT', 3, 'NOGEST', 'EMAIL'),
