	(632, '2019-12-09 23:54:28', '2019-04-17 08:06:28', 'CONTACTO', 'Estimados Señores: Tengo el honor de presentarle un producto que se adapta plenamente a las necesidades de su empresa. Nuestro producto le permitirá llegar a nuevos clientes e incrementar de manera inmediata sus ventas. Le presentamos una base de datos de empresas con los datos de contacto de sus dueños y directivos. El catálogo incluye más de un millón de direcciones, y es uno de los mayores en el mercado español. Contiene datos tales como: nombre de la empresa, domicilio social, datos de contacto del dueño, e-mail, teléfono, fax, página web, etc. Puede empezar a usar el catálogo y promocionar sus productos inmediatamente. El retorno de la inversión está garantizado. ¡Lo compra una vez y lo puede usar toda la vida! *** Base de datos de empresas españolas - 1.548.400 registros. - 190.00 € - Sólo hasta el 17/04/2019 Más información en nuestra web: http://www.basededatos.online/?page=catalog Atentamente, GC-Support-Team', 480, 'VCONT', 4, 'NOGEST', 'EMAIL'),
