	(647, '2019-12-09 23:54:29', '2019-04-18 14:44:40', 'Inquiry about Verious Machinery and Metal Parts', 'Dear Valued Customer, We would like to seek the opportunity of cooperating with your esteemed company. Our company supplies various machinery and equipment including agriculture & forestry machinery, engineering & construction machinery, metal processing machinery, plastic & rubber machinery, packaging machinery and woodworking machinery, etc. We can also supply metal casting and machining parts according to your requirement. You could visit our website: www. machinerymachinery. com for more information about our company and the products supplied. If you have any requirement for these machinery or equipment, please don’t hesitate to write to us. We look forward to receiving your reply. Sincerely, Richard -- Qingdao Hymedi Metal & Machinery | No.79 Xuzhou Road, Qingdao 266071, China Tel: +86 532 8077 8172 | Skype: hymedi Email: machinery@ hymedi. com | Website: www. machinerymachinery. com', 492, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(648, '2019-12-09 23:54:29', '2019-04-18 15:46:45', 'Solicitud Informacion', 'Buenas tardes, Necesitamos presupuesto para alquiler de contenedor tipo Hospitality para un par de eventos que tenemos este mes. ¿Tenéis disponibilidad para la próxima semana? Contenedor + Transporte a Perelló Muchas gracias! Sara C [cid:4__=4EBBF777DFBEA5918f9e8a93df@carrefour.com] SARA CABANÉ RUIZ Field Marketing Manager - East Spain Area Red Bull España S.L. * Torre Espacio - Paseo de la Castellana 259 D, planta 32 * Madrid 28046 Spain T:+34 91 728 10 00 - 683 158 257 sara.cabane@redbull.com * www.redbull.com TO LEARN MORE ABOUT HOW RED BULL GIVES YOU WINGS, PLEASE VISIT www.redbull.com', 493, 'VCONT', 4, 'NOGEST', 'EMAIL'),
