	(650, '2019-12-09 23:54:29', '2019-04-20 11:12:10', 'Petición presupuesto casetas para Repsol Petróleo Tarragona', 'Buenos días, Una vez consultada su página web, solicitamos oferta de alquiler de casetas para Repsol Petróleo en Tarragona que se adapten más o menos a las siguientes características: - 1 x MÓDULO 15 m² DIAFANO - Caseta Comedor sin mobiliario Equipamientos : 1 AIRE ACONDICIONADO VENTANA 1 EXTINTOR POLVO 6KG 2 PERSIANA - 1 x MÓDULO 15 m² DIAFANO - Caseta Vestuario con mobiliario Equipamientos : 1 AIRE ACONDICIONADO VENTANA 1 EXTINTOR POLVO 6KG 2 PERSIANA 2 BANCO VESTUARIOS 4 TAQUILLAS (2 puertas x unidad) - 1 x MÓDULO 15 m² DIAFANO - Caseta Oficina con mobiliario para 2 puestos de trabajo Equipamientos : 1 AIRE ACONDICIONADO VENTANA 1 EXTINTOR POLVO 6KG 2 PERSIANA 2 SILLON GIRATORIO CON RUEDAS 2 SILLON CONFIDENTE 2 MESA DESPACHO 2 CAJONERA - 1 x CONTENEDOR STORAGE 20 ft CIERRE SEG - 1 x ASEO ECOLÓGICO (1.20x1.20) - 1 x MÓDULO 5 m² SANITARIO 2.50 INCLUIR SERVICIOS DE LIMPIEZA Y TRANSPORTES PERIODO DE ALQUILER: 5 MESES ---------------------------------------------------------------------------- ------------------------------------------------- logo COC SIN NADA ,logo COC SIN NADA CONSTRUCCIONES OCAÑA CAÑAS, S.L. Polígono Industrial Sepes. Parcela 703 13500 Puertollano (Ciudad Real) Telf. 926 44 19 08 Fax. 926 42 12 95 Pedro González Romero - 635 640 414 Departamento Técnico E-Mail: tecnico@cocsl.es Web: www.cocsl.es Q Antes de imprimir este mensaje, por favor compruebe que es necesario. Proteger el Medio Ambiente es cuestión de TODOS. Usted queda informado y acepta expresamente la incorporación de sus Datos Personales a los ficheros automatizados denominados OUTLOOK, del cual es titular y responsable la entidad CONSTRUCCIONES OCAÑA CAÑAS, S.L. Usted queda informado y consiente expresamente al tratamiento automatizado de sus Datos Personales, siendo las finalidades de este tratamiento la gestión de comunicaciones electrónicas. Usted podrá ejercitar los de