	(651, '2019-12-09 23:54:29', '2019-04-20 13:13:00', 'LLOGUER CONTAINERS', 'Bon dia Eduard, Necessitaria preu i disponibilitat pel lloguer de 4 x 40\'. El mes probable es que els necessitessim per finals de la setmana que ve. Parlem dimarts. Pere Collell Riera Agency and operations department tel.: +34-972314400 mob.: +34-630020599 www.fribera.es En cumplimiento de la L.O. 15/1.999 de Protección de Datos de Carácter Personal, le informamos que su dirección de correo electrónico y los datos personales facilitados por usted se han incorporado al fichero del que es Responsable FELIX RIBERA E HIJOS, S.A., La finalidad de los datos incorporados a dicho fichero es la de permitir futuras comunicaciones derivadas de la relación profesional iniciada. Podrá ejercitar sus derechos de acceso, rectificación, cancelación y oposición en la sede del Responsable del Fichero: C/ Pagés Ortiz, 94 - 17230 Palamós (Girona). Este correo electrónico puede contener información privada y estrictamente confidencial. Si Usted no es el destinatario del presente mensaje, no está autorizado a leerlo, retenerlo o difundirlo, en virtud de la legislación vigente. En compliment de la L.O. 15/1.999 de Protecció de Dades de Caràcter Personal, li informem que la seva adreça de correu electrònic i les dades Personals facilitades per vostè s\'han incorporat al fitxer del que és responsable FELIX RIBERA E HIJOS, S.A.., La finalitat de les dades incorporades a aquest fitxer és la de permetre futures comunicacions derivades de la relació professional iniciada.Podrà exercitar els seus drets d\' accés, rectificació, cancel.lació i oposició a la seu del Responsable del fitxer: C/ Pagés Ortiz, 94-17230-Palamós(Girona).Aquest missatge pot contenir informació privada i estrictament confidencial. Si vostè no és el destinatari d`aquest missatge, no està autoritzat a llegir-lo, retenir-lo o divulgar-lo, en virtud de la legistació vigent. In pursuance of the protection data law L.O. 15/1999, be informed that your e-ma