	(652, '2019-12-09 23:54:29', '2019-04-20 14:04:32', 'contenedores marítimos', 'Buenos días, estoy interesado en realizar un proyecto de vivienda utilizando contenedores marítimos nuevos 40 HC open side, pero sin las puertas dado que se acoplarían lateralmente para dar mayor espacio interior. Al estar apoyado únicamente en sus extremos que distan 12 metros, la rigidez del suelo del contenedor es importante. La elección del Open Side se basa en que supongo tiene mayor rigidez que el estándar DV. Dada su experiencia en la transformación para usos diversos de estos contenedores, les ruego me confirmen si podría emplear ese modelo de contenedor apoyado solo en sus extremos y cual sería su coste nuevo, considerando que no habría que instalarle sus puertas laterales ni frontales. Muchas gracias por su atención. Saludos.', 497, 'VCONT', 3, 'NOGEST', 'EMAIL'),
