	(655, '2019-12-09 23:54:29', '2019-04-21 20:31:58', 'Precios contenedor almacenaje ', 'Busco contenedor para almacenaje de maquinaria agrícola. He visto que tienen mode especiales para almacenaje, y también me gustaría saber si tienen ofertas de contenedores maritimos de segunda mano que pudieran servir.\r\nEl lugar a transportar sería provincia de Alicante. \r\nMuchas gracias ', 500, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(656, '2019-12-09 23:54:29', '2019-04-22 11:57:33', 'Informacion y presupuesto', 'Hola mi nombre es Lorenzo Padilla CEO de la empresa PEI PADIMAR SL ubicada en Almeria, actualmente estamos envueltos en un proyecto de viviendas modulares para la Republica Democratica del Congo, por ese motivo estaria muy interesado en poder tener mas informacion de las viviendas que ustedes construyen.\r\n\r\nEspero sus comentarios.\r\n\r\nUn saludo ', 501, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(657, '2019-12-09 23:54:30', '2019-04-22 12:48:17', 'Solicitud Informacion', 'Empresa: Comercial Sistemas Lineales, S.L. (CSL) Telefono: 913028332 Comercial Sistemas Lineales, S.L. C/Caleruega nº 18 28033 – Madrid ESB80259104 Buenos dias, Somos una empresa de Suministros Industriales de Madrid. El motivo de contactar con Vds. es que hemos mantenido una reunion con uno de nuestros clientes habituales ya que tienen la intencion de comprar un contenedor de 30 m3 para guardar materiales para su futuro uso. En principio no necesitan homologacion contra incendios. Lo unico que me solicitan es que este contenedor tenga los anclajes necesarios para poder ser levantado por grua y con puesta/s en los extremos. Les rogaria me facilitaran documentacion tecnica de los modelos que puedan satisfacer estas necesidades y presupuesto. Esperando contestacion, reciban un cordial saludo. Jorge Gomez. cslsl@cslsl.com www.cslsl.es Tlf: 913028332 Le informamos que sus datos personales, que puedan constar en esta comunicación, están incorporados en un fichero bajo nuestra responsabilidad, con la finalidad de RECURSOS HUMANOS; GESTIÓN DE CLIENTES, CONTABLE, FISCAL Y ADMINISTRATIVA. Si desea ejercitar sus derechos de acceso, rectificación, cancelación u oposición, según el Art. 15 y siguientes de la Ley Orgánica 15/1999, de 13 de Diciembre, de protección de datos de carácter personal; puede dirigirse por escrito a COMERCIAL SISTEMAS LINEALES, S.L., con domicilio en C/ CALERUEGA, 18 - 2º C 28033 MADRID (MADRID), o vía correo electrónico a cslsl@cslsl.com con el asunto: Datos Personales. El contenido de este correo electrónico y sus anexos son estrictamente confidenciales. En caso de que no sea el destinatario y haya recibido este mensaje por error, agradecemos que lo comunique inmediatamente al remitente, sin difundir, almacenar o copiar su contenido. La difusión por cualquier medio del contenido de este correo podría ser sancionada conforme lo previsto a las leyes españolas. No se autoriza la utilización con fines comerciales o para su incorporación a ficheros automatizados de las direcciones del emisor o del destinatario.', 502, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(658, '2019-12-09 23:54:30', '2019-04-22 15:51:58', 'Venta Módulos y Casetas', 'Buenos días.\r\n\r\nEstoy interesado y quisiera recibir más información de la oferta [Módulo prefabricado / caseta de obra OFI 66 - Venta desde 1.950€ - ZARCA].\r\n\r\nhay alguna manera de rebajar el precio por la compra de dos unidades?\r\n\r\nal ser modulares, se podrían unir dos módulos de alguna manera?\r\n\r\nMuchas gracias.', 396, 'VCONT', 4, 'NOGEST', 'EMAIL'),
