	(660, '2019-12-09 23:54:30', '2019-04-22 18:47:24', 'Solicitud Informacion', 'Buenas tardes, Estoy buscando una caseta de entre 25 y 30 m2 con uno de los frentes en cristal. Completamente diáfana. Quizás con la posibilidad de un pequeño aseo en una esquina. Equipada con a/a frio calor. Estoy interesada en comprar, aunque dependiendo del presupuesto, no descarto el alquiler. Sería para instalarla en Ceceda (Madrid). Quedo a la espera de sus comentarios. Un saludo. Elisa Tcach', 503, 'VCONT', 4, 'NOGEST', 'EMAIL'),
