	(670, '2019-12-09 23:54:31', '2019-04-23 11:31:00', 'GPS control de flota para ZARCA S.L.', 'Hola, Mi nombre es María Gómez y pertenezco a FlotaGPS , una empresa que ofrece a las compañías la capacidad de controlar cómo sus empleados actúan en la carretera a la vez que aumenta la productividad del quipo. Quiero ayudarle a entender mejor la industria del control de flotas GPS y ofrecerle las mejores tarifas de servicio. Los puntos clave a tener en cuenta: • Las estadísticas muestran que millones de euros se pierden cada año en España debido a la disminución de la productividad del personal. • La gestión de combustible de la flota reduce el consumo de combustible y también aumenta la capacidad de asignar de manera eficiente su flota utilizando puntos de referencia y posicionamiento en tiempo real. Incluso si usted ya tiene una fuente para la localización de flotas GPS, es bueno saber cuáles son sus opciones ya que constantemente aparecen alternativas nuevas y más avanzadas. Nuestro sitio web le mostrará las opciones más actuales con los mejores descuentos ofrecidos por los proveedores de software de GPS de gran reputación nacional. Necesitaremos la siguiente información para preparar un presupuesto o propuesta: * ¿Cuántos vehículos necesita rastrear? * Nombre de su organización * Nombre y Apellido * Número de teléfono * Ciudad * Dirección * Código postal Le recomiendo que consulte nuestros precios respondiendo a este correo electrónico. Atentamente, María Gómez Maria@es-Flota-GPS.online ES-Flota-GPS Su privacidad es importante para nosotros. No pasaremos sus datos a compañías de terceros sin su expreso permiso. Responder "BAJA", si no desea recibir más mensajes.', 271, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(671, '2019-12-09 23:54:31', '2019-04-23 12:19:12', 'Presupuesto contenedores para baños y vestuarios', 'Buenos días, Queríamos saber si diseñáis soluciones a medida en contenedores. Si es así, nos gustaría solicitar presupuesto para diseñar e instalar en Barcelona: 1. 2 vestuarios (femenino y masculino) de unos 15-20m2 cada uno con: 1. 4 duchas 2. 2 lavabos 3. 1 urinario 2. Un módulo de baños con: 1. 1 urinario femenino + 1 lavabo 2. 1 urinario masculino + 1 lavabo 3. 1 urinario minusválidos Todos los contenedores irían colocados dentro de una nave industrial. El acabado exterior podría ser sencillo, pintado en negro y con alguna ventana para ventilar el interior. Por contra, los acabados interiores serían un poco más exclusivos de lo habitual [image: image.png] Si hacéis este tipo de proyectos, agradeceríamos si pudierais enviarnos una cotización aproximada. Gracias de antemano, *GALLEGO PRADA | Oiane Urra* Communications and Event Manager 934 493 335 · 652 714 244', 509, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(672, '2019-12-09 23:54:31', '2019-04-23 12:23:42', 'RV: SOLICITUD OFERTA CONTENEDOR/ALMACÉN RESIDUOS P.E. FARRAPA', 'Buenos días Reenvío mail de solicitud de oferta, ampliando el plazo para presentación de la misma hasta el 30-04-2019. Espero recibir su mejor oferta lo antes posible. Gracias y saludos Martín Fariña Palleiro Operation&Maintenance Supervisor [Clients:Enel:Design:Artworks:04 Email Signature:logos png:EGP_Logo_Primary_RGB.png] ENEL GREEN POWER ESPAÑA S.L. C/ Enrique Mariñas Romero Periodista, s/n - Edf.Proa, planta 11 15009 A Coruña, Spain +34 699200243 martin.farina@enel.com __________________________________________________________________________________________________________________________________________ Este mensaje está previsto únicamente para el siguiente uso: PÚBLICO - USO INTERNO - CONFIDENCIAL (ALTAMENTE CONFIDENCIAL) - RESTRINGIDO __________________________________________________________________________________________________________________________________________ Este correo electrónico es confidencial y puede contener información privilegiada. Si lo ha recibido por error, está avisado de su estatus. Avísenos de inmediato respondiendo al mensaje de correo electrónico y borre el mensaje de su sistema. No lo copie ni lo use para ningún propósito, ni revele su contenido a ninguna otra persona, a menos que reciba autorización. Cualquier uso malintencionado podría constituir una infracción de confidencialidad. De: Fariña Palleiro, Martin Enviado el: lunes, 01 de abril de 2019 16:28 Para: \'comercial@zarca.es\' Asunto: SOLICITUD OFERTA CONTENEDOR/ALMACÉN RESIDUOS P.E. FARRAPA Buenas tardes Por la presente solicito su mejor oferta económica según el siguiente alcance: o Suministro e instalación en el P.E. Farrapa (abajo detallo dirección y coordenadas) de un contenedor para almacenaje de residuos peligrosos o no y con una superficie útil aproximada a los 15 m2 y 2,5 m de altura. § El contenedor deberá llevar una cubeta de retención instalada para evitar que fugas de los recipientes salgan al exterior del contenedor. § El contenedor deberá incluir un sistema de cierre, considerándose sistema mínimo el cierre mediante candado de seguridad. § El contenedor deberá incluir una rampa de acceso con barandillas antipánico en sus laterales. § El contenedor deberá estar pintado en verde, con el logo de Enel Green Power serigrafiado en blanco (EGPE suministrará al adjudicatario la documentación gráfica que necesite a este respecto). CONDICIONANTES DE LA OFERTA Se ofertará de la siguiente manera: - 1 OFERTA SIN DESGLOSAR, QUE INCLUYA UN ÚNICO PRECIO Y QUE CONTEMPLE, POR ESCRITO, CON CARÁCTER DE MÍNIMOS: o Suministro y transporte hasta la planta. o Descarga, instalación y nivelación del container en el terreno. o Puesta a tierra de las partes metálicas del container. Ante cualquier duda o necesidad de aclaración, por favor, contáctenme en mi email o teléfono. El plazo máximo para presentación de la oferta expira el día 08-04-2019 a las 18:00 DIRECCIÓN P.E. FARRAPA: P.K. 2,9 LU-P-0105 (Desde ALTO DA XESTA hacia A PASTORIZA) C.P. 27738 - ABADÍN - LUGO COORDENADAS SET: HUSO UTM:29 X= 630.740 Y=4.803.083 ETRS 89 43º 22´ 9.23´´ N 7º 23´ 10.70´´ W Saludos Martín Fariña Palleiro Operation&Maintenance Supervisor [Clients:Enel:Design:Artworks:04 Email Signature:logos png:EGP_Logo_Primary_RGB.png] ENEL GREEN POWER ESPAÑA S.L. C/ Enrique Mariñas Romero Periodista, s/n - Edf.Proa, planta 11 15009 A Coruña, Spain +34 699200243 martin.farina@enel.com __________________________________________________________________________________________________________________________________________ Este mensaje está previsto únicamente para el siguiente uso: PÚBLICO - USO INTERNO - CONFIDENCIAL (ALTAMENTE CONFIDENCIAL) - RESTRINGIDO __________________________________________________________________________________________________________________________________________ Este correo electrónico es confidencial y puede contener información 