	(682, '2019-12-09 23:54:32', '2019-04-23 21:02:39', 'Compra de Modulo Prefabricado de Ocasión o contenedor marítimo', 'Hola buenas tardes, estoy interesado en la compra de un modulo prefabricado de ocasión de 6,00 x 2,40 metros, de su sección de ofertas o en caso que no dispongan de ese modelo un contenedor marítimo de 6,00 metros.\r\nCon la posibilidad de su traslado a roses en Barcelona Código Postal 17480.\r\nA la espera de su presupuesto y forma de pago reciban un cordial saludo.\r\nLuis Racero García\r\nGracias de antemano\r\n', 61, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(683, '2019-12-09 23:54:32', '2019-04-23 21:30:53', 'Alquiler Cámara Frigorífica Portátil ', 'Les he mandado hace pocos minutos para que me den precio del alquiler de una cámara frigorífica portátil de 3M pero se me ha pasado pedirle también el precio del transporte hasta Montilla (Córdoba).\r\n\r\nGracias, Saludos', 514, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(684, '2019-12-09 23:54:33', '2019-04-24 00:33:47', 'Venta Contenedores', 'Buenos días.\r\n\r\nEstoy interesado y quisiera recibir más información de la oferta [Container 8\' Segunda Mano - Venta desde 1.250€ - ZARCA] \r\n\r\n... preferably in English!\r\n\r\nWe are looking for a second-hand 8 tot 10ft container in good shape to be transported to a finca near Maella (Aragon). Do you offer transport as well and what are your prices for this? \r\n\r\nMuchas gracias,\r\nDaniel Sterckx\r\n', 515, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(685, '2019-12-09 23:54:33', '2019-04-24 00:33:57', 'Presupuesto', 'Hola, estoy interesado en contenedores de 6 y 8 pies, podría darme precio de unidades usadas y nuevas.\r\nmuchas gracias\r\n\r\nSaludos\r\n\r\nManuel Puras', 516, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(686, '2019-12-09 23:54:33', '2019-04-24 07:52:15', 'Solicitud Informacion', 'Telefono:606246527 Me gustaría informarme sobre sus módulos prefabricados con baño cuya finalidad será una oficina. Atentamente, Marta Calleja', 517, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(687, '2019-12-09 23:54:33', '2019-04-24 08:55:53', 'Fwd: Mensaje', 'Estimados Señores: Tengo el honor de presentarle un producto que se adapta plenamente a las necesidades de su empresa. Nuestro producto le permitirá llegar a nuevos clientes e incrementar de manera inmediata sus ventas. Le presentamos una base de datos de empresas con los datos de contacto de sus dueños y directivos. El catálogo incluye más de un millón de direcciones, y es uno de los mayores en el mercado español. Contiene datos tales como: nombre de la empresa, domicilio social, datos de contacto del dueño, e-mail, teléfono, fax, página web, etc. Puede empezar a usar el catálogo y promocionar sus productos inmediatamente. El retorno de la inversión está garantizado. ¡Lo compra una vez y lo puede usar toda la vida! *** Base de datos de empresas españolas - 1.548.400 registros. - 190.00 € - Sólo hasta el 24/04/2019 Más información en nuestra web: http://www.basededatosdbs.com/?page=catalog Atentamente, GC-Support-Team', 518, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(688, '2019-12-09 23:54:33', '2019-04-24 09:12:35', 'SOLICITUD OFERTA', 'Buenos días Solicitamos presupuesto para el alquiler de una caseta con dos despachos para la obra que vamos a comenzar en Perogordo (Segovia) para una duración mínima de tres meses. Esperamos su mejor oferta. Un saludo Goensa Construcciones Rafael Moreno Administracion administracion@goensaco.es C/ Severo Ochoa Nº9-NAVE 5 28521-RIVAS-VACIAMADRID MADRID TELF: 913486560', 519, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(689, '2019-12-09 23:54:33', '2019-04-24 10:07:02', 'COMPRA', 'Hola, \r\nTeneis contenedores de 40 pies HC usados para la venta? Somos de Barcelona y me interesaria que `presupuestaran ya pusto en Barbera del valles.\r\nDesde ya muchas gracias!!', 520, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(690, '2019-12-09 23:54:33', '2019-04-24 10:44:05', 'Solicitud Informacion', 'Buenos días, Somos una empresa ubicada en San Vicente del Raspeig en Alicante. Estamos buscando un espacio para alquilar con una temperatura entre 4 y 8ºC. Las dimensiones que necesitamos sería para poner dos palets americanos uno encima de otro. El peso sería de unos 1280 kg y las medidas serían 120x100 y la altura entre 218 y 234 cm. También me gustaría saber si en el espacio existe carretilla elevadora para poder moverlos. Quedo a la espera de su pronta respuesta. Gracias de antemano. Un saludo. Mª Carmen Gutiérrez. Tlf: 691381773 Departamento Administrativo administracion@glenbiotech.es — En cumplimiento de la L.O.15/1.999 de Protección de Datos de Carácter Personal, le informamos que su dirección de correo electrónico y los datos personales facilitados por usted se han incorporado al fichero del que es Responsable Glen Biotech, S.L.. La finalidad del fichero es poder mantener futuras comunicaciones por la relación profesional iniciada. Podrá ejercitar sus derechos de acceso, rectificación, cancelación y oposición dirigiéndose para ello por carta certificada al Departamento de Administración: Glen Biotech S.L., Carretera de Agost, Nº 126, 03690 San Vicente del Raspeig, Alicante. Así mismo le informamos que el presente mensaje puede contener información confidencial, siendo para uso exclusivo del destinatario arriba indicado. La recepción del mensaje no autoriza el acceso al contenido del mismo si usted no es el destinatario, por lo que en tal circunstancia deberá destruirlo de inmediato y notificar este extremo al remitente. Así mismo se le informa que está totalmente prohibida cualquier divulgación, distribución o reproducción de este mensaje. Agradecemos su colaboración.', 521, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(691, '2019-12-09 23:54:33', '2019-04-24 11:29:53', 'PRESUPUESTO ALQUILER CONTAINER', 'Buenos Dias, Me han facilitado su contacto desde el centro comercial Value Retail La Roca Village. Tenemos una tienda cita en este mismo centro comercial y por motivo de falta de espacio en nuestro local comercial, requeriremos un container para hacer uso de zona de almacenaje. Lo necesitaremos a partir de la semana del 6 al 12 de mayo. Le agradezco me pase un presupuesto y me informe de cómo proceder para los pagos. Para más información , no dude en ponerse en contacto conmigo. Un cordial saludo, JULIEN-PIERRE CANICIO Retail Manager Iberia BOARDRIDERS Plaza Emili Mira, 4 08022 Barcelona SPAIN m +34 647 903 180 [Email-signature-noncomp (00000002)]', 522, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(692, '2019-12-09 23:54:33', '2019-04-24 12:09:57', 'RV: Tarifa de precios Eurocolor Septiembre 2018', 'Muy Sres. Nuestros: Hola muy buenos dias ,me gustaría poder tener una entrevista con el responsable de compras Gracias - adjunto remitimos tarifa de precios Eurocolor /Orfa Septiembre 2018. Esperando sea de su interés, se despide, atentamente, Miquel Hijazo 647612792 INDUSTRIAS QUÍMICAS EUROCOLOR, S.A. -------------------------------------------------------------------------------- INDUSTRIAS QUIMICAS EUROCOLOR SA, Responsable del tratamiento de sus datos de carácter personal, le informa conforme a lo previsto en el RGPD de 27 de abril de 2016, que recaba y trata sus datos de carácter personal, aplicando las medidas técnicas y organizativas que establece el presente Reglamento con la finalidad de gestionar la relación que le vincula con el Responsable, así como poder remitirle cualquier tipo de comunicación a través de los medios designados al efecto. Usted da, como titular de sus datos, su consentimiento y autorización para dicho tratamiento. Podrá ejercitar los derechos de acceso, rectificación, supresión, limitación, portabilidad y oposición dirigiéndose al Responsable con dirección BARRIO AGUIRRE, 5,ARRIGORRIAGA,48480,BIZKAIA.', 523, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(693, '2019-12-09 23:54:33', '2019-04-24 12:33:08', 'Undelivered Mail Returned to Sender', 'This is the mail system at host dns109243.phdns5.es. I\'m sorry to have to inform you that your message could not be delivered to one or more recipients. It\'s attached below. For further assistance, please send mail to postmaster. If you do so, please include this problem report. You can delete your own text from the attached returned message. The mail system : host relay.profesionalhosting.com[185.92.245.33] said: 550 Your account has been locked. Please contact your administrator. (in reply to end of DATA command)', 155, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(694, '2019-12-09 23:54:33', '2019-04-24 12:48:03', 'Aire Acondicionado SIN Aparato Exterior y SIN obras  - Teknopoint', 'Aire Acondicionado SIN Aparato Exterior y SIN obras - Teknopoint Buenos días, mi nombre es Ana y le escribo para presentarle Teknopoint, estamos especializados en el sector de la climatización con sistemas compactos estéticos que no precisan aparato exterior ni tuberías exteriores ni obras, nos dedicamos a ayudar a nuestros clientes a decidir cual es el sistema de climatización más acorde a sus necesidades de uso. Un sistema perfecto para evitar problemas con las normas de las comunidades de vecinos así como para evitar los condicionantes de la normativa municipal que prohíbe instalar aparatos de aire acondicionado en la fachada de los edificios y locales. Nuestro personal está altamente cualificado y preparado encontrar la solución más idónea y perfecta para su vivienda o negocio. Un acondicionador de aire único que se instala en menos de 2 horas sin apenas obras y sin unidad exterior. Permite la integración de hasta 3 unidades interiores (Splits) o de techo (Cassette). Cuenta con todas las funciones de un climatizador moderno y entre sus principales características, destacan su bajo consumo, baja sonoridad, el ahorro de costes por obras y su alto rendimiento. Además funcionan con el nuevo refrigerante ecológico R32 que proporciona bajo consumo energético. Me gustaría poder hablar con usted y así poder presentarle de forma detallada nuestros productos. Un saludo y muchas gracias por su tiempo. Ana Isabel Departamento de ventas La información contenida en este mensaje y/o archivos adjuntos, enviada desde TeknoPoint, es confidencial/privilegiada y está destinada a ser leída sólo por la(s) persona(s) a la(s) que va dirigida. Le recordamos que sus datos no se almacenarán en nuestro sistema y no se volverán a usar para comunicarnos con ustedes si no es como respuesta a su contacto. Puede ejercer sus derechos siempre y cuando se cumplan los requisitos exigidos por la normativa, acceso, rectificación, limitación de tratamiento, supresión, portabilidad y oposición/revocación, en los términos que establece la normativa vigente en materia de protección de datos, dirigiendo su petición a través de correo electrónico anaisabel@teknopoint.es (anaisabel@teknopoint.es) Si usted lee este mensaje y no es destinatario señalado, el empleado o el agente responsable de entregar el mensaje al destinatario, o ha recibido esta comunicación por error, le informamos que está totalmente prohibida y puede ser ilegal, cualquier distribución o reproducción de esta comunicación, y le rogamos que nos lo notifique inmediatamente y nos devuelva el mensaje original a la dirección arriba mencionada. Puede darse de baja haciendo clic aquí (anaisabel@teknopoint.es) .', 524, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(695, '2019-12-09 23:54:33', '2019-04-24 13:18:26', 'Solicitud Informacion', 'Empresa: Frimorife Telefono: 962571323 Guadassuar, Calle Benifaió nº 44, 46610, Valencia. Buenos días S’s, necesito precio de suministro de un contenedor de 20 pies para realizar un tratamiento de frio/calor específico. Deberá de estar aislado. Gracias por todo; Josep Peris Ferrer Enginyer Industrial Director Tècnic Dpt. Climatització FRIMORIFE SL Phone: +34 96257 1323 , Fax: +34 96257 1307 tecnico@frimorife.com www.frimorife.com Aquest missatge i els fitxers annexos són confidencials. Els mateixos contenen informació reservada que no pot ser difosa. Si vostè ha rebut aquest correu per error, tinga l\'amabilitat d\'eliminar-ho del seu sistema i avisar al remitent mitjançant reexpedició a la seua adreça electrònica; no haurà de copiar el missatge ni divulgar el seu contingut a cap persona. Li recordem que la seua adreça de correu electrònic juntament amb la informació de caràcter personal que ens haja facilitat i ens facilite d\'ara endavant ha sigut incorporada a un fitxer titularitat de FRIMORIFE, SLU la finalitat de la qual és poder mantenir el contacte amb vostè i dur a terme la nostra relació negocial, la gestió administrativa i/o promocional i de prospecció comercial. D\'acord amb el que es disposa en la L.O. 15/1999, de Protecció de Dades de Caràcter Personal, Vosté té dret a exercitar els drets d\'accés, rectificació, cancel·lació, i en el seu cas, oposició, enviant una sol·licitud per escrit, acompanyada d\'una fotocòpia del seu D.N.I. a la següent adreça: Carrer Benifaió, 44 (Pol. Ind.), 46610 Guadassuar (València). Este mensaje y los ficheros anexos son confidenciales. Los mismos contienen información reservada que no puede ser difundida. Si usted ha recibido este correo por error, tenga la amabilidad de eliminarlo de su sistema y avisar al remitente mediante reenvío a su dirección electrónica; no deberá copiar el mensaje ni divulgar su contenido a ninguna persona.Le recordamos 