	(696, '2019-12-09 23:54:33', '2019-04-24 13:51:23', 'Compra de caseta ', 'Hola. Buen día. Trabajo en Proyecto INSERTIUM, un centro especial de empleo para personas con discapacidad intelectual. Trabajamos desde hace 20 años aproximadamente para la empresa CTC de Coslada, en Madrid. En estos momentos contamos con una caseta prefabricada en la que se hacen los cambios de vestuario, se hace el desayuno en las horas de descanso y también se descansa cuando hace mal tiempo. Pero la caseta ya está muy deteriorada y necesitaríamos cambiarla por otra. En este sentido necesitaríamos una caseta de unos 9 metros de frontal por 5 metros de ancho, que estuviera dividida en dos partes, una más grande (de 5 por 5 ) y otra para tener un baño (de 2 por 5) a ser posible con dos/tres separaciones para tazas de baño, una pequeña ducha y tres lavabos. Pero también nos podríamos amoldar a otras estructuras que tuviesen medidas similares. Necesitaríamos saber si ustedes retirarían la caseta vieja y colocarían la nueva, o cómo harían. La verdad es que no tenemos experiencia en esto y necesitaríamos su asesoramiento. Y finalmente cual sería el presupuesto de todo esto. No sé si me he explicado bien, pero ante cualquier duda les pediría me llamasen y mejor les explico hablado. Pues de momento eso es todo. Les agradezco su atención y quedo a la espera de su respuesta. Gracias. Saludos y que tengan un buen día. Juan Carlos Velázquez', 526, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(697, '2019-12-09 23:54:33', '2019-04-24 13:51:24', 'Compra de caseta ', 'Hola. Buen día. Trabajo en Proyecto INSERTIUM, un centro especial de empleo para personas con discapacidad intelectual. Trabajamos desde hace 20 años aproximadamente para la empresa CTC de Coslada, en Madrid. En estos momentos contamos con una caseta prefabricada en la que se hacen los cambios de vestuario, se hace el desayuno en las horas de descanso y también se descansa cuando hace mal tiempo. Pero la caseta ya está muy deteriorada y necesitaríamos cambiarla por otra. En este sentido necesitaríamos una caseta de unos 9 metros de frontal por 5 metros de ancho, que estuviera dividida en dos partes, una más grande (de 5 por 5 ) y otra para tener un baño (de 2 por 5) a ser posible con dos/tres separaciones para tazas de baño, una pequeña ducha y tres lavabos. Pero también nos podríamos amoldar a otras estructuras que tuviesen medidas similares. Necesitaríamos saber si ustedes retirarían la caseta vieja y colocarían la nueva, o cómo harían. La verdad es que no tenemos experiencia en esto y necesitaríamos su asesoramiento. Y finalmente cual sería el presupuesto de todo esto. No sé si me he explicado bien, pero ante cualquier duda les pediría me llamasen y mejor les explico hablado. Pues de momento eso es todo. Les agradezco su atención y quedo a la espera de su respuesta. Gracias. Saludos y que tengan un buen día. Juan Carlos Velázquez', 526, 'VCONT', 4, 'NOGEST', 'EMAIL'),
