	(699, '2019-12-09 23:54:34', '2019-04-24 15:58:26', 'PRESUPUESTO AURO', 'Buenas tardes, Me pongo en contacto con vosotros para pedir presupuesto sobre el módulo de vigilancia SEGU22 y el módulo de oficina OFI44L, tanto la venta como alquiler visto en vuestra página web. Sería para tenerla en una pequeña explanada con una persona dentro vigilando desde ahí, 24h del día. Si tenéis algo que pueda amoldarse a esto, estamos dispuestos a escucharlos. Gracias, -- *AVISO LEGAL: Este mensaje y su contenido está dirigido únicamente a su destinatario y es confidencial. Por ello, se informa a quien lo reciba por error o tenga conocimiento del mismo sin ser su destinatario, que la información contenida en él es reservada y su uso no autorizado; por lo que, en tal caso, le rogamos nos lo comunique por la misma vía o por teléfono (666.663.036); así como, que se abstenga de reproducir el mensaje mediante cualquier medio o remitirlo o entregarlo a otra persona, procediendo a su destrucción de manera inmediata. AURO NEW TRANSPORT CONCEPT, S.L. se reserva las acciones legales que le correspondan contra todo tercero que acceda de forma ilegítima al contenido de cualquier mensaje externo procedente del mismo. *', 528, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(700, '2019-12-09 23:54:34', '2019-04-24 16:56:03', 'Contenedor OS 20` Novo ( porta 4 hojas + porta topo 2 hojas Direcha', 'Buenas tardes Ex. mo Sr CARLOS ZARCA Somos una empresa Portuguesa de OPORTO e pedimos oferta de Venta de contenedor de 20`OS nuevo como Foto junto. Qual precio con transporte pra 1 unidad. ( Si tienes DV no és necessário HC ) Aguardo contestacion, Saludos cordiales Atentamente, [image: Comod, Lda] João Pires CEO | Comod, Lda | General Manager M: 936 992 788 P: 252 692 282 E: geral.comod@gmail.com A: Rua Senhora do Alívio - Rega, Estela www.comod.pt Declaração: A informação contida nesta mensagem, e os ficheiros anexos, é privilegiada e confidencial, destinando-se exclusivamente ao(s) destinatário(s).Se não é o destinatário (ou o responsável pela sua entrega ao destinatário) e recebeu a mesma por engano, fica notificado que é estritamente proibido reproduzir, guardar ou distribuir toda ou qualquer parte desta mensagem e ficheiros anexos. Por favor reencaminhe a mensagem para o responsável pelo seu envio ou contacte-nos por telefone e elimine a mensagem e ficheiros anexos do seu computador, sem os reproduzir. [image: Imagem relacionada] Proteja o Ambiente. O Planeta agradece.', 529, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(701, '2019-12-09 23:54:34', '2019-04-24 17:57:50', 'Caseta SER', 'Hola, Nos gustaría un presupuesto para la caseta adjunta. Las medidas son 6,20 largo x 3,00 ancho x 2,40 de alto y tienen que incluir candados de seguridad y aire acondicionado. La decoración externa con césped artificial la haremos nosotros. Esto sería para una entrega el 24 de mayo así que tenemos que saber si es factible en tiempos también? Muchas Gracias Tim [firma-Tim-2018] En cumplimiento de lo dispuesto en la Ley Orgánica 15/1999 de Protección de Datos de Carácter Personal (LOPD), le comunicamos que su dirección de correo electrónico forma parte de una base de datos gestionada bajo la responsabilidad de QUATTROCENTO DISEÑO, S.L, con la única finalidad de solicitarle o prestarle nuestros servicios en su condición de proveedor, cliente, o porque nos ha solicitado información. Puede ejercer su derecho de acceso, rectificación, supresión y portabilidad mediante carta a QUATTROCENTO DISEÑO S.L, C/ Mar de Omán nº 8, 2ª-27, 28033 Madrid. Este correo y cualquier archivo adjunto son de uso exclusivo de sus destinatarios, quedando prohibidos cualquier comunicación, divulgación o reenvío tanto del mensaje como de su contenido. Si lo recibiera por error, por favor, notifíquelo al remitente y proceda a eliminarlo de su sistema.', 530, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(702, '2019-12-09 23:54:34', '2019-04-24 19:01:48', 'Contenedores usados', 'Necesito un presupuesto de un contenedor usado de 20\'. No importa estado. La utilidad será para un almacén dentro de un local. También nos gustaría saber si os encargáis del transporte y la colocación del contenedor dentro del local. Este local tiene las medidas suficientes para que sea introducido sin dificultad de espacio. No nos importa estado, solo que se pueda adquirir a un buen precio. Gracias', 531, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(703, '2019-12-09 23:54:34', '2019-04-24 20:47:44', 'Solicitar Presupuesto', 'Buenos días, Estoy creando un proyecto y necesito precio de compra de los siguiente elementos, he visto vuestra web y creo que podrían disponer de ellos: * Contenedor de 20? OPEN SIDE, ALTURA ESTANDAR.. * Contenedor almacén de 10? ESTANDAR * Módulo Sanitario con baño para personas discapacitadas Desde ya muchas gracias, les dejo mi móvil por si desean hacerme alguna consulta. Saludos cordiales, Marcelo Varela 670716567', 532, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(704, '2019-12-09 23:54:34', '2019-04-24 23:13:52', 'Vivienda unifamiliar con contenedores marítimos', 'Hola soy Ana, estoy dándole vueltas a la idea de hacer una casa con contenedores marítimos y estoy viendo las opciones que tengo. En su web aparece que ustedes realizan transformación de contenedores y a su vez también hacen casas prefabricadas. En el caso de querer hacer una casa con contenedores, ¿realizarían ustedes el diseño? o ¿únicamente se encargarían de la transformación y transporte una vez obtenido el diseño? Un saludo Ana', 533, 'VCONT', 4, 'NOGEST', 'EMAIL'),
