	(707, '2019-12-09 23:54:34', '2019-04-25 10:51:23', 'Solicitud presupuesto', 'Buenos días, Para solicitarle presupuesto de alquiler mensual para: * 1 Caseta de obra. Dimensiones aprox. 6x3. Posibilidad de separación interior en dos espacios independientes. * 1 Baño químico Para la zona de Ejea de los Caballeros (Zaragoza) Un saludo Juan Maeso Martínez-Carrasco Director de Proyecto Email: jmaeso@globalsic.es Teléfono: (+34) 669 188 138 www.globalsic.es --------------------------------------------- --- Este correo electrónico ha sido comprobado en busca de virus por AVG. http://www.avg.com', 535, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(708, '2019-12-09 23:54:34', '2019-04-25 11:38:56', 'Solicitud de presupuesto para 4 contenedores de 12 m', 'Buenos días: Os escribo desde una agencia de Madrid, necesitamos adquirir en compra 4 contenedores para exterior de aprox 12 m medianamente acondicionado (luz y A/A, no es necesario toma de agua) y con ventanas a modo de oficina. Uno de ellos debería de tener una terraza en la parte superior (algo parecido a la foto que os adjunto). Seria posible que me enviarais un aproximado del coste que supondría esto entregado en Madrid Capital? cid:image001.png@01D4FB58.D8DE7B20 Mil gracias. Montse Descripción: cid:image001.jpg@01D333A1.125C33A0 Descripción: cid:image002.jpg@01D333A1.125C33A0', 536, 'VCONT', 3, 'NOGEST', 'EMAIL'),
