	(713, '2019-12-09 23:54:34', '2019-04-25 16:41:37', 'SIXT VLC. Solicitud de presupuesto', 'Buenos tardes, Me pongo en contacto con ustedes ya que estoy buscando un proveedor de casetas modulares. He visto en vuestra web el siguiente modulo Oficina Acristalada Gris (3m Ancho y 6 m de largo). [cid:image003.png@01D4FB85.BDAD9980] Solicito presupuesto para una igual con las siguientes características. -Exterior color naranja ral 2004. Interior blanco. -Aire acondicionado. -Pantallas leds. -Altura libre interior 2,70 m. -Instalación en Valencia. -Rampa de acceso con descansillo. Seria similar como el siguiente ejemplo: [cid:image002.png@01D4FB85.89256B20] Gracias, un saludo. [Sixt Logo] [XXMAREAL-620_500x150 Murcia AP] Francisco Espín Junior Manager Facility and Turnaround E-Mail: francisco.espin@sixt.com Mobile: +34 617 740 340 Sixt Rent a Car, S.L.U. ? C/del Canal de Sant Jordi, 29 Local 2 Pol. Son Oms ? 07610 Palma de Mallorca Registro Mercantil de Mallorca Torno 1641, Folio 157, Hoja PM-31.771 Conselleria de Foment del Govern Balear C.I.F. B07947591 La información contenida en el presente mensaje es confidencial y únicamente el destinatario está autorizado a leerla. Queda prohibida la reproducción, publicación, divulgación, total o parcial del mensaje, así como el uso no autorizado por el emisor. Si este mensaje le hubiera llegado por error, elimínelo y notifique inmediatamente al remitente. Gracias por su colaboración.', 540, 'VCONT', 4, 'NOGEST', 'EMAIL'),
