	(723, '2019-12-09 23:54:43', '2019-04-26 10:28:33', 'Presupuesto espacio en un colegio', 'Buenos días, mi nombre es Jorge y soy el Director del CEIP Odón de Buen de Zuera. En estos momentos estamos valorando la posibilidad de incorporar a nuestras instalaciones un espacio que nos permite desarrollar actividadaes de estimulación sensorial y no podemos hacerlo en las instalaciones del colegio pues no tenemos espacios libres. Las características de este espacio serían las siguientes: - Unos 40 m2 aproximadamente para niños de 3 hasta 8 años. - Espacio diáfano, sin habitaciones, y con un par de ventanas sería suficiente pues solemos tapar las paredes y ventanas para tenerlo siempre en penumbra. - No es estrictamente necesario un baño pero podíamos pedir presupuesto con y sin él. - Un sistema de calor y ventilación. - Un adecuado aislamiento. Muchas gracias de antemano. Esperamos su respuesta. Un saludo, Jorge. C.E.I.P.ODON DE BUEN C/ JorgeLuna, 15 ZUERA -ZARAGOZA Telf yfax. 976 680114 Email:cpzuera@educa.aragon.es Web: http://cpodondebuen.wixsite.com/inicio', 550, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(724, '2019-12-09 23:54:43', '2019-04-26 13:17:28', 'Presupuesto módulo prefabricado.', 'Buenas tardes,\r\n\r\ncontactaba con ustedes para pedir presupuesto de un módulo prefabricado.\r\n\r\nQuería unas medidas similares a un contenedor de 40 pies, lo que hacen unos 28 metros cuadrados.\r\n\r\nSegún lo que he visto en el apartado de productos, lo que se asemejaría serían 2 módulos prefabricados "OFI66" ensamblados a lo largo.\r\n\r\nNecesitaría que además de las ventanas que llevan normalmente, tuviera una ventana en uno de los lados menores.\r\n\r\nPor último, quería conocer si el presupuesto incluye:\r\n\r\n-Transporte.\r\n-Instalaciones (electricidad, redes...).\r\n-Mobiliario.\r\n\r\nGracias.\r\nUn saludo.', 551, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(725, '2019-12-09 23:54:43', '2019-04-26 13:36:49', 'RE:  Solicitud de presupuesto para 4 contenedores de 12 m', 'Hola de nuevo: Pudisteis ver mi email? Me urge tener un aprox del presupuesto. Gracias. Montse De: Pandemonium Marketing [mailto:comercial@pandemonium.es] Enviado el: jueves, 25 de abril de 2019 11:39 Para: \'comercial@zarca.es\' Asunto: Solicitud de presupuesto para 4 contenedores de 12 m Buenos días: Os escribo desde una agencia de Madrid, necesitamos adquirir en compra 4 contenedores para exterior de aprox 12 m medianamente acondicionado (luz y A/A, no es necesario toma de agua) y con ventanas a modo de oficina. Uno de ellos debería de tener una terraza en la parte superior (algo parecido a la foto que os adjunto). Seria posible que me enviarais un aproximado del coste que supondría esto entregado en Madrid Capital? cid:image001.png@01D4FB58.D8DE7B20 Mil gracias. Montse Descripción: cid:image001.jpg@01D333A1.125C33A0 Descripción: cid:image002.jpg@01D333A1.125C33A0', 536, 'VCONT', 4, 'NOGEST', 'EMAIL'),
