	(728, '2019-12-09 23:54:43', '2019-04-26 15:50:23', 'Oferta - Lloguer casetes', 'Bona tarda, Us escric des de la UTE TES (Valoriza i Romero Polo) que estem realitzant l\'ampliació de l\'abocador de Montoliu de Lleida (Lleida) i necessitaríem que ens ofertessiu per unes casetes que hem d\'ubicar al recinte. Necessitem ubicar dos casetes: * Una per fer la funció de menjador * Una altra per fer la funció de vestuari amb wc i dutxa Havíem pensat que les dos fessin 6m x 2.5m, seria possible? Ens podeu ofertar el lloguer d\'aquestes casetes i el seu transport (de portar i recollir-les)? Especifiqueu també el mètode de pagament. Si teniu algun dubte us podeu posar en contacte amb mi. Moltes Gracies i bon cap de setmana. Rosalia Cervós Cap de Producció Divisió de Construcció 637 21 78 82 -------------- [cid:image001.jpg@01D487E3.60472BF0] rcervos@romeropolo.com C/ Comerç 2 - 25007 LLEIDA 973 22 89 60 romeropolo.com Aquest missatge pot contenir informació confidencial. Si vostè no n\'és el destinatari, si us plau, esborri\'l i faci\'ns-ho saber immediatament. No el reenviï ni en copiï el contingut, ja que està sotmès a secret professional i la llei en prohibeix la divulgació. Si la seva empresa no permet rebre missatges d\'aquesta mena, per favor, faci\'ns-ho saber immediatament. El correu electrònic via Internet no permet assegurar la confidencialitat dels missatges que s\'envien, ni que es rebin íntegrament ni tampoc que la recepció sigui correcta. ROMERO POLO no assumeix cap responsabilitat per aquestes circumstàncies. Si el destinatari d\'aquest missatge no consent la utilització del correu electrònic via Internet i la gravació de missatges, li preguem que ens ho comuniqui immediatament. P Abans d\'imprimir aquest e-mail pensi bé si és necessari fer-ho. El medi ambient és cosa de tots.', 554, 'VCONT', 3, 'NOGEST', 'EMAIL'),
