	(743, '2019-12-09 23:54:44', '2019-04-29 08:42:33', 'Solicitud Informacion', 'Hola; Necesitaríamos presupuesto desglosado de campamento de obra, en alquiler 10 meses (módulos, mobiliario y oficinas) de esta serie de módulos con estas prestaciones. Modulo A; .-Compuesto de 2 módulos de 2,4x6 metros, cuyo interior contenga de 2 oficinas y una sala de reuniones. Cada oficina dispondrán; mesa, estantería, taquilla y varias sillas, una de ellas de oficina. Sala de reuniones dispondrá de mesa y 6 sillas. Modulo B; .-Compuesto de 1 módulos de 2,4x6 metros, cuyo interior contenga de 2 oficinas. Cada oficina dispondrán; mesa, estantería, taquilla y varias sillas, una de ellas de oficina. Modulo C; .-Compuesto de 1 módulos de 2,4x6 metros, cuyo interior contenga una sala de reuniones. Sala de reuniones dispondrá de 2 estanterías, mesa y sillas para 14 personas. Modulo D; .-Compuesto de 3 módulos de 2,4x6 metros, cuyo interior contenga de 2 oficinas aisladas y en resto de espacio 3 puestos de trabajo de oficina. Cada oficina dispondrán; mesa, estantería, taquilla y varias sillas, una de ellas de oficina. Modulo E; .-Compuesto de varios WC y lavabos para las necesidades de 15 personas aprox. Modulo; .-Modulo de pequeño de vigilancia. Un saludo. Celestino', 565, 'VCONT', 4, 'NOGEST', 'EMAIL'),
