	(745, '2019-12-09 23:54:44', '2019-04-29 10:14:45', 'RE: Consulta Contenedor', 'De: Rodrigo Pigem [mailto:rpigem@vitaqua.es] Enviado el: miércoles, 17 de abril de 2019 16:52 Para: \'comercial@zarca.es\' Asunto: Consulta Contenedor Buenas tardes Estamos buscando para su adquisición un contenedor o caseta de obra de 20\' con apertura lateral y aislado térmicamente. Si fuese un módulo de caseta con apertura lateral, nosotros ya veríamos cómo colocar las puertas. ¿Ustedes puedes suministrar este tipo de elemento? Muchas gracias Un cordial saludo Rodrigo Pigem rpigem@vitaqua.es Calle Enrique Granados 99-101, Entlo. 1ª 08008 Barcelona Telf: 93 410 46 78 Fax: 93 322 87 12 www.vitaqua.es _____ Confidencialidad: Este correo electrónico puede contener información estrictamente confidencial y es de uso exclusivo del destinatario, quedando prohibida a cualquier otra persona su revelación, copia, distribución o el ejercicio de cualquier acción relativa a su contenido. Si ha recibido este correo electrónico por error, por favor contacte al remitente, y posteriormente proceda a borrarlo de su sistema. Gracias por su colaboración. Por favor considere su responsabilidad con el medio ambiente antes de imprimir este correo. _____', 485, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(746, '2019-12-09 23:54:44', '2019-04-29 11:41:01', 'Precio contenedor marítimo 8 pies', 'Buenos días En nombre de un cliente les agradecería saber el precio de alquilar su contenedor marítimo 8 pies: https://www.zarca.es/productos/contenedor-maritimo-de-8-pies/ El presupuesto debería ser para 1 contenedor: -Alquiler por unas 3 semanas -Transporte hasta Cornellà de Terri (Girona) y recogida O alternativamente 2 contenedores: -Alquiler por unos 11 días -Transporte hasta Cornellà de Terri (Girona) y recogida En espera de su pronta respuesta, reciban un cordial saludo Gracias Eva Perendreu-Mata, MSc Senior Scientist- Efficacy specialist-Biocides Exponent International Limited The Lenz, Hornbeam Business Park; Harrogate, North Yorkshire, HG2 8RE; UK * Mobile: +34 648 009394 Skype: eva.perendreu_exponent Email eperendreu-mata@exponent.com * Personal Bio http://www.exponent.com/eva_perendreu-mata www.exponent.com Meet Exponent at: IUPAC International Congress in conjuntion with the ECPA and ISCP, 19-24 May 2019, Ghent, Belgium. Visit us at booth 35 or contact Rob Mason (rmason@exponent.com), Nell Townsend (ntownsend@exponent.com) or Caroline Harris (charris@exponent.com) to arrange a meeting. The Chemical Watch Biocides Symposium on 23 -24 May 2019 in Rome, Italy, chaired by Dr. David Dillon. Please contact David Dillon (ddillon@exponent.com), Gwen Fraser (gfraser@exponent.com) or Eva Perendreu-Mata (eperendreu-mata@exponent.com) to arrange a meeting. SETAC Europe annual meeting in Helsinki, 26 - 30 May (Booth No. 2 in the Exhibition Hall). Please contact Martin Vaughan (mvaughan@exponent.com) or Denis Weber (dweber@exponent.com) to arrange a meeting. Exponent\'s Chemical Regulation and Food Safety Group in Europe continues to expand. We now have staff based in China able to assist with biocide, pesticide, industrial chemical, cosmetic and food contact material, regulatory enquiries and registrations in Asia. For further details on our capabilities, please contact Selina