	(751, '2019-12-09 23:54:44', '2019-04-29 16:13:29', 'Presupuesto contenedor 20 pies', 'Buenos días.\r\n\r\nEstoy interesado y quisiera recibir más información de la oferta [Contenedores marítimos 20\' Ocasión Pintado]. se puede elegir el color? nos interesaría en verde o blanco.\r\n\r\nMuchas gracias.', 570, 'VCONT', 4, 'NOGEST', 'EMAIL'),
