	(754, '2019-12-09 23:54:44', '2019-04-30 09:56:20', 'Buenos dÃ­as', 'Buenos días. Tengo el honor de presentarle un producto que se adapta plenamente a las necesidades de su empresa. Nuestro producto le permitirá llegar a nuevos clientes e incrementar de manera inmediata sus ventas. Con el objetivo del aumento inmediato de las ventas de sus productos y el incremento del número de visitas a su página web, hemos preparado un catálogo que contiene una lista de clientes potenciales.?? Todos los catálogos son específicos para sectores concretos. La selección de los sectores y clientes objetivo es extremadamente sencilla. La aplicación especial que incluimos gratuitamente permite elegir sectores y subsectores.?? Contiene datos tales como: nombre de la empresa, domicilio social, datos de contacto del dueño, e-mail, teléfono, fax, página web, etc. Puede empezar a usar el catálogo y promocionar sus productos inmediatamente. El retorno de la inversión está garantizado. ¡Lo compra una vez y lo puede usar toda la vida! ---- Base de datos de empresas españolas - 1.548.400 registros. - 190.00 € - Sólo hasta el 30/04/2019 ---- Más información en nuestra web: http://www.globalmarketing-es.top/?page=catalog Atentamente, GC-Team Juan Andrés Marion', 385, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(755, '2019-12-09 23:54:44', '2019-04-30 10:42:26', 'Via Maris Salou', 'Buenos días, Estamos estudiando la obra de referencia y necesitamos, a los tres meses de empezar la obra la colocación de los módulos necesarios para "construir" el piso muestra. 5.- SHOW-ROOM La oferta presentada incluye la realización de un show-room completo según tipología de la vivienda 3B (90 m2 - ver ANEXO 3), mediante elementos prefabricados que deberá estar ejecutado durante los 3 meses siguientes de la firma del acta de inicio de las obras. Este show-room, será el piso totalmente completo, según tipología anterior, incluso todos los elementos exteriores, fachada, carpintería exterior, pavimento, barandilla, jardinera incluso voladizo superior. Adjunto plano de la tipología de vivienda para ver si es posible hacerlo con vuestro módulos. Muchas gracias, por favor, para cualquier duda llámame y lo comentamos. Saludos, [VIAS 2011 med] Annabel Martín Tècnic Estudis Delegació Catalunya i Aragón Tel: 93.415.31.61 Fax: 93.217.24.23', 573, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(756, '2019-12-09 23:54:44', '2019-04-30 11:49:16', 'Venta Módulos y Casetas', 'Buenos días.\r\n\r\nEstoy interesado y quisiera recibir más información de la oferta [Módulos Prefabricados Ocasión de 6,00 x 2,40 metros - Venta desde 2.150€ - ZARCA].\r\n\r\nMuchas gracias.', 574, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(757, '2019-12-09 23:54:44', '2019-04-30 12:24:52', 'PRESUPUESTO CONTAINER', 'Buenos días, Necesitaríamos por favor un presupuesto de un container y de su instalación en el centro comercial de la Roca del Vallés "La Roca Village". Estaría ubicado en la parte trasera del local UNIT 38 durante el periodo mayo a octubre 2019. Quedamos a la espera de recibirlo. Muchas Gracias, Un saludo [Logo Grup Galceran Color] Judit Cuyàs Gerència, GRUP GALCERAN Pg. Ferrocarrils Catalans, 178 Bis 08940 Cornellà de Llobregat Tel. 93 480 16 86 E-mail: jcuyas@grupgalceran.com www.grupgalceran.com', 575, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(758, '2019-12-09 23:54:45', '2019-04-30 12:43:09', 'MC - Petición de precio', 'Buenos días, Para una obra que tenemos adjudicada en Reus, solicitamos su mejor precio de alquiler de: * 2 módulos de casetas de dos pisos según pdf adjunto. Los mismos deben ir sin muebles ni taquillas, solo climatizados, cortinas y escaleras exteriores. * Los mismos deben estar montados el día 25/05/19 * Final alquiler previsto 15/12/19 Atentament / Atentamente / Best regards, Albert Vallverdú Domínguez Dpto. de Compras Tel. +34 977 21 53 04 // Tel. Directo. +34 977 248 228 Fax. +34 977 235 024 E-mail. avallverdu@cfcyp.com www.carbonellfigueras.com Antes de imprimir este e-mail piense si es imprescindible hacerlo. El cuidado del medioambiente es responsabilidad de todos. Protección de Datos Personales En virtud de la normativa de Protección de Datos de Carácter Personal, por la presente autoriza a que los datos personales facilitados sean incorporados en un fichero denominado contactos responsabilidad de CARBONELL FIGUERAS SA y domicilio a calle Mallorca, n. 22, 43005 TARRAGONA (TARRAGONA) La finalidad de este tratamiento es la de gestionar las personas de contacto. Estos datos no serán transmitidos a terceras personas y serán conservados siempre que sea imprescindible o legítimo para la finalidad que se captaron. En cualquier caso podrá indicar la revocación del consentimiento dado, así como ejercitar los derechos de acceso, rectificación o supresión, la limitación del tratamiento o oponerse, así como el derecho a la portabilidad de los datos. Estas peticiones deberán realizarse en calle Mallorca, n. 22, 43005 TARRAGONA (TARRAGONA). Así mismo podrá presentar una reclamación ante la Agencia Española de Protección de Datos. Darse de baja de la lista de correo Si usted no desea recibir más información sobre nuestros servicios, puede darse de baja en la siguiente dirección de correo electrónico: baja@cfcyp.com. Aviso sobre la confidencialidad de les comunicaciones El contenido de este correo electrónico y de sus anexos es estrictamente confidencial. En el caso que usted no sea destinatario y haya recibido este mensaje por equivocación, agradeceríamos que lo comunicara al remitente, sin difundir, almacenar o copiar su contenido.', 576, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(759, '2019-12-09 23:54:45', '2019-04-30 13:18:08', 'Marketing digital', '*|MC:SUBJECT|**|MC_PREVIEW_TEXT|* ¿Conoces la forma más inteligente y rentable de promocionar tu marca? Tenemos para ti formación en Marketing digital, community manager, comercio electrónico, seo y sem. El Marketing Digital hoy en día es más necesario que nunca. Amplia tus conocimientos y domina todos los aspectos del marketing digital, desde el dominio del SEO y SEM hasta el community manager. No te quedes atrás respecto a tus competidores. Con los cursos de Marketing digital que te ofrece AIP con los que aprenderás todas aquellas técnicas que cualquier negocio del siglo XXI necesita para crecer utilizando las nuevas tecnologías. De la mano de nuestros profesionales aprenderás como crear un plan de marketing digital eficaz y profesional para vender tus productos o servicios. AIP somos un centro con más de 30 años de experiencia donde te ofrecemos formación personalizada adecuada a las necesidades de tu empresa sin que tengas que preocuparte del proceso de bonificación ya que nosotros nos encargamos de gestionarlo. Ofrecemos servicios de formación en empresas o en nuestras instalaciones y contamos con el certificado de centro oficial de formación Adobe. INFORMATE SOBRE NUESTROS CURSOS Copyright ©, todos los derechos reservados. Nuestra dirección de correo es: guillem@aipbarcelona.com (guillem@aipbarcelona.com%20%C2%A0) ¿Desea cambiar la forma en que recibe estos correos electrónicos? Si no desea seguir recibiendo esta información puede darse de baja de esta lista.', 221, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(760, '2019-12-09 23:54:45', '2019-04-30 13:45:54', 'presupuesto', 'Hola, En febrero llamé para pedir un presupuesto para un container. Os mando otra vez la información. Adjunto croquis de detalle. Es para una oficina para el Club Tennis Porqueres. Os agradecería que mandarais presupuesto para presentar en el ayuntamiento. Marc Rovira Lliberia (629284302) Gracias *TAC·TIC TENNIS* *aprènmou-tejugagaudeix www.tactictennis.com *', 577, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(761, '2019-12-09 23:54:45', '2019-04-30 13:54:23', 'COFRICO_ALQUILER CÁMARAS FRIGORÍFICAS OVIEDO', 'Estimado José, Solicito mejor oferta para el siguiente alquiler de cámaras frigoríficas, con equipos frigoríficos incorporados: * 1 unidad 15 m3 aprox, limitación altura 2400 mm, 0ºC * 1 unidad 15 m3 aprox, limitación altura 2400 mm, -25ºC * Inicio alquiler finales Agosto 2019 * Final alquiler finales Octubre 2019 * Emplazamiento: Oviedo * Incluir transporte, montaje, puesta en marcha y desmontaje. Las cámaras tendrán que ser de tipo modular o desmontable, ya que no van en la calle si no en una planta del hotel. Gracias por adelantado y recibe un cordial saludo, David Pardo Jefe de Compras. Cofrico Central M: +34 696 978 245 T: +34 981 783 430 Correo electrónico: dpardo@cofrico.com | http://www.cofrico.com [cid:622e493f-3da8-4111-b8d7-39138c8f2c19] La conservación del medio ambiente es prioritaria y esencial. No imprimas este correo electrónico si no es realmente necesario. INFORMACIÓN BÁSICA SOBRE PROTECCIÓN DE DATOS: De conformidad a lo dispuesto en la actual normativa de Proteccio?n de Datos de Cara?cter personal, le informamos que los responsables de tratamiento de los datos de cara?cter personal recogidos en este documento son Cofrico, S.L. , cuya finalidad es poder atender las consultas y cualquier tipo de gestio?n realizada por este medio de comunicacio?n. Sus datos no se cedera?n a terceros, salvo por obligacio?n legal. Tiene usted derecho a acceder, rectificar o suprimir los datos erro?neos, solicitar la limitacio?n del tratamiento de sus datos así como oponerse o retirar el consentimiento en cualquier momento. Para ello, Cofrico, S.L. dispone de formularios especi?ficos. Puede presentar su propia solicitud o solicitar nuestros formularios, siempre acompan?ados de una copia de su DNI para acreditar su identidad en: cofrico@cofrico.com. Puede consultar la informacio?n adicional y detallada sobre Proteccio?n de Datos solicita?ndola por correo electro?nico a cofrico@cofrico.com. Ninguna parte de este documento puede ser reproducida, ni introducida en ningu?n sistema de recuperacio?n, ni transmitida de ninguna forma, ni por ningu?n medio, ya sea electro?nico, meca?nico por fotocopia, grabacio?n o de otro tipo, con ningu?n propo?sito, sin la autorizacio?n por escrito del titular de este documento. Los nombres de compan?i?as, personas o productos reales aquí? mencionados pueden ser marcas comerciales de sus respectivos propietarios. Este mensaje, y en su caso, cualquier fichero anexo al mismo, puede contener informacio?n confidencial, siendo para uso exclusivo del destinatario, quedando prohibida su divulgacio?n copia o distribucio?n a terceros sin la autorizacio?n expresa del remitente. Si Vd. ha recibido este mensaje erro?neamente, se ruega lo notifique al remitente y proceda a su borrado.', 578, 'VCONT', 4, 'NOGEST', 'EMAIL'),
