	(768, '2019-12-09 23:54:45', '2019-04-30 19:12:25', 'CONTAINER OFICINA PUNTO DE VENTA', 'Hola Quisiera recibir información para la compra de un CONTAINER OFICINA, para ser ubicado en PALENCIA, COMO PUNTO DE INFORMACIÓN Y VENTA , actividad de INMOBILIARIA. HE VISTO ALGUNO EN WEB. Se colocaría en el exterior de una NAVE INDUSTRIAL REFORMADA. Tengo una idea de unos 25 metros cuadrados como máximo y 16 como mínimo. Por favor, atenderé su información gustosamente. Gracias Demetrio Gutiérrez 649723260', 583, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(769, '2019-12-09 23:54:45', '2019-05-01 10:30:56', 'Vale de comida para ZARCA S.L.', 'Hola, Mi nombre es María y estoy con ValeDeComida, una compañía que ofrece a las empresas la posibilidad de Proporcionar a los empleados un almuerzo a buen precio. - Simplifica y elimina costes administrativos por la gestión de los gastos de comida. - Importe exento de IRPF hasta 9€ por persona y día y deducible. - Empleados con más motivación ya que disfrutan de un gran beneficio social. Necesitaremos la siguiente información para preparar un presupuesto o propuesta: •Nombre de la empresa •Nombre y Apellido •Número de teléfono •Código postal •Dirección •Cuántos empleados tiene tu empresa? Le recomiendo que consulte nuestros precios respondiendo a este correo electrónico. Atentamente, María Padro Maria@es-CompararOrcamento-Now.site ValeDeComida Su privacidad es importante para nosotros. No pasaremos sus datos a compañías de terceros sin su expreso permiso Responder "Baja", si no desea recibir más mensajes', 105, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(770, '2019-12-09 23:54:45', '2019-05-01 13:22:16', 'Consulta persupuesto.', 'Buenas tardes, \r\n\r\nQuería consultarles un presupuesto para realizar un loft de aproximadamente 15 metros cuadrados en el que habría un lavabo pero sin cocina, con los aislamientos pertinentes para calor y frío. \r\n\r\nGracias de antemano.', 396, 'VCONT', 4, 'NOGEST', 'EMAIL'),
