	(773, '2019-12-09 23:54:45', '2019-05-02 12:05:12', 'Solicitud Informacion', 'Hola, Por favor haga nos un propuesto de precio para esta Modulo incluido el transporte a Petra/Mallorca. Gracias, Olaf Hopfer 0049 17640167322 https://www.zarca.es/wp-content/uploads/2016/10/modulo-prefabricado-oficina-acritalada-gris-1200x784.jpg Oficina Acristalada Gris (3m Ancho)Módulo prefabricado oficina acristalada gris de 7,20 x 3 metros (anchura especial) con aire acondicionado. [cid:image002.png@01D500DF.4B63DB00]', 585, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(774, '2019-12-09 23:54:45', '2019-05-02 13:19:29', 'INFORMACION', 'Buenos días.\r\n\r\nEstoy interesado y quisiera recibir más información de la oferta [Vivienda Modular - Venta desde 15.933€].\r\n\r\nMuchas gracias.\r\n\r\nTIENEN ALGÚN MODELO DE DOS DORMITORIOS?', 586, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(775, '2019-12-09 23:54:45', '2019-05-02 13:48:00', 'Precio contenedor', 'Buenas tardes, Nos ponemos en contacto con vosotros para solicitaros el coste de un contenedor marítimo de 600x250x250 cm aproximadamente. Un cliente nos ha solicitado realizar una muestra en el interior, y nos gustaría utilizarlo cono espacio efímero realizándole algunas modificaciones. Cualquier duda que tengan, no duden e contactarnos directamente. Gracias, [https://www.totem161.com/firma/firma-totem.png] Antonio Fernández · 0034 954 105 605 afernandez@totem161.com · totem161.com Advertencia/Warning - Este mensaje de correo electrónico, cuyo contenido es ESTRICTAMENTE CONFIDENCIAL, así como los documentos adjuntos, están dirigidos EXCLUSIVAMENTE a los destinatarios especificados, de manera que queda EXPRESAMENTE PROHIBIDA su divulgación, copia, difusión, publicidad o circulación por cualquier medio a terceros, sin consentimiento expreso del emisor. Dicha exigencia se enmarca dentro del compromiso manifiesto que TOTEM ESPACIOS COMERCIALES, S.L firma como documento de confidencialidad con todas las empresas clientes. La manifestaciones realizadas asÍ como las obligaciones inherentes serán extensibles a las empresas a las que se solicita presupuesto, siendo responsables solidarias de su incumplimiento. *This e-mail is privileged, confidential and contains private information. Any reading,retention, distribution or copying of this communication by any person other than its intended recipient is prohibited. Recuerde que todos sus datos serán tratados con la máxima confidencialidad según las vigentes leyes 15/1999 de protección de datos de carácter personal(LOPD) y 34/2002 de Servicios de la sociedad de lainformación y de comercio electrónico (LSSI-CE). La información contenida en este mensaje de correo electrónico es confidencial y puede revestir el carácter de reservada. Está destinada exclusivamente a su destinatario. El acceso o uso de este mensaje, por parte de cualquier otra persona que no