	(796, '2019-12-09 23:54:46', '2019-05-05 14:17:01', 'SEDNA Containers - new 40ft High Cube reefer and new build equipment', 'Dear all, Available end of May 40\'High Cube reefers in Rotterdam! Quantity: 10 Price: $ 18.250,00 Quality: New YOM 2019 Condition: One way used provided with T-bar floor. Machinery: Carrier Prime Line Terms of delivery: Deliver free on truck ex SEDNA appointed depot in Rotterdam . Date of delivery: only in case of delivery. Terms of payment: Advance payment prior to release. Remaining terms: subject to availability. Remark: This offer is based on our Terms and Conditions. Validity: Offer valid for 5 working days At present we are also producing new stock in China and soon available in Rotterdam( or delivered to your specific destination). * 40\'High Cube palled wide. * 45\'High Cube palled wide * 20\'dv in Ral 5010 & 9010 * 20\'High Cube * 20\'High Cube Double Door * 40\'dv * 40\'High Cube * 40\'High Cube Double Door Kindly advise if you have any demands for standard and special equipment. Looking forward to your booking, and if you have any questions about our current stock don\'t hesitate to contact us.', 600, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(797, '2019-12-09 23:54:46', '2019-05-06 06:18:53', 'Contenedores prefabricados', 'Estimados Srs. Somos *ARK(CHINA) CO., LTD *una compañia dedicada a la fabricación de estructuras modulares prefabricadas, así como la transformación de contendores marímtios, con experiencia internacional basados en la calidad y el buen servicio. Para más información visite nuestra página *www.arkprefab.com * Saludos, -- *Ives Bejarano * Sales Manager *ARK Prefab Company Limited* t +86 (0) 21 60838082 (Ext. 611) m +86 13795444919 Your 1 Stop Solution for Modular Building Construction -- _Please consider the environment before printing this e-mail ???? ????_ This communication contains information from ARK PREFAB GROUP companies, that may be confidential. Except for personal use by the intended recipient, or as expressly authorized by the sender, any person who receives this information is prohibited from disclosing, copying, distributing, and/or using it. If you have received this communication in error, please immediately delete it and all copies, and promptly notify the sender. Nothing in this communication is intended to operate as an electronic signature under applicable law.', 601, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(798, '2019-12-09 23:54:46', '2019-05-06 10:48:43', 'Compras Casetas', 'Buenos días, Nos ponemos en contacto con Uds. para pedirles *presupuesto* de casetas o contenedores de segunda mano, si esto no fuera posible también estudiaríamos que fueran nuevos. Queremos comprar 4 unidades que tengan unas medidas aproximadas de 6x2,5x2,5m. cada uno. Estos compartimentos pueden ser de metal o de otro material, ya que estarían en el exterior. Por otra parte, nos gustaría que un frontal (largo) estuviera acristalado y la puerta de entrada fuese por un lateral (ancho). También que pudieran ser apilados en dos plantas y entonces para subir a la planta segunda requeriríamos unas escaleras laterales. Gracias por su atención, saludos cordiales. *Luis Peñalver* *Administración* *Escuela Superior de Diseño (Madrid)* *914390000* *722141427*', 602, 'VCONT', 4, 'NOGEST', 'EMAIL'),
