	(810, '2019-12-09 23:54:47', '2019-05-07 11:57:19', 'Solicitud de precio / Plazo de suministro', 'Buenas tardes, Me pongo en contacto con vosotros para que por favor me paseis precio y plazo del siguiente encargo: Cámara frigorífica para refrigeración: 8uds Nuevo o de segunda mano garantizado. Capacidad interior 27 m³. Espesor de paneles 80mm con núcleo de poliuretano rígido de 40kg/m³ de densidad. Potencia frigorífica 3300 W. Dos compresores de 1.75 CV (1 de emergencia). Suelo antideslizante e iluminación IP67. Puerta pivotante con cerradura y llave. Perfil higiénico en todas sus aristas. Placa con Gprs para comunicación de datos móviles. Legalizado por industria. En interior estanterías de aluminio y estantes de polietileno. Cámara frigorífica para congelación: 8uds Nuevo o de segunda mano garantizado. Capacidad interior 27 m³. Válvula de equilibrado 16W Potencia 3300 W Dos compresores (1 de emergencia) de 4.25 CV Suelo antideslizante Puerta pivotante con cerradura y llave. Alarma de hombre atrapado. Perfil higiénico en todas sus aristas. Iluminación interior IP 67. Placa con GPRS para comunicación de datos móviles. Legalizado por industria. Contenedor para almacenaje: 8uds Nuevo Capacida 67 m³ y longitud 12m. Fabricado en acero anticorrosivo corten 2mm. Recubrimiento interior antihumedad y suelo de madera hidrófuga. Contenedor para aseo y oficina: 8uds Nuevo Capacidad 45 m³ Aseo con ducha y dos despachos independientes con ventanas. Acerca de este último, ¿existe la posibilidad de fabricarlo a medida?. Nos dan un plazo de suministro de 45 días, ¿es posible cumplirlo?. Gracias de antemano. Un saludo!!! Héctor Feria Revilla hector@tavilga.es 684 168 863', 608, 'VCONT', 4, 'NOGEST', 'EMAIL'),
