	(826, '2019-12-09 23:54:52', '2019-05-08 12:44:18', 'RV: Presentación Bioaire_Climatización Evaporativa', 'ZERCOSO Y CATASUS Dep. de compres ó manteniment Estimado Sr. En el documento adjunto le mando información de nuestros sistemas de refrigeración Breezair por vapor de agua y calefacción Space-Ray por Gas Ciudad ó Propano. Ambas Empresas son Líderes Mundiales en climatización ecológica de grandes y pequeñas superficies. Nuestros sistemas son los más eficaces y a la vez los mas económicos tanto de instalación como de mantenimiento. Si la temperatura interior de su Industria supera en verano los 30º le interesará abrir el archivo adjunto. Trata de refrigeración industrial por evaporativos, consiguen reducir la temperatura interior en 10/12º dejando la humedad a un max. del 60% con un mínimo coste. Además renuevan el aire continuamente eliminando polvo y malos olores dejando el ambiente mucho más confortable. Pídanos presupuesto sin compromiso. FIRMA-BIO2 NOTA LEGAL: En cumplimiento de la Ley Orgánica 15/1999 de Protección de Datos Personales, le informamos que sus datos están incorporados a nuestros ficheros, con el fin de mantener relaciones profesionales y / o comerciales. Si lo desea puede ejercer los derechos de acceso, rectificación, cancelación y oposición a sus datos dirigiéndose por escrito a info@bioaire.es incluyendo copia de su D.N.I. El contenido de este correo electrónico y sus documentos adjuntos se dirige únicamente a la persona ó entidad que se muestra como destinatario, pudiendo contener datos confidenciales ó privilegiados. Si Vd. no es el destinatario y recibe este correo por error, rogamos se ponga en contacto con nosotros y lo elimine inmediatamente junto con todos sus documentos adjuntos sin hacer ningún uso de los datos que en ellos figuren.', 619, 'VCONT', 4, 'NOGEST', 'EMAIL'),
