	(834, '2019-12-09 23:54:53', '2019-05-09 12:08:55', 'Central de compras Film', 'Si usted no es capaz de ver este email, haga clic http://321ug.r.ca.d.sendibm2.com/mk/mr/3ep8eCLAuOZDsZ5zwBLj6ZKF7BhHHI4cQ4uL8wqPQeY3xZa51XJ4h96dzXiS7Xoh_wVWxI4uDpIPFbTRZp7NRu2OPT0OOhFQK_ZXxyq2wqu36DNLeQBuenos días, Soy Lucía Muñoz, sales manager de www.centralcomprasfilm.com Somos una central de compras de film estirable, estamos presente en 18 países y agrupamos entre nuestros asociados un volumen superior de 900.000kg. En España ofrecemos a nuestros asociados una agrupacion de 7 fabricantes constantemente auditados, con unas condiciones económicas muy favorables. Los precios que ofrecemos para este mes de Febrero son : Film manual de 23my: 1 palet a 2,39€ Film automático 23my: 1 palet a 1,35€ * acceda a la web para ver otras opciones en espesor y/o cantidad de film de 250% o 300% de pre-estiro. El proceso es muy simple, acceda a nuestra web www.centralcomprasfilm.com y vea los PRECIOS DEL MES, si los precios le interesan solo tiene que rellenar el formulario y le contactarán directamente desde la fábrica seleccionada para la gestión y suministro del producto con esas condiciones. Ventajas: - Los mejores precios y sin gastos adicionales para el asociado. - Después de enviar el formulario relleno, le llamarán en menos de 6 horas para que pueda acogerse al precio negociado por centraldecomprasfilm.com - Desde la formalización del pedido, el plazo de entrega para recibirlo en su almacén es de 48/72 horas. - Sin pagos adelantados, el pago estipulado con nuestros fabricantes es a 60 días. - 15 días de prueba de producto sin compromiso. Para cualquier duda o consulta quedo a su disposición. Lucia Muñoz [ centralcomprasfilm.com ]( http://321ug.r.ca.d.sendibm2.com/mk/cl/f/STcYps61H9Pfm-JHki8fi6Jyz-6BXXJSghp4vdRVfoQtEvGknp1jVM2TRuXvqWJ8dsq-He8uZJzJkGmIRNwlLrS6SlCO8OsM46OI_I3uqtscOHFzAjbumEPMBnVgptbo7gk0pEcexF3NMvtdmdoVkJYB1GZzgtBzZk-3vAeD5g ) [ info@centralcomprasfilm.com ]( mailto:info@centra