	(858, '2019-12-09 23:54:54', '2019-05-13 08:07:16', 'ORDER AND PARTNERSHIP', 'Hi, Located in the united kingdom, the famous brand Harrods is a department store located on Brompton Road in Knightsbridge, London furnished by European products. We are looking to buy new products to attract new customers and also retain our existing ones ,create new partnerships. Could you also send to us all information required to become one of your regular distributors. Please, we would appreciate if you could send us your stock list availability via email?. Payment: Our Payment Terms is within 15 days net in Europe and 30 days net in UK as we operate with all our suppliers. Waiting for your feedback, Bella Shaffer Managing Director - Partnership Services Dept: ORDER AND PARTNERSHIP https://www.harrods.com/en-gb Direct-line +44 (0) 7417524576 Fax : +44 (0)20 7581 0470 Best regards, Image result for HARRODS Harrods Limited, a company registered in England (company number 00030209), with registered offices at 87/135 Brompton Road, London, SW1X 7XL and VAT number 629 273 423 ------------------------------------------------------------------------------------- This e-mail is confidential and intended only for the addresses shown. If you are not an intended recipient, please be advised that any use, dissemination, forwarding or copying of this e-mail is strictly prohibited. Internet e-mails are not necessarily secure and Harrods Ltd does not accept responsibility for changes made to this message after it was sent. Please note that incoming and outgoing electronic mail messages may be monitored. Should you receive this transmission in error, notify the sender immediately. This e-mail message may contain confidential or legally privileged information and is intended only for the use of the intended recipient(s). Any unauthorized disclosure, dissemination, distribution, copying or the taking of any action in reliance on the information herein is prohibited. E-mails are not secure and cannot