	(859, '2019-12-09 23:54:54', '2019-05-13 10:59:16', 'Presupuesto contenedor de segunda mano', 'Buenas tardes, Mi nombre es Serena Molina, soy investigadora del instituto de investigación IMDEA Agua en Madrid. Le escribo porque quería pedir presupuesto para adquirir un contenedor de 20 pies de segunda mano. Me gustaría que pudiera abrirse en la pared larga del contenedor por facilidad de uso (en la cara de los 6 metros). Y necesitamos que esté techado. Cuando tiempo de uso tienen estos contenedores usados? Están en buen estado? También me gustaría saber el tiempo de entrega y si en el precio que nos den está incluido el transporte y descarga a nuestras instalaciones. Al ser un centro de investigación, nuestro protocolo de compras no nos permite hacer pagos por adelantado. Tendrían algún problema con este aspecto? Si no existen contenedores de estas características de segunda mano, cuanto valdría uno nuevo? Si necesita algún otro tipo de información para hacer el presupuesto no duden en escribirme o llamarme al número que aparece en la firma del correo. Espero sus noticias. Un saludo, Serena Dr. Serena Molina Martínez serena.molina@imdea.org cid:1D5B388F-0404-4B49-87BF-949A16AF7445@imdea-agua.org Avenida Punto Com 2. Parque Científico Tecnológico de la Universidad de Alcalá. 28805 Alcalá de Henares (Madrid), Spain. Tel.: +34 91 830 59 62', 642, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(860, '2019-12-09 23:54:54', '2019-05-13 11:12:10', 'Precio piscina', 'Hola, estoy construyendome un chalet y quería saber precios de la piscina, para valorar si aprovecho que estoy con la obra e instalar la piscina.\r\nMi intención es poner algo bastante básico ya que la zona no es muy calurosas y el tiempo de disfrute no sería mucho.\r\n\r\nGracias y espero vuestra respuesta.', 61, 'VCONT', 4, 'NOGEST', 'EMAIL'),
