	(862, '2019-12-09 23:54:54', '2019-05-13 12:51:32', 'Solicitud presupuesto contenedores', 'Buenos días. Se solicita presupuesto para 16 contenedores, con las siguientes características: - 8 contenedores nuevos que se usarán como almacén, con una capacidad mínima de 67 m3 y una longitud mínima de 12 m. - 8 contenedores nuevos que se usarán como oficina, con una capacidad mínima de 45 m3, aseo con ducha y dos despachos independientes con ventana. La entrega de los contenedores se haría en los Servicios Centrales de la Agencia, en Avenida de Grecia, s/n; 41012 Sevilla. El plazo para la recepción de la oferta concluye el 16/05/19, a las 12:00. Gracias y un saludo. --', 644, 'VCONT', 3, 'NOGEST', 'EMAIL'),
