	(866, '2019-12-09 23:54:54', '2019-05-13 22:45:43', 'Consulta', 'Hola, He conocido su empresa mediante su página web. En estos momentos estoy buscando la mejor opción para realizar un proyecto de vivienda, motivo por el que me pongo en contacto con ustedes para solicitarle presupuesto de: 3 unidades container ISO HIGH CUBE 20\' para un proyecto de vivienda y precio de 2 contenedores ISO HIGH CUBE 40\' para otro proyecto de vivienda. De segunda mano, si puede ser. Así mismo, también les solicito precio si es posible de limpieza y desinfección. Los containers se entregarian en la província de Girona, por lo que les ruego indiquen el coste del transporte y el plazo de entrega. Muchas gracias de antemano. Atentamente, Sònia Domínguez', 648, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(867, '2019-12-09 23:54:54', '2019-05-13 23:05:42', 'Festival', 'Buenos días, somos organizadores de un festival solidario y solicitamos presupuesto de alquiler de un modulo para utilizar como taquilla de venta de entradas para los días 15, 16 y 17. \r\n\r\nGracias', 649, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(868, '2019-12-09 23:54:54', '2019-05-14 07:26:30', 'Solicitud Informacion', 'Empresa: Tallers Arboix s.l Telefono:938592461 Bona tarda, Necessitaria oferta per a: -16 contenidors marítims LC 20 open side -30 contenidors marítims LC 10 Els necessitaria de color blanc En la oferta haurieu d?adjuntar fotos del tipus de contenidor i planol Les entregues aproximades seríen: -3 LC20 i 6 LC10 : 10/07/19 -3 LC20 i 6 LC10 : 02/09/19 -3 LC20 i 6 LC10 : 02/12/19 -3 LC20 i 6 LC10 : 21/01/20 -4 LC20 i 6 LC10 : 25/03/20 Per qualsevol dubte estic a la vostra disposició Salut!', 650, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(869, '2019-12-09 23:54:54', '2019-05-14 09:31:29', 'sol·licitud oferta contenidor 8\'', 'Bon dia, Sol·licitem oferta d\'un contenidor marítim tipus magatzem nou, de 8\' o similar. Posat a Vacarisses. Gràcies, Salutacions, [cid:image001.jpg@01D3F995.D56B51E0] www.heraholding.com Àngels López Project Manager Oficina Tècnica angels.lopez@heraholding.com Tel: 932 051 010 Extensió: 3339 Oficines Centrals Numància, 185 - 6a planta Tel. +34 932 051 010 08034 BARCELONA', 651, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(870, '2019-12-09 23:54:54', '2019-05-14 12:05:21', 'MODULO ALMACEN MATERIAL ELECTRICO SF - SOLPED 8300040362', 'Buenos días, Adjunto especificación técnica para el suministro de un modulo prefabricado para el astillero de Navantia San Fernando. Rogamos nos remitan su oferta antes del próximo lunes 20 a las 10.00h Saludos, [Logo_grupoSepi]Javier Márquez Moreno Astillero Puerto Real - Purchase Department NAVANTIA (Grupo SEPI) Phone: +34 660 517 602 - 49835 +34 956820593 - 5593 jmarquez@navantia.es www.navantia.es NAVANTIA ______________________________ Este mensaje y cualquier fichero anexo al mismo contiene información de carácter confidencial dirigida exclusivamente a su(s) destinatario(s) y, en su caso, sometida a secreto profesional. Queda prohibida su difusión, copia o distribución a terceros sin la previa autorización escrita. Si Vd. ha recibido este mensaje por error, se ruega lo comunique inmediatamente por esta misma vía y proceda a su completa eliminación. The information in this e-mail and in any attachments is confidential and, if any, protected by a professional privilege and intended solely for the attention and use of the named addressee(s). You are hereby notified that any dissemination, copy or distribution of this information is prohibited without the prior written consent. If you have received this communication in error, please notify the sender by reply e-mail and delete it. ______________________________ Piense en el medio ambiente. ¿Necesita realmente imprimir este correo? Please care for the environment. Do you really need to print this e-mail?', 652, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(871, '2019-12-09 23:54:54', '2019-05-14 12:16:11', 'Venta Módulos y Casetas', 'Buenos días.\r\n\r\nEstoy interesado y quisiera recibir más información de la oferta [Caseta de obra OFAL66 de ocasión - Venta desde 3.290€ - ZARCA].\r\n\r\nMuchas gracias.', 653, 'VCONT', 4, 'NOGEST', 'EMAIL'),
