	(873, '2019-12-09 23:54:54', '2019-05-14 12:18:53', 'Alquiler', 'Buenas tardes,\r\nMe podría informar del precio de alquiler de dos cámaras frigoríficas de unos 3 metros. \r\nVeo en su página que actualmente tienen ofertas, pero no se si estas estarán vigentes para la época de vendimia, o si existe una cantidad mínima de días de alquiler.\r\nMuchas gracias.', 654, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(874, '2019-12-09 23:54:54', '2019-05-14 12:23:34', 'CONTENEDOR MARÍTIMO PARA ALMACÉN CLUB DEPORTIBO', 'Necesitamos presupuesto de un contenedor marítimo de 6 metros de largo para almacén y oficina de Club Deportivo. Quisiéramos saber precio del básico y del modificado para oficina o taquilla. Si es posible con transporte y colocación incluido, sería para Puerto Real en Cádiz. Un saludo', 655, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(875, '2019-12-09 23:54:54', '2019-05-14 12:24:18', 'SOLICITUD CONTAINER 20 PIES OBRA POP', 'Bueno días, Nos ponemos en contacto con ustedes ya que volvemos a necesitar un CONTAINER DE 20 PIES para una obra en Barcelona. Hace unos meses ya nos suministrasteis uno para una obra Parc del Fondo d?En Peixo en El Prat de Llobregar, así que ya tenemos abierta ficha de cliente. El que solicitamos ahora, sería con las mismas características y los mismos servicios contratados. Lo necesitamos en obra durante 1 mes aprox. Debería estar en obra el martes que viene 21 de mayo. Ruego nos pasen presupuesto lo más rápido posible para formalizar pedido y pago El nombre de la nueva obra es: PARC DE LA PEGASO - POP Quedamos a su disposición para cualquier otro dato que precisen. Saludos, Gemma Muntaner BDU - ESPACIOS DE VALOR Roger de Flor 91, 6º 1ª 08013 Barcelona Tel: +34 932 464 904 www.bdu.es BDUlogoEscalado email Este mensaje y los adjuntos pueden contener información confidencial, no estando permitida su comunicación, reproducción o distribución. Si usted no es el destinatario final, le rogamos nos lo comunique y borre el mismo. De conformidad con el que dispone la normativa vigente en protección de datos RGPD y LOPD, le informamos que los datos personales serán tratados bajo la responsabilidad de BDU Espacios de Valor SL. Puede ejercer los derechos de acceso, rectificación, portabilidad, supresión, limitación y oposición mandando un mensaje a bdu@bdu.es. Si considera que el tratamiento no se ajusta a la normativa vigente, podrá presentar una reclamación ante la autoridad de control en agpd.es.', 656, 'VCONT', 3, 'NOGEST', 'EMAIL'),
