	(877, '2019-12-09 23:54:54', '2019-05-14 16:17:58', 'Solicitud de presupuesto', 'Hola!! Buenas tardes! El motivo de mi contacto es solicitar presupuesto de Alquiler (para un espacio comercial con una mesa y dos sillas)! en una obra nueva en construcción. Equipado con aire acondicionado, con ventanas y que proyecte buena imagen. El periodo de alquiler será de 6 meses. Necesito q contemplen la instalación y la desinstalación. Tb el punto de luz... Gracias [https://cdn2.hubspot.net/hubfs/2772937/Firma%20nueva%20imagen/vivendex_logo-firma_mail.png] Sònia López i Mestre Investment Sales Assitant +34 697 137 420 +34 934 184 948 s.lopez@vivendex.com C/ Folgueroles 17-25 08022 – Barcelona www.vivendex.com A los efectos de lo establecido en el Reglamento (UE) 2016/679 del parlamento europeo y del consejo, del 27 de abril de 2016, sobre Protección de Datos de Carácter Personal, y de la Ley 34/2002,de 11 de Julio de Servicios de la Sociedad de la Información y de Correo Electrónico (LSSI), Viana Resort S.L., de nombre comercial VIVENDEX, garantiza la confidencialidad de los datos personales de sus clientes. Le comunicamos que su dirección de correo electrónico forma parte de una base de datos gestionada bajo la responsabilidad de VIVENDEX con la única finalidad de mantener contacto sea por su condición de cliente o porque nos haya solicitado información comercial en algún momento, sea porque usted ha autorizado que sus datos figuren en un fichero comercial automatizado. Usted podrá en todo momento, ejercitar sus derechos de acceso, rectificación, cancelación y oposición de sus datos de carácter personal por correo ordinario en la siguiente dirección LOPD@vivendex.com en los términos establecidos en el RGPD. Este mensaje se dirige exclusivamente a su destinatario y puede contener información privilegiada o confidencial. Si usted ha recibido este mensaje por error, por favor borre su contenido y comuníquenoslo en la dirección del remitente a la mayor brevedad posible.', 657, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(878, '2019-12-09 23:54:55', '2019-05-14 16:22:15', 'RETIRADA CONTENEDOR DE OBRA.', 'Buenas tardes, les solicitamos a partir del día de hoy, la retirada del contenedor Box de alquiler, en la obra Carretera Reial C/ Torreblanca, Sant Just Desvern BCN ya que hemos terminado los trabajos de estructura. Ref. contractual 00003445. Para coordinar la retirada por favor contacten con Juan Rodríguez 698 15 84 62 Atentamente saludos.', 658, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(879, '2019-12-09 23:54:55', '2019-05-14 16:40:56', 'Compra casetas de obra', 'Buenas tardes, Estamos buscando casetas de obra de 2,20x3,30 máximo. Si son mas pequeñas no pasaría nada, nos podéis pasar precios por favor? Es bastante urgente. Gracias Saludos, GENERAL DE CONSTRUCCIÓ I SERVEIS Carrer Bonaventura Armengol, 15 Edifici Occesa 4-5 AD500 Andorra la Vella Tel. +376 808 708 E-mail: gcs@andorra.ad', 659, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(880, '2019-12-09 23:54:55', '2019-05-14 17:46:57', 'Informació', 'Bona tarda, Estem redactant un projecte per un magatzem en un camp de fútbol i uns vestuaris (en 2a. Fase) i estem considerant la possiblitat d\'executar-ho amb contenidors marítims. Voldria saber si tenen alguna tarifa de preus dels contenidors i alguna indicació de preus de la seva customització. Si s\'han de posar en contacte amb mi, els prego que ho facin per correu electrònic. Atentament, Montse Llorens Leiva, arquitecte Nota legal: Aquest missatge i qualsevol arxiu adjunt està destinat únicament a la persona a qui es dirigeix i és confidencial. Si vostè ha rebut aquest missatge per error, si us plau comuniqui-ho al remitent i esborri?l immediatament. La utilització, revelació i/o reproducció del missatge pot constituir un delicte. Protecció de Dades: Li informem que les seves dades de contacte electrònic estan sent tractades d?acord amb la normativa de la Llei de Protecció de Dades, trobant-se incorporades a un fitxer titularitat de MONTSERRAT LLORENS LEIVA amb la finalitat de tramesa d?informació, resposta a consultes, i contactes genèrics. Igualment li informem que podrà exercir els drets d?accés, rectificació, oposició i cancel·lació a través de comunicació a MONTSERRAT LLORENS LEIVA C/Joan Amades, 8 de Sant Quintí de Mediona (08777). Abans d?imprimir aquest correu electrònic pensa si és necessari fer-ho: El medi ambient és cosa de tots.', 660, 'VCONT', 4, 'NOGEST', 'EMAIL'),
