	(883, '2019-12-09 23:54:55', '2019-05-15 07:19:48', 'PETICION DE OFERTA', 'Buenos días, necesito precio y plazo de entrega para el siguiente material: 1 CONTENEDOR CONGELADOR/REFRIGERADOR 10 PIES Muchas gracias, un saludo BAYPORT GLOBAL SUPPLIES S.A. A-11071859 LUIS ESPARZA Navy Department P.I. Tres Caminos, C/ La Dorada S/N 11510 Puerto Real (Cádiz -Spain) M: 647 806 474 T: +34 956 28 28 07 E: navy@bayport.eu www.bayport.eu Este correo electrónico y la información contenida en él es confidencial, dirigiéndose exclusivamente al destinatario mencionado en el encabezamiento. Si hubiese recibido o accedido a este mensaje por error, le rogamos que nos lo comunique y proceda a destruirlo de inmediato. Cualquier divulgación, copia, distribución o utilización no autorizada de la información contenida en el mismo está prohibida por la legislación vigente. Los datos personales facilitados por usted o por terceros forman parte de un fichero responsabilidad de BAYPORT GLOBAL SUPPLIES con la finalidad de gestionar y mantener los contactos y relaciones que se produzcan como consecuencia de la relación que mantiene con BAYPORT GLOBAL SUPPLIES. Normalmente, la base jurídica que legitima este tratamiento, será su consentimiento, el interés legítimo o la necesidad para gestionar una relación contractual o similar. El plazo de conservación de sus datos vendrá determinado por la relación que mantiene con nosotros. Para más información al respecto, o para ejercer sus derechos de acceso, rectificación, cancelación/supresión, oposición, limitación o portabilidad, dirija una comunicación por escrito a C/ La Dorada, s/n - (11510 Puerto Real, Cádiz) o dirección de correo electrónico: calidad@bayport.eu. Asimismo, en caso de considerar vulnerado su derecho a la protección de datos personales, podrá interponer una reclamación ante la AEPD ( www.aepd.es).', 662, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(884, '2019-12-09 23:54:55', '2019-05-15 08:22:06', 'Re: Clientes', 'Estimados Señores: Tras visitar su página de Internet, hemos observado que está dirigida principalmente a empresas; por eso, queremos proponerles un producto que les ayudará a aumentar significativamente su número de clientes. Le presentamos una base de datos de empresas con los datos de contacto de sus dueños y directivos. El catálogo incluye más de un millón de direcciones, y es uno de los mayores en el mercado español. Contiene datos tales como: nombre de la empresa, domicilio social, datos de contacto del dueño, e-mail, teléfono, fax, página web, etc. Puede empezar a usar el catálogo y promocionar sus productos inmediatamente. El retorno de la inversión está garantizado. *** Base de datos de empresas españolas - 1.548.400 registros. - 190.00 € - Sólo hasta el 15/05/2019 *** Base de datos Europa 2019 (ES, DE, AT, CH, UK, FR, IT) - 8.101.561 registros - 490 € - Sólo hasta el 15/05/2019 Más información en nuestra web: http://www.infodataes.com/?page=catalog Atentamente, GC-Support-Team', 663, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(885, '2019-12-09 23:54:55', '2019-05-15 09:24:53', 'Interesados en adquisición Casetas de Obra', 'Muy Señores míos.\r\nPor la presente les informo, que estamos interesados en la adquisición de varios módulos de casetas de obra, en concreto en módulos que sean factibles de unirlos unos con otros, o simplemente las estructuras sin cerramientos. Estudiamos igualmente la adquisición de elementos de segunda mano.\r\nA la espera de sus noticias.\r\nUn saludo', 664, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(886, '2019-12-09 23:54:55', '2019-05-15 09:40:47', 'Solicitud Presupuesto Casetas de Obra - San Lorenzo del Escorial', 'Buenos días, Les escribo para solicitar presupuesto para casetas de obra en San Lorenzo del Escorial (Madrid), para una actuación que estamos comenzando. De este modo, se trata de algo urgente, por lo que rogaría me pasaran la oferta a la mayor brevedad posible (si pudiera ser hoy mismo, lo agradecería mucho) Las casetas que necesitamos son: - 2 casetas de 6,00 x 2,40 para las funciones de comedor - 2 casetas de 6,00 x 2,40 para las funciones de vestuario - 2 casetas de 6,00 x 2,40 para las funciones de aseo - 1 caseta de 6,00 x 2,40 con baño para las funciones de oficina - 1 caseta de 6,00 x 2,40 sin baño para las funciones de oficina Muchas gracias de antemano, disculpen las molestias Un cordial saludo [https://www.tragsa.es/SiteCollectionImages/Relaciones%20Institucionales%20(Prensa)/FIRMA%20OUTLOOK/Tragsa.png] [https://www.tragsa.es/SiteCollectionImages/Relaciones%20Institucionales%20(Prensa)/FIRMA%20OUTLOOK/cenefa.png] Alejandre Escribano, Carlos TMED Obras Madrid Madrid / G. Zona Obras Grupo Tragsa - SEPI [https://www.tragsa.es/SiteCollectionImages/Relaciones%20Institucionales%20(Prensa)/FIRMA%20OUTLOOK/Tragsa_SEPI.png] Carretera de Toledo, Km. 6,8 - 28916 Leganés Tel.: - 649816331 calejand@tragsa.es www.tragsa.es En beneficio del medio ambiente, imprime este e-mail sólo si realmente es necesario For the benefit of the environment, print this e-mail only if you really need to POLITICA DE PRIVACIDAD, de conformidad con el Reglamento UE 2016/679 y la Ley Orgánica 3/2018 ********************************************************************************************** El consumo de papel es perjudicial para el medio ambiente. Por favor, téngalo en cuenta antes de imprimir este mensaje. AVISO LEGAL: Este mensaje y sus anexos pueden contener información confidencial o legalmente protegida. Está dirigido únicamente a la persona o entidad indicada com