	(887, '2019-12-09 23:54:55', '2019-05-15 09:45:16', 'Re: Solicitud Presupuesto Casetas de Obra - San Lorenzo del Escorial', 'Buenos días de nuevo, como dato que he olvidado facilitar, el período estimado de alquiler es de 14 meses. Un saludo [https://www.tragsa.es/SiteCollectionImages/Relaciones%20Institucionales%20(Prensa)/FIRMA%20OUTLOOK/Tragsa.png] [https://www.tragsa.es/SiteCollectionImages/Relaciones%20Institucionales%20(Prensa)/FIRMA%20OUTLOOK/cenefa.png] Alejandre Escribano, Carlos TMED Obras Madrid Madrid / G. Zona Obras Grupo Tragsa - SEPI [https://www.tragsa.es/SiteCollectionImages/Relaciones%20Institucionales%20(Prensa)/FIRMA%20OUTLOOK/Tragsa_SEPI.png] Carretera de Toledo, Km. 6,8 - 28916 Leganés Tel.: - 649816331 calejand@tragsa.es www.tragsa.es En beneficio del medio ambiente, imprime este e-mail sólo si realmente es necesario For the benefit of the environment, print this e-mail only if you really need to POLITICA DE PRIVACIDAD, de conformidad con el Reglamento UE 2016/679 y la Ley Orgánica 3/2018 ________________________________ De: Alejandre Escribano, Carlos Enviado: miércoles, 15 de mayo de 2019 9:40:47 Para: comercial@zarca.es Asunto: Solicitud Presupuesto Casetas de Obra - San Lorenzo del Escorial Buenos días, Les escribo para solicitar presupuesto para casetas de obra en San Lorenzo del Escorial (Madrid), para una actuación que estamos comenzando. De este modo, se trata de algo urgente, por lo que rogaría me pasaran la oferta a la mayor brevedad posible (si pudiera ser hoy mismo, lo agradecería mucho) Las casetas que necesitamos son: - 2 casetas de 6,00 x 2,40 para las funciones de comedor - 2 casetas de 6,00 x 2,40 para las funciones de vestuario - 2 casetas de 6,00 x 2,40 para las funciones de aseo - 1 caseta de 6,00 x 2,40 con baño para las funciones de oficina - 1 caseta de 6,00 x 2,40 sin baño para las funciones de oficina Muchas gracias de antemano, disculpen las molestias Un cordial saludo [https://www.tragsa.es/SiteCollectionImages/Rela