	(906, '2019-12-09 23:54:56', '2019-05-16 17:08:51', 'Rampa camara frigorífica', 'Buenas tardes\r\nNos gustaría saber si fabrican rampas a medida para cámaras frigoríficas y si es así, saber el coste de una de 14,5 cm de escalón ( altura ) 1,54 de ancho y 1,50 de largo\r\n\r\nMuchas gracias y reciban un cordial saludo ', 676, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(907, '2019-12-09 23:54:56', '2019-05-16 17:21:43', 'Solicitud presupuesto', 'Buenas tardes, Me pongo en contacto con vosotros ya que tenemos un proyecto en el que el cliente requiere un contenedor marítimo transformado para utilizarlo como "chiringuito". Los datos que tenemos hasta ahora son los siguientes: - Medidas contenedor: contenedor marítimo 20” (Largo 6,05m, Ancho 2,43m, Alto 2,59m) - Distribución de aperturas y puertas: apertura en los 2 lados largos + apertura en uno de los lados anchos (con "media puerta") + puerta completa en el otro lado ancho ¿Podríais enviarnos un presupuesto incluyendo costes de instalación, transporte y plazos de entrega? La ubicación del proyecto es en Mataró (Barcelona). Gracias, -- *Alba Marín* Ingeniera de Aeropuertos Telf. +34 622 16 90 55 CONFIDENCIALIDAD: La información contenida en este mensaje es confidencial y para uso exclusivo del destinatario. Si ha recibido este mensaje por error, le agradeceremos nos lo indique y proceda a su eliminación. CONFIDENTIALITY: The information contained in this message is confidential and for the exclusive use of its addressee. If you have received this message in error, please notify us and delete it from your system.', 677, 'VCONT', 4, 'NOGEST', 'EMAIL'),
