	(923, '2019-12-09 23:55:01', '2019-05-20 13:07:42', 'AVISO PAGOS GRUPO DULCESOL', 'Estimado proveedor: Por parte de la empresa DULCESA S.L.U. se ha generado una remesa de pagos confirmados (confirming), a trav?s de la entidad bancaria SANTANDER. Esta entidad contactar con Ud/s. y le ofrecer la posibilidad de anticipar todas o parte de las facturas incluidas en la remesa. Si desea/n conocer la relaci¢n de facturas incluidas en la remesa, puede/n hacerlo tambi?n con sus claves a trav?s de nuestra web (http://www.dulcesol.es/, EXTRANET, ACCESO PROVEEDORES); aqu¡ pueden consultar, asimismo, los datos de contacto que figuran en nuestra base de datos (direcci¢n postal, tel?fono, fax y correo electr¢nico). Si no dispone/n de sus claves, puede/n solicitarlas respondiendo a este mensaje e indic ndolo en su respuesta. El modo de pago asignado por nuestra empresa a sus facturas es el denominado CHEQUE. Por las facturas que Ud/s. no anticipe/n, la entidad bancaria SANTANDER emitir autom ticamente un cheque, cuando se produzca el vencimiento de cada una de las facturas pagadas, y lo enviar por correo postal a la direcci¢n que figura en nuestra base de datos. Si lo prefieren, esta forma de pago puede ser sustituida por una TRANSFERENCIA. Para que ello sea posible, debe/n Ud/s. facilitar un n£mero de cuenta bancaria a la entidad SANTANDER, a trav?s del n£mero de fax, 91 257 11 41, para lo cual pueden utilizar el mismo formulario que dicha entidad les har llegar. Si as¡ se lo indica/n, la entidad SANTANDER le/s abonar en el futuro en la cuenta facilitada todas las transferencias por nuestros pagos confirmados. Deber n acompa¤ar alg£n certificado o documento acreditativo, respecto de la titularidad de la cuenta en la que deseen recibir las transferencias. Estamos a su disposici¢n para resolver cualquier duda relacionada con la gesti¢n de sus facturas y del pago de las mismas. Puede/n contactar con nosotros respondiendo a este mismo mensaje y planteando las cuestiones que considere/n oportunas. Tambi?n puede/n ponerse en contacto con la entidad bancaria, a trav?s del tel?fono 902 02 27 15. Gracias por su atenci¢n. Reciba/n un cordial saludo. GRUPO DULCESOL (Administraci¢n y Finanzas) proveedores.dulcesa@dulcesol.es Dear supplier: We have generated a consignment of confirmed payments (confirming) through the banking entity Santander. It will contact you to offer you the possibility of anticipate the payment of all the invoices of the consignment or just some of them before the date of their expiration. If you want to know the invoices included in the consignment, you can do it in our web (http://www.dulcesol.es/, EXTRANET, ACCESO PROVEEDORES); here you can also check the contact data that we have of your company in our database (postal address, telephone number, fax, email address). If you can not logging, you can ask us for your passwords to log, answering this email. The payment method that we have assigned to your company is cheque. In case you do not anticipate your invoices before the date of their expiration the banking entity Santander will send a cheque of your invoices to the postal address of your company that appear in our database. If you prefer a bank transfer as a payment method you have to ask for change it just giving your account number with a certificated document that prove that your company is the account holder, to the banking entity Santander using the fax number 91 257 11 41 sending the formulary that the banking entity Santander will send to you. Please, contact us answering this email if you have any question, asking about whaterver you need to know else of this process. You can also contact with the banking entity Santander using the telephone number 902 02 27 15. Thank you very much for your attention. Best Regards, GRUPO DULCESOL (administration and finances department) proveedores.dulcesa@dulcesol.es', 258, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(924, '2019-12-09 23:55:01', '2019-05-20 13:32:13', 'Fwd: Compras Casetas', 'Buenos días, Seguimos a la espera del presupuesto pedido. Saludos. *Luis Peñalver* *Administración* *Escuela Superior de Diseño (Madrid)* *914390000* *722141427* ---------- Forwarded message --------- De: Gestion Escuela Superior de Diseño Date: lun., 6 may. 2019 a las 10:48 Subject: Compras Casetas To: Buenos días, Nos ponemos en contacto con Uds. para pedirles *presupuesto* de casetas o contenedores de segunda mano, si esto no fuera posible también estudiaríamos que fueran nuevos. Queremos comprar 4 unidades que tengan unas medidas aproximadas de 6x2,5x2,5m. cada uno. Estos compartimentos pueden ser de metal o de otro material, ya que estarían en el exterior. Por otra parte, nos gustaría que un frontal (largo) estuviera acristalado y la puerta de entrada fuese por un lateral (ancho). También que pudieran ser apilados en dos plantas y entonces para subir a la planta segunda requeriríamos unas escaleras laterales. Gracias por su atención, saludos cordiales. *Luis Peñalver* *Administración* *Escuela Superior de Diseño (Madrid)* *914390000* *722141427*', 602, 'VCONT', 4, 'NOGEST', 'EMAIL'),
