n oportunas. Tambi?n puede/n ponerse en contacto con la entidad bancaria, a trav?s del tel?fono 902 02 27 15. Gracias por su atenci¢n. Reciba/n un cordial saludo. GRUPO DULCESOL (Administraci¢n y Finanzas) proveedores.dulcesa@dulcesol.es Dear supplier: We have generated a consignment of confirmed payments (confirming) through the banking entity Santander. It will contact you to offer you the possibility of anticipate the payment of all the invoices of the consignment or just some of them before the date of their expiration. If you want to know the invoices included in the consignment, you can do it in our web (http://www.dulcesol.es/, EXTRANET, ACCESO PROVEEDORES); here you can also check the contact data that we have of your company in our database (postal address, telephone number, fax, email address). If you can not logging, you can ask us for your passwords to log, answering this email. The payment method that we have assigned to your company is cheque. In case you do not anticipate your invoices before the date of their expiration the banking entity Santander will send a cheque of your invoices to the postal address of your company that appear in our database. If you prefer a bank transfer as a payment method you have to ask for change it just giving your account number with a certificated document that prove that your company is the account holder, to the banking entity Santander using the fax number 91 257 11 41 sending the formulary that the banking entity Santander will send to you. Please, contact us answering this email if you have any question, asking about whaterver you need to know else of this process. You can also contact with the banking entity Santander using the telephone number 902 02 27 15. Thank you very much for your attention. Best Regards, GRUPO DULCESOL (administration and finances department) proveedores.dulcesa@dulcesol.es', 258, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(932, '2019-12-09 23:55:01', '2019-05-21 09:34:27', 'FCB Les Rambles Barça ', 'Bon dia Eduard, Me presento, Soy Ramón Burguera y seré la persona encargada de realizar a partir de ahora el seguimiento presupuestario de esta obra. Me comenta Nicolás que hay unos precios pendientes de darnos por tu parte sobre la fabricación de unos contenedores.......en qué punto se encuentra este tema? Necesito ir cerrando temas.... Quedo a la espera de tus noticias. Un saludo. Ramon Burguera [cid:image001.jpg@01D50FB8.6206CE70] GAC 3000 ramon.burguera@gac3000.com C/Séneca 11, Baixos. Barcelona 08006 BARCELONA Tel.: 93 206 61 27 http://www.gac3000.com/', 695, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(933, '2019-12-09 23:55:01', '2019-05-21 11:30:55', 'GPS control de flota para ZARCA S.L.', 'Hola, Mi nombre es María Gómez y pertenezco a FlotaGPS , una empresa que ofrece a las compañías la capacidad de controlar cómo sus empleados actúan en la carretera a la vez que aumenta la productividad del quipo. Quiero ayudarle a entender mejor la industria del control de flotas GPS y ofrecerle las mejores tarifas de servicio. Los puntos clave a tener en cuenta: • Las estadísticas muestran que millones de euros se pierden cada año en España debido a la disminución de la productividad del personal. • La gestión de combustible de la flota reduce el consumo de combustible y también aumenta la capacidad de asignar de manera eficiente su flota utilizando puntos de referencia y posicionamiento en tiempo real. Incluso si usted ya tiene una fuente para la localización de flotas GPS, es bueno saber cuáles son sus opciones ya que constantemente aparecen alternativas nuevas y más avanzadas. Nuestro sitio web le mostrará las opciones más actuales con los mejores descuentos ofrecidos por los proveedores de software de GPS de gran reputación nacional. Necesitaremos la siguiente información para preparar un presupuesto o propuesta: * ¿Cuántos vehículos necesita rastrear? * Nombre de su organización * Nombre y Apellido * Número de teléfono * Ciudad * Dirección * Código postal Le recomiendo que consulte nuestros precios respondiendo a este correo electrónico. Atentamente, María Gómez Maria@es-Flota-GPS.online ES-Flota-GPS Su privacidad es importante para nosotros. No pasaremos sus datos a compañías de terceros sin su expreso permiso. Responder "BAJA", si no desea recibir más mensajes.', 271, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(934, '2019-12-09 23:55:01', '2019-05-21 12:57:32', ' Venta o alquiler modulo baño', 'Buenos días, Les escribo desde la Isla de La Palma, en Tenerife. Queremos instalar un módulo prefabricado con un aseo sencillo (WC+lavabo) y con una sala diáfana (uso de comedor o similar). El baño saldría a un desagüe y habría que conectarlo a un tanque de agua. La ubicación seria el Telescopio LST1 con el Observatorio del Roque de Los Muchachos en La Palma. Me podrían hacer una oferta para venta y otra para alquiler de mínimo 3 años por favor? Saludos y gracias Patricia Márquez LST Telescope Manager Institut de Fisica d\'Altes Energies (IFAE) Centro de Astrofísica de La Palma (CALP) Mail: pmarquez@ifae.es Legal Notice - (LOPD) - http://legal.ifae.es -- Avís - Aviso - Legal Notice - (LOPD) - http://legal.ifae.es', 696, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(935, '2019-12-09 23:55:01', '2019-05-21 13:45:15', 'RV: OBRA EN GETAFE. LOS MOLINOS', 'Buenos días, les escribo en relación a la oferta que les solicitamos, cuando podrían tenerla? Muchas gracias Javier Pereira Anes Ingeniero de Caminos,Canales y Puertos Móvil 675 72 12 09 De: Angel Navarro [mailto:angel_navarro@ocasa.es] Enviado el: martes, 16 de abril de 2019 11:48 Para: comercial@zarca.es Asunto: RV: OBRA EN GETAFE. LOS MOLINOS OBRAS, CAMINOS Y ASFALTOS, S.A. COMO ADJUDICATARIA DE LA OBRA ?Los Molinos (Huertos urbanos y Estructuras de sombra)? SOLICITA OFERTA DE: u CASETA DE 2 OFICINAS+ASEO 19,40 m2 Caseta prefabricada de obra, para dos despachos de oficina y un aseo con inodoro y lavabo de 7,92x2,45x2,45 m de 19,40 m2. Estructura y cerramiento de chapa galvanizada pintada, aislamiento de poliestireno expandido autoextinguible, interior con tablero melaminado en color. Cubierta de chapa galvanizada reforzada con perfil de acero; fibra de vidrio de 60 mm, interior con tablex lacado. Divisiones en tablero de melamina. Suelo de aglomerado revestido con PVC continuo de 2 mm, y poliestireno de 50 mm con apoyo en base de chapa galvanizada de sección trapezoidal. Puerta de 0,80x2,00 m, de chapa galvanizada de 1 mm, reforzada y con poliestireno de 20 mm, picaporte y cerradura. Dos ventanas aluminio anodizado corredera, contraventana de acero galvanizado. Instalación eléctrica a 220 V, toma de tierra, automático, 2 fluorescentes de 40 W, enchufes para 1500 W y punto luz exterior de 60 W. Dos equipos de aire acondicionado/bomba de calor. Incluido transporte y descarga en obra. ?????????????????????????????????????????????.2ud DATOS: OBRAS, CAMINOS Y ASFALTOS, S.A. C/ MIGUEL FARADAY Nº 20 OFICINAS A101/102 EDIFICIO CHARMEX GREEN BULDING 28906 GETAFE (MADRID) C.I.F. A-32.212.375 TFNOS: 91.491.29.40/91.743.33.52 firma_angel_navarro', 697, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(936, '2019-12-09 23:55:01', '2019-05-21 14:03:09', 'Melhorar Vendas', 'Bom dia, tudo bem?\r\n\r\nEstava vendo seu site www.zarca.es e percebi que ele pode te ajudar a vender mais com um Apresentador Virtual. \r\n\r\nÉ uma pessoa em 3D que fala seu texto. \r\n\r\nNós criamos e instalamos em seu site. \r\n\r\nEle pode falar seu texto por até 2 minutos, veja os exemplos em nosso site: \r\n\r\nhttps://www.bceleva.com.br/produto/apresentador-virtual-para-sites/ \r\n\r\nNosso Whatsapp para dúvidas (11) 9 5876 4459.\r\n\r\nSe não quiser receber mais este tipo de divulgação, por favor, responda este email com o endereço do seu site para removermos da nossa lista. Só queremos ajudar.\r\n\r\nAbraço.\r\n\r\nWilliam Marques\r\nEleva Brasil Solulções em Internet.', 459, 'VCONT', 4, 'NOGEST', 'EMAIL'),
