	(944, '2019-12-09 23:55:02', '2019-05-22 07:37:03', 'Estimados SeÃ±ores', 'Estimados Señores: Tengo el honor de presentarle un producto que se adapta plenamente a las necesidades de su empresa. Nuestro producto le permitirá llegar a nuevos clientes e incrementar de manera inmediata sus ventas. Le presentamos una base de datos de empresas con los datos de contacto de sus dueños y directivos. El catálogo incluye más de un millón de direcciones, y es uno de los mayores en el mercado español. Contiene datos tales como: nombre de la empresa, domicilio social, datos de contacto del dueño, e-mail, teléfono, fax, página web, etc. *** Base de datos de empresas españolas - 1.548.400 registros. - 190.00 € - Sólo hasta el 22/05/2019 *** Base de datos Europa 2019 (ES, DE, AT, CH, UK, FR, IT) - 8.101.561 registros - 490 € - Sólo hasta el 22/05/2019 Más información en nuestra web: http://www.dbdataes.com/?page=catalog Atentamente, GC-Support-Team', 702, 'VCONT', 3, 'NOGEST', 'EMAIL'),
