	(947, '2019-12-09 23:55:02', '2019-05-22 10:03:41', 'OFERTA ROPA LABORAL', 'Apreciados Sres, Me permito ponerme en contacto con uds. con el fin de presentarle nuestra empresa, así como adjuntarles folleto indicativo. GRALSAN es una compañía líder en el mercado especializada en Vestuario Laboral y Equipos de Protección Individual. Años de experiencia en el sector y un equipo técnico-comercial garantizan unas soluciones adaptadas a sus necesidades. Un amplio stock, una entrega rápida y unos precios competitivos completan la oferta de GRALSAN. Disponemos un variado muestrario de productos dirigidos en exclusiva a cuidar al máximo la imagen corporativa así como la seguridad laboral en su compañía. Sin duda, somos líderes utilizando las últimas innovaciones en cuanto a la personalización de la uniformidad, serigrafía, transfer, bordado y vinilo textil termo adhesivo. Los mejores fabricantes del sector nos confían la distribución de sus artículos y ellos nos dan la garantía de ofrecerte los mejores productos con la mejor relación calidad/precio/servicio de la zona. No dude en contactar con nosotros para cualquier proyecto que pudiera precisar, nuestro departamento comercial procederá a facilitarle soporte y asesoramiento en todo momento. Esperando poder ofrecerles nuestros servicios, reciba un cordial saludo. Atentamente, GRABADO DE TODO TIPO (BORDADO, TRANSFER, VINILO, SERIGRAFIA, ETC...) PREGUNTE POR NUESTRAS OFERTAS, PIDANOS PRESUPUESTO. CAMISETA M/CORTA .......................2,89 POLO M/CORTA ALGODON..............6,90 PANTALON MULTIBOLSILLOS...........12,90 CHAQUETA POLAR..........................12,20 ETC... www.gralsan.es firma_ruben', 704, 'VCONT', 3, 'NOGEST', 'EMAIL'),
