	(951, '2019-12-09 23:55:02', '2019-05-22 12:30:38', 'RV: PETICIÓN OFERTA URGENTE CONTENEDOR OBRA ADJUDICADA EDARES VARIOS', 'Adjunto remito descripción mediciones y planos para que, con la mayor brevedad posible, nos envíe su mejor oferta para la construcción de un equipo portátil de deshidratación. OBRA: DESCRIPCIÓN: ?CONSTRUCCIÓN DE LAS OBRAS DE MEJORA EN LA DESHIDRATACIÓN Y TRATAMIENTO DE FANGOS EN LAS EDARES DE AGOST, AIGÜES, PARADISO, MASCARAT, FINESTRAT Y SELLA Y SUMINISTRO EQUIPO PORTÁTIL DESHIDRATACIÓN? CAPÍTULO: CONTENEDOR MARÍTIMO TEXTO: (Mediciones y planos adjuntos) Para cualquier aclaración ruego se ponga en contacto con el jefe de obra Javier Torrella 629605326. Atentamente, image001 Beatriz Pérez Martínez Departamento de Compras Chm Obras e Infraestructuras, S.A. Av. Jean Claude Combaldieu, s/n Partida Agua Amarga 03008 ALICANTE Tel. 965145205 Fax : 965210031 bperez@chm.es www.chm.es', 708, 'VCONT', 4, 'NOGEST', 'EMAIL'),
