	(953, '2019-12-09 23:55:02', '2019-05-22 12:59:20', 'Alojamiento Rural con Contenedores', 'Buenas tardes,\r\n\r\nContacto con ustedes para consultarles la viabilidad de construcción de un Alojamiento rural a base de módulos independientes, conectados entre sí por pasarelas de Tarima de madera. \r\nSe trata de una pre planificación prevista para valorar el proyecto. Serían en total:\r\n- 8 módulos independientes, 4 pequeños y 4 más grandes. Los pequeños constarían de habitación doble y baño completo con ducha amplia (amplios, 30m2) y terraza privada. Los más grandes de dos habitaciones y 1 baño completo con ducha amplia.\r\n- 2 módulos de 50-60m2 a modo de vivienda de los propietarios también independientes. \r\n- 1 o 2 módulos comunes: cocina, salón, comedor, recepción.\r\n- 1 módulo de min 80m2, mitad sala de Fitness mitad almacén.\r\n\r\nEn cuanto a cimentaciones no podría concretar les más ya que estamos evaluando viabilidad en esta fase.\r\n\r\nTambién consultarles la posibilidad de traslado de los módulos en el futuro a otra localización, si es algo que es factible.\r\n\r\nPodría utilizarse un módulo a modo de piscina con sistema de depuración incluido?\r\n\r\nLos módulos han de tener grandes ventanales bien aislados. Queremos que el proyecto sea sostenible y limpio, utilizando sistemas renovables como paneles solares, y aquellos que nos puedan recomendar ustedes por su experiencia.\r\n\r\nEn cuanto a la localización, podemos proponer varios puntos en España. Si nos pueden presupuestar desplazamientos también se lo agradezco.\r\n\r\nLas calidades y aislamientos han de ser medias-altas dependiendo de las partidas.\r\n\r\nEspero que a groso modo se puedan hacer a la idea. Pueden contactarme por tfno también.\r\n\r\nGracias de antemano.\r\n\r\nUn saludo,\r\n\r\nAlberto Aparicio\r\n\r\n627935664 ', 709, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(954, '2019-12-09 23:55:02', '2019-05-22 13:17:40', 'SOLICITUD DE OFERTA', 'Buenos días Necesitamos adquirir dos unidades de caseta prefabricada con estas características, también podrían ser en madera, les ruego me manden su mejor oferta 2 ud CASETA OFICINAS+ASEO 19,40 m2 Caseta prefabricada de obra, para dos despachos de oficina y un aseo con inodoro y lavabo de 7,92x2,45x2,45 m de 19,40 m2. Estructura y cerramiento de chapa galvanizada pintada, aislamiento de poliestireno expandido autoextinguible, interior con tablero laminado en color. Cubierta de chapa galvanizada reforzada con perfil de acero; fibra de vidrio de 60 mm, interior con tablex lacado. Di- visiones en tablero de melamina. Suelo de aglomerado revestido con PVC continuo de 2 mm, y poliestireno de 50 mm con apoyo en base de chapa galvanizada de sección trapezoidal. Puerta de 0,80x2,00 m, de chapa galvanizada de 1 mm, reforzada y con poliestireno de 20 mm, picaporte y cerradura. Dos ventanas aluminio anodizado corredera, contraventana de acero galvanizado. Instalación eléctrica a 220 V, toma de tierra, automático, 2 fluorescentes de 40 W, enchufes para 1500 W y punto luz exterior de 60 W. Dos equipos de aire acondicionado/bomba de calor. Incluido transporte y descarga en obra. Muchísimas gracias de antemano Javier Pereira Anes Ingeniero de Caminos,Canales y Puertos Móvil 675 72 12 09', 697, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(955, '2019-12-09 23:55:02', '2019-05-22 15:12:10', 'SIN TITULO', 'Buenos días, \r\n\r\nSolicito presupuesto para el alquiler de una cámara portátil de julio a septiembre y comprar otras 2 cámaras. \r\nLa capacidad que valoramos para cada cámara es de unos 20 pallets pero si tienes cámaras con otros tamaños pásame presupuesto para valorarlo también. \r\n\r\nNecesitaría el presupuesto con urgencia. \r\ngracias, \r\nSaludos, \r\nTania', 710, 'VCONT', 4, 'NOGEST', 'EMAIL');
