	(956, '2019-12-09 23:55:02', '2019-05-22 16:07:20', 'OFERTA Módulos prefabricados - TEPSA TGN', 'Buenas tardes, Se requiere oferta para 2 módulos prefabricados iguales a instalar en puerto de Tarragona de las siguientes características: - Dimensiones interiores: 1500 x 2100 mm. - 1 ventana corredera en la parte frontal de aprox. 1 m de anchura con cristales oscuros-reflectantes per proteger del sol y con persiana veneciana. - 1 puerta de 800 mm de anchura con la mitad superior de cristal oscuro-reflectante per proteger del sol. Batiente hacia fuera. - 1 mesa de aprox. 1m x 0,3m. - Opcional: o Suministro e instalación: § Climatización frío-calor. § 2 enchufes debajo de la mesa. § Iluminación interior. § Pequeño cuadro eléctrico para los elementos descritos. o Trampilla o registro en el suelo, debajo del armario eléctrico que instalará Tepsa. Medidas aprox.: 300 x 500 mm. Se adjunta plano detallando los módulos requeridos. Se requiere incluir fecha de suministro a Tarragona de ambos módulos en la oferta. Cualquier pregunta, no duden en ponerse en contacto. Saludos, Julio Marra-López Julio Marra-López Soporte Ingeniería ?????????????? TEPSA Flexible Tanking. Certified. Avenida Muelle de la Energia, 4 08039 Barcelona tel. +34 +34 93 289 55 40 fax. +34 juliomarralopez@tepsa.es www.tepsa.es Este correo electrónico y, en su caso, cualquier fichero anexo al mismo, puede contener información de carácter confidencial exclusivamente dirigida a su(s) destinatario(s). Queda prohibida su divulgación, copia o distribución a terceros sin la previa autorización de TEPSA. En caso de haber recibido este correo por error, le rogamos notifique inmediatamente esta circunstancia mediante reenvío a la dirección electrónica del remitente. Le agradecemos de antemano su colaboración. ________________________________________ This e-mail, and where appropriate, any file attached to it, should contain information of confidential nature, exclusively intended for its recipient(s). You may not copy this message or use it for any purpose or disclose its contents to any other person or take any action based on them without prior authorization from TEPSA. Should you have received this mail by mistake, we would be most grateful if you could notify us immediately. Thank you very much indeed in advance for your collaboration. X', 711, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(957, '2019-12-09 23:55:02', '2019-05-22 17:09:25', 'SIN TITULO', 'Hola buenas \r\nEstoy interesado en este contenedor. Y a lo mejor dos más más grande de 40 más tarde. Pero premero el pequeño.\r\nMe lo puedes llevar a santa Pola cerca del pinet /la marina en mi campo ?', 61, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(958, '2019-12-09 23:55:02', '2019-05-22 17:56:09', 'Video Corporativo para Zarca', 'Hola, Soy Marc Vilà, project manager de la productora audiovisual Maldito Studio, de Barcelona. Nos especializamos en el video corporativo y creativo para empresas, así como publicidad y eventos corporativos. Contacto con vosotros para ofreceros la posibilidad de realizar un video corporativo para reforzar vuestra marca. El video es la mejor forma de poder mostrar tu marca de una forma más dinámica y estética, a la vez que sirve como material promocional tanto para clientes como proveedores. Os dejo algunos links de trabajos realizados estos últimos meses, de modo que tengáis una idea de qué os podemos ofrecer. Video resumen corporativo: https://vimeo.com/333703869 Ejemplos concretos: http://www.malditostudio.com/projectes/maldito-studio-rail-sider-mediterraneo/ http://www.malditostudio.com/projectes/maldito-studio-solga-diamant/ Espero que os gusten los trabajos y que podáis valorar la posibilidad de colaborar juntos. Salutaciones cordiales Marc Vilà Badell Project Manager +34 650 87 27 47 www.malditostudio.com', 712, 'VCONT', 4, 'NOGEST', 'EMAIL'),
