	(964, '2019-12-09 23:55:02', '2019-05-23 14:36:17', 'Informacion modulo', 'Hola, Queria saber precio de un modulo. Ofi66 modulo oficina 6 m. Gracias. Un saludo, Juan Antonio Torres Mata Socorros, Emergencias y Medioambiente Asamblea Local Cruz Roja de Ibiza y Formentera Avda. España, 51. 07800 Ibiza Tel: +34 971390303 IP: 29100 móvil: 620952348 jutoma@cruzroja.es www.cruzroja.es http://www.cruzroja.es/principal/web/illesbalears - Facebook - Twitter Cada vegada més a prop de les persones + Creu Roja Espanyola Humanitat Imparcialitat Neutralitat Independència Voluntariat Unitat Universalitat CONFIDENCIALIDAD. El contenido de esta comunicación y el de toda la documentación anexa es confidencial y va dirigido únicamente al destinatario del mismo. En el supuesto de que usted no fuera el destinatario, le solicitamos nos lo haga saber a la dirección del remitente y que no comunique su contenido a terceros, procediendo a su destrucción.', 715, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(965, '2019-12-09 23:55:03', '2019-05-23 14:44:34', 'Módulos prefabricados MJ Gruas', 'Buenos días, Estaríamos interesados en la compra de varios módulos prefabricados, con quien deberíamos contactar? Sería similar al pdf adjunto: - Conjunto de Módulos de 30m2 para oficinas - 1 módulo aislado de 15 m2 para comedor - Conjunto de módulos de 30m2 para vestuarios-sanitarios - Módulo aislado sanitario de 5m2 Gracias de antemano. Nota de confidencialidad: Este mensaje se envía desde el sistema de correo electrónico de empresa de M. Y J. GRUAS, S.A. Podría contener por lo tanto secretos de empresa y otra información confidencial tutelados por las leyes de la Unión Europea y otros Estados. Si Vd. lo recibiera por error o sin ser una de las personas indicadas en el encabezamiento, deberá destruirlo sin copiarlo ni revelarlo o cualquier otra acción relacionada con el contenido del mensaje e informar inmediatamente por correo electrónico al emisor del mensaje. Las personas y entidades que violen sus deberes de confidencialidad podrán ser perseguidas ante los Tribunales de Justicia al amparo de la legislación civil, penal y administrativa nacional e internacional. Gracias por su colaboración. Q Antes de imprimir este mensaje, asegúrate de que es necesario. Proteger el medio ambiente está también en tu mano.', 716, 'VCONT', 4, 'NOGEST', 'EMAIL'),
