	(967, '2019-12-09 23:55:03', '2019-05-23 15:14:20', 'Presupuesto Contenedor 45pies', 'Buenas tardes, Le escribo porque necesito precio de un contenedor de 45´HC, ¿podría pasarme precios y plazo de entrega? Gracias, ELENA JIMÉNEZ MARTÍNEZ Business Developer T.: +34 954 13 60 20 M.: +34 747 760 353 E.: elenajimenez@proinsener.com W.: www.proinsener.com _____ Sus datos de carácter personal se encuentran incluidos en la actividad de tratamiento ?Clientes/Proveedores?, de la que es responsable PROinSENER ENERGÍA, S.L, cuya finalidad es gestionar la relación con nuestros Clientes y Proveedores. Sus datos personales se mantendrán en tanto se mantenga la relación comercial, así como por los plazos establecidos en normativa aplicable para atender posibles responsabilidades. Puede ejercitar sus derechos de acceso, rectificación, supresión y portabilidad de sus datos, de limitación y oposición a su tratamiento, así como a no ser objeto de decisiones basadas únicamente en el tratamiento automatizado de sus datos, cuando procedan, ante PROinSENER ENERGÍA, S.L a través del correo electrónico, proinsener@proinsener.com, igualmente puede dirigirse a nosotros por esta misma vía para recibir información ampliada sobre nuestra Política de Protección de datos. Cláusula confidencial: Este mensaje es solamente para la persona a la que va dirigido. Puede contener información confidencial o legalmente protegida. No debe directa o indirectamente, usar, revelar, distribuir, imprimir o copiar, ninguna de las partes de este mensaje si Usted no es el destinatario. El correo electrónico vía internet no permite asegurar ni la confidencialidad ni la correcta recepción de los mismos. En el caso de no ser el destinatario de este mensaje devuélvanoslo a esta misma dirección y destrúyalo inmediatamente. _____', 59, 'VCONT', 3, 'NOGEST', 'EMAIL'),
