	(978, '2019-12-09 23:55:04', '2019-05-24 08:54:35', 'Lloguer módul Bar/Kiosk 28/6 al 26/7 Cinema Fresh', 'Bon dia, Necessitem pressupost per lloguer 1 mòdul tipus Bar / Kiosk 6 x 2,35 aprox. Transport de lliurament i retirada de material Portar: 28 de juny 2019 retirar 26 de juliol 2019 Parc Torras Villà de Granollers Gràcies -- Maite Cadenas Servei de Cultura Àrea de Serveis a la Persona Ajuntament de Granollers C. Jaume Camp i Lloreda, 1, 2a planta. Edifici Can Puntes 93 842 66 81 [ mailto:mtcadenas@granollers.cat | mtcadenas@granollers.cat ] [ https://www.granollers.cat/ | www.granollers.cat ] [ http://www.granollers.cat/ ] Si no sou el destinatari d\'aquest email, us demanem que l\'elimineu i ens informeu al mes aviat possible. Politica de privacitat Les vostres dades son tractades per l\'Ajuntament de Granollers en relacio amb el fet de contactar amb l\'Ajuntament i la gestio i tramitacio de comunicacions dels ciutadans amb l\'Ajuntament. Base juridica del tractament: tractem les vostres dades per al compliment d\'una missio feta en interes public, exercici de poders publics i/o compliment d\'obligacio legal. Podeu ampliar aquesta informacio a: www.granollers.cat/politicadeprivacitat. Drets: podeu exercir els vostres drets d\'acces, rectificacio, supressio, portabilitat de dades, limitacio i d\'oposicio al tractament adrecant-vos a l\'a/e: oac@ajuntament.granollers.cat o per correu postal: Ajuntament de Granollers, Pl. Porxada, 6, 08401 Granollers.', 725, 'VCONT', 4, 'NOGEST', 'EMAIL'),
