	(993, '2019-12-09 23:55:04', '2019-05-27 12:58:34', 'CONTENEDORES', 'Buenos días Me dedico a buscaroportunidades de negocios/ventas para empresas. Actualmente existe unconcurso público/licitación que puede ser de interés para vuestra empresa.Podéis ver las características del concurso en el documento pdf adjunto a esteemail. Trabajo de lasiguiente forma: Yo os envío toda ladocumentación de la licitación para que vuestra empresa pueda participar eneste concurso público. Solamente y exclusivamente en el caso que vuestraempresa se adjudique el contrato y una vez que hayáis recibido el 100% delvalor del contrato, vuestra empresa me tendría que abonar la cantidad (IVA noincluido) del 3% sobre el valor sin IVA facturado. En este caso la presentación de la oferta/envío de ladocumentación para participar en la licitación se debe de realizar de formaelectrónica utilizando un programa. A PETICIÓN VUESTRA, yo os podría ayudar a presentar vuestraoferta de la siguiente forma: - Vosotros preparáis elpresupuesto y toda la documentación técnica requerida. En el caso de quetengáis alguna duda sobre los requerimientos técnicos, tendréis que contactardirectamente con la entidad pública que ha sacado la licitación y preguntar aellos - Yo os ayudo en las dudas quetengáis sobre la documentación administrativa a presentar por vuestra empresa. - Yo me encargo de enviar deforma electrónica/utilizando un programa toda la documentación (presupuesto,documentación técnica y documentación administrativa) En el caso de estarinteresado NECESITO QUE ME RESPONDÁIS A ESTE EMAIL, indicando que estáis deacuerdo con las condiciones anteriormente mencionadas. Un saludo / Best Regards Luis Miguel Zoilo Donaire Libertad, nº 23 06260 Monesterio Badajoz (Spain) M: +(34) 627 657 098 E: spainptp@yahoo.es Skype: spainptp "Building business relationships and partnerships are an essential part of being successful"', 734, 'VCONT', 3, 'NOGEST', 'EMAIL'),
