	(997, '2019-12-09 23:55:04', '2019-05-27 18:11:16', 'Solicitud de oferta', 'Buenas tardes, Contacto con usted ya que desde la central me han facilitado su mail de contacto para solicitar un presupuesto. Estoy valorando incorporar un módulo de trabajo de 4 metros x 2,7 metros y una altura de unos 2,4 metros. El módulo deberá ser de pladur con dos ventanales para visualizar la planta y puerta de acceso. El módulo iría dentro de una nave cubierta y seria necesario preparar dos puesto de trabajo con conectividad y alimentación eléctrica. Me mantengo a la espera de su respuesta Cualquier duda estamos en contacto , Un saludo -- *Enrique López Cruz* elopez@ness.es +34 602 229 895 Calle Virgilio 2B. Centro Empresarial Arco Pozuelo Alarcon 28223 (Madrid) www.ness.es +34 917 992 688 *Tratamos la información que nos facilita con el fin de prestarles el servicio solicitado. Los datos proporcionados se conservarán hasta que el interesado no solicite su supresión. Los datos no se cederán a terceros salvo una obligación legal. Usted tiene derecho a acceder a sus datos personales, rectificar los datos inexactos o solicitar su supresión cuando los datos ya no sean necesarios*', 735, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(998, '2019-12-09 23:55:04', '2019-05-28 10:13:40', 'Programación', '*|MC:SUBJECT|**|MC_PREVIEW_TEXT|* View this email in your browser * Hoy en dia los programadores son indispensables para que el mundo digital en el que vivimos siga evolucionando. Desde 2010 la oferta laboral para los programadores no ha parado de crecer tanto en número como en salarios. Aprovecha ésta oportunidad para aprender el funcionamiento de los programas más utilizados para la programación. * Unity En el curso aprenderás todas las técnicas y tecnologías de última generación para el diseño de videojuegos. Trabajarás con el engine Unity 5 y otras herramientas relacionadas. Realizarás todo tipo de ejercicios prácticos basados en casos reales de videojuegos, y desarrollarás un proyecto final de videojuego a tu elección. php Este lenguaje se considera uno de los lenguajes más flexibles, potentes y de alto rendimiento conocidos hasta el día de hoy, lo que ha atraído el interés de múltiples sitios con gran demanda de tráfico, como Facebook o Wikipedia, para optar por el mismo como tecnología de servidor. PHP puede ser desplegado en la mayoría de los servidores web y en casi todos los sistemas operativos y plataformas sin costo alguno. El lenguaje PHP se encuentra instalado en más de 20 millones de sitios web y en un millón de servidores. jQuery En los últimos años han surgido diferentes librerías que agilizan la programación de código Javascript, simplificando esta tarea y reduciendo la cantidad de código significativamente. jQuery es una de las librerías Javascript más utilizada en el mundo de la programación web del lado del cliente. Sus principales bazas son la reducción de la cantidad de código necesario para realizar una acción, compatibilidad del código con la mayoría de los navegadores modernos y el uso de selectores CSS en sus llamadas, facilitando así el entendimiento de la librería a los diseñadores. Con este Curso de JQuery adquirirás todos estos conocimientos para que puedas implementarlos en tu pagina web. Android Android es el sistema operativo de Google para dispositivos móviles y tabletas. Una de las mejores características de este sistema operativo es que es completamente libre. Es decir, ni para programar en este sistema ni para incluirlo en un teléfono hay que pagar nada. Y esto lo hace muy popular entre fabricantes y desarrolladores, ya que los costes para lanzar un teléfono o una aplicación son muy bajos. Android Studio (SDK) está compuesto por un conjunto de herramientas de programación de código abierto multiplataforma. Este suministra al programador frameworks para el desarrollo de aplicaciones gráficas, definición y manipulación de modelos de software, aplicaciones web. Programación.NET La tecnología .NET de Microsoft se ha ido consolidando poco a poco ganándose un merecido primer plano en el mundo de la programación. La versión 3.5 de la tecnología .NET Framework era ya un modelo realmente estable y maduro. Con esta nueva versión con la que trabajaremos: Visual Basic 2012 Express Edition, alcanzaremos en poco tiempo los conocimientos necesarios para realizar aplicaciones de calidad. En este curso aprenderemos la filosofía del entorno .NET y luego su aplicación a Visual Basic.NET. Tendremos una parte teórica para conocer todas las herramientas que nos proporciona este entorno para luego dar un repaso a una útil colección de ejemplos que nos servirán de base para futuras aplicaciones. ASP.NET es un framework para aplicaciones web desarrollado y comercializado por Microsoft. Está pensado para que programadores y diseñadores puedan construir sitios web dinámicos, aplicaciones web, intranets y servicios web XML. Java El Curso de Java abarca los aspectos del lenguaje más frecuentemente utilizados en la programación de aplicaciones sencillas para cliente. Persigue dos objetivos: – Dotar al alumno de unos conocimientos del lenguaje usando la plataforma J2SE (Java 2 Standard Edition), que le permitan desarrollar aplicaciones para cliente sencillas. – Preparar al alumno para que sea capaz de iniciarse en la programación enfocada a servidor usando la plataforma J2EE (Java 2 Enterprise Edition), una de las formas de programar en Java más ampliamente extendida a nivel empresarial. JAVA EE Java Platform, Enterprise Edition o Java EE, es una plataforma de programación, que parte de la Plataforma Java, para desarrollar y ejecutar software de aplicaciones en el lenguaje de programación Java. Permite utilizar arquitecturas de N capas distribuidas y se apoya ampliamente en componentes de software modulares ejecutándose sobre un servidor de aplicaciones AIP somos un centro con más de 30 años de experiencia donde te ofrecemos formación personalizada adecuada a las necesidades de tu empresa sin que tengas que preocuparte del proceso de bonificación ya que nosotros nos encargamos de gestionarlo. Ofrecemos servicios de formación en empresas o en nuestras instalaciones y contamos con el certificado de centro oficial de formación Adobe. INFORMATE SOBRE NUESTROS CURSOS Copyright ©, todos los derechos reservados. Nuestra dirección de correo es: guillem@aipbarcelona.com (guillem@aipbarcelona.com%20%C2%A0) ¿Desea cambiar la forma en que recibe estos correos electrónicos? Si no desea seguir recibiendo esta información puede darse de baja de esta lista.', 221, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(999, '2019-12-09 23:55:04', '2019-05-28 10:30:23', 'SERVICIO TECNICO MAQUINARIA', 'Buenos días. Somos una empresa dedicada a la reparación y mantenimiento de maquinaria. Os adjuntamos un dossier de nuestra empresa donde explicamos un poco mas lo que hacemos. Estamos ampliando nuestra cartera de clientes y creemos que vuestra empresa puede estar interesada en los servicios que prestamos. Hemos observado que disponen de maquinaria como la que usan nuestros clientes, la cual llevamos años reparando y manteniendo. Nos encantaría tener una entrevista mas personal con vosotros para que nos conocierais, explicaros mejor a que nos dedicamos y el tipo de maquina que hemos reparado. También estamos a vuestro servicio para cualquier avería o consulta de repuestos, ya que tenemos precios mejorado y originales de marcas principales com KALMAR, BELOTTI, LUNA, KONECRANES,HYSTER, FANTUZZI etc. Nuestra tarifa de precios es competitiva y esta incluida en el dossier. A la espera de noticias recibe un cordial saludo. [image: image.png] ISAAC GÓMEZ Director Técnico Comercial REPARACIONES GOMAR, S.L. Telf.: +34 619258992 Mail: repgomar@gmail.com Este mensaje y sus archivos adjuntos van dirigidos exclusivamente a su destinatario, pudiendo contener información confidencial sometida a secreto profesional. No está permitida su reproducción o distribución sin la autorización expresa de REPARACIONES GOMAR, S.L.. Si usted no es el destinatario final por favor elimínelo e infórmenos por esta vía.Le informamos que tratamos sus datos personales con la finalidad de realizar la gestión administrativa, contable y fiscal, así como enviarle comunicaciones comerciales sobre nuestros servicios. Los datos proporcionados se conservarán mientras se mantenga la relación comercial o durante los años necesarios para cumplir con las obligaciones legales. Los datos no se cederán a terceros salvo en los casos en que exista una obligación legal. Asimismo, le informamos de la posibilidad de ejercer los siguientes derechos sobre sus datos personales: derecho de acceso, rectificación, supresión u olvido, limitación, oposición, portabilidad y a retirar el consentimiento prestado. Para ello podrá enviar un email a: repgomar@gmail.com. Además, el interesado puede dirigirse a la Autoridad de Control en materia de Protección de Datos competente para obtener información adicional o presentar una reclamación. Si usted no desea recibir nuestra información, póngase en contacto con nosotros enviando un correo electrónico a la siguiente dirección: repgomar@gmail.com. Datos identificativos: REPARACIONES GOMAR, S.L., B81746109, CL ÁMSTERDAM 3 - NAVE 6 - 28813 - TORRES DE LA ALAMEDA - MADRID', 736, 'VCONT', 3, 'NOGEST', 'EMAIL'),
