	(1002, '2019-12-09 23:55:05', '2019-05-28 15:46:30', 'Solicitud Informacion', 'Buenas tardes. Les escribo desde el centro de emergencias 112 SOS Aragón del Gobierno de Aragón. Necesitamos un presupuesto para la instalación de una zona de vida en el circuito de Motorland (Alcañiz) durante los días 19 al 22 de septiembre, ambos inclusive. Como verán en el dibujo adjunto se trataría de módulos unidos (A,B Y C) formando un comedor; otros cuatro módulos unidos (D, E, F y G) formando una zona de estar/descanso; dos aseos (uno para hombres y otro para mujeres); dos despachos separados (módulos H e I) y una zona aparte con tres módulos (J y K serían dormitorios) + aseo para los pilotos del helicóptero del 112. He tomado como referencia los módulos de 6 metros que he visto en su web. Quedo a la espera de tus noticias. Recibe un cordial saludo. Michel Fernández Técnico de Emergencias 112 Aragón -- ** * *** *Técnico de Centro de Emergencias* *112 S.O.S. Aragón* Servicio de Seguridad y Protección Civil • Gobierno de Aragón Pº María Agustín, 36 • 50071 Zaragoza Teléfono: 976 71 30 03 Correo-e: Temergencias112@aragon.es Web: 112Aragón', 737, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1003, '2019-12-09 23:55:05', '2019-05-28 17:43:37', 'Pressupost mòdul de vestidor', 'Hola, voldria pressupost, si és possible, d\'un mòdul prefabricat de vestidor amb la distribució que adjunto en un croquis, per entregar a Sant Cugat. Gràcies per l\'atenció. Romà Crespiera arquitecte Crespiera Simó Diagonal Arquitectura SLP visiteu la nostra web segueix-nos a facebook', 738, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1004, '2019-12-09 23:55:05', '2019-05-28 17:44:08', 'Venta Módulos y Casetas', 'Buenos días.\r\n\r\nEstoy interesado y quisiera recibir más información de la oferta [Caseta de obra de ocasión].\r\n\r\nMuchas gracias.', 739, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(1005, '2019-12-09 23:55:05', '2019-05-28 18:37:03', 'ALQUILER CONTENEDORES SIRO AGUILAR', 'Buenas Tardes, Soy Beatriz, de Siro Aguilar de Campoo, y estoy interesada en el Alquiler de dos containers de 12 metros de 40\' con temperatura controlada, 15-16º C. Sería para mediados de Junio hasta mediados de Septiembre aproximadamente. También necesitaríamos grúa para su instalación. ¿me pasáis presupuesto? Gracias de antemano Un saludo / kind regards Beatriz Vítores Cadena de Suministro Tel. 676 628 582 / Ext. 3788 Beatriz.Vitores@cerealtosiro.com [cid:image001.jpg@01D4A846.181D56A0] NUESTRA DIRECCIÓN DE CORREO ELECTRÓNICO HA CAMBIADO, ACTUALIZALA POR FAVOR. Antes de imprimir este e-mail piense si es imprescindible hacerlo. El cuidado del medioambiente es responsabilidad de todos. Este correo electrónico y la información contenida en él es confidencial, dirigiéndose exclusivamente al destinatario mencionado en el encabezamiento. Si hubiese recibido o accedido a este mensaje por error, le rogamos que nos lo comunique y proceda a destruirlo de inmediato. Cualquier divulgación, copia, distribución o utilización no autorizada de la información contenida en la mismo está prohibida por la legislación vigente. Los datos personales facilitados por usted o por terceros forman parte de un fichero responsabilidad de Cerealto Siro Foods, S.L. con la finalidad de canalizar las oportunas comunicaciones que se produzcan como consecuencia de la relación que mantiene con Cerealto Siro Foods. Normalmente, la base jurídica que legitima este tratamiento será su consentimiento, el interés legítimo o la necesidad para gestionar una relación contractual o similar. El plazo de conservación de sus datos vendrá determinado por la relación que mantiene con nosotros. Para más información al respecto, o para ejercer sus derechos de acceso, rectificación, cancelación/supresión, oposición, limitación o portabilidad, dirija una comunicación por escrito a Ctra.Burgos-Portugal, Km.84, 34200 Venta de Ba