	(1006, '2019-12-09 23:55:05', '2019-05-28 19:04:33', 'Consulta alquiler contenedores.', 'Buenas tardes , nos ponemos en contacto con ustedes para exponerels un tema un poco especial que les queremos comentar. Del 25 de Julio al 25 de Agosto se celebra en Pineda de Mar la 9ª edicion del festival de Muisca Arts d´Estiu , en el espacio ESPAI MARITIM , tendremos un total de 20 conciertos , ver weeb artsdestiu.com. Este espacio necesita de un cerramiento ya que prácticamente todo el espacio es diafono y al cobrar entrada necesitamos de efectuar el cerramiento del recinto. Hemos pensado que mediante la utilización de sus containers de 40 pies ( 12 mts ) podemos efectuar un cerramiento del espacio , etc... quizás lo mejor seria tener una reunión con ustedes para exponerles nuestra idea técnica ya que ustedes disponen de diferentes productos que nos puede ser muy útiles. Les paso mis datos para contactar y establecer esta reunión técnica. * TONI MAS* *MMEVENTOS SLU* *612481157.*', 741, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(1007, '2019-12-09 23:55:05', '2019-05-29 07:32:27', 'FW: Contacto', 'Buenos días. He observado que los productos que ofrecen en su pa?gina de Internet tienen mucho potencial para la venta en li?nea. Por eso, quiero proponerles un cata?logo totalmente nuevo que contiene ma?s de 1.500.000 contactos de propietarios de empresas espan?olas. Gracias a ese completo cata?logo, su oferta llegara? a ma?s de 1 millo?n de clientes potenciales ¡en un solo di?a! *** Base de datos de empresas españolas - 1.548.400 registros. - 190.00 € - Sólo hasta el 29/05/2019 http://www.dbm-es.com/?p=1 Atentamente, GC-Support-Team', 386, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1008, '2019-12-09 23:55:05', '2019-05-29 08:06:45', 'pressupost', 'Bon dia. Reiterem la nostra sol·licitud de pressupost feta via web de la seva empresa i correu electrònic. Gràcies i salutacions. Carmen Enrique Àrea d\'Infraestructures i Serveis Generals Balmes, 21 3r 2a Tel. 93 403 54 55 mcarmeenrique@ub.edu [cid:image004.png@01D47042.E68BEFB0] De: Maria Del Carmen Enrique Fernandez Enviat: dijous, 16 de maig de 2019 12:55 Per a: comercial@zarca.es Tema: Solicitud Informacion Empresa: UNIVERSITAT DE BARCELONA Teléfono: 93 403 54 565 Buenos días. Hace unos días hicimos esta pregunta vía web de su empresa: Deseamos saber el precio del alquiler de una caseta de unos 6m de largox2,50x2.50 por un periodo de un año, provista de estanterías. También nos interesa saber el precio de compra de dicha caseta, o de un contenedor. Un saludo cordial. Carmen Enrique Àrea d\'Infraestructures i Serveis Generals Balmes, 21 3r 2a Tel. 93 403 54 55 mcarmeenrique@ub.edu [cid:image004.png@01D47042.E68BEFB0] Aquest missatge, i els fitxers adjunts que hi pugui haver, pot contenir informació confidencial o protegida legalment i s\'adreça exclusivament a la persona o entitat destinatària. Si no consteu com a destinatari final o no teniu l\'encàrrec de rebre\'l, no esteu autoritzat a llegir-lo, retenir-lo, modificar-lo, distribuir-lo, copiar-lo ni a revelar-ne el contingut. Si l\'heu rebut per error, informeu-ne el remitent i elimineu del sistema tant el missatge com els fitxers adjunts que hi pugui haver. Este mensaje, y los ficheros adjuntos que pueda incluir, puede contener información confidencial o legalmente protegida y está exclusivamente dirigido a la persona o entidad destinataria. Si usted no consta como destinatario final ni es la persona encargada de recibirlo, no está autorizado a leerlo, retenerlo, modificarlo, distribuirlo o copiarlo, ni a revelar su contenido. Si lo ha recibido por error, informe de ello al remitente y elimine del sistema tanto el mensaje como los ficheros 