	(1009, '2019-12-09 23:55:05', '2019-05-29 10:00:04', 'Caseta monte', 'Hola qué tal? Estamos barajando de poner una caseta en nuestro huerto, de unos 1200 m*. Hemos visto su pagina y querríamos tener información de precios. Que costaría algo como la foto que le enviamos? Y otra cosa, ya que ustedes tendrán más experiencia, es saber si se necesitan permisos especiales, como los de obra, ya que va a ser, como le he dicho antes en un huerto fuera del pueblo. Si me aconsejan otra cosa, háganmelo saber, Les paso mi móvil por si lo prefieren 670407785 Un saludo, Ezequiel [Image] Descarga Outlook para iOS', 742, 'VCONT', 4, 'NOGEST', 'EMAIL'),
