	(1011, '2019-12-09 23:55:05', '2019-05-29 13:52:30', 'instalaciones', 'Buenos días: Hemos de empezar una obra y tengo que montar unas pequeñas instalaciones. ADJUDICADA a la UTE PRESA DE L´ALBAGES (OSEPSA ? ELECNOR): PROYECTO DE OBRAS COMPLEMENTARIAS Y ACABADOS Nº 1 DE LA PRESA DE L´ALBAGÉS. TT.MM. DE L´ALBAGÉS Y CERVIÁ DE LES GARRIGUES (LLEIDA) Necesito precio de lo siguiente: · 2 Contenedores grandes · 2 Contenedores pequeños · 1 Caseta para poder instalar una o dos mesas y una estantería, etc. (a modo de oficina) · 1 Caseta con un par de baños, lavabo · 2 WC químicos Pásame precio de alquiler y de venta. Si de algo no tenéis me lo comentas. La duración de la obra es un año. Sería para entregar el material en Albages. UN saludo SERGIO SANTAFE VALERO Departamento técnico cid:image003.jpg@01D4D99B.FB1654D0 OBRAS Y SERVICIOS PÚBLICOS, S.A. CIF: A-28012359 DELEGACION NORESTE C/ Alcoraz nº 8, 2º G 22.002 HUESCA Tfno. 974 21 19 49 Móvil: 647 45 60 45 Página web: www.osepsa.es Se informa a quien recibiera este documento sin ser el destinatario o persona autorizada por éste, que la información contenida en el mismo es confidencial y su utilización y/o divulgación está prohibida. Si ha recibido este documento por error, le rogamos nos lo comunique y proceda a su destrucción. En cumplimiento de la normativa de protección de datos, se informa igualmente al destinatario del presente correo electrónico del tratamiento de sus datos por parte de la empresa con fines de contacto y basado en el interés legítimo para el mantenimiento de la relación existente entre remitente y destinatario. Los datos se conservarán mientras se mantenga dicha relación y no se solicite su supresión y, en su caso, durante los plazos legales de aplicación. Los interesados pueden ejercitar sus derechos de acceso, rectificación, supresión, portabilidad y la limitación u oposición dirigiéndose a la dirección de nuestras oficinas en Calle Víctor Andrés Belaunde, 27, C.P. 28016, Madrid, así como a reclamar 