	(1017, '2019-12-09 23:55:05', '2019-05-30 10:49:50', 'Evento Madrid 7 septiembre / MARACATÚ', 'Buenos días, Les escribo desde Maracatú, agencia de eventos ubicada en Madrid. El próximo sábado 7 de septiembre tenemos un festival de música en Madrid capital y estamos buscando una estructura tipo contenedor de este tipo para una marca: Lo necesitaríamos el viernes por la mañana en Madrid y la recogida sería el domingo a primera hora (6-8 septiembre). ¿Podrías presupuestarnos ambos modelos? Nosotros nos encargaríamos de customizarlo. Quedamos a la espera. Muchas gracias de antemano. Saludos, Rebeca. Rebeca Martínez Ballesteros Partner & Account Director M: +34 620 94 87 62 wearemaracatu.com', 750, 'VCONT', 3, 'NOGEST', 'EMAIL'),
