	(1019, '2019-12-09 23:55:05', '2019-05-30 18:19:50', 'Alquiler caseta de obra 7-8-9 junio Cornellá', 'Buenas tardes, Les escribo desde Mediatem, una empresa del grupo Mediapro. Necesitaríamos conocer el presupuesto de alquiler para una caseta de obra de unos 15 m2 del 7 al 9 de junio en el Campo Municipal de Cornellá. Instalación viernes por la mañana recogida lunes por la mañana. Alguna como esta por ejemplo: [cid:image001.jpg@01D51714.442C8210] Gracias, Un saludo! [firma (1)]', 751, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1020, '2019-12-09 23:55:05', '2019-05-30 19:03:31', 'Solicitud de presupuesto ', 'Interesada en conocer el precio de modelo: Oficina Acristalada Gris (3m Ancho)\r\nMódulo prefabricado oficina acristalada gris de 7,20 x 3 metros (anchura especial) con aire acondicionado.\r\n', 752, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1021, '2019-12-09 23:55:05', '2019-05-30 19:17:42', 'Oferta de contenedores de frío - cámara', 'Buenas tardes: Somos una bodega de la Ribera del Duero que estamos buscando alquilar contenedores para control de temperatura durante el mes de octubre en vendimia. Nos gustaría tener una oferta para las unidades de 6 y 12 metros. Entendemos que con 2 unidades de 12 metros o bien 4 de 6 podríamos organizar nuestras necesidades. Si necesitan más información, por favor pónganse en contacto conmigo. Gracias y un saludo', 753, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1022, '2019-12-09 23:55:05', '2019-05-30 20:46:03', 'deposito de agua', 'Hola, para montar un depósito de agua en una finca en el campo he pensado en un contenedor. no sé si el producto a contratar es un contenedor y luego simplemente sellarlo yo por dentro para quitar fugas o el producto debería ser el contenedor ya transformado, aunque no necesito ni techo practicable, ni cristal para ver el interior ni nada. me dejo aconsejar si debería ser  un contenedor de 6 o 12m en función de si necesitaría más transformación el de 12 y pudiera subir el precio.\r\ngracias\r\n', 754, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1023, '2019-12-09 23:55:09', '2019-05-30 21:25:28', 'Cotización contenedores Open Side', 'Estimados. Buenas tardes. Antes que nada me presento, mi nombre es German De Stefano. Trabajo en el departamento técnico de la firma Pfisterer de Argentina. Ante un nuevo proyecto que estamos licitando, necesitamos cotizar 4 contenedores Open Side de 40 pies, como el de la siguiente imagen: Ante la posibilidad de realizar alguna modificación sobre el modelo base, me gustaría hacer las siguientes consultas: 1) Si se dividiera el largo total del contenedor en 4 partes iguales, se puede realizar una división interna en un cuarto del largo? Como se indica en el siguiente esquema: 2) Se puede reducir la cantidad de puertas de acceso lateral de forma de acceder solamente a las ¾ partes del contenedor y contar solamente con una puerta en el extremo? O, en su lugar, no contar con puerta en el extremo y que la totalidad del acceso sea por el lateral? A su vez, los contenedores deberán cumplir con los siguientes requisitos, solicitados por nuestro cliente: A los componentes de acero se le hará un tratamiento previo de superficie por lo menos con el grado A SA 2 1/2, o de la norma sueca. Y se pintarán con pinturas de tipo marino con las siguientes especificaciones: Exterior: 80 micras de fondo anticorrosivo cromato de zinc (dos manos) 60 micras de pintura acrílica (dos manos) Interior: 30 micras de fondo anticorrosivo 60 micras de pintura de acabado acrílico o epóxico Inferior: 60 micras de fondo anticorrosivo cromato de zinc 140 micras de pintura negra epoxi bituminosa (2 componentes) Es obligatoria la aplicación del esquema de pintura a todas las ?caras? del contenedor sin excepción. Los 4 contenedores deberán ser entregados en Montevideo (Uruguay) Desde ya muchas gracias, quedamos a la espera de sus consultas. Saludos! Germán De Stefano Departamento de Obras Tel: +54 011 4304-7114 (Int.140) Fax: +54 11 4362-2381 Cel: +54 11 3217-9619 gdestefano@pfisterer.com.ar PFISTERER S.A. Avda. V