	(1044, '2019-12-09 23:55:10', '2019-06-04 17:07:21', 'revista logistica industrial 2000', 'Adjunto te envío, una vez más, nuestra revista “ LOGISTICA INDUSTRIAL 2000”, correspondiente al mes de Junio de 2019 y, como siempre, totalmente gratuita. Te recuerdo que si tienes algo que de lo que informar relacionado con tu empresa, en lo que se refiere a nuevos productos, reportajes, etc. nos puedes hacer llegar la nota de prensa correspondiente, para insertarla en la revista. Esto también es gratuito. De la misma forma si hay alguna persona de la empresa que no reciba la revista y tienes interés en que la reciba, envíanos un correo con sus datos y se la haremos llegar inmediatamente. Saludos cordiales José A. Herreros Gerente Libre de virus. www.avast.com <#DAB4FAD8-2DD7-40BB-A1B8-4E2AA1F9FDF2>', 382, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1045, '2019-12-09 23:55:10', '2019-06-04 18:01:16', 'Caseta/Contenedores para Oficina en Obra', 'Buenas tardes, Mi nombre es Jose Luis Lázaro de la Empresa TRECOM COMPONENTES, nuestra empresa se dedica a la venta y exportación de recambios de maquinaria de movimiento de tierras pero en ocasiones como se da el caso ahora, unos de nuestros clientes en Sudamérica nos pide si le podemos ayudar ofertándole unas Casetas/Contenedor para Oficina. Necesitaríamos que nos ofertaran las siguientes Casetas/Contenedores para Oficina en Obra (4 Unidades) con las siguientes características - Medidas de un Contenedor de 20´ - Pintura (bajo pedido) RAL7035 - Recubrimiento interior Truciolar blanco - Recubrimiento techo Truciolar blanco - Aislamiento lana mineral 60 mm paredes 100 mm techo, 60 mm piso - Sistema eléctrico con cuadro y tomas, según normativa IT 400v/32A/3f+N+T - Piso cemento-madera recubrimiento piso PVC gris Necesitaríamos la oferta de La oficina portátil vacía, sin ningún tabique y montada (Creo que el modelo ANA6000 sería el correcto, pero vosotros sois los expertos). Y por favor el precio de la oferta que sea puestas en el Puerto de Bilbao. Estas Casetas como les comentaba serian para exportarlas a Sudamerica. Quedamos a la espera de su rápida contestación. Gracias de Antemano. Atentamente. Jose Luis Lázaro Dpto. Compras Trecom Componentes Telf.: 976 22 97 61 Mov.: 625 64 01 47', 773, 'VCONT', 4, 'NOGEST', 'EMAIL'),
