	(1068, '2019-12-09 23:55:11', '2019-06-06 15:42:10', 'presupuesto módulo oficina OFI66', 'Buenas tardes, les escribo para pedir presupuesto de un container tipo oficina para ticketing. Se trataría de dos módulos para el evento World Roller Games que se celebra ahora en Julio. Uno se instalaria del 5 al 13 de Julio en el Passeig Marítim del Bogatell, junto al forum. El otro se instalaria del 27 de Junio al 15 de Julio en el CEM de la Mar bella. Los dos módulos serian iguales, dos ventanas, puerta, diáfanos y aire acondicionado. Con posibilidad de tener mesa o barra de trabajo para la venta de entradas. Sin barrotes también a poder ser. Le paso los datos de facturación por si tienen que abrir ficha y mandarme presupuesto. FUNDACIÓ ROLLER SPORTS G66792839 C/ ALMOGÀVERS, 64?66 3er 08018 BARCELONA Gracias de antemano Manel Jiménez 699877513', 787, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1069, '2019-12-09 23:55:11', '2019-06-06 18:36:45', 'RV: Cámaras congelado mantequera', 'Buenas tardes, Me dirijo para comunicaros la retirada del contenedor frigorífico ubicado en la industria láctea de COVAP - Os pido me indiquéis con antelación la fecha de la retirada del mismo y el procedimiento a seguir. Gracias Saludos [cid:image001.jpg@01D34676.A4375010] Jesús Cosín Delegado Comercial Zona SUR Móvil 616 10 40 39 jesus.cosin@morillo.es www.morillo.es 902 380 220 SERVICIO 24 HORAS Este mensaje y sus adjuntos contienen información confidencial y reservada dirigida exclusivamente a su destinatario. Si ha recibido este mensaje por error, se ruega lo notifique inmediatamente por esta misma vía y borre el mensaje de su sistema. Nótese que el correo electrónico vía Internet no permite asegurar ni la confidencialidad de los mensajes que se transmiten ni la correcta recepción de los mismos. Los datos derivados de su correspondencia se incluyen en un fichero de titularidad de COMERCIAL DE MAQUINARIA MORILLO S.A.U.. cuya finalidad exclusiva es gestionar las comunicaciones de la empresa entendiéndose que usted consiente el tratamiento de los mismos con dicha finalidad al mantener tal correspondencia. Para darse de baja o ejercer sus derechos de acceso, rectificación, cancelación u oposición puede realizarlo dirigiéndose por escrito a la dirección: Av. Generalitat 146, 08191, Rubi, Barcelona o por mail: info@morillo.es', 421, 'VCONT', 4, 'NOGEST', 'EMAIL'),
