	(1072, '2019-12-09 23:55:11', '2019-06-07 06:01:15', 'Boletín 07 junio 2019', '7 de junio 2019 La digitalización modela el futuro de una logística que seguirá en manos de las personas JAIME PINEDO Múnich Logística, tecnología e innovación son tres elementos indisociables que esta semana gozan de una especial visibilidad en los pabellones del recinto ferial de Múnich, donde la feria bienal Transport Logistic expone la mayor oferta mundial de productos y servicios dirigidos a satisfacer la creciente demanda de un movimiento eficiente de las mercancías en un mercado global. R. Egea: “Hay empresas que están más pendientes de las estadísticas que de la seguridad real de las personas” Fernando Vitoria La ciudad de Valencia ha acogido esta semana la reunión de la Comisión Estatal de Prevención del sindicato de estiba Coordinadora, así como una jornada técnica de coordinación de actividades empresariales organizada por la Fundación de Estudios Portuarios (Funespor). Rafael Egea, presidente de Coordinadora en Valencia y que además ostenta el cargo de secretario de la Comisión, aseguró ayer a este Diario que “aunque se va avanzando poco a poco, todavía hay que seguir trabajando duro para conseguir implantar una cultura efectiva de la prevención y la seguridad en los puertos, de hecho, hay empresas que están más pendientes de las estadísticas, o de cómo manejar los datos sobre accidentabilidad, que de la seguridad real de las personas que trabajamos en los puertos”. Natalia Vicente, nueva responsable de Seguridad y Prevención de Coordinadora en Valencia FERNANDO VITORIA Valencia Rafael Egea, presidente de Coordinadora en Valencia y Natalia Vicente, miembro del comité de empresa del CPE por parte de Coordinadora, son dos de los representantes valencianos que han participado en la Comisión y en la Jornada Técnica. La unidad ecológica Paco Prado Renfe Mercancías digitaliza toda su operativa y logra un seguimiento 100% en tiempo real MIGUEL JIMÉNEZ Madrid FGC?prevé doblar las circulaciones de trenes de potasa ante el aumento de tráficos de ICL ELENA GARCÍA Barcelona VitransGroup coordina la operativa logística del “Arctic Sunrise” en el puerto de Bilbao DP Bilbao Prácticos de Valencia SLP incorpora al servicio una nueva embarcación Rodman 41 MAGDA TATAY Valencia PortCastelló suspende la operativa en una zona del muelle transversal exterior por su deterioro DP Castellón La UE?garantizará con un marco jurídico común la interoperabilidad en el transporte DP Madrid El crucero “Le Bougainville” de Ponant se estrena en Barcelona JUAN CARLOS SARMENTERO Barcelona Dachser potencia los conceptos de integración y conectividad de los sistemas y los procesos JAIME PINEDO Múnich Diego Dareco apuesta crecer en el mercado alimentario a través de la internacionalización JAIME PINEDO Múnich Grupo Diario en Transport Logistic 2019 DP Múnich Sparber encuentra en Transport Logistic una fórmula para seguir creciendo al ritmo del mercado JAIME PINEDO Múnich La Escola Europea promociona Translogmed en el norte de África JAIME PINEDO Múnich Alfil Logistics muestra en Múnich su vocación como socio global para la eficiencia logística JAIME PINEDO Múnich Logística Suardíaz presenta su nueva imagen en Transport Logistics JAIME PINEDO Múnich La Asamblea General del Montepío será el 27 de junio DP Valencia Las empresas vascas dispondrán de un instrumento financiero de 100 millones para iniciativas de inversión productiva DP Bilbao Síganos en: ¿Podemos ayudarle? TEL: +34 96 330 18 32 08039 BARCELONA | Tel. 93 289 67 07 | barcelona@grupodiario.com 48009 BILBAO | Tel. 94 425 72 48 | bilbao@grupodiario.com 28003 MADRID | Tel. 91 536 21 17 | madrid@grupodiario.com 46120 Alboraya. VALENCIA | Tel. 96 330 18 32 | valencia@grupodiario.com Si no desea seguir recibiendo esta publicación haga click aquí para darse de baja en el servicio.', 775, 'VCONT', 3, 'NOGEST', 'EMAIL'),
