	(1075, '2019-12-09 23:55:11', '2019-06-07 09:03:34', 'Venta Contenedores', 'buenos días.\r\n\r\nMi nombre es Carlos vidal Garcia, soy el subdirector técnico de la cadena paidesport center, una cadena de centros fitness/wellness, con 9 instalaciones en toda españa.\r\n\r\nEstaríamos interesados en recibir más información de precios de venta de contenedores marítimos de 9 y 10 pies, con suelo de madera, color exterior negro, luz interior e instalación para poder recibir corriente eléctrica y cierre con candado convencional.\r\n\r\nLa idea seria realizar una prueba piloto en uno de nuestros centros, para utilizarlo como almacenaje exterior para el material.\r\n\r\nestaríamos interesados también es ver si podrían gestionar su porte o traslado hacía una de nuestras instalaciones ubicadas en Oviedo o Aviles (Asturias) y añadir este coste al presupuesto.\r\n\r\nmuchas gracias.\r\n\r\nun saludo, atentamente.\r\n\r\nCarlos vidal Garcia.', 791, 'VCONT', 4, 'NOGEST', 'EMAIL'),
