	(1090, '2019-12-09 23:55:12', '2019-06-10 05:58:49', 'Boletín 10 junio 2019', '10 de junio 2019 Transport Logistic Munich confirma el enorme poder transformador de la logística JAIME PINEDO Munich No siempre es sencillo confirmar las grandes expectativas que Transport Logistic despierta cada dos años, pero finalmente este certamen siempre acaba lográndolo. Hay muchas ferias sectoriales especializadas en las diferentes variantes y mercados del transporte y la logística, pero Transport Logistic sigue siendo la gran referencia. María José Serra asume la dirección del operador Yusen Logistics en Valencia LOLI DOLZ Valencia El operador de servicios logísticos Yusen Logistics Ibérica cuenta, desde el pasado mes de febrero, con una nueva directora en su sede de Valencia. La Cátedra Fundación Aduanera-URV impartirá “el máster por excelencia” en Derecho Aduanero DP Barcelona La Cátedra Fundación Aduanera-URV de Estudios Aduaneros, nacida de la colaboración entre la Fundación Aduanera y la Universitat Rovira i Virgili (URV), empezará a impartir el 15 de octubre la primera edición de su Máster en Derecho Aduanero, llamado a ser “el máster por excelencia” de esta materia en España, tal y como destacaron el pasado jueves en su presentación Alejandro Arola, presidente de la Fundación Aduanera, y Jordi Palomar, director de la Academia Aduanera y coordinador del Máster en Derecho Aduanero. Informados desinformados Elena García De la Encina muestra su apoyo a los proyectos e inversiones que desarrolla Valenciaport DP Valencia El Gobierno autoriza la contratación de dos trabajadores en el Puerto de Málaga para permitir el tráfico de mercancías durante los fines de semana DP Málaga La CNMC seguirá “muy de cerca” el acuerdo de colaboración entre Correos y Amazon INMA PEÑA Madrid El índice VCFI aumenta un 0,02% en mayo DP Valencia Cristina Granados, nueva socia de Propeller Valencia DP Valencia La carga aérea encuentra en Múnich una feria a su medida JAIME PINEDO Múnich Embalex aprovec