	(1096, '2019-12-09 23:55:12', '2019-06-10 16:14:34', 'Containers presupuesto', 'Buenas tardes, Voy a montar un negocio de resaturacion tipo Sports Bar y necesito varios contenedores de 20 pies o 40 pies de altura 2.59 o mejor incluso de los de 2.90 usados para transformarlos. si fueran de 20 pies, necesito dos para cocina, 1 para cuarto de bano, 1 para almacen y 16 para zona de comedor. Os mando una idea de como seria el diseno en unas fotos. Querria un presupuesto desglosado por partes: 1) Coste de los containers 2) Estimacion coste de transporte de los containers a Marbella o Palma de Mallorca.3) Trasnformacion de los containers en base al diseno aportado.4) Tiempos estimados para disponer de los containers sin transformar y tras la transformacion. Muchas gracias de antemano y un saludo, Beatriz Pagola+97433041983', 802, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(1097, '2019-12-09 23:55:12', '2019-06-10 16:23:19', 'Presupuesto', 'Buenas tardes, me pongo en contacto porque estaría interesado en una cámara de congelación portátil, ver si hay alquiler con opción a compra, alquiler únicamente o compra de cámara nueva o de 2ª mano. \r\nEn caso del alquiler, estimo que la duración mínima sería de un año.\r\n\r\nSe trabajaría con productos cárnicos y la ubicación sería en interior de una nave.\r\n\r\nEn cuanto a dimensiones quisiera ver las diferentes ofertas disponibles entre 10-30 palets.\r\n\r\nSaludos,', 803, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1098, '2019-12-09 23:55:12', '2019-06-10 16:50:12', 'Factura JET-NET', 'Buenas tardes, Adjuntamos la factura del servicio de limpieza de tuberías realizado el mes de mayo. Gracias y un saludo, -- *Dep. Administració i Att. al Client* *Tel. 931.021.099 - 669.984.484* *www.desatascosjetnet.com *', 804, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1099, '2019-12-09 23:55:12', '2019-06-10 18:09:51', 'RE: Cámaras congelado mantequera', 'Buenas tardes Cuando tiene previsto venir a por el contenedor ¿? Gracias De: Jesus Cosin Enviado el: jueves, 6 de junio de 2019 18:37 Para: Comercial ZARCA CC: \'w_ladi@hotmail.es\' ; Delegacion Malaga Asunto: RV: Cámaras congelado mantequera Buenas tardes, Me dirijo para comunicaros la retirada del contenedor frigorífico ubicado en la industria láctea de COVAP - Os pido me indiquéis con antelación la fecha de la retirada del mismo y el procedimiento a seguir. Gracias Saludos [cid:image001.jpg@01D34676.A4375010] Jesús Cosín Delegado Comercial Zona SUR Móvil 616 10 40 39 jesus.cosin@morillo.es www.morillo.es 902 380 220 SERVICIO 24 HORAS Este mensaje y sus adjuntos contienen información confidencial y reservada dirigida exclusivamente a su destinatario. Si ha recibido este mensaje por error, se ruega lo notifique inmediatamente por esta misma vía y borre el mensaje de su sistema. Nótese que el correo electrónico vía Internet no permite asegurar ni la confidencialidad de los mensajes que se transmiten ni la correcta recepción de los mismos. Los datos derivados de su correspondencia se incluyen en un fichero de titularidad de COMERCIAL DE MAQUINARIA MORILLO S.A.U.. cuya finalidad exclusiva es gestionar las comunicaciones de la empresa entendiéndose que usted consiente el tratamiento de los mismos con dicha finalidad al mantener tal correspondencia. Para darse de baja o ejercer sus derechos de acceso, rectificación, cancelación u oposición puede realizarlo dirigiéndose por escrito a la dirección: Av. Generalitat 146, 08191, Rubi, Barcelona o por mail: info@morillo.es', 421, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1100, '2019-12-09 23:55:12', '2019-06-10 18:25:21', 'SIN TITULO', 'Hola estaría interesado en conocer el precio del alquiler de una cámara frigorífica,por un lado la de 3m y por otro la de 6m.\r\nEl alquiler sería para Burriana,Castellon desde el 29 de julio al 5 de agosto\r\nGracias espero su respuesta', 100, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1101, '2019-12-09 23:55:12', '2019-06-10 18:29:49', 'Alquiler de cámara frigoríficas ', 'Hola estaría interesado en conocer el precio del alquiler de de dos Camaras frigorificas, por un lado la de 3m y por otro la de 6m\r\nEl alquilar sería desde el 29 de julio hasta el 5 de agosto en Burriana,Castellon\r\nGracias espero su respuesta', 100, 'VCONT', 4, 'NOGEST', 'EMAIL'),
