	(1109, '2019-12-09 23:55:12', '2019-06-11 11:25:44', 'AIP Barcelona - Gestión de proyectos', '*|MC:SUBJECT|**|MC_PREVIEW_TEXT|* * Gestionar proyectos es una tarea compleja que tiene que ser realizada con rigor y sobretodo mucho control sobre cada uno de los procesos. Gracias a nuestros cursos enfocados a la gestión de proyectos podrás dominar las distintas herramientas más utilizadas en las principales empresas. Para ello contamos con profesores con más de 30 años de experiencia en sectores profesionales y certificados en Autodesk o Adobe entre otros. * Presto Presto es el programa de presupuestos y mediciones BIM que integra la gestión y el control de costes para edificación y obra civil que comprende las diferentes necesidades de todos los agentes que intervienen en todas las fases: MS Project Microsoft Project es un software de administración de proyectos diseñado, desarrollado y comercializado por Microsoft para ayudar a administradores de proyectos en el desarrollo de planes, asignación de recursos a tareas, dar seguimiento al progreso, administrar presupuestos y analizar cargas de trabajo. REVIT Revit es un programa de diseño creado exclusivamente para proyectos de construcción. A partir del diseño en 3D del edificio se obtienen los planos en 2D que se precisan para la presentación del proyecto: planos de planta, alzados, secciones, así como vistas modelizadas que permiten mostrar el proyecto con gran realismo. Revit permite abordar los proyectos de modelado BIM en dos partes: el conocimiento del proyecto y la gestión del proyecto. AIP somos un centro con más de 30 años de experiencia donde te ofrecemos formación personalizada adecuada a las necesidades de tu empresa sin que tengas que preocuparte del proceso de bonificación ya que nosotros nos encargamos de gestionarlo. Ofrecemos servicios de formación en empresas o en nuestras instalaciones y contamos con el certificado de centro oficial de formación Adobe. INFORMATE SOBRE NUESTROS CURSOS Copyright ©, todos los derechos reservados. Nuestra dirección de correo es: guillem@aipbarcelona.com (guillem@aipbarcelona.com%20%C2%A0) ¿Desea cambiar la forma en que recibe estos correos electrónicos? Si no desea seguir recibiendo esta información puede darse de baja de esta lista.', 221, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1110, '2019-12-09 23:55:12', '2019-06-11 13:02:18', 'Oferta Módulos Vestuarios, Oficinas y Gimnasio - Urnieta (Guipúzcoa)', 'Buenos días, Necesitaría que nos ofertasen los siguientes módulos para su instalación en Urnieta (Guipúzcoa): * 1 Ud. de Módulo de Vestuario. * 1 Ud. de Módulo de Oficinas. * 1 Ud. de Módulo de Conjunto de Gimnasio. El inicio del montaje sería para el 1 de Agosto de 2019 y su finalización el 30 de Agosto de 2019. Adjunto planos y características de los módulos; el alquiler inicial sería de 22 meses, ampliable a otro 8 meses más. Si tienen cualquier consulta, no duden en ponerse en contacto conmigo. Gracias. Un saludo Jorge Navarro T/ 941 256 453 - F/ 941 254 395 jorgenavarro@ocisa.es Plaza del Mercado, 12 Bajo - 26001 Logroño (La Rioja) España - Email: ocisa@ocisa.es - Web www.ocisa.es', 807, 'VCONT', 3, 'NOGEST', 'EMAIL'),
