	(1112, '2019-12-09 23:55:12', '2019-06-11 14:47:10', 'venta contenedores', 'Buenas tardes,\r\n\r\nLe escribo desde la Fundación Contorno Urbano porque estamos interesados en la compra de un contenedor marítimo para un proyecto de regeneración urbana que estamos haciendo en L\'Hospitalet de Llobregat. \r\n\r\nEl proyecto es una actividad social que estamos realizando con los jóvenes y los vecinos de los barrios de la Florida y en esta primera fase necesitariamos para este verano un contenedor de unos 6m x 2,40m aproximadamente, el qual nos sirva primero para guarda material de construcción y posteriormente poder darle otros usos. Por esto, quisiéramos garantizar que el contenedor se pueda cerrar de forma segura y que es resistente a la bandalización. \r\n\r\nPor otro lado, el solar está unos metros por debajo del nivel de la calle y sería conveniente visitar el solar antes de su instalación. (adjuntamos fotos)\r\n\r\nResumiendo, solicitamos un presupuesto de contenedor básico de 6m x 2.40m aprox, más transporte. No importa si es nuevo o reutilizado.  \r\n\r\nTambién hemos visto que tenéis otras opciones de contenedores que se abren por los laterales y también casetas de obra, nos podríais informar de ofertas que se puedan ajustar a lo que estamos buscando y que nos puedan ser de interés? \r\n\r\nPodéis poneros en contacto directamente con nosotras por teléfono o por correo electrónico:\r\n\r\nNinoska Juan 649 84 39 21\r\nMaribel Mata 627 98 69 18\r\ninfo@contornourbano.com\r\n\r\nGracias y saludos cordiales,\r\n', 808, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(1113, '2019-12-09 23:55:12', '2019-06-11 17:32:22', 'Contenedor maritimo 40 pies HC', 'Buenas tardes. Estoy buscando un contenedor maritimo de 40 pies y High Cube para guardar una aeronave. Necesito que esté en buenas condiciones, que sea semi nuevo. Puedes darme precio, puesto en la localidad de Broto (provincia de Huesca)? Gracias, un saludo, Mario.', 809, 'VCONT', 3, 'NOGEST', 'EMAIL'),
