	(1117, '2019-12-09 23:55:13', '2019-06-12 05:58:22', 'Boletín 12 junio 2019', '12 de junio 2019 Correos “está trabajando por ser viable en el menor tiempo posible” y reducir su déficit DP Madrid Grupo Correos “está trabajando por ser viable en el menor tiempo posible” y poder reducir su déficit de 178 millones, declararon ayer fuentes de la compañía a Diario del Puerto. Windward incorpora a su flota tres tractoras Man y tres plataformas extensibles D-Tec LOLI DOLZ Valencia Windward Operador de Transporte sigue alcanzando sus metas. Paso a paso y estando cerca del cliente, la empresa, que comenzó a operar hace dos años, ha ido cumpliendo sus objetivos a corto plazo y ha decicido invertir en tres nuevas tractoras de la marca Man y tres plataformas extensibles de la marca D-Tec. Boluda prepara en el Puerto de Vilagarcía la primera operativa ferroviaria hasta Ferrazo DP Vilagarcía Boluda, compañía concesionaria de la terminal de contenedores del Puerto de Vilagarcía, realizará este viernes una operativa ferroportuaria en el puerto arousano que supondrá el estreno por parte de un operador del trazado ferroviario al puerto desde su extensión a los muelles Comercial, de Comboa y de Ferrazo. CST Grupo incorpora el Depósito Aduanero en su oferta de servicios DP Valencia Synergy certifica en Miranda el éxito del servicio ferroviario con el Puerto de Barcelona DP Barcelona Mercadona pone en marcha su almacén logístico para la compra online en Barcelona DP Barcelona Los estibadores del Puerto de Algeciras defienden su profesionalidad INMA PEÑA Madrid El Puerto de Sevilla mueve la mayor torre eólica marina del mundo DP Sevilla El COACAV apuesta por la formación y programa un nuevo curso sobre el “Valor de la mercancía” DP Valencia El Propeller Junior visita el CPE de Valencia DP Valencia Aportem consigue instrumentos musicales y más de mil libros para menores del Marítimo DP Valencia Alicante Port celebra una mesa redonda sobre los usos complementarios de los faros DP Alicante 