	(1721, '2019-12-10 00:15:19', '2019-06-13 05:58:17', 'Boletín 13 junio 2019', '13 de junio 2019 GAM, vocación por el servicio con sus soluciones de maquinaria con un único proveedor JAIME PINEDO Oviedo La multinacional española GAM (General de Maquinaria de Alquiler), especializada en servicios relacionados con la maquinaria y más en concreto, en servicios integrales de alquiler y proyectos llave en mano para cualquier necesidad de elevación, manipulación, industria y energía, escenificó ayer su pasión por el servicio y su apuesta por un modelo empresarial que permita un “crecimiento colaborativo y plural”, como expuso su presidente, Pedro Luis Fernández, durante la celebración del evento “Partners’ Day” en su sede central de Granda, junto a Oviedo, la capital de Asturias. Navarro: “El SIL 2019 pondrá en conocimiento del público general lo que significa la logística” ELENA GARCÍA Barcelona La logística representa el 8% del Producto Interior Bruto (PIB) de España y el 13% de Catalunya pero “pese a su importancia, es un sector muy desconocido para una gran mayoría de la sociedad. Por tanto, uno de los objetivos del SIL 2019 es poner en conocimiento del público general lo que significa la logística y los cambios que estamos viviendo en este ámbito”. El Puerto de Barcelona acoge a 350 transitarios internacionales en SINO-European Conference DP Barcelona El Puerto de Barcelona acoge estos días a unos 350 transitarios procedentes de 80 países distintos participantes en la SINO-European International Freight Forwarders Conference, el principal encuentro de transitarios chinos y asiáticos en Europa que organiza la China International Freight Forwarders Association (CIFA), con la colaboración de la WCA Family of Logistic Networks (WCAF), la Asociación de Transitarios de Barcelona (ATEIA-OLTRA) y el Puerto de Barcelona. Honorabilidad FERNANDO VITORIA Valencia La logística entra en una fase “crítica” de cara a poder sacar partido a la digitalización MIGUEL JIMÉNEZ Madrid La c