	(1722, '2019-12-10 00:15:19', '2019-06-13 11:12:10', 'RETINEO.-19-029 solicitud ppto caseta', 'Buenos días, Vamos a empezar una obra para el Consorcio de Aguas de Tarragona en Tarragona. Por favor, solicito presupuesto de alquiler de una caseta oficina por 3 meses, comenzando el lunes 24 junio. Gracias. Saludos. -- Q Antes de imprimir este mensaje, asegúrate de que es necesario. Proteger el medio ambiente está también en tu mano. Este mensaje es confidencial y va dirigido únicamente a la persona propietaria de la dirección de correo. Si por cualquier error recibe este mensaje, por favor elimínelo inmediatamente junto con los documentos adjuntos / The information in this email is confidential and may be legally privileged. It is intended solely for the addressee. If this is not the case, please destroy it and any attached documents immediately.', 1254, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(1723, '2019-12-10 00:15:19', '2019-06-13 13:50:17', 'Presupuesto Caseta', 'Buenos días. Me llamo Alejandro Delgado y les escribo desde la Universidad Rey Juan Carlos. Estamos pensando en colocar unas casetas en el Campus de Fuenlabrada para poder utilizarlas de oficinas para diferentes asociaciones que puedan poner a disposición de nuestro alumnado una oferta diferente a la que tienen actualmente en el campus. Por ello, hemos visto en su página web la caseta que les pongo en el enlace: https://www.zarca.es/productos/venta-caseta-de-obra-ofal66-ocasion/ Más o menos es el tipo de caseta que venimos buscando para nuestro propósito, pero nos quedan un par de dudas al respecto. En primer lugar nos gustaría saber si la instalación eléctrica que tiene, sirve para conectarla directamente a la red eléctrica general o habría que hacer algo aparte; también y siguiendo con este tema, nos gustaría conocer la posibilidad de añadir algunos interruptores de corriente más o tomas de red para ordenadores. En segundo lugar, tenemos duda con respecto a la funcionalidad del baño con el que viene la caseta, ¿trae algún tipo de depósito séptico? O por el contrario ¿habría que conectarlo a la red de canalización? También nos gustaría que nos mostraran si fuera posible alguna imagen de como es la caseta por fuera, dado que en el enlace solo se ve el plano de la misma. Quedo a la espera de su respuesta, gracias por su atención. Un saludo. [logo urjc] Alejandro Delgado Ramírez Administrativo / Gestión Económica Universidad Rey Juan Carlos Campus de Fuenlabrada (Madrid), España Teléfono: 91 488 46 87 alejandro.delgado@urjc.es | www.urjc.es | @URJC | Por favor no imprima este documento salvo que sea absolutamente necesario. Gracias por su colaboración.[cid:image002.jpg@01CF4365.FA8D8410]', 1255, 'VCONT', 4, 'NOGEST', 'EMAIL'),
