	(1778, '2019-12-10 00:15:21', '2019-07-03 08:53:39', 'Presupuesto', 'Buenos días\r\n\r\nMe dirijo a ustedes para pedirle presupuesto para un módulo sanitario aislado de 4,00x2,40m que tuviera las siguientes características:\r\n\r\n3 Inodoros\r\n1 Urito\r\n2 Lavabos con pedestal\r\n2 Puertas exteriores\r\n2 Ventanas abatibles con reja dimensiones 500x500mm\r\n\r\nNos gustaría saber si existe la posibilidad de que tuviera acabado en madera, o forrado en madera el exterior.\r\n\r\nDel mismo modo agradecería nos hicieran llegar su catálogo de venta de módulos.\r\n\r\nSaludos.', 1294, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(1779, '2019-12-10 00:15:21', '2019-07-03 11:51:03', 'Venta Módulos y Casetas', 'Buenos días.\r\n\r\nEstoy interesado y quisiera recibir más información de la oferta [Módulo prefabricado / caseta de obra OFI 66 - Venta desde 1.950€ - ZARCA].\r\n\r\nMuchas gracias.', 1295, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1780, '2019-12-10 00:15:21', '2019-07-03 12:58:04', 'Oferta-Presupuesto', 'Les agradecería que me enviaran oferta de un contenedor de 20\'.  Es para ubicar un sistema de depuración de agua en su interior.  Requiere una pequeña transformación (puerta y ventana). Les ruego me envíen presupuesto solo contenedor y  añadiendo la transformación', 1296, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1781, '2019-12-10 00:15:21', '2019-07-03 14:30:59', 'Presupuesto', 'Buenas tardes:\r\n\r\nActualmente estamos realizando un Proyecto en Barbera del Valles y necesitariamos un presupuesto para las siguientes casetas:\r\n\r\n1.	1 x canteen – sized for 20PAX. Air-conditioned. With sink if possible.\r\n2.	1 x change room / wardrobe – sized for 20PAX\r\n3.	Toilet facilities sized for 15-20PAX. There is no sewage connection so needs to be self-contained and include servicing (pumping etc.)\r\n4.	1 x office space – could be a part of the canteen unit. Air-conditioned\r\n\r\nSi tuvieran alguna duda no duden en contactarme. \r\nEspero su respuesta muy pronto.\r\n\r\nUn saludo.\r\n\r\nJoshua Gasco', 1297, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(1782, '2019-12-10 00:15:22', '2019-07-03 17:49:39', 'Contenedor de 10 pies para almacén', 'Buenas tardes,\r\n\r\nEstoy buscando un contenedor marítimo de 10 pies (3 metros) de ocasión para usarlo como almacén en una finca rústica cerca de Mataró (Barcelona).\r\nHe visto en su web que disponen de ofertas de ocasión, no sé si tendrían alguna oferta de lo que estoy buscando.\r\nMe interesaría también saber si podrían hacer el transporte.', 61, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1783, '2019-12-10 00:15:22', '2019-07-04 11:07:13', 'Piscinas modulares', 'Buenas,\r\nEstoy interesado en saber presupuesto para una piscina modular a instalar en mi jardín en San Mateo (Gran Canaria)', 1298, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(1784, '2019-12-10 00:15:22', '2019-07-04 14:39:08', 'RENOVACIÓN CASETA DE COMEDOR Y LAVABOS', 'Sres, Disponemos de una superficie útil de 7x8. Mantendríamos una forma de “L” con dos nuevos módulos, de comedor y lavabos ( 2 servicios), con los accesos en la plazuela que queda, y el comedor podría tener ventanas en las dos caras largas y en la corta para que entre luz.\r\nEl comedor debe disponer de aire acondicionado,  calentador para agua caliente, pica y encimera con armario incorporado, e instalación eléctrica y enchufes para instalar electrodomésticos ( microondas, nevera, máquina de café, máquina de refrescos). La distribución debe ser tal que quepa mesa y sillas para 8 trabajadores..\r\nLos lavabos (2 servicios) tienen que tener retrete y lavamanos con agua fría y caliente. El agua caliente la cogeríamos de la instalación del comedor\r\nConsideren también en la propuesta retirar y llevaros los módulos existentes.\r\nQuedo a su disposición para cualquier aclaración y en espera de tu mejor oferta.\r\n', 1299, 'VCONT', 4, 'NOGEST', 'EMAIL'),
