	(1794, '2019-12-10 00:15:22', '2019-07-10 04:55:58', 'Container relative support from China', 'Dear Madam or Sir,\r\n\r\nI hope my email finds you well.\r\nThis is Suyee from China, we are one of the professional factory who have container plywood flooring and all the shipping cargo container repair spare parts for export.\r\nWe do business since 2010, always for container floor panels and all dry/refeer container spare parts export.\r\nWe have been worked with numberous of customers around world, some of them, example CIMC, MSC, MATEC,MECRC, etc.\r\n\r\nWe also have modular office/home/toilets etc. export directly from our factory to your port, also including all the spare parts for container modular office. \r\n\r\nIf you  have any request for these items, please feel free to contact with me on Email: suyee@ssshun.com or WhatsApp/Wechat:008617722838572, I will always reply you within hours.\r\n \r\nYours sincerely,\r\nSuyee \r\n', 1307, 'VCONT', 4, 'NOGEST', 'EMAIL'),
