	(1807, '2019-12-10 00:15:23', '2019-07-18 14:07:49', 'CONTENEDOR DE 8 A 12 PIES', 'Buenos días,\r\n\r\nNecesitaría precios para compra de un contenedor de 8 a 12 pies, ya sea nuevo o de segunda mano.\r\n\r\nSería para el Ayuntamiento de L\'Alfàs del Pi (Alicante), donde se debería realizar la entrega.\r\n\r\nRuego contacten conmigo para mayor información.\r\n\r\nAtentamente,\r\n\r\nSalvador Mañez.', 1318, 'VCONT', 4, 'NOGEST', 'EMAIL'),
