	(1813, '2019-12-10 00:15:50', '2019-07-22 10:38:12', 'alquiler de modulos prefabricados', 'buenos días:\r\nquería preguntarles si alquilan módulos prefabricados que puedan usarse como oficinas. Necesitariamos ubicar 24 personas \r\nagradeciendoles su atención , reciban un cordial saludo\r\nAndrés Ortiz\r\n', 1321, 'VCONT', 4, 'NOGEST', 'EMAIL'),
