	(1818, '2019-12-10 00:15:50', '2019-07-24 09:27:58', 'Venta Contenedores', 'Buenos días.\r\n\r\nEstoy interesado y quisiera recibir más información de la oferta [Container de 20\' Cargo Worthy - Venta desde 1.695€ - ZARCA].\r\n\r\nMuchas gracias.\r\n\r\nEstoy buscando un contenedor para usarlo de almacen en casa, vivo a las afueras de Alicante, el tema del coste del transporte y grua para descargarlo en mi casa como seria. Muchas gracias de antemano un saludo.', 61, 'VCONT', 4, 'NOGEST', 'EMAIL'),
