	(1845, '2019-12-10 00:15:51', '2019-08-05 10:07:49', 'Caseta Cafegra', 'Caseta per Cafegra\r\n\r\nBon dia  Eduard, la caseta te que ser sense un dels laterals llarcs, es a dir oberta, l’alçada i l’ampla crec que son estard, no?\r\nLa mida de llarc es 350cm tot i que podem anar fins els 360cm com a maxim-maxim.\r\nTambé ens podria anar be una de 400cm tot i que les preferències serien per les mides anteriors.\r\nTindria que portar instal•lació eléctrica que tindria de constar de :\r\n?	Llum al sostre, dos fluorescents  centrats  per poder  il•luminar de forma correcta l’interior, on  em de posar maquines de cafèé.\r\n?	Tres línees independents de dos endolls  xuco cada una , protegides amb 16Amp cada 2 endolls.  Tenen que estar repartits en el lateral llarc i a una alçada de 200cm del terre.\r\nPer suposat el quadre elèctric amb les proteccions de capçalera necessaris.\r\nPer últim també m’hauries de comptar el transport  i col•locació de la caseta a Vilaseca-Salou, Tarragona.\r\n', 1346, 'VCONT', 4, 'NOGEST', 'EMAIL'),
