	(1885, '2019-12-10 00:15:52', '2019-08-21 21:49:41', 'Melhorar Vendas', 'Bom dia, tudo bem?\r\n\r\nEstava vendo seu site www.zarca.es e percebi que ele pode te ajudar a vender mais com um Apresentador Virtual. \r\n\r\nÉ uma pessoa em 3D que fala seu texto. \r\n\r\n20 modelos diferentes para você escolher.\r\n\r\nNós criamos e instalamos em seu site. \r\n\r\nEle pode falar seu texto por até 2 minutos, veja os exemplos em nosso site: \r\n\r\nhttps://www.bceleva.com.br/produto/apresentador-virtual-para-sites/ \r\n\r\nCopie o endereço do site acima, cole na barra de endereços do seu navegador e aperte Enter.\r\n\r\nNosso Whatsapp para dúvidas (11) 9 5876 4459.\r\n\r\nSe não quiser receber mais este tipo de divulgação, por favor, responda este email com o endereço do seu site para removermos da nossa lista. Só queremos ajudar.\r\n\r\nAbraço.\r\n\r\nWilliam Marques\r\nEleva Brasil Solulções em Internet.', 1324, 'VCONT', 4, 'NOGEST', 'EMAIL'),
