	(2019, '2019-12-10 00:17:26', '2019-10-13 14:16:23', 'Decision sobre el tamaño a adquirir.', 'Apreciados Srs. de Zarca. S.L. \r\nEstoy interesado en la adquisición de un contenedor de 8 pies o 10 pies de  su empresa.\r\nNecesito su asesoramiento técnico, para no comentar errores en los cálculos del espacio, las medidas de los contenedores y el tamaño del mismo.\r\nMi duda está entre la elección de un contenedor de 8 pies y el de 10 pies, dependiendo de sus dimensiones. \r\nEntendemos que las medidas del contenedor de 10 pies son: medida externas (L x A x H): 2,98 x 2,44 x 2,59 m. Quisiera confirmarlo. Así como las del de 8 Pies.  \r\nAdemás de que facilitaran los precios de compra de ambos, envío, etc.   \r\n\r\nEspacio de la donde ubicarlo que estamos valorando es de 3,20 m. de ancho y 4 de largo. Altura libre. \r\n\r\nQuedo a la espera de sus comentarios. \r\nMuchas gracias. \r\nUn saludo. \r\nJavier Albert \r\n', 1469, 'VCONT', 4, 'NOGEST', 'EMAIL'),
