	(2022, '2019-12-10 00:17:27', '2019-10-14 11:41:22', 'VESTUARIOS DE EQUIPOS', 'Buenos Días; \r\n\r\nDisponemos de un pabellón polideportivo sin vestuarios actualmente, y estamos valorando la instalación de vesturios modulares. \r\n\r\nNuestras necesidades son 4 vestuarios para equipos de 12-15 integrantes con zona seca suficiente, y además con lavabo, wc y 5 duchas. \r\n\r\nAdemás, un contenedor adicional para arbitros con zona seca y 2 duchas y wc, \r\n\r\nUn saludo', 1471, 'VCONT', 3, 'NOGEST', 'EMAIL'),
