	(2024, '2019-12-10 00:17:27', '2019-10-14 13:29:21', 'Información', 'Buenos días.\r\n\r\nEstoy interesado y quisiera recibir más información de la oferta [Contenedores Marítimos 40\' HIGH-CUBE PALLET-WIDE]. Me gustaría saber si tienen dos y el presupuesto por comprar dos, necesitaría saber si pueden transportarlos hasta la ubicación requerida y a descargarlos. Si me pudieran hacer tambien un presupuesto de un open side de 20\' y de uno de 40\'.\r\n\r\nMuchas gracias.', 1473, 'VCONT', 4, 'NOGEST', 'EMAIL'),
