	(2050, '2019-12-10 00:17:28', '2019-10-24 21:05:54', 'Consulta', 'Hola:\r\n\r\n¿Estas casas prefabricadas (enlace abajo) se pueden instalar en suelo urbano y ser casas que dan  cumplimiento al CTE?\r\n\r\nEn caso afirmativo, ¿me pueden dar precios para 2 habitaciones y unos 50 m2?\r\n\r\nhttps://www.zarca.es/viviendas-prefabricadas/', 1497, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(2051, '2019-12-10 00:17:28', '2019-10-25 13:38:03', 'SOLICITUD CASETA DE OBRA', 'Buenos días David,\r\n\r\ntras la conversación telefónica que hemos tenido hace un rato, te escribo para que me tengas fichado y me envies lo antes posible las opciones de caseta que hemos comentado.\r\n1- MEDIDAS: 240x600\r\n2- ESTETICA: Medio frontal acristalado y ventanas en \r\n    el perimetro,\r\n3- Aire acondicionado y aseo.\r\n4- ALQUILER: 6 meses de momento, seguramente será mas tiempo. ', 1498, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(2052, '2019-12-10 00:17:28', '2019-10-26 01:32:16', 'precio', 'Me gustaria saber que precios de los  containers almacén con la medida mas pequeña y también el transporte hasta Estartit (Girona) y si por casualidad teneis de segunda mano.Gracias!', 1499, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(2053, '2019-12-10 00:17:28', '2019-10-27 13:23:06', 'Cotizacion', 'Buenos días señores, \r\n\r\nLes solicito puedan enviar precio por lo siguiente:\r\n\r\nContenedores de para almacén de todas medidas  y frigoríficas por favor.\r\n\r\nMuchas Gracias.\r\n\r\nRamón Andrades G.', 1500, 'VCONT', 4, 'NOGEST', 'EMAIL'),
