	(2055, '2019-12-10 00:17:28', '2019-10-28 12:15:32', 'DESPIECE', 'Buenos dias\r\n\r\nestaria interesado en conocer si se pueden comprar unicamente el marco y las puertas, me daria igual que fueran usadas, son para usarlas en un trabajo de decoracion y necesitaria 9 puertas dobles de contenedor', 1502, 'VCONT', 4, 'NOGEST', 'EMAIL'),
