	(2059, '2019-12-10 00:17:33', '2019-10-31 13:35:24', 'MÒDU VESTUARI', 'Bon dia, estem interesats en rebre oferta per un mòdul per col.locar a interior d\'una nau per Vestuari.\r\nNecessitem un espai per 13 tequilles i un labavo + wc + dutxa.\r\nEns interessaria preu de lloguer i preu de compra.\r\n\r\nGràcies\r\nEulàlia.', 1505, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(2060, '2019-12-10 00:17:33', '2019-10-31 19:09:11', 'Aseos', 'Hola,\r\n\r\nme gustaría recibir presupuesto de un contenedor o caseta con aseos hombre y mujer.\r\n\r\nEspero su respuesta.\r\n\r\nGracias de antemano', 1506, 'VCONT', 3, 'NOGEST', 'EMAIL'),
	(2061, '2019-12-10 00:17:33', '2019-11-01 13:02:14', 'Solicitud Estimado servicio de alquiler ', 'Señores Zarcal  S.L. un cordial saludo mediante la presente solicitamos nos actualicen un estimado para el servicio de alquiler de un contenedor de 40 pies BOX DOUBLE DOOR y uno Sencillo.\r\n\r\nEl servicio debe contar con las siguientes requerimientos.\r\n1- Alquiler del contenedor puesto en la dirección que solicitemos.\r\n2- Recoger  el contenedor y transportarlo a Puerto.\r\n3- Realizar transporte de puerto hasta Roma Italia.\r\n4- Recoger el contenedor desocupado en el destino final.', 1507, 'VCONT', 4, 'NOGEST', 'EMAIL'),
	(2062, '2019-12-10 00:17:33', '2019-11-02 12:42:43', 'MODULO ASEO + OFICINA OCASION', 'Buenos días.\r\n\r\nEstoy interesado y quisiera recibir más información de la oferta [Caseta de obra OFAL66 de ocasión - Venta desde 3.290€ - ZARCA].\r\n\r\nMuchas gracias.', 1508, 'VCONT', 4, 'NOGEST', 'EMAIL'),
