	(2081, '2019-12-10 00:17:33', '2019-11-13 11:43:23', 'Contenedores frigoríficos ', 'Buenos días, \r\n\r\nMe pongo en contacto con ustedes para solicitar información acerca de las cámaras frigoríficas portátiles para almacenamiento de residuos. Necesitamos contenedores de capacidad superior a 1500 L. La frecuencia de recogida de esos residuos no va a ser a las 24 horas por lo que nos interesaría que fueran cámaras frigoríficas portátiles. ¿Disponen ustedes de contenedores con esas características? En caso afirmativo, ¿cuál sería el coste de alquiler? ¿hacen envíos a Canarias?\r\n', 1522, 'VCONT', 4, 'NOGEST', 'EMAIL'),
